(1, 1, 2, NULL, NULL, NULL, 'Auvent Easy-Out / 1,4m - de Front Runner', 'AWNI015', 'Cet auvent pour galerie mesure 1,4m de large et a une distance de 2,1m à partir du véhicule. Voici la taille idéale pour des véhicules plus petits.', 160, 1625.6, NULL, 284.87, 341.85, 'Matériau utilisé :\\nNylon indéchirable\\nDimensions du produit :\\nÉtendu : Largeur 1400mm x Longueur 2100mm\\nRétracté : Largeur 1400mm x Longueur 160mm\\nPoids :\\n9,5kg', 'Cet auvent pour galerie mesure 1,4m de large et a une distance de 2,1m à partir du véhicule. Voici la taille idéale pour des véhicules plus petits.', 'Auvent Easy-Out / 1,4m - de Front Runner', 'Tentes & auvents|CAMPING|Vélo|Paddle|Surf|Neige|Pèche|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:26', NULL, NULL, 5.5, 10.8, 6009542235844, 'CN', 'EUR', 284.87, '6306.12.00', 10, 0),
(2, 1, 2, NULL, NULL, NULL, 'Brise-vent/soleil pour auvent de 2 m', 'AWNI038', 'Besoin d\'une couverture plus étendue ?Créez une protection supplémentaire lorsque vous utilisez votre auvent Easy-Out/ 2 m. Ce brise/soleil s\'attache facilement à votre auvent pour créer un muravant qui vous protégera davantage des intempéries.', 320, 390, NULL, 66.38655, 79.66386, 'Contient :\\n1 x Panneau de store étanche et résistantaux UV avec sangles de fixation\\n4 x Piquets de tente\\n\\nMatériaux utilisés :\\n400d oxford/polyester ripstop, résistantaux UV, enduit PU imperméable à l\'eau 1500 mm\\n\\nDimensions du produit :\\n2 m Largeur x 2 m Longueur\\n\\nPoids :\\n1,54 kg', 'Besoin d\'une couverture plus étendue ?Créez une protection supplémentaire lorsque vous utilisez votre auvent Easy-Out/ 2 m. Ce brise/soleil s\'attache facilement à votre auvent pour créer un muravant qui vous protégera davantage des intempéries.', 'Brise-vent/soleil pour auvent de 2 m', 'Tentes & auvents|CAMPING|ALL CAMPING GEAR|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:29', NULL, NULL, 3.543309, 1.6, 6009542260068, 'CN', 'EUR', 66.387, '6306.12.00', 10, 0),
(3, 1, 2, NULL, NULL, NULL, 'Brise-vent pour auvent 2.5M / Frontal - par Front Runner', 'AWNI039', 'Besoin d\'une couverture plus étendue ? Créezune protection supplémentaire lorsque vous utilisez votre auvent Easy-Out /2.5M. Ce brise vent/soleil s\'attache facilement à votre auvent pour créer un mur avantqui vous protégera davantage des intempéries.', 325, 370, NULL, 74.78992, 89.747904, 'Composé de :\\n1 x Panneau de store étanche et résistant aux UV avec sangles de fixation\\n4 x Piquets de tente\\nMatériaux utilisés :\\n400d oxford/polyester ripstop, résistant aux UV, enduit PU imperméable à l\'eau 1500 mm\\nDimensions du produit :\\n2m (78.7\'\') Largeur x 2.5m (98.42\'\') Longueur\\nPoids :\\n2.1kg (4.6lbs)', 'Besoin d\'une couverture plus étendue ? Créezune protection supplémentaire lorsque vous utilisez votre auvent Easy-Out /2.5M. Ce brise vent/soleil s\'attache facilement à votre auvent pour créer un mur avantqui vous protégera davantage des intempéries.', 'Brise-vent pour auvent 2.5M / Frontal - par Front Runner', 'Tentes & auvents|CAMPING|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:33', NULL, NULL, 4.724412, 1.9, 6009542260341, 'CN', 'EUR', 74.79, '6306.12.00', 9, 0),
(4, 1, 2, NULL, NULL, NULL, 'Brise-vent/soleil pour auvent de 2 m et 2,5 m / côté', 'AWNI040', 'Besoin d\'une couverture plus étendue ? Créezune protection supplémentaire lorsque vous utilisez votre auvent Easy-Out / 2 m.Ce brise/soleil s\'attache facilement à votre auvent pour créer un mur latéralqui vous protégera davantage des intempéries.', 320, 370, NULL, 66.38655, 79.66386, 'Contient :\\n1 x Panneau de store étanche et résistant aux UVavec sangles de fixation\\n4 x Piquets de tente\\n\\nMatériaux utilisés :\\n400d oxford/polyester ripstop, résistant aux UV,enduit PU imperméable à l\'eau 1500 mm\\n\\nDimensions du produit :\\n2,1 m Largeur x 2 m Longueur\\n\\nPoids:\\n1,36 kg (avec piquets)', 'Besoin d\'une couverture plus étendue ? Créezune protection supplémentaire lorsque vous utilisez votre auvent Easy-Out / 2 m.Ce brise/soleil s\'attache facilement à votre auvent pour créer un mur latéralqui vous protégera davantage des intempéries.', 'Brise-vent/soleil pour auvent de 2 m et 2,5 m / côté', 'Tentes & auvents|CAMPING|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:36', NULL, NULL, 2.362206, 1.4, 6009542260167, 'CN', 'EUR', 66.387, '6306.12.00', 10, 0),
(5, 1, 2, NULL, NULL, NULL, 'Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2M - par Front Runner', 'AWNI043', 'Améliorez votre auvent Easy-Out 2M ou votre moustiquaire pour auvent Easy-Out 2M avec ce revêtement imperméable à fermeture éclair. Il se fixe rapidement pour transformer toutes les pièces de l\'auvent et de la moustiquaire en un abri entièrement fermé.', 350, 380, NULL, 83.19328, 99.831936, 'Composé de :\\n1 x Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2M\\nMatériaux utilisés :\\nEnduit de PVC\\nDimensions du produit :\\nDimensions ouvertes : 1900mm (74.8\'\') largeur x 2000mm (78.7\'\') profondeur x 150mm (6\'\') hauteur\\nPoids :\\n2.6kg (5.7lbs)', 'Améliorez votre auvent Easy-Out 2M ou votre moustiquaire pour auvent Easy-Out 2M avec ce revêtement imperméable à fermeture éclair. Il se fixe rapidement pour transformer toutes les pièces de l\'auvent et de la moustiquaire en un abri entièrement fermé.', 'Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2M - par Front Runner', 'Tentes & auvents|CAMPING|ALL CAMPING GEAR|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:40', NULL, NULL, 3.149608, 2.7, 6009542260051, 'CN', 'EUR', 83.193, '6306.90.00', 6, 0),
(6, 1, 2, NULL, NULL, NULL, 'Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2.5M - par Front Runner', 'AWNI044', 'Améliorez votre auvent Easy-Out 2.5M ou votre moustiquaire pour auvent Easy-Out 2.5M avec ce revêtement de sol imperméable à fermeture éclair. Il se fixe rapidement pour transformer toutes les pièces de l\'auvent et de la moustiquaire en un abri entièrement fermé.', 400, 470, NULL, 83.19328, 99.831936, 'Composé de :\\n1 x Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2.5M\\nMatériaux utilisés :\\nEnduit de PVC\\nDimensions du produit :\\nDimensions ouvertes : 2400mm (94.5\'\') Largeur x 2000mm (78.7\'\') Profondeur x 150mm (6\'\') Hauteur\\nPoids : 1.08kg (2.4lbs)', 'Améliorez votre auvent Easy-Out 2.5M ou votre moustiquaire pour auvent Easy-Out 2.5M avec ce revêtement de sol imperméable à fermeture éclair. Il se fixe rapidement pour transformer toutes les pièces de l\'auvent et de la moustiquaire en un abri entièrement fermé.', 'Plancher imperméable pour chambre d\'auvent Easy-Out/moustiquaire pour auvent Easy-Out / 2.5M - par Front Runner', 'Tentes & auvents|CAMPING|ALL CAMPING GEAR|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 10:35:42', NULL, NULL, 3.149608, 3.3, 6009542260075, 'CN', 'EUR', 83.193, '6306.90.00', 3, 0),
