(10, 1, 2, NULL, NULL, NULL, 'Kit de dégagement pour auvent magnétique Dometic', 'AWNI062', 'Connectez sans effort votre auvent à votre véhicule grâce à un kit magnétique de 6 mm. Également disponible en longueur de 3 m.', 60, 860, NULL, 24.36975, 29.2437, 'Composé de :1 x bande Keder\\n3 x profilés en forme de 8\\nDimensions du produit :\\n3000mm (118.1\'\') de long x 15mm (0.6\'\') de large x 100mm (4\'\') de haut\\nPoids :\\n1,9 kg (4,2lbs)\\nNotes spéciales :\\nSKU : 9120000421', 'Connectez sans effort votre auvent à votre véhicule grâce à un kit magnétique de 6 mm. Également disponible en longueur de 3 m.', 'Kit de dégagement pour auvent magnétique Dometic', 'Tentes & auvents|CAMPING|Outils & Autres|ALL CAMPING GEAR', 0, 1, '2022-01-07 10:35:47', NULL, NULL, 2.4, 2.1, 5060540040138, 'CN', 'EUR', 24.37, '8505.11.00', 0, 0),
(11, 1, 2, NULL, NULL, NULL, 'Dometic Club AIR Pro DA - Auvent gonflable pour voiture / 2.6M', 'AWNI063', 'Partez à l\'aventure et restez confortable plus longtemps avec le Dometic Club AIR Pro DA. Rapide à monter, il est doté de panneaux frontaux et latéraux zippés et d\'une ventilation apex protégée contre les intempéries. L\'intérieur étonnamment spacieux est conçu pour compléter votre véhicule et apporter le confort de la maison sur chaque site de camping.', 560, 990, NULL, 1155.46218, 1386.554616, 'Composé de :\\n1 x Auvent d\'extérieur portable gonflable\\nDimensions du produit :\\n2400mm (94.5\'\') L x 2600mm (102.4\'\') W\\nHauteur :\\n1800mm (70.9\'\') Min H / 2250mm (88.6\'\') Max H\\nPoids :\\n29.7kg (65.5lbs)\\nNotes spéciales :\\nSKU : 9120001140', 'Partez à l\'aventure et restez confortable plus longtemps avec le Dometic Club AIR Pro DA. Rapide à monter, il est doté de panneaux frontaux et latéraux zippés et d\'une ventilation apex protégée contre les intempéries. L\'intérieur étonnamment spacieux est conçu pour compléter votre véhicule et apporter le confort de la maison sur chaque site de camping.', 'Dometic Club AIR Pro DA - Auvent gonflable pour voiture / 2.6M', 'Tentes & auvents|CAMPING|ALL CAMPING GEAR', 0, 1, '2022-01-07 10:35:47', NULL, NULL, 13, 29.7, 5060646168309, 'CN', 'EUR', 1155.462, '6306.2200.000', 4, 0),
(12, 1, 2, NULL, NULL, NULL, 'Vélum pour auvent gonflable Club AIR Pro DA Dometic', 'AWNI064', 'Isolez le toit et régulez la température intérieure de votre auvent Dometic. Facile à monter, ce revêtement de toit minimise également la condensation pour donner un coup de pouce à votre confort.', 220, 270, NULL, 50.42017, 60.504204, 'Composé de :\\n1 x Doublure de toit\\n1 x Sac de transport\\nDimensions du produit :\\n270mm (10.6\'\') de long x 220mm (8.7\'\') de large et 50mm (2\'\') de haut\\nPoids :\\n0.6Kg (1.3lbs)\\nNotes spéciales :\\nSKU : 9120001185', 'Isolez le toit et régulez la température intérieure de votre auvent Dometic. Facile à monter, ce revêtement de toit minimise également la condensation pour donner un coup de pouce à votre confort.', 'Vélum pour auvent gonflable Club AIR Pro DA Dometic', 'Tentes & auvents|CAMPING', 0, 1, '2022-01-07 10:35:49', NULL, NULL, 2, 5.4, 5060646168750, 'CN', 'EUR', 50.42, '6306.9000.190', 5, 0),
