(76, 1, 2, NULL, NULL, NULL, 'Support de bouteille de gaz/propane - de Front Runner', 'GBHO012', 'Alimentez votre aventure avec ce support degaz/propane facile d’utilisation qui se fixe fermement à n’importe quel plateauFront Runner. Ne soyez plus jamais loin du confort de votre fourneau portableet autres accessoires de propane. Le procédé de verrouillage simple vous permetde fixer rapidement des bouteilles de tailles différentes.', 332, 370, NULL, 147.05882, 176.470584, 'Composé de :\\n1 x paire de support de galerie\\n1 x support de cylindres de GPL\\nComposants d\'installation\\nGuide de montage\\nMatériaux utilisés:\\nAcier en époxy noir\\nLoquets de sécurité en acier inoxydable\\nNotes spéciales:\\nDimensions du cylindre :\\nHauteur maximum du cylindre:12.6\'\' (320mm)\\nDiamètre maximum du cylindre: 11\'\' (280mm)\\nDiamètre maximum du col supérieur: 6.7\'\' (170mm)\\nPoids max:22lb (10kg)', 'Alimentez votre aventure avec ce support degaz/propane facile d’utilisation qui se fixe fermement à n’importe quel plateauFront Runner. Ne soyez plus jamais loin du confort de votre fourneau portableet autres accessoires de propane. Le procédé de verrouillage simple vous permetde fixer rapidement des bouteilles de tailles différentes.', 'Support de bouteille de gaz/propane - de Front Runner', 'Accessoires|CAMPING|Cuisine de camping|ACTIVITIES|FISHING|OVERLANDING & EXPEDITION|CAMPER|Manger|ÉXPEDITION|Manger', 0, 1, '2022-01-07 10:39:17', NULL, NULL, 3.3, 3, 6009542249964, 'ZA', 'EUR', 147.059, '7326.90.98', 10, 0),
(77, 1, 2, NULL, NULL, NULL, 'Support de bouteille de gaz simple pour un Land Rover Defender 90/110 - par Front Runner', 'GBHO013', 'Transportez et rangez votre bouteille de gaz/propane sur votre Land Rover 90 110 grâce à ce support de bouteille de gaz simple en acier inoxydable 3CR12, monté sur gouttière.', 250, 925, NULL, 189.07563, 226.890756, 'Composé de :\\n1 x Cadre de bouteille de gaz\\n1 x Plaque de base de la bouteille de gaz\\n1 x Collier de serrage réglable pour bouteille de gaz\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier inoxydable 3CR12 peint par poudrage noir\\nDimensions des produits assemblés :\\n341 mm (13.4\'\') Longueur x 294 mm (11.5\'\') Largeur x 621 mm (24.4\'\') Hauteur\\nPoids :\\n5.4kg (11.9lbs)\\nConvient :\\nConvient aux bouteilles de gaz d\'un diamètre compris entre 210 mm (8.3\'\') et 290 mm (11.4\'\').', 'Transportez et rangez votre bouteille de gaz/propane sur votre Land Rover 90 110 grâce à ce support de bouteille de gaz simple en acier inoxydable 3CR12, monté sur gouttière.', 'Support de bouteille de gaz simple pour un Land Rover Defender 90/110 - par Front Runner', 'CAMPING|Rangement|STORAGE ACCESSORIES|VEHICLE ACCESSORIES|ALL CAMPING GEAR|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:39:20', NULL, NULL, 4.724412, 5.8, 6009542262925, 'ZA', 'EUR', 189.076, '7326.90.98', 10, 0),
(78, 1, 2, NULL, NULL, NULL, 'Support de bouteille de gaz/propane / Montage latéral - par Front Runner', 'GBHO014', 'Transportez et rangez votre bouteille de gaz/propane sur le côté de votre véhicule grâce à ce support en acier inoxydable 3CR12.', 245, 315, NULL, 158.82353, 190.588236, 'Consiste en :\\n1 x plaque arrière de bouteille de gaz\\n1 x Plaque de base de la bouteille de gaz\\n1 x Pince à bouteille de gaz réglable\\nMatériel d\'installation :\\nInstruction de montage\\nMatériaux utilisés :\\nAcier inoxydable 3CR12 peint par poudrage noir\\nDimensions des produits assemblés :\\n358mm (14\'\') L x 294mm (11.5\'\') L x 205mm (8\'\') H\\nPoids :\\n4,5kg (9,92lbs)\\nAdéquation :\\nConvient aux bouteilles de gaz de 210 mm à 290 mm de diamètre', 'Transportez et rangez votre bouteille de gaz/propane sur le côté de votre véhicule grâce à ce support en acier inoxydable 3CR12.', 'Support de bouteille de gaz/propane / Montage latéral - par Front Runner', 'CAMPING|Cuisine de camping|Rangement|STORAGE ACCESSORIES|VEHICLE ACCESSORIES|ALL CAMPING GEAR', 0, 1, '2022-01-07 10:39:24', NULL, NULL, 6.1, 4.8, 6009542262963, 'ZA', 'EUR', 158.824, '7326.90.98', 10, 0),
(79, 1, 2, NULL, NULL, NULL, 'Hayon latéral en verre pour un Land Rover Defender (1983-2016) - de Front Runner', 'GWLD006', ' Le hayon latéral en verre de Front Runner remplace la fenêtre latérale d’un Defender et vous permet de basculer la fenêtre, ce qui crée un accès à 100% au contenu de votre espace de chargement.', 535, 1180, NULL, 721.84874, 866.218488, ' \\nContient : \\n1x Hayon en verre \\n1x Encadrement extérieur \\n1x Kit de fixation \\n2x Vérin à gaz \\n1x Support intérieur au côté droit \\n1x Support intérieur au côté gauche \\n1x Support intérieur supérieur \\n1x Support intérieur inférieur \\nMatériaux utilisés : \\nVerre trempé, feuilleté et teinté 6mm \\nAcier inoxydable 3CR12 époxy noir \\n  \\nDimensions du produit : \\nDimensions générales : longueur 1120mm x largeur 50mm x hauteur 490mm \\nPanneau de porte : longueur 1044mm x hauteur 414mm \\n  \\nPoids : \\n15kg \\nSpécifications de la vitre : \\nLumière visible : \\nTransmission : 44 \\nRéflexion extérieure : 5 \\n  \\nÉnergie solaire : \\nÉlimination totale : 38 \\nRéflexion extérieure : 5 \\nAbsorption 1 : 47 \\nTransmission directe : 47 \\nFacteur solaire : 0.62 \\n  \\nFacteur d’ombre : \\nTaux : 0.71 \\n  \\nValeur U : \\n(W/m2).K (centre du verre) : 5.8', ' Le hayon latéral en verre de Front Runner remplace la fenêtre latérale d’un Defender et vous permet de basculer la fenêtre, ce qui crée un accès à 100% au contenu de votre espace de chargement.', 'Hayon latéral en verre pour un Land Rover Defender (1983-2016) - de Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:39:28', NULL, NULL, 3.93701, 16.1, 6009542224121, 'ZA', 'EUR', 721.849, '8708.22.90', 10, 0),
(80, 1, 2, NULL, NULL, NULL, 'Étagère pour le coffre du hayon latéral pour un Land Rover Defender TDI/TD5 - de Front Runner', 'GWLD007', 'Cette étagère correspond au coffre du hayon latéral pour un Land Rover Defender TDI/TD5. Utilisez ces étagères pour créer différentes sections dans le coffre du hayon pour ranger des produits, des pots et de l’approvisionnement. ', 300, 1030, NULL, 79.83193, 95.798316, 'Consiste en :\\n1x Etagère en bois\\n1x Cadre en acier doux\\n1x Kit de fixation Matériel utilisé :\\nEtagère : Contreplaqué teinté\\nCadre : Acier doux revêtu de poudre noire \\nDimensions du produit :\\n209mm (8,2\'\') L x 997mm (39,3\'\') L x 36mm (1,4\'\') H Poids :\\n3,8kg (8,4lbs)', 'Cette étagère correspond au coffre du hayon latéral pour un Land Rover Defender TDI/TD5. Utilisez ces étagères pour créer différentes sections dans le coffre du hayon pour ranger des produits, des pots et de l’approvisionnement. ', 'Étagère pour le coffre du hayon latéral pour un Land Rover Defender TDI/TD5 - de Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR|Produits vedettes', 0, 1, '2022-01-07 10:39:31', NULL, NULL, 2.165355, 4.6, 6009542223834, 'ZA', 'EUR', 79.832, '8708.99.97', 10, 0),
(81, 1, 2, NULL, NULL, NULL, 'Coffre de rangement pour hayon latéral d’un Land Rover Defender TDI/TD5 (1983-2006) - de Front Runner', 'GWLD008', ' Le coffre de rangement pour hayon latéral de Front Runner est utilisé en combinaison avec le hayon latéral en verre ou le hayon latéral en aluminium. Le coffre crée un espace supplémentaire qui est accessible par le côté de votre véhicule. ', 375, 1065, NULL, 284.87395, 341.84874, ' \\nContient : \\n1 x Kit de fixation \\n2 x Plaque latérale - 1 à gauche, 1 à droite \\n2 x Supports \\n1 x Plaque supérieure \\n2 x Plaque en bois \\n1 x Plaque inférieure \\n  \\nMatériau utilisé : \\nAcier doux en époxy noir \\n  \\nDimensions du produit : \\nLongueur 255mm x Largeur 1000mm x Hauteur 654mm \\n  \\nPoids : 13,1kg', ' Le coffre de rangement pour hayon latéral de Front Runner est utilisé en combinaison avec le hayon latéral en verre ou le hayon latéral en aluminium. Le coffre crée un espace supplémentaire qui est accessible par le côté de votre véhicule. ', 'Coffre de rangement pour hayon latéral d’un Land Rover Defender TDI/TD5 (1983-2006) - de Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR|Produits vedettes', 0, 1, '2022-01-07 10:39:33', NULL, NULL, 4.724412, 14.5, 6009542226897, 'ZA', 'EUR', 284.874, '8708.99.97', 10, 0),
(82, 1, 2, NULL, NULL, NULL, 'Hayon latéral pour un Land Rover Defender (1983-2016) / Aluminium - de Front Runner', 'GWLD009', ' Le hayon latéral de Front Runner remplace la fenêtre latérale d’un Defender. Il vous permet d’avoir un accès facile vers votre espace de chargement dans votre véhicule.', 535, 1180, NULL, 701.68067, 842.016804, ' \\nContient : \\n1x Hayon en aluminium \\n1x Encadrement extérieur \\n1x Kit de fixation \\n2x Vérin à gaz \\n1x Support intérieur au côté droit \\n1x Support intérieur au côté gauche \\n1x Support intérieur supérieur \\n1x Support intérieur inférieur \\n  \\nMatériaux utilisés : \\nAluminium 3mm en époxy noir \\nAcier doux 2mm en époxy noir \\nPlatine de renforcement \\nAcier inoxydable 3CR12 en époxy noir \\n  \\nDimensions du produit : \\nGénéralement : longueur 1120mm x largeur 50mm x hauteur 490mm \\nPanneau de porte : longueur 1044mm x hauteur 414mm \\n  \\nPoids : 15,5kg', ' Le hayon latéral de Front Runner remplace la fenêtre latérale d’un Defender. Il vous permet d’avoir un accès facile vers votre espace de chargement dans votre véhicule.', 'Hayon latéral pour un Land Rover Defender (1983-2016) / Aluminium - de Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:39:35', NULL, NULL, 4.527562, 17.5, 6009542226903, 'ZA', 'EUR', 701.681, '8708.99.97', 10, 0),
