(84, 1, 2, NULL, NULL, NULL, 'Coffre de rangement pour hayon latéral d’un Land Rover Defender Puma (2007-2016) - de Front Runner', 'GWLD011', ' Le coffre de rangement pour un hayon latéral de Front Runner est utilisé en combinaison avec le hayon latéral en verre ou le hayon latéral en aluminium. Le coffre crée un espace supplémentaire qui est accessible par le côté de votre véhicule. ', 375, 1060, NULL, 276.47059, 331.764708, ' \\nContient : \\n1 x Kit de fixation \\n2 x Plaque latérale - 1 à gauche, 1 à droite \\n2 x Supports \\n1 x Plaque supérieure \\n2 x Plaque en bois \\n1 x Plaque inférieure \\n  \\nMatériaux utilisés : \\nAcier doux en époxy noir \\nPlaque arrière : contreplaqué teinté \\n  \\nDimensions du produit : \\nLongueur 255mm x Largeur 1000mm x Hauteur 654mm \\n  \\nPoids : 13,1kg', ' Le coffre de rangement pour un hayon latéral de Front Runner est utilisé en combinaison avec le hayon latéral en verre ou le hayon latéral en aluminium. Le coffre crée un espace supplémentaire qui est accessible par le côté de votre véhicule. ', 'Coffre de rangement pour hayon latéral d’un Land Rover Defender Puma (2007-2016) - de Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:39:41', NULL, NULL, 4.330711, 14.5, 6009542226927, 'ZA', 'EUR', 276.471, '8708.99.97', 10, 0),
(85, 1, 2, NULL, NULL, NULL, 'Panneau de fenêtre / verre de hayon latéral en verre pour un Land Rover Defender (1983-2016) - par Front Runner', 'GWLD301', 'Le panneau de verre de hayon latéral pour un Land Rover Defender est un remplacement pour votre fenêtre Gullwing avant. Il dispose d\'un verre teinté et trempé de 6mm pour la visibilité et la durabilité.', 540, 1180, NULL, 251.2605, 301.5126, 'Composé de :\\n1 x Panneau de verre\\nMatériaux utilisés :\\nVerre de 6 mm teinté et trempé\\nDimensions du produit :\\n1044mm (41.1\'\') Longueur x 414mm (16.3\'\') Largeur x 6mm (0.2\'\') Hauteur.\\nPoids :\\n6,07kg (13,4lbs)\\nSpécifications du verre :\\nLumière visible :\\nTransmission : 44\\nRéflexion extérieure : 5\\nÉnergie solaire :\\nÉlimination totale : 38\\nRéflexion à l\'extérieur : 5\\nAbsorption 1 : 47\\nTransmission directe : 47\\nSHGC : 0.62\\nCoefficient d\'ombrage :\\nRatio : 0.71\\nValeur U :\\n(W/m2).K (centre du verre) : 5.8', 'Le panneau de verre de hayon latéral pour un Land Rover Defender est un remplacement pour votre fenêtre Gullwing avant. Il dispose d\'un verre teinté et trempé de 6mm pour la visibilité et la durabilité.', 'Panneau de fenêtre / verre de hayon latéral en verre pour un Land Rover Defender (1983-2016) - par Front Runner', 'Rangement|ALL STORAGE SYSTEMS|Coffres pour hayon latéral|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:39:44', NULL, NULL, 3.93701, 8.6, 6009542233338, 'ZA', 'EUR', 251.261, '8708.22.90', 4, 0),
