(122, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Audi A4 Allroad (2009-2016) - de Front Runner', 'KRAA001T', 'Transportez tout votre équipement sur votre Audi AF Allroad avec ce kit de galerie Slimline II, élégant, robuste (et facile à monter).', 445, 1730, NULL, 785.71429, 942.857148, 'KRAA001T -Kit de galerie Slimline II pour un Audi A4 Allroad (2009-2016) - de Front Runner\\nComposé de :\\n2x GOFR001 - Poignée sur pieds de rail affleurant\\n2x GOFR014 - Poignées extérieures de rail affleurant / No. 6\\n2x GOFR035 - Poignées intérieures de rail affleurant / F\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 47.83kg (105.45lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nPoids : 445 mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 150mm (6\'\')\\nPoids à la livraison :\\nPoids : 24kg (53lbs)', 'Transportez tout votre équipement sur votre Audi AF Allroad avec ce kit de galerie Slimline II, élégant, robuste (et facile à monter).', 'Kit de galerie Slimline II pour un Audi A4 Allroad (2009-2016) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:42:03', NULL, NULL, 5.9, 24, 6009542213187, 'ZA', 'EUR', 785.714, '7616.99', 10, 0),
(123, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Audi Q3 (2011-actuel) - de Front Runner', 'KRAQ001T', 'Ce kit galerie complète de 1156 mm de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour le montage du plateau Slimline II sur les rails de toit de votre Audi Q3 (8U). Ce système se monte facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.', 450, 1730, NULL, 760.5042, 912.60504, 'Composé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR014 - Grips extérieurs de rail affleurant / No. 6\\n2x GOFR031 - Grips intérieurs de rail affleurant / B\\n1x RRSTD06 - Plateau SLII - 1255mm(W)X1156mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm bord extra étroit /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 44.25kg (97.55lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre Kit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie utilise des rails de pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pieds pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 450 mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids à la livraison :\\nPoids : 20.57kg (45lbs)', 'Ce kit galerie complète de 1156 mm de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour le montage du plateau Slimline II sur les rails de toit de votre Audi Q3 (8U). Ce système se monte facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Audi Q3 (2011-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:42:07', NULL, NULL, 5.511814, 20.6, 6009542243757, 'ZA', 'EUR', 760.504, '8708.29.90', 6, 0),
(124, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Audi Q5 (2009-2017) - de Front Runner', 'KRAQ002T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Audi Q5 (8R). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 861.34454, 1033.613448, 'KRAQ002T - Kit de galerie Slimline II pour une Audi Q5 (2009-2017)\\nContient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR031 - Pied Grab-On intérieur pour barres Flush / B - de Front Runner\\n1 x RRSTD05 - Plateau Slimline II - 1255mm (largeur) x 954mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 18kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 21,0kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Audi Q5 (8R). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Audi Q5 (2009-2017) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:42:10', NULL, NULL, 5.511814, 26.5, 6009542243559, 'ZA', 'EUR', 861.345, '7616.99', 6, 0),
