auteur285mm\\n\\nPoidsde la livraison :Poids : 26,0kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1560mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre BMX X5(2003-2010). Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour BMW X5 (2000-2013) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 10:42:26', NULL, NULL, 11.220478, 26.2, 6009542252506, 'ZA', 'EUR', 844.538, '7616.99', 10, 0),
(130, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II BMW X3 (2018-jusqu’à présent) - de Front Runner', 'KRBX003T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Rail Grip pourmonter le plateau Slimline II sur les barres surélevées de votre BMX X3 (2018-jusqu’àprésent). Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres flush d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 743.69748, 892.436976, 'KRBX003T Kit de galerie de toit Slimline IIBMW X3 (2018-jusqu’à présent) - de Front Runner\\n1 x GOFR001-Base de pied de rail (Paire) - de Front Runner\\n1 x GOFR014 -Poignées extérieures à barre flush / N° 6 - de Front Runner\\n1 x GOFR032 -Poignées intérieures à barres flush / C - de Front Runner\\n1 x RRSTD06 - PlateauSlimline II - 1255 mm (largeur) x 1156 mm (longueur) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 19 kg\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455 mm\\nLongueur 1610 mm\\nHauteur 215 mm\\n\\nPoids de la livraison :\\nPoids : 22,0kg', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Rail Grip pourmonter le plateau Slimline II sur les barres surélevées de votre BMX X3 (2018-jusqu’àprésent). Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres flush d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II BMW X3 (2018-jusqu’à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:42:30', NULL, NULL, 8.464571, 23.9, 6009542260259, 'ZA', 'EUR', 743.697, '8708.29.90', 10, 0),
(131, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une BMW X1 (2009-jusqu\'à présent) - de Front Runner', 'KRBX004T', 'Libérez un espace de chargement précieux dans votre BMW X1 en utilisant ce Kit Galerie de toit Slimline II pour transporter votre matériel d\'aventure favori, afin que vous ayez toujours de la place pour vos compagnons de voyage.', 440, 1730, NULL, 726.89076, 872.268912, 'KRBX004T -Kit de galerie Slimline II pour une BMW X1 (2009-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR015 - Grips extérieurs de rail affleurant / No. 7\\n2x GOFR036 - Grips intérieurs de rail affleurant / G\\n1x RRAC928 - Entretoise plastique pour base de pied de rail / 6mm (paire)\\n1x RRSTA06 - Plateau SLII - 1165mm(W)X1156mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm bord extra étroit /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 22.66kg (49.96lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 22.6kg (50lbs)', 'Libérez un espace de chargement précieux dans votre BMW X1 en utilisant ce Kit Galerie de toit Slimline II pour transporter votre matériel d\'aventure favori, afin que vous ayez toujours de la place pour vos compagnons de voyage.', 'Kit de galerie Slimline II pour une BMW X1 (2009-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:42:34', NULL, NULL, 6.3, 22.6, 6009542217628, 'ZA', 'EUR', 726.891, '7616.99', 10, 0),
(132, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Hardtop/ 1165mm (l) - de Front Runner', 'KRCA007', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 40mm, 2 barres de toit de 1165mm, 2 rails pour une benne de Pick-Up de 1150mm, et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 115, 1545, NULL, 256.30252, 307.563024, 'KRCA007 - Kit de barres pour un Hardtop/ 1165mm (largeur) - par Front Runner\\nComposé de :\\n2 x FASS012 - Paire de pieds / 40mm-50mm - par Front Runner\\n1 x LBSK013 - Paire de barres de toit / 1165mm(W) - par Front Runner\\n1 x TRCA003 - Rails de hardtop\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 7kg (14lbs)\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur 245 mm (10\'\')\\nLongueur 1290mm (51\'\')\\nHauteur 115mm (5\'\')\\nPoids d\'expédition :\\nPoids 7.6kg (16.8lbs)', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 40mm, 2 barres de toit de 1165mm, 2 rails pour une benne de Pick-Up de 1150mm, et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour un Hardtop/ 1165mm (l) - de Front Runner', 'Barres de toit|Kit de barres de toit|Kit de barres de toit pour benne de Pick-Up', 0, 1, '2022-01-07 10:42:38', NULL, NULL, 9.6, 8, 6009542231976, 'ZA', 'EUR', 256.303, '8708.29.90', 10, 0),
(133, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un hardtop RSI DC Smart / 1255mm - de Front Runner', 'KRCA008', 'Libérez un espace intérieur précieux tout en faisant passer votre équipement d\'aventure partout grâce à ces barres de charge Front Runner légères et à profil bas pour votre hardtop RSI DC Smart.', 110, 1380, NULL, 180.67227, 216.806724, 'KRCA008 -Kit de barres de toit pour un hardtop RSI DC Smart / 1255mm - par Front Runner\\nComposé de :\\n2x FASS012 - Pieds / 40mm - 50mm\\n1x LBSK014 - Paire de barres de toit 1255mm(W)\\n2x RRAC921 - Kit de montage pour les galeries de canopins\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nPoids approximatif du montage : 11,3 kg (24,91lbs)\\nLes fentes en T situées en haut et en bas des lattes peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de charge, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de charge utilise des pieds, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de barres de charge utilise des rails de pied, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des rails de pied indiqués ci-dessus pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 110 mm (4\'\')\\nLongueur : 1380mm (54\'\')\\nHauteur : 150mm (6\'\')\\nPoids à la livraison :\\nPoids : 5.6kg (12lbs)', 'Libérez un espace intérieur précieux tout en faisant passer votre équipement d\'aventure partout grâce à ces barres de charge Front Runner légères et à profil bas pour votre hardtop RSI DC Smart.', 'Kit de barres de toit pour un hardtop RSI DC Smart / 1255mm - de Front Runner', 'Barres de toit|Kit de barres de toit', 0, 1, '2022-01-07 10:42:39', NULL, NULL, 5.9, 5.6, 6009542213224, 'ZA', 'EUR', 180.672, '8708.29.90', 10, 0),
(134, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Hardtop RSI DC Smart / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner', 'KRCA008T', 'Ce kit permet de créer une galerie complète sur un hardtop RSI avec un toit d\'environ 1165 mm (Largeur) x 1358 mm (Longueur). Le plateau Slimline II se monte sur les pieds fournis qui se glissent dans le rail du hardtop.', 445, 1730, NULL, 710.08403, 852.100836, 'KRCA008T -Kit de galerie Slimline II pour un Hardtop RSI DC Smart / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner\\nComposé de :\\n3 x FASS012 - Pieds / 40mm-50mm - par Front Runner\\n3 x RRAC921 - Set d\'installation du kit de galerie de canopy\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(L) X 1358mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 23,3 kg (51,4 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n23.1kg (51.0lbs)', 'Ce kit permet de créer une galerie complète sur un hardtop RSI avec un toit d\'environ 1165 mm (Largeur) x 1358 mm (Longueur). Le plateau Slimline II se monte sur les pieds fournis qui se glissent dans le rail du hardtop.', 'Kit de galerie Slimline II pour un Hardtop RSI DC Smart / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner', 'Kits de galeries pour canopy', 0, 1, '2022-01-07 10:42:41', NULL, NULL, 5.9, 24.2, 6009542237411, 'ZA', 'EUR', 710.084, '8708.29.90', 10, 0),
(135, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour hardtop RSI DC Smart / 1165mm - de Front Runner', 'KRCA009', 'Libérez un espace intérieur précieux tout en faisant passer votre équipement d\'aventure partout grâce à ces barres de toit Front Runner légères et à profil bas pour votre HardtopRSIDCSmart .', 110, 1280, NULL, 172.26891, 206.722692, 'KRCA009 -Kit de barres de toit pour hardtop RSI DC Smart / 1165mm - par Front Runner\\nComposé de :\\n2x FASS012 - Set de pieds / 40mm - 50mm\\n1x LBSK013 - Paire de barres de charge 1165mm(W)\\n2x RRAC921 - Kit de montage de la galerie Canopy Set\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nPoids approximatif du montage : 10,56kg (23,28lbs)\\nLes fentes en T situées en haut et en bas des lattes peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de charge, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de charge utilise des pieds, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 110 mm (4\'\')\\nLongueur : 1280mm (50\'\')\\nHauteur : 145mm (6\'\')\\nPoids à la livraison :\\nPoids : 5.2kg (11lbs)', 'Libérez un espace intérieur précieux tout en faisant passer votre équipement d\'aventure partout grâce à ces barres de toit Front Runner légères et à profil bas pour votre HardtopRSIDCSmart .', 'Kit de barres de toit pour hardtop RSI DC Smart / 1165mm - de Front Runner', 'Barres de toit|Kit de barres de toit|Kits de galeries pour canopy', 0, 1, '2022-01-07 10:42:45', NULL, NULL, 5.7, 5.2, 6009542213231, 'ZA', 'EUR', 172.269, '8708.29.90', 10, 0),
(136, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour Hardtop / 1345mm - de Front Runner', 'KRCA010', 'Le kit de barres de toit pour hardtop a été conçu pour les voyageurs qui ont besoin d\'une capacité de stockage supplémentaire pour leur toit, mais qui ne veulent pas sacrifier une construction à profil bas. Ces barres de 1345 mm utilisent les mêmes lattes en aluminium durable que la galerie de toit Slimline II, ce qui vous permet de monter des accessoires Front Runner.', 110, 1455, NULL, 189.0756, 226.89072, 'KRCA010 -Kit de barres de toit pour Hardtop / 1345mm - de Front Runner\\nComposé de :\\n2x FASS012 - Paire de pieds / 40mm - 50mm\\n1x LBSK015 - Paire de barres de toit 1345mm(W)\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nPoids approximatif installé : 6kg (13.23lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.Dimensions de livraison :\\nLargeur : 110mm (4\'\')\\nLongueur : 1455mm (58\'\')\\nHauteur : 135mm (6\'\')\\nPoids de la livraison :\\nPoids : 5.18kg (11.42lbs)', 'Le kit de barres de toit pour hardtop a été conçu pour les voyageurs qui ont besoin d\'une capacité de stockage supplémentaire pour leur toit, mais qui ne veulent pas sacrifier une construction à profil bas. Ces barres de 1345 mm utilisent les mêmes lattes en aluminium durable que la galerie de toit Slimline II, ce qui vous permet de monter des accessoires Front Runner.', 'Kit de barres de toit pour Hardtop / 1345mm - de Front Runner', 'Barres de toit|Kit de barres de toit|Kits de galeries pour canopy', 0, 1, '2022-01-07 10:42:47', NULL, NULL, 5.3, 5.2, 6009542223711, 'ZA', 'EUR', 189.076, '8708.29.90', 10, 0),
