(138, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Hardtop RSI pour Nissan Navara D23 (2014-jusqu\'à présent) - DE Front Runner', 'KRCA074T', 'Ce kit comprend une galerie complète pour le hardtop RSI pour un Nissan Navara. La taille de la galerie est d\'environ 1165 mm (Largeur) x 1358 mm (Longueur). Le plateau Slimline II se monte sur les pieds fournis qui glissent dans le rail de la canopy.', 450, 1730, NULL, 701.68067, 842.016804, 'KRCA074T -Kit de galerie Slimline II pour un Hardtop RSI pour Nissan Navara D23 (2014-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x FASS012 - Foot Set / 40mm-50mm - de Front Runner\\n2 x RRAC921 - Set d\'installation du kit de galerie de canopy\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(L) X 1358mm(L) - de Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 23,2 kg (51,2 lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n23.0kg (51.0lbs)', 'Ce kit comprend une galerie complète pour le hardtop RSI pour un Nissan Navara. La taille de la galerie est d\'environ 1165 mm (Largeur) x 1358 mm (Longueur). Le plateau Slimline II se monte sur les pieds fournis qui glissent dans le rail de la canopy.', 'Kit de galerie Slimline II pour un Hardtop RSI pour Nissan Navara D23 (2014-jusqu\'à présent) - DE Front Runner', 'Kits de galeries pour canopy|VEHICLE SPECIFIC GEAR|Galerie|Kit de Galerie Slimline II', 0, 1, '2022-01-07 10:42:51', NULL, NULL, 5.511814, 23, 6009542243290, 'ZA', 'EUR', 701.681, '8708.29', 10, 0),
(139, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un hardtop Rhinoman / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner', 'KRCA076T', 'Ce kit permet de créer un rack de taille normale sur un hardtop Rhinoman dont la taille du toit est d\'environ 1165mm/45.9\'\' (Largeur) x 1358mm/53.5\'\' ( Longueur). Le plateau Slimline II se monte sur des pieds fournis qui se glissent dans le rail existant du hardtop Rhinoman.', 450, 1730, NULL, 710.08403, 852.100836, 'KRCA076T -Kit de galerie Slimline II pour un hardtop Rhinoman / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner\\nComposé de :\\n3 x FASS012 - Pieds / 40mm-50mm - par Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (Largeur) X 1358mm (Longueur) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 23,1 kg (50,9lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la crémaillère et des profils de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de galerie de toit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64.0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids à l\'expédition :\\n23.0kg (51.0lbs)', 'Ce kit permet de créer un rack de taille normale sur un hardtop Rhinoman dont la taille du toit est d\'environ 1165mm/45.9\'\' (Largeur) x 1358mm/53.5\'\' ( Longueur). Le plateau Slimline II se monte sur des pieds fournis qui se glissent dans le rail existant du hardtop Rhinoman.', 'Kit de galerie Slimline II pour un hardtop Rhinoman / 1165mm (Largeur) x 1358mm (Longueur) - par Front Runner', 'Kits de galeries pour canopy', 0, 1, '2022-01-07 10:42:55', NULL, NULL, 5.511814, 23, 6009542245614, 'ZA', 'EUR', 710.084, '8708.29', 10, 0),
