rie complète pour le hardtop RSI pour Volkswagen Amarok DC. La taille de la galerie est d\'environ 1255mm/49.4\'\' (Largeur) x 1358mm/53.5\'\' (Longueur). Le plateau Slimline II se monte sur les pieds fournis qui glissent dans le rail du hardtop.', 'Kit de galerie Slimline II pour un hardtop RSI pour Volkswagen Amarok DC - par Front Runner', 'Kits de galeries pour canopy|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 10:42:58', NULL, NULL, 8.07087, 24.5, 6009542251707, 'ZA', 'EUR', 743.697, '8708.29.90', 10, 0),
