(146, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour hardtop RSI Smart Extra Cab / 1165mm(Largeur) x 1762mm(Longueur) - par Front Runner', 'KRCA087T', 'Économisez l\'espace précieux de la benne pour d\'autres utilisations en plaçant votre équipement d\'aventure sur le toit de votre canopy. Le Kit de galerie Slimline II pour un hardtop RSI Extra Cab Smart contient tout ce dont vous avez besoin pour l\'installer facilement et partir à l\'aventure.', 440, 1730, NULL, 852.94118, 1023.529416, 'KRCA087T - Kit de galerie Slimline II pour RSI Extra Cab Smart Canopy\\nComposé de :\\n3x FASS012 - Set de pieds / 40mm - 50mm\\n3x RRAC921 - Kit de montage de la galerie Canopy Set\\n1x RRSTA09 - Plateau SLII - 1165mm(W)X1762mm(L)\\nMatérieux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 26.68kg (58.82lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\nPoids : 27.6kg (61lbs)', 'Économisez l\'espace précieux de la benne pour d\'autres utilisations en plaçant votre équipement d\'aventure sur le toit de votre canopy. Le Kit de galerie Slimline II pour un hardtop RSI Extra Cab Smart contient tout ce dont vous avez besoin pour l\'installer facilement et partir à l\'aventure.', 'Kit de galerie Slimline II pour hardtop RSI Smart Extra Cab / 1165mm(Largeur) x 1762mm(Longueur) - par Front Runner', 'Galerie|Galerie pour hard top/cabine/remorque', 0, 1, '2022-01-07 10:43:14', NULL, NULL, 6.1, 27.6, 6009542217635, 'ZA', 'EUR', 852.941, '8708.29', 10, 0),
(147, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour hardtop RSI Smart de Jeep Gladiator JT (2019- jusqu\'à présent) - par Front Runner', 'KRCA092T', 'Utilisez tout votre précieux espace de toit sur le Hardtop RSI Smart de votre Gladiator avec ce kit de galerie Slimline II pour Hardtop RSI Smart de Jeep Gladiator JT. Économisez l\'espace précieux du lit pour d\'autres utilisations en mettant votre équipement d\'aventure sur le toit.', 445, 1720, NULL, 777.31092, 932.773104, 'KRCA092T-Kit de galerie Slimline II pour hardtop RSI Smart de Jeep Gladiator JT (2019 - jusqu\'à présent)- par Front Runner\\nComposé de :\\n3x FASS012 - Pieds / 40mm - 50mm\\n3x RRAC921 - Kit d\'installation pour galerie de hardtop\\n1x RRSTG07 - Plateau SLII -1345mm(Largeur) X 1358mm (Longueur)\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé :24.65kg (54.34lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied de fixation indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des pieds de rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 445mm (18\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 25kg (55lbs)', 'Utilisez tout votre précieux espace de toit sur le Hardtop RSI Smart de votre Gladiator avec ce kit de galerie Slimline II pour Hardtop RSI Smart de Jeep Gladiator JT. Économisez l\'espace précieux du lit pour d\'autres utilisations en mettant votre équipement d\'aventure sur le toit.', 'Kit de galerie Slimline II pour hardtop RSI Smart de Jeep Gladiator JT (2019- jusqu\'à présent) - par Front Runner', 'Galerie|Kits de galeries pour canopy|Kits de galeries pour canopy|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:17', NULL, NULL, 6.1, 25, 6009542218281, 'ZA', 'EUR', 777.311, '8708.29', 10, 0),
(148, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour la benne de la Chevrolet Colorado Pick-Up Truck (2004-jusqu’à présent) - de Front Runner', 'KRCC001T', 'Ce kit contient une galerie qui est montée au-dessusde la benne d’une Chevrolet Colorado 2004+. Ce kit pour une benne de Pick-Upcontient le plateau Slimline II (1425mm x 1358mm), 2 rails et 4 piedsUniversels qui correspondent aux rails. Le forage peut être nécessaire pour lemontage.', 450, 1730, NULL, 928.57143, 1114.285716, 'KRCC001T -Kit de galerie Slimline II pour la benne de la Chevrolet Colorado Pick-Up Truck(2004-jusqu’à présent) - de Front Runner\\n2 x LASS026 - Pieds 188mm (paire) pourle plateau Universel d’une benne de Pick-Up - de Front Runner \\n1 x RRSTJ07 - Plateau Slimline II - 1425mm(largeur) x 1358mm (longueur) - de Front Runner\\n1 x TRBU001 - Rails pour une benne de Pick-Up1000mm (longueur) - de Front Runner\\n\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 26kg\\n\\nLa rainure en T sur le haut et sur lebas du plateau de la barre transversale convient pour un boulon de 8mm(standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoinde pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à lahauteur des pieds pour déterminer la hauteur de galerie à partir de votregouttière.\\nSi votre galerie Slimline II a besoin de piedsde rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à lahauteur des pieds de rails pour déterminer la hauteur de la galerie à partir dupoint le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\n\\nPoids de la livraison :\\nPoids : 30.4kg', 'Ce kit contient une galerie qui est montée au-dessusde la benne d’une Chevrolet Colorado 2004+. Ce kit pour une benne de Pick-Upcontient le plateau Slimline II (1425mm x 1358mm), 2 rails et 4 piedsUniversels qui correspondent aux rails. Le forage peut être nécessaire pour lemontage.', 'Kit de galerie Slimline II pour la benne de la Chevrolet Colorado Pick-Up Truck (2004-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:20', NULL, NULL, 5.511814, 31.4, 6009542231464, 'ZA', 'EUR', 928.571, '7616.99', 10, 0);
