(149, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Citroen C4 (2010-actuel) - de Front Runner', 'KRCC004T', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Citroen C4. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 676.47059, 811.764708, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR034 - Pied Grab-On intérieur pour barres Flush / E - de Front Runner\\n1 x RRSTD05 - Plateau Slimline II - 1255mm (largeur) x 954mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 18kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 21,1kg', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Citroen C4. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Citroen C4 (2010-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:24', NULL, NULL, 5.511814, 21.7, 6009542243580, 'ZA', 'EUR', 676.471, '7616.99', 10, 0),
(150, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Chevrolet Colorado (2015-jusqu’à présent) - de Front Runner', 'KRCC005T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pied de rails pour placer la galerie sur votre Chevrolet Colorado. Vous devez forer dans le toit pour installer la galerie.', 450, 1730, NULL, 836.13445, 1003.36134, 'KRCC005T - Kit de galerie Slimline II pour une Chevrolet Colorado (2015-jusqu’à présent) - Front Runner\\nContient :\\n1 x FACC001 - Pieds de rail Chev Colorado/GMC Canyon - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 18kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 21,1kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pied de rails pour placer la galerie sur votre Chevrolet Colorado. Vous devez forer dans le toit pour installer la galerie.', 'Kit de galerie Slimline II pour une Chevrolet Colorado (2015-jusqu’à présent) - de Front Runner', 'Kit de Galerie Slimline II|Galerie|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:43:27', NULL, NULL, 5.511814, 29.8, 6009542247328, 'ZA', 'EUR', 836.134, '7616.99', 2, 0),
(151, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour la benne de la Chevy Colorado Roll Top 5.1’ (2015-jusqu’à présent) - de Front Runner', 'KRCC006T', 'Ce kit contient une galerie qui est montéeau-dessus de la benne d’une Chevrolet Colorado (2015-jusqu’à présent). Ce kit pourune benne de Pick-Up contient le plateau Slimline II (1425mm x 1358mm), 2rails, 2 pieds universels qui correspondent aux rails et 2 pieds support RollTop. Le forage est nécessaire pour l’installation.', 455, 1730, NULL, 1121.84874, 1346.218488, '2 x LASS026 - Pieds (paire) universels/ hauts d’une benne de Pick-Up - de Front Runner\\n2 x LASS028 - Pieds support pour unePick-Up Roll Top - de Front Runner\\n1 x RRAC902 - Kit de boulons pour labenne de la Ford F150 2004-2014\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm(largeur) x 1358mm (longueur) - de Front Runner \\n1 x TRBU002 - Rails pour une benne dePick-Up 1200mm (longueur) - de Front Runner\\n\\nMatériel utilisé: \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation:30kg \\n\\nLa rainure en T sur le haut et sur lebas du plateau de la barre transversale convient pour un boulon de 8mm(standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\n\\nSi votre galerie Slimline II a besoinde pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur despieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoinde pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à lahauteur des pieds de rails pour déterminer la hauteur de la galerie à partir dupoint le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 455mm \\nLongueur 1620mm \\nHauteur 270mm \\n\\nPoids de la livraison :\\nPoids : 34,5kg', 'Ce kit contient une galerie qui est montéeau-dessus de la benne d’une Chevrolet Colorado (2015-jusqu’à présent). Ce kit pourune benne de Pick-Up contient le plateau Slimline II (1425mm x 1358mm), 2rails, 2 pieds universels qui correspondent aux rails et 2 pieds support RollTop. Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour la benne de la Chevy Colorado Roll Top 5.1’ (2015-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galerie|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 10:43:32', NULL, NULL, 10.629927, 34.6, 6009542249568, 'ZA', 'EUR', 1121.849, '7616.99', 10, 0),
(152, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II Chevrolet Captiva (2006-actuel) - de Front Runner', 'KRCC007T', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1156mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Chevrolet Captiva. Ce système s’installe facilementen utilisant les pieds solides tout-terrain qui s’accrochent aux barreslongitudinales d’origine. Le forage n’est pas nécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'Composé de :\\n2 x GOFR001 - Pied de rail (paire) - par Front Runner\\n2 x GORR051 - Pince pour rail extérieur surélevé / n° 2 - par Front Runner\\n2 x GORR074 - Prise de rail intérieur surélevé / E - par Front Runner\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(L) X 1156mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 21,8 kg (48,1 lb)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'accrochage ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 455mm (18.0\'\')\\nLongueur : 1610mm (63,0\'\')\\nHauteur : 285mm (11,0\'\')\\nPoids de l\'expédition :\\n22,8kg (50.0lbs)', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1156mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Chevrolet Captiva. Ce système s’installe facilementen utilisant les pieds solides tout-terrain qui s’accrochent aux barreslongitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II Chevrolet Captiva (2006-actuel) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:35', NULL, NULL, 11.220478, 22.8, 6009542252629, 'ZA', 'EUR', 710.084, '7616.99', 10, 0),
