nt une galeriequi est montée au-dessus de la benne d’une Chevrolet Silverado Standard Pick-UpTruck 1987+. Ce kit pour une benne de Pick-Up contient leplateau Slimline II (1475mm x 1358mm), 2 rails et 4 pieds Universels quicorrespondent aux rails. Le forage peut être nécessaire pour le montage.', 'Kit de galerie Slimline II pour la benne de la Chevrolet Silverado Standard Pick-Up Truck (1987-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:39', NULL, NULL, 5.511814, 31.6, 6009542231488, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(154, 1, 2, NULL, NULL, NULL, 'Kit de double barre de benne pour un Chevrolet Silverado Crew Cab / benne courte (2007-jusqu\'à présent) - de Front Runner', 'KRCS004', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus du lit de votre Chevy Silverado grâce à ces deux solides et élégantes barres de chargement pour le cover de votre pick-up.', 1685, 125, NULL, 365.54622, 438.655464, 'KRCS004 - Kit de double barre de benne pour un Chevrolet Silverado Crew Cab / benne courte (2007-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x LASS026 - Pieds de benne à chargement universel / Grand (paire) - de Front Runner\\n1 x LBSK018 - Paire de barres de toit 1575mm(l) - de Front Runner\\n1 x TRBU002 - Pistes pour benne de chargement Bakkie / 1200mm(L) - de Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 11.4 kg (25.2 lb)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 1685mm (66.0\'\')\\nLongueur : 125mm (5.0\'\')\\nHauteur : 310mm (12,0\'\')\\nPoids de la livraison :\\n11.0kg (24.0lbs)', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus du lit de votre Chevy Silverado grâce à ces deux solides et élégantes barres de chargement pour le cover de votre pick-up.', 'Kit de double barre de benne pour un Chevrolet Silverado Crew Cab / benne courte (2007-jusqu\'à présent) - de Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:43:42', NULL, NULL, 12.2, 11, 6009542283333, 'ZA', 'EUR', 365.546, '7616.99', 10, 0),
(155, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour une Chevrolet Silverado Crew Cab / Benne courte (2007-jusqu\'à présent) - de Front Runner', 'KRCS004T', 'Ce kit permet de créer une galerie complète qui se place au-dessus de votre benne courte de votre Chevrolet Silverado Crew Cab, et contient le plateau Slimline II (1575 mm x 1560 mm), 2 rails et 6 pieds universels de benne pick-up qui s\'adaptent aux rails.', 445, 1730, NULL, 1088.23529, 1305.882348, 'KRCS004T -Kit de galerie de benne Slimline II pour une Chevrolet Silverado Crew Cab / Benne courte (2007-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x LASS026 - Pieds universels de benne à chargement / Grand (paire) - par Front Runner\\n1 x RRSTP08 - Plateau SLII - 1575mm(L)X1560mm(L)\\n1 x TRBU002 - rails pour benne de chargement Bakkie / 1200mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 35,3 kg (77,8 livres)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 445mm (18.0\'\')\\nLongueur : 1730mm (68,0\'\')\\nHauteur : 290mm (11,0\'\')\\nPoids de la livraison :\\n35,8kg (79.0lbs)', 'Ce kit permet de créer une galerie complète qui se place au-dessus de votre benne courte de votre Chevrolet Silverado Crew Cab, et contient le plateau Slimline II (1575 mm x 1560 mm), 2 rails et 6 pieds universels de benne pick-up qui s\'adaptent aux rails.', 'Kit de galerie de benne Slimline II pour une Chevrolet Silverado Crew Cab / Benne courte (2007-jusqu\'à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 10:44:05', NULL, NULL, 11.4, 35.8, 6009542283340, 'ZA', 'EUR', 1088.235, '7616.99', 10, 0),
(156, 1, 2, NULL, NULL, NULL, 'Kit de double barres de toit pour un Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner', 'KRCS005', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Chevy Silverado grâce à ces deux solides et élégantes barres de toit pour la benne du pick-up.', 130, 1690, NULL, 399.15966, 478.991592, 'KRCS005 - Kit de double barres de toit pour un Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x LASS026 - Pieds de benne de pick-up universel / Grand - de Front Runner\\n1 x LBSK018 - Paire de barres de toit 1575mm(W) - de Front Runner\\n1 x TRBU004 - Pistes pour benne de chargement Bakkie / 1600mm(L) - de Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 12.2kg (26.9lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 130mm (5.0\'\')\\nLongueur : 1690mm (67,0\'\')\\nHauteur : 310mm (12,0\'\')\\nPoids de la livraison :\\n12.0kg (26.0lbs)', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Chevy Silverado grâce à ces deux solides et élégantes barres de toit pour la benne du pick-up.', 'Kit de double barres de toit pour un Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:44:08', NULL, NULL, 12.2, 12, 6009542283357, 'ZA', 'EUR', 399.16, '7616.99', 3, 0),
(157, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour benne de Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner', 'KRCS005T', 'Rendez le plateau de chargement de votre Chevrolet Silverado Crew Cab plus polyvalent et libérez un espace précieux grâce à cette galerie complète qui s\'installe facilement dans les rails fournis.', 440, 1730, NULL, 1231.09244, 1477.310928, 'KRCS005T - Kit de galerie Slimline II pour benne de Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x LASS026 - Pieds de benne à chargement universel / Grand (paire) - par Front Runner\\n1 x RRSTP09 - Plateau SLII - 1575mm(L)X1762mm(L)\\n1 x TRBU004 - Pistes pour benne de chargement Bakkie / 1600mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 39,4 kg (87,0 lb)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 1730mm (68.0\'\')\\nLongueur : 445mm (18,0\'\')\\nHauteur : 290mm (11,0\'\')\\nPoids de la livraison :\\n35,8kg (79.0lbs)', 'Rendez le plateau de chargement de votre Chevrolet Silverado Crew Cab plus polyvalent et libérez un espace précieux grâce à cette galerie complète qui s\'installe facilement dans les rails fournis.', 'Kit de galerie Slimline II pour benne de Chevrolet Silverado Crew Cab (2007-jusqu\'à présent) - de Front Runner', 'Kit de Galerie Slimline II|Galerie', 0, 1, '2022-01-07 10:44:10', NULL, NULL, 11.4, 35.8, 6009542283364, 'ZA', 'EUR', 1231.092, '7616.99', 3, 0),
(158, 1, 2, NULL, NULL, NULL, 'Chevrolet Silverado Crew Cab / Benne à chargement courte (2007 - actuel) Kit triple barre de charge - par Front Runner', 'KRCS006', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Chevy Silverado grâce à ces trois solides et élégantes barres de chargement pour benne pick-up.', 1685, 125, NULL, 500, 600, 'Composé de :\\n3 x LASS026 - Paire de pieds de benne à chargement universel - par Front Runner\\n1 x LBSK019 - Jeu de barres de toit 1575mm(W) - par Front Runner\\n1 x TRBU002 - rails pour benne de chargement Bakkie / 1200mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 15,9 kg (35,0 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 1685mm (66.0\'\')\\nLongueur : 125mm (5.0\'\')\\nHauteur : 385mm (15,0\'\')\\nPoids de la livraison :\\n14,4kg (32,0lbs)', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Chevy Silverado grâce à ces trois solides et élégantes barres de chargement pour benne pick-up.', 'Chevrolet Silverado Crew Cab / Benne à chargement courte (2007 - actuel) Kit triple barre de charge - par Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:44:13', NULL, NULL, 15.2, 14.4, 6009542283371, 'ZA', 'EUR', 500, '7616.99', 4, 0),
