(160, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Chevrolet Trailblazer (2012-jusqu\'à présent) - de Front Runner', 'KRCT001T', 'Ce kit de porte-bagages de toit complet Slimline II de 1560 mm de long contient le plateau Slimline II, un déflecteur de vent et deux rails de pied pour monter le plateau Slimline II sur votre Chevrolet Trailblazer ( 2012-Current).', 450, 1730, NULL, 819.32773, 983.193276, 'KRCT001T - Kit de galerie Slimline II pour un Chevrolet Trailblazer (2012-current) - de Front Runner\\n\\nComposé de :\\n1 x FACT001 - Pieds de rails pour un Chevrolet Trail Blazer (Paire G/D) 84mm\\n1 x RRSTA08 - Plateau Slimline II - 1165mm (largeur) x 1560mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :24kg (53lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 28.2kg (62.0lbs)', 'Ce kit de porte-bagages de toit complet Slimline II de 1560 mm de long contient le plateau Slimline II, un déflecteur de vent et deux rails de pied pour monter le plateau Slimline II sur votre Chevrolet Trailblazer ( 2012-Current).', 'Kit de galerie Slimline II pour un Chevrolet Trailblazer (2012-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:44:17', NULL, NULL, 5.511814, 28.9, 6009542224831, 'ZA', 'EUR', 819.328, '7616.99', 5, 0),
(161, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour la benne du Ram Mega Cab 4 - portes (2002-2008) - de Front Runner', 'KRDR003T', 'Ce kit contientune galerie qui est montée au-dessus de la benne d’une Dodge Ram Mega Cab2002-2008. Ce kit pour une benne de Pick-Up contient le plateau Slimline II(1475mm x 1358mm), 2 rails et 4 pieds de montage universels qui correspondent aux rails.Le forage peut être nécessaire pour le montage.', 450, 1730, NULL, 945.3782, 1134.45384, 'KRDR003T -Kit de galerie Slimline II pour la benne du Ram Mega Cab 4 - portes (2002-2008) - de Front Runner\\nComposé de :\\n3 x LASS026 - Pieds pour benne de pick-up universel/ Haut (Paire)\\n1 x RRSTM07 - Plateau SLII -1475mm(l)X1358mm(L)\\n1x TRBU001- Rails pour benne de Pick-Up / 1000mm (L)\\nMateriau utilisé :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\n\\nPoids approximatif d’installation: 31.9kg (70.33lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 140mm (6\'\')\\n\\nPoids de la livraison :\\nPoids :31.62kg (70lbs)', 'Ce kit contientune galerie qui est montée au-dessus de la benne d’une Dodge Ram Mega Cab2002-2008. Ce kit pour une benne de Pick-Up contient le plateau Slimline II(1475mm x 1358mm), 2 rails et 4 pieds de montage universels qui correspondent aux rails.Le forage peut être nécessaire pour le montage.', 'Kit de galerie Slimline II pour la benne du Ram Mega Cab 4 - portes (2002-2008) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:44:21', NULL, NULL, 5.511814, 31.6, 6009542231549, 'ZA', 'EUR', 945.378, '7616.99', 10, 0),
