(180, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II 1/4 pour une Dodge Sprinter Van (2007-jusqu’à présent) - de Front Runner', 'KRDS003T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1560mm pour la DodgeSprinter (2007+) contient un plateau Slimline II, un déflecteur de vent, un setde rails et 6 pieds de support. Le forage est nécessaire pour l’installation.', 455, 1800, NULL, 1331.93277, 1598.319324, 'KRDS003TKit de galerie de toit Slimline II 1/4 pour une Dodge Sprinter Van(2007-jusqu’à présent) - de Front Runner\\nContient:\\n3 x FASS016 - pieds plats (paire) /65mm - de Front Runner\\n1 x RRSTM08 plateau Slimline II -1475mm (largeur) x 1560mm (longueur) - de Front Runner\\n1 x TRMS001 - rails pour une MercedesSprinter (2006-jusqu’à présent) / 3082mm-4098mm (longueur) - de Front Runner\\n1 x WDST009 - Déflecteur de vent 20mmlarge paire / 1345mm (largeur) - de Front Runner\\n\\nMatériel utilisé:\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatifd’installation: 35kg\\n\\nLa rainure en T sur le haut et sur lebas du plateau de la barre transversale convient pour un boulon de 8mm(standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\n\\nSi votre gallérie Slimline II abesoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à lahauteur des pieds pour déterminer la hauteur de galerie à partir de votregouttière.\\n\\nSi votre galerie Slimline II a besoinde pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') àla hauteur des pieds de rails pour déterminer la hauteur de la galerie à partirdu point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 455mm\\nLongueur 1800mm\\nHauteur 250mm\\n\\nPoids de la livraison :Poids:40,9kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1560mm pour la DodgeSprinter (2007+) contient un plateau Slimline II, un déflecteur de vent, un setde rails et 6 pieds de support. Le forage est nécessaire pour l’installation.', 'Kit de galerie de toit Slimline II 1/4 pour une Dodge Sprinter Van (2007-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:00', NULL, NULL, 9.842525, 39.9, 6009542252049, 'ZA', 'EUR', 1331.933, '7616.99', 10, 0),
(181, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Bronco (1966-1977) - de Front Runner', 'KRFB001T', 'Le kitde galerie de toit Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' pour votreFord Bronco contient le plateau Slimline II, un déflecteur de vent et 8 piècesde montage avec gouttières pour monter le plateau sur votre véhicule. Lagalerie s’installe facilement sans devoir forer.', 455, 1730, NULL, 1264.70588, 1517.647056, 'KRFB001T - Kit de galerie de toit SLII pourune Ford Bronco (1966-1977)\\n\\nComposé de :\\n4 x LASS103 - Pied n°3 155mm (Paire)\\n1 x RRSTM10 - Plateau Slimline II - 1475mm(largeur) x 1964mm (longueur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 34kg (74lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 455mm\\nLongueur : 1610mm\\nHauteur : 250mm\\nPoids de la livraison : \\n39.1kg (86.0lbs)', 'Le kitde galerie de toit Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' pour votreFord Bronco contient le plateau Slimline II, un déflecteur de vent et 8 piècesde montage avec gouttières pour monter le plateau sur votre véhicule. Lagalerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Ford Bronco (1966-1977) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:03', NULL, NULL, 9.842525, 39.5, 6009542252902, 'ZA', 'EUR', 1264.706, '7616.99', 10, 0),
(182, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Bronco Sport (Badlands/Première édition) (2021-jusqu\'à présent) - de Front Runner', 'KRFB002T', 'Laissez votre Bronco Sport vagabonder dans la nature avec le kit de galerie Slimline II.Transportez votre matériel d\'aventure préféré et vos jouets sur le toit tout en libérant un espace intérieur précieux pour les personnes ou les marchandises.', 445, 1725, NULL, 794.11765, 952.94118, 'KRFB002T - Kit de galerie Slimline II pour une Ford Bronco Sport (Badlands/Première édition) (2021-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR053 - Griffes extérieures de rail surélevé / No. 4\\n2x GORR072 - Griffes intérieures de rail surélevé / C\\n1x RRSTD07 - Plateau SLII - 1255mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 24.87kg (54.83lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur : 445mm (18\'\')\\nLongueur : 1725mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids d\'expédition :\\nPoids : 24kg (53lbs)', 'Laissez votre Bronco Sport vagabonder dans la nature avec le kit de galerie Slimline II.Transportez votre matériel d\'aventure préféré et vos jouets sur le toit tout en libérant un espace intérieur précieux pour les personnes ou les marchandises.', 'Kit de galerie Slimline II pour une Ford Bronco Sport (Badlands/Première édition) (2021-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:07', NULL, NULL, 6.1, 24, 6009542218441, 'ZA', 'EUR', 794.118, '7616.99', 10, 0),
(183, 1, 2, NULL, NULL, NULL, 'Kit Slimline II pour barres de toit Ford Bronco Sport (Base/Big Bend/Outer Banks) (2021-actuel) - par Front Runner', 'KRFB003T', 'Laissez votre Bronco Sport (Base/Big Bend/Outer Banks) (2021-actuel) vagabonder dans la nature avec le Kit Galerie Slimline II pour barres de toit . Transportez votre équipement d\'aventure et vos jouets préférés sur le toit lorsque vous libérez un espace intérieur précieux pour les personnes ou un chargement plus important.', 440, 1720, NULL, 785.71429, 942.857148, 'Composé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR052 - Poignées extérieures de rail surélevé / No. 3\\n2x GORR071 - Grips intérieurs de rail surélevé / B\\n1x RRSTD07 - Plateau SLII - 1255mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 24.83kg (54.74lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie sur rail Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 150mm (6\'\')\\nPoids à la livraison :\\nPoids : 25.4kg (56lbs)', 'Laissez votre Bronco Sport (Base/Big Bend/Outer Banks) (2021-actuel) vagabonder dans la nature avec le Kit Galerie Slimline II pour barres de toit . Transportez votre équipement d\'aventure et vos jouets préférés sur le toit lorsque vous libérez un espace intérieur précieux pour les personnes ou un chargement plus important.', 'Kit Slimline II pour barres de toit Ford Bronco Sport (Base/Big Bend/Outer Banks) (2021-actuel) - par Front Runner', 'Galerie', 0, 1, '2022-01-07 10:49:11', NULL, NULL, 5.9, 25.4, 6009542219318, 'ZA', 'EUR', 785.714, '7616.99', 10, 0),
(184, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Everest (2015 - jusqu\'à présent) - de Front Runner', 'KRFE001T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II à votre Ford Everest. La galerie peut facilement être installée en utilisant les points de montage existants. Le forage n’est pas nécessaire. ', 440, 1730, NULL, 1046.21849, 1255.462188, 'KRFE001T - Kit de galerie Slimline II pour une Ford Everest (2015 - jusqu\'à présent) \\n\\nContient:\\n1 x FAFE001 - Pieds de rails Ford Everest (2015 - jusqu\'à présent) 94mm\\n1 x RRSTD09 - Plateau Slimline II - 1255mm (largeur) x 1762mm(longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 32kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 630mm\\nLongueur : 1640mm\\nHauteur : 160mm\\n\\nPoids de la livraison : 37,4kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II à votre Ford Everest. La galerie peut facilement être installée en utilisant les points de montage existants. Le forage n’est pas nécessaire. ', 'Kit de galerie Slimline II pour une Ford Everest (2015 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:49:13', NULL, NULL, 9.6, 37.6, 6009542237527, 'ZA', 'EUR', 1046.218, '8708.29.90', 6, 0),
(185, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Everest (2009-2015) - de Front Runner', 'KRFE003T', 'Ce kit de galerie Slimline II complet, d\'une longueur de 1560mm/61.4\'\', contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds d\'accrochage pour monter le plateau Slimline II sur les rails de toit de votre Ford Everest. Ce système s\'installe facilement avec des pieds résistants tout terrain qui s\'accrochent aux rails de toit existants de d\'origine . Aucun forage n\'est nécessaire.', 450, 1730, NULL, 920.16807, 1104.201684, 'KRFE003T -Kit de galerie Slimline II pour rails de toit pour une Ford Everest (2009-2015) - par Front Runner\\nComposé de :\\n3 x GOFR001 - Base de pied de rail (paire) - par Front Runner\\n3 x GORR051 - Support extérieur de rail surélevé / No. 2 - par Front Runner\\n3 x GORR070 - Support intérieur pour rail surélevé / A - par Front Runner\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(Largeur) X 1560mm(Longueur) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 25kg (54lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et des profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de porte-bagages de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 28.7 kg (63.2 lb)', 'Ce kit de galerie Slimline II complet, d\'une longueur de 1560mm/61.4\'\', contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds d\'accrochage pour monter le plateau Slimline II sur les rails de toit de votre Ford Everest. Ce système s\'installe facilement avec des pieds résistants tout terrain qui s\'accrochent aux rails de toit existants de d\'origine . Aucun forage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Ford Everest (2009-2015) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:18', NULL, NULL, 5.511814, 28.7, 6009542264493, 'ZA', 'EUR', 920.168, '7616.99', 10, 0),
(186, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Explorer (2020-jusqu\'à présent) - de Front Runner', 'KRFE004T', 'Explorez davantage dans votre Ford Explorer grâce à ce système de galerie de toit entièrement métallique et peint par poudrage. La conception modulaire vous permet de retirer des lattes pour dégager l\'accès aux toits ou d\'ajouter des lattes pour une plateforme complète. Le montage rapide et sûr des accessoires rend votre Exlporer facilement prêt pour toute aventure.', 440, 1730, NULL, 995.79832, 1194.957984, 'KRFE004T -Kit de galerie Slimline II pour une Ford Explorer (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x GOFR001 - Base de pied de rail (paire) - par Front Runner\\n3 x GOFR010 - Supports extérieurs de rail affleurant / No. 1 - par Front Runner\\n3 x GOFR035 - Supports intérieurs de rail affleurant / F - par Front Runner\\n1 x RRAC904 - Entretoise en plastique pour la base du rail de pied / 10mm (paire) - par Front Runner\\n1 x RRSTG07 - Plateau Slimline II - 1345mm(L) X 1358mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 21.6kg (47.6lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 440mm (17.3\'\')\\nLongueur 1730mm (68.1\'\')\\nHauteur 150mm (5.9\'\')\\nPoids de l\'expédition :\\nPoids : 26.4 kg (58.2 lb)', 'Explorez davantage dans votre Ford Explorer grâce à ce système de galerie de toit entièrement métallique et peint par poudrage. La conception modulaire vous permet de retirer des lattes pour dégager l\'accès aux toits ou d\'ajouter des lattes pour une plateforme complète. Le montage rapide et sûr des accessoires rend votre Exlporer facilement prêt pour toute aventure.', 'Kit de galerie Slimline II pour une Ford Explorer (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:49:22', NULL, NULL, 5.9, 26, 6009542200088, 'ZA', 'EUR', 995.798, '7616.99', 10, 0),
(187, 1, 2, NULL, NULL, NULL, 'Kit de 1/2 galerie de toit Slimline II pour une Ford Excursion (2000-2005) - de Front Runner', 'KRFE005T', 'Transportez encore plus d\'équipement sur votre Ford Excursion avec ce kit de galerie de toit Slimline II. Rendue résistante au tout-terrain grâce à des matériaux de première qualité, cette galerie modulaire s\'adapte à toutes les aventures.', 440, 1730, NULL, 1147.05882, 1376.470584, 'KRFE005T -Kit de 1/2 galerie de toit Slimline II pour une Ford Excursion (2000-2005) - de Front Runner\\nComposé de :\\n3x FASS013 - Set de pieds / 60mm - 70mm\\n3x RRAC907 - Plaque à crampons MB Sprinter Track\\n1x RRSTJ11 - Plateau SLII - 1425mm(W)X2166mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 71.78kg (158.25lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\nPoids : 35.8kg (79lbs)', 'Transportez encore plus d\'équipement sur votre Ford Excursion avec ce kit de galerie de toit Slimline II. Rendue résistante au tout-terrain grâce à des matériaux de première qualité, cette galerie modulaire s\'adapte à toutes les aventures.', 'Kit de 1/2 galerie de toit Slimline II pour une Ford Excursion (2000-2005) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:49:27', NULL, NULL, 6.1, 35.8, 6009542213866, 'ZA', 'EUR', 1147.059, '7616.99', 10, 0),
(188, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Ford Excursion (2000-2005) - de Front Runner', 'KRFE006T', 'Transportez encore plus d\'équipement sur votre Ford Excursion avec ce kit de galerie de toit Slimline II. Rendue résistante au tout-terrain grâce à des matériaux de première qualité, cette galerie modulaire s\'adapte à toutes les aventures.', 440, 1730, NULL, 1676.47059, 2011.764708, 'KRFE006T -Kit de galerie Slimline II pour Ford Excursion (2000-2005) - de Front Runner\\nComposé de :\\n2x FASS012 - Paire de pieds / 40mm - 50mm\\n2x FASS013 - Paire de pieds / 60mm - 70mm\\n1x RRAC903 - Kit de boulons - Ford Excursion (2000-2005)\\n1x RRSTJ14 - Plateau SLII - 1425mm(L)X2772mm(L)\\n2x TRAC010 - Rail universel non percé / 1800mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 97.52kg (214.99lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 280mm (11\'\')\\nPoids à la livraison :\\nPoids : 47.2kg (104lbs)', 'Transportez encore plus d\'équipement sur votre Ford Excursion avec ce kit de galerie de toit Slimline II. Rendue résistante au tout-terrain grâce à des matériaux de première qualité, cette galerie modulaire s\'adapte à toutes les aventures.', 'Kit de galerie Slimline II pour Ford Excursion (2000-2005) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:46', NULL, NULL, 11, 47.2, 6009542213873, 'ZA', 'EUR', 1676.471, '7616.99', 5, 0);
