(189, 1, 2, NULL, NULL, NULL, 'Kit de 3/4 galerie Slimline II pour une Ford E150/E250/E350 Extended Cab (1992-2014) - deFront Runner', 'KRFE007T', 'Transformez votre van en véhicule d\'aventure ultime avec le Kit de galerie 3/4 Slimline II pour Ford E150/ E250/E350 Extended Cab. Montez votre équipement d\'aventure sur les 3/4 du toit afin de disposer d\'un espace intérieur suffisant pour travailler ou jouer.', 440, 1730, NULL, 1701.68067, 2042.016804, 'KRFE007T-Kit de3/4galerie Slimline II pour Ford E150/ E250/E350 Extended Cab (1992-2014)\\nComposé de :\\n1x LASP104 - No 4 Plus Leg 180mm (paire)\\n4x LASS027 - Entretoise de jambe 6mm (paire)\\n2x LASS103 - jambe n°3 155mm (paire)\\n2x LASS104 - No 4 Leg 170mm (Paire)\\n1x RRSTP14 - Plateau SLII - 1575mm(L)X2772mm(L)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 53.08kg (117.02lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids à la livraison :\\nPoids : 53.8kg (118lbs)', 'Transformez votre van en véhicule d\'aventure ultime avec le Kit de galerie 3/4 Slimline II pour Ford E150/ E250/E350 Extended Cab. Montez votre équipement d\'aventure sur les 3/4 du toit afin de disposer d\'un espace intérieur suffisant pour travailler ou jouer.', 'Kit de 3/4 galerie Slimline II pour une Ford E150/E250/E350 Extended Cab (1992-2014) - deFront Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:50', NULL, NULL, 10.6, 53.8, 6009542217642, 'ZA', 'EUR', 1701.681, '7616.99', 10, 0),
(190, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Ford E150/ E250/E350 Extended Cab (2016 - jusqu\'à présent) - de Front Runner', 'KRFE008T', 'Transformez votre van en véhicule d\'aventure ultime avec le Kit de galerie de toit Slimline II pour une Ford E150/ E250/E350 Extended Cab. Montez votre équipement d\'aventure sur le toit pour disposer d\'un espace intérieur suffisant pour travailler ou jouer.', 440, 1730, NULL, 2306.7227, 2768.06724, 'KRFE008T - Kit de galerie Slimline II pour Ford E150/E250/E350 Extended Cab (2016-jusqu\'à présent)\\nComposé de :\\n1x LASP104 - No 4 Plus Leg 180mm (paire)\\n5x LASS027 - Entretoise de jambe 6mm (paire)\\n3x LASS103 - jambe n°3 155mm (paire)\\n2x LASS104 - No 4 Leg 170mm (Paire)\\n2x RRSTP09 - Plateau SLII - 1575mm(L)X1762mm(L)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 73.52kg (162.08lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids à la livraison :\\nPoids : 43.8kg (96lbs)', 'Transformez votre van en véhicule d\'aventure ultime avec le Kit de galerie de toit Slimline II pour une Ford E150/ E250/E350 Extended Cab. Montez votre équipement d\'aventure sur le toit pour disposer d\'un espace intérieur suffisant pour travailler ou jouer.', 'Kit de galerie Slimline II pour Ford E150/ E250/E350 Extended Cab (2016 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:49:54', NULL, NULL, 10.6, 43.8, 6009542217659, 'ZA', 'EUR', 2306.723, '7616.99', 10, 0),
(191, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Expedition/Lincoln Navigator (2018-jusqu\'à présent) - de Front Runner', 'KRFE009T', 'Vous n\'avez pas besoin d\'une installation permanente de galerie de toit pour débloquer votre prochaine aventure. Le kit de galerie de toit Slimline II pour la Ford Expedition ou la Lincoln Navigator 2018-jusqu\'à présent s\'installe sur vos rails d\'usine, sans perçage, avec des pieds résistants au tout-terrain. Vous pouvez profiter de l\'utilité des accessoires de galerie Front Runner, tout en conservant la possibilité de retirer la galerie à tout moment.', 440, 1730, NULL, 1147.0588, 1376.47056, 'KRFE009T -Kit de galerie Slimline II pour une Ford Expedition/Lincoln Navigator (2018-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GORR054 - Griffes extérieures de rail surélevé / No. 5\\n3x GORR070 - Griffes intérieures de rail surélevé / A\\n1x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTJ09 - Plateau SLII - 1425mm(l)X1762mm(L)\\n1x WDST009 - Paire de déflecteurs de vent 20mm de large / 1345mm(l)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 34kg (74.96lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.Dimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids de la livraison :\\nPoids : 35kg (77lbs)', 'Vous n\'avez pas besoin d\'une installation permanente de galerie de toit pour débloquer votre prochaine aventure. Le kit de galerie de toit Slimline II pour la Ford Expedition ou la Lincoln Navigator 2018-jusqu\'à présent s\'installe sur vos rails d\'usine, sans perçage, avec des pieds résistants au tout-terrain. Vous pouvez profiter de l\'utilité des accessoires de galerie Front Runner, tout en conservant la possibilité de retirer la galerie à tout moment.', 'Kit de galerie Slimline II pour une Ford Expedition/Lincoln Navigator (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:49:57', NULL, NULL, 6.3, 35, 6009542233468, 'ZA', 'EUR', 1147.059, '8708.29.90', 10, 0),
(192, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour la benne de la Ford F150 F250 F350 Pick-Up Truck (1997-jusqu’à présent) - de Front Runner', 'KRFF002T', 'Ce kit contientune galerie qui est montée au-dessus de la benne d’une Ford F150 F250 F350. Cekit pour une benne de Pick-Up contient le plateau Slimline II (1475mm x1358mm), 2 rails et 4 pieds Universels qui correspondent aux rails. Le foragepeut être nécessaire pour le montage.', 450, 1730, NULL, 1373.94958, 1648.739496, 'KRFF002T Kit degalerie Slimline II pour la benne de la Ford F150 F250 F350 Pick-Up Truck (1997-jusqu’àprésent) - de Front Runner\\n2 x LASS026 - Pieds 188mm (paire) pour le plateauUniversel d’une benne de Pick-Up - de Front Runner\\n1 x RRSTM07 - Plateau Slimline II - 1475mm(largeur) x 1358mm (longueur) - de Front Runner\\n1 x TRBU001 - Rails pour une benne de Pick-Up1000mm (longueur) - de Front Runner\\n\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 27kg\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\n\\nPoids de la livraison :\\nPoids : 30.9kg', 'Ce kit contientune galerie qui est montée au-dessus de la benne d’une Ford F150 F250 F350. Cekit pour une benne de Pick-Up contient le plateau Slimline II (1475mm x1358mm), 2 rails et 4 pieds Universels qui correspondent aux rails. Le foragepeut être nécessaire pour le montage.', 'Kit de galerie Slimline II pour la benne de la Ford F150 F250 F350 Pick-Up Truck (1997-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:49:58', NULL, NULL, 5.511814, 40.6, 6009542231563, 'ZA', 'EUR', 1373.95, '7616.99', 10, 0),
