(194, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II Roll Top 6.5’ pour la benne de la Ford F150 (2004-2014) - de Front Runner', 'KRFF009T', 'Le kit de galerie Slimline II pour toute la longueur du toit s’installe au-dessus de la benne de la Ford F150 avec Roll Top. Le kit de galerie Slimline II contient le plateau Slimline II (1475mm x 1762mm), 2 rails et 6 pieds Roll Top qui correspondent aux rails.', 450, 1730, NULL, 1516.80672, 1820.168064, 'KRFF009T - Kit de galerie Slimline II pour une Ford F150 (2004-2014)\\nContient :\\n3 x LASS026 - Pied Universel/ Haut (Paire) - de Front Runner\\n3 x LASS027 - Écarteur de pied 6mm (Paire) - de Front Runner\\n3 x LASS028 - Pied Roll Top - Front Runner\\n1 x RRAC902 - Kit de boulons pour la benne de la Ford F150 2004-2014\\n1 x RRSTM09 - Plateau Slimline II - 1475mm (largeur) x 1762mm(longueur) - Front Runner\\n1 x TRAC003 - Rails Universels 1800mm (longueur) - Front Runner\\nMatériel utilisé :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 38kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 44,6kg', 'Le kit de galerie Slimline II pour toute la longueur du 