nsions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 265mm (10\'\')\\nPoids de l\'expédition :\\nPoids : 37.9 kg (83.4 lb)', 'Ce kit crée une galerie pleine grandeur qui se place au-dessus de la benne de votre Ford F150 (2005 + avec Retrax XR rails). Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm x 1560mm) et 6 pieds de benne de pick-up universelsqui s\'adaptent aux rails Retrax XR existants.', 'Kit de galerie de benne Slimline II pour un un Ford F150 avec Retrax XR 6.5\' (2015-jusqu\'à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 10:50:22', NULL, NULL, 10.433077, 37.9, 6009542264455, 'ZA', 'EUR', 1273.109, '7616.99', 10, 0),
