(212, 1, 2, NULL, NULL, NULL, 'Ford F150 5,5\' Super Crew (2009-actuel) Kit triple barre de charge - par Front Runner', 'KRFF026', 'Garantissez que tout votre matériel arrive à bon port sans compromettre le précieux espace de chargement de votre Ford F150 5,5\' Super Crew grâce à ces trois barres de charge surbaissées en aluminium peint par poudrage.', 235, 1630, NULL, 592.43697, 710.924364, 'Composé de :\\n3x LASS028 - Montage de pied de fixation pour rouleaux Pick-Up\\n1x LBSK019 - Set de barre de charge de toit 1575mm(W)\\n1x TRAC002 - Rail universel / 1400mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nPoids approximatif du montage : 29.93kg (65.98lbs)\\nLes fentes en T situées en haut et en bas des lattes peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de charge, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de charge utilise des pieds, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de barres de charge utilise des rails de pied, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des rails de pied indiqués ci-dessus pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 235 mm (9\'\')\\nLongueur : 1630mm (64\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 13.6kg (30lbs)', 'Garantissez que tout votre matériel arrive à bon port sans compromettre le précieux espace de chargement de votre Ford F150 5,5\' Super Crew grâce à ces trois barres de charge surbaissées en aluminium peint par poudrage.', 'Ford F150 5,5\' Super Crew (2009-actuel) Kit triple barre de charge - par Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:21', NULL, NULL, 6.3, 13.6, 6009542283524, 'ZA', 'EUR', 592.437, '7616.99', 4, 0),
(213, 1, 2, NULL, NULL, NULL, 'Ford F150 6,5\' Super Crew (2009-actuel) Kit triple barre de charge - par Front Runner', 'KRFF027', 'Garantissez que tout votre matériel arrive à bon port sans compromettre le précieux espace de chargement de votre Ford F150 6,5\' Super Crew grâce à ces barres de charge surbaissées en aluminium anticorrosion.', 1685, 165, NULL, 483.19328, 579.831936, 'Composé de :\\n3x LASS028 - Montage de pied de fixation pour rouleaux Pick-Up\\n1x LBSK019 - Set de barre de charge de toit 1575mm(W)\\n1x TRAC003 - Rail universel / 1800mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nPoids approximatif du montage : 30.36kg (66.93lbs)\\nLes rainures en T situées en haut et en bas des lattes peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de charge, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de charge utilise des pieds, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de barres de charge utilise des rails de pied, ajoutez la hauteur de la barre de charge (22 mm) à la hauteur des rails de pied indiqués ci-dessus pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 1685mm (66\'\')\\nLongueur : 165mm (6\'\')\\nHauteur : 230mm (9\'\')\\nPoids à la livraison :\\nPoids : 13.2kg (29lbs)', 'Garantissez que tout votre matériel arrive à bon port sans compromettre le précieux espace de chargement de votre Ford F150 6,5\' Super Crew grâce à ces barres de charge surbaissées en aluminium anticorrosion.', 'Ford F150 6,5\' Super Crew (2009-actuel) Kit triple barre de charge - par Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:24', NULL, NULL, 9.1, 13.2, 6009542283531, 'ZA', 'EUR', 483.193, '7616.99', 4, 0),
(214, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Ford Kuga (2016-jusqu\'à présent) - de Front Runner', 'KRFK001T', 'Cekit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5” contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Ford Kuga. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 777.31092, 932.773104, 'KRFK001T -Kit de galerie Slimline II pour Ford Kuga (2016-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 -Base de pied de rail (Paire) - de Front Runner\\n2 x GORR052 - Rail élevé extérieurGrab-On / N° 3 - de Front Runner\\n2 x GORR071 - Rail élevé intérieurGrab-On / B - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur)- de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extra étroit (paire) / 1156mm(largeur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 21kg(46lbs)\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455mm(18\'\')\\nLongueur 1610mm(63\'\')\\nHauteur 285mm(11\'\')\\n\\nPoids de la livraison :\\nPoids : 24.3kg (53.5lbs)', 'Cekit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5” contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Ford Kuga. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie Slimline II pour Ford Kuga (2016-jusqu\'à présent) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 10:51:26', NULL, NULL, 11.220478, 24.4, 6009542252490, 'ZA', 'EUR', 777.311, '7616.99', 10, 0),
(215, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford DC (2012 - jusqu\'à présent) - de Front Runner', 'KRFM005T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1156mm/45.5\'\' pour un Ford DC (2012+) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds de montage pour monter le plateau sur votre véhicule. Le forage est nécessaire pour l’installation.', 450, 1730, NULL, 743.69748, 892.436976, 'KRFM005T - Kit de galerie pour une Ford DC - Slimline II de Front Runner\\n\\nComposé de :\\n1 x FASS012 - Paire de Pieds/ 40mm-50mm- de Front Runner\\n1 x FASS014 - Pair de Pieds - incliné / 65mm- de Front Runner\\n1 x RRSTD06 - Plateau Slimline II -1255mm(l) X 1156mm(L)- de Front Runner\\n1 x TRFR001 - Rails pour une Ford Ranger (2012- jusqu\'à présent) / 1200mm- de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 23.5kg (51.9lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64.0\'\')\\nHauteur : 140mm(6.0\'\')\\n\\nPoids de la livraison :\\n28.4kg (63.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1156mm/45.5\'\' pour un Ford DC (2012+) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds de montage pour monter le plateau sur votre véhicule. Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour une Ford DC (2012 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:30', NULL, NULL, 5.511814, 28.4, 6009542220536, 'ZA', 'EUR', 743.697, '7616.99', 10, 0),
(216, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Ford/Mazda T6/T7 (2012 - jusqu’à présent) / Pieds AND Rails - de Front Runner', 'KRFM013', 'Un ensemble de barres de toit avec pieds montés sur rail, utilisé pour transporter de l\'équipement sur le toit de votre véhicule lorsque vous n\'avez pas besoin d\'une galerie complète Front Runner. Cette solution à profil bas et à empreinte réduite comprend 2 pieds de 50 mm, 2 pieds de 60 mm, 2 barres de toit de 1255 mm, 2 rails Ford Ranger de 1200 mm, 1 déflecteur de vent pour barre de toit de 10 mm et des instructions de montage - tous les éléments nécessaires pour monter les barres de toit Front Runner sur le véhicule.', 250, 1360, NULL, 298.31933, 357.983196, 'KRFM013 -Kit de barres de toit pour une Ford/Mazda T6/T7 (2012 - jusqu’à présent) / Pieds Rails - de Front Runner\\n\\nComposé de :\\n1 x FASS012 - Paire de Pieds / 40mm-50mm - de Front Runner\\n1 x FASS013 - Pair de Pieds/ 60mm-70mm - de Front Runner\\n1 x LBSK014 - Paire de Barres de toit 1255mm (l) - de Front Runner\\n1 x TRFR001 - Rails pour une Ford Ranger (2012 - jusqu\'à présent) / 1200mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :8kg (18lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.Dimensions de livraison :\\n\\nLargeur 250mm(10\'\')\\nLongueur 1360mm(54\'\')\\nHauteur 110mm(4\'\')\\n\\nPoids de la livraison:\\n9.3kg (20.5lbs)', 'Un ensemble de barres de toit avec pieds montés sur rail, utilisé pour transporter de l\'équipement sur le toit de votre véhicule lorsque vous n\'avez pas besoin d\'une galerie complète Front Runner. Cette solution à profil bas et à empreinte réduite comprend 2 pieds de 50 mm, 2 pieds de 60 mm, 2 barres de toit de 1255 mm, 2 rails Ford Ranger de 1200 mm, 1 déflecteur de vent pour barre de toit de 10 mm et des instructions de montage - tous les éléments nécessaires pour monter les barres de toit Front Runner sur le véhicule.', 'Kit de barres de toit pour une Ford/Mazda T6/T7 (2012 - jusqu’à présent) / Pieds AND Rails - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:35', NULL, NULL, 4.330711, 9.3, 6009542232010, 'ZA', 'EUR', 298.319, '7616.99', 10, 0),
