10mm\\nHauteur 285mm\\n\\nPoids de la livraison :Poids : 22,8kg', 'Cekit de galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Fiat PandaCross. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour Fiat Panda Cross (2015-actuel) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:38', NULL, NULL, 11.220478, 23.1, 6009542252209, 'ZA', 'EUR', 743.697, '8708.29.90', 10, 0),
(218, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour un Ford Ranger Pick-up (1998-2012) - par Front Runner', 'KRFR001T', 'Ce kit permet de créer une galerie pleine grandeur qui se place au-dessus de la benne du pick-up de votre Ford Ranger (1998-2012). Ce kit de galerie Slimline II contient le plateau Slimline II (1475 mm x 1358 mm), 2 rails et 4 pieds de benne universels qui s\'adaptent aux rails. L\'installation nécessite un perçage.', 450, 1730, NULL, 861.34454, 1033.613448, 'KRFR001T -Kit de galerie de benne Slimline II pour un Ford Ranger Pick-up (1998-2012) - par Front Runner\\nComposé de :\\n2 x LASS026 - Pied de benneuniversel / grand (paire) - par Front Runner\\n1 x RRSTD07 - Plateau Slimline II - 1255mm(L) X 1358mm(L) - par Front Runner\\n1 x TRBU001 - Rails de benne de Pick-up / 1000mm(L) - by Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 25kg (56lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule (™s) et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule (™s).\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 29.5 kg (65.0 lbs)', 'Ce kit permet de créer une galerie pleine grandeur qui se place au-dessus de la benne du pick-up de votre Ford Ranger (1998-2012). Ce kit de galerie Slimline II contient le plateau Slimline II (1475 mm x 1358 mm), 2 rails et 4 pieds de benne universels qui s\'adaptent aux rails. L\'installation nécessite un perçage.', 'Kit de galerie de benne Slimline II pour un Ford Ranger Pick-up (1998-2012) - par Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:42', NULL, NULL, 5.511814, 29.5, 6009542231662, 'ZA', 'EUR', 861.345, '8708.29.90', 10, 0),
(219, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une benne d’un Ford Ranger Super Cab 2 portes (1998-2012) - de Front Runner', 'KRFR002T', ' Ce kit contient une galerie qui est montée au-dessus de la benne d’un Ford Ranger Super Cab 2 portes 1998-2012. Ce kit pour une benne de Pick-Up contient le plateau Slimline II (1255mm x 1358mm), 2 rails et 4 pieds Universels qui correspondent aux rails.', 450, 1730, NULL, 861.34454, 1033.613448, ' \\nKRFR002T - Kit de galerie pour une benne d’un Ford Ranger Super Cab 2 portes (1998-2012) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS026 - Pieds 188mm (paire) pour le plateau Universel d’une benne de Pick-Up \\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n1 x TRBU001 - Rails pour une benne de Pick-Up 1000mm (Paire) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 24kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 28,0kg', ' Ce kit contient une galerie qui est montée au-dessus de la benne d’un Ford Ranger Super Cab 2 portes 1998-2012. Ce kit pour une benne de Pick-Up contient le plateau Slimline II (1255mm x 1358mm), 2 rails et 4 pieds Universels qui correspondent aux rails.', 'Kit de galerie Slimline II pour une benne d’un Ford Ranger Super Cab 2 portes (1998-2012) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:51:45', NULL, NULL, 5.511814, 29.5, 6009542231655, 'ZA', 'EUR', 861.345, '7616.99', 10, 0),
(220, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Ford Ranger T6 Wildtrak (2014-jusqu\'à présent) - de Front Runner', 'KRFR004T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm/45.5” contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Ford Ranger T6Wildtrak. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 455, 1730, NULL, 743.69748, 892.436976, 'KRFR004T - Kit de galerie de toitSlimline II Ford Ranger T6 Wildtrak (2014-jusqu’à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR053 - Rail élevéextérieurGrab-On / N° 4 - de Front Runner\\n2 x GORR071 - Rail élevéintérieurGrab-On / B - de Front Runner\\n1 x RRAC904 - Espaceur en plastiquepour pied de rail / 10mm (paire)\\n1 x RRSTA06 - Plateau Slimline II -1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1156mm (largeur) - de Front Runner\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 20kg (43lbs)\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm(18\'\')\\nLongueur1610mm(63\'\')\\nHauteur285mm(11\'\')\\n\\nPoidsde la livraison :\\n22.9kg (50.4lbs)', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm/45.5” contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Ford Ranger T6Wildtrak. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie Slimline II pour un Ford Ranger T6 Wildtrak (2014-jusqu\'à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:52:09', NULL, NULL, 11.220478, 23.2, 6009542252476, 'ZA', 'EUR', 743.697, '8708.29.90', 10, 0),
(221, 1, 2, NULL, NULL, NULL, 'Ford Ranger 5\' (2012-actuel) Kit de galerie de chargement pour benne Slimline II - par Front Runner', 'KRFR006T', 'Transportez encore plus avec ce kit de galerie complète et résistante pour Ford Ranger, qui vous permettra de libérer l\'espace de chargement pour votre précieux matériel.', 445, 1725, NULL, 953.78151, 1144.537812, 'Composé de :\\n2 x LASS026 - Pieds universels pour benne de chargement / Grand (paire) - par Front Runner\\n1 x RRSTM07 - Plateau Slimline II - 1475mm(L) X 1358mm(L) - par Front Runner\\n1 x TRBU001 - Bakkie Load Bed Tracks / 1000mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 29,4 kg (64,8 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 445mm (18.0\'\')\\nLongueur : 1725mm (68,0\'\')\\nHauteur : 290mm (11,0\'\')\\nPoids de la livraison :\\n30,4kg (67.0lbs)', 'Transportez encore plus avec ce kit de galerie complète et résistante pour Ford Ranger, qui vous permettra de libérer l\'espace de chargement pour votre précieux matériel.', 'Ford Ranger 5\' (2012-actuel) Kit de galerie de chargement pour benne Slimline II - par Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 10:52:13', NULL, NULL, 11.4, 30.4, 6009542283548, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(222, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour benne d\'un Ford Ranger (2014-jusqu\'à présent) - de Front Runner', 'KRFR009T', 'Libérez l\'espace de la benne de votre Ranger en transportant votre équipement d\'aventure ou vos jouets par-dessus la benne avec ce kit de galerie Slimline II Ford Ranger (2014-jusqu\'à présent) pour benne montée sur pieds.', 445, 1715, NULL, 1533.6134, 1840.33608, 'KRFR009T -Kit de galerie Slimline II pour benne d\'un Ford Ranger (2014-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x LASS026 - Pied universel de benne / Haut (paire)\\n1x LASS034 - Supports de montage pour benne pour Ford Ranger\\n1x RRSTG07 - Plateau SLII -1345mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 49.05kg (108.14lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 445 mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 290mm (11\'\')\\nPoids à la livraison :\\nPoids : 48.2kg (106lbs)', 'Libérez l\'espace de la benne de votre Ranger en transportant votre équipement d\'aventure ou vos jouets par-dessus la benne avec ce kit de galerie Slimline II Ford Ranger (2014-jusqu\'à présent) pour benne montée sur pieds.', 'Kit de galerie Slimline II pour benne d\'un Ford Ranger (2014-jusqu\'à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 10:52:17', NULL, NULL, 11.4, 48.2, 6009542218489, 'ZA', 'EUR', 1533.613, '7616.99', 10, 0),
