(227, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Ford Transit 4ème génération ( 2013- jusqu\'à présent) - par Front Runner', 'KRFT001T', 'La galerie Slimline II pour toute la longueur du toit de 2772mmmm contient le plateau Slimline II, un déflecteur de vent et 4 pieds de rail profil bas pour monter le plateau Slimline II sur votre Ford Transit 4ème génération (USA 148 SPEC) (Euro L3H2 L3H3 Spec). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 440, 1730, NULL, 1567.22689, 1880.672268, 'KRFT001T - Kit de galerie de toit pour Ford Transit 4ème génération ( 2013-jusqu\'à présent) Slimline II - par Front Runner\\nComposé de :\\n1 x FAFT001 - Rails de pied Ford Transit 4ème génération ( actuelle 2013) - par Front Runner\\n1 x RRSTM14 - Plateau Slimline II - 1475mm(L) X 2772mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 43kg (95lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et des profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de porte-bagages de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur du porte-bagages par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 500mm (20\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 300mm (12\'\')\\nPoids de l\'expédition :\\nPoids 50.3kg (110.6lbs)', 'La galerie Slimline II pour toute la longueur du toit de 2772mmmm contient le plateau Slimline II, un déflecteur de vent et 4 pieds de rail profil bas pour monter le plateau Slimline II sur votre Ford Transit 4ème génération (USA 148 SPEC) (Euro L3H2 L3H3 Spec). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour Ford Transit 4ème génération ( 2013- jusqu\'à présent) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 10:52:36', NULL, NULL, 9.8, 51.6, 6009542263922, 'ZA', 'EUR', 1567.227, '8708.29.90', 10, 0),
(228, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour une Ford Transit 4th Gen (2013-jusqu\'à présent) - par Front Runner', 'KRFT002T', 'Ce kit de galerie Slimline II de 1156 mm/45.5\'\' de long et de taille 1/2 contient le plateau Slimline II, le déflecteur d\'air et 4 rails de pied pour monter le plateau Slimline II sur votre Ford Transit 4e génération. Aucun perçage n\'est nécessaire.', 450, 1730, NULL, 911.76471, 1094.117652, 'KRFT002T -Kit de galerie Slimline II 1/2 pour une Ford Transit 4th Gen (2013-jusqu\'à présent) - par Front Runner\\nComposé de :\\n1 x FAFT001 - Rails de pied Ford Transit 4e génération ( 2013 - jusqu\'à présent) - par Front Runner\\n1 x RRSTM06 - Plateau Slimline II - 1475mm(L) x 1156mm(L) - par la Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 28kg (61lbs)\\nLes rainures en T sur le dessus et le dessous des lattes de rayonnage et des profils de bordure permettent de fixer des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm/2 po) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre ensemble de galerie de toit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm/2 \'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm/2 po) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 300mm (12\'\')\\nPoids d\'expédition :\\nPoids 32.1kg (70.7lbs)', 'Ce kit de galerie Slimline II de 1156 mm/45.5\'\' de long et de taille 1/2 contient le plateau Slimline II, le déflecteur d\'air et 4 rails de pied pour monter le plateau Slimline II sur votre Ford Transit 4e génération. Aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II 1/2 pour une Ford Transit 4th Gen (2013-jusqu\'à présent) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:52:38', NULL, NULL, 11.81103, 32.1, 6009542263939, 'ZA', 'EUR', 911.765, '8708.29.90', 10, 0),
(229, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Ford Tourneo / Transit Custom LWB (2013-jusqu\'à présent) - de Front Runner', 'KRFT003T', 'Libérez un espace intérieur précieux en installant votre matériel, vos rangements et vos jouets sur le toit de votre fourgon grâce au kit de galerie Slimline II pour une Ford Tourneo/Transit Custom LWB. Cette galerie est solide, durable et fiable - tout ce dont vous avez besoin lorsque vous devez transporter tout ce que vous possédez.', 440, 1730, NULL, 1626.05042, 1951.260504, 'Composé de :\\n1x FAFT002 - Pieds de rails pour Ford Tourneo/TransitCustomLWB(2013-jusqu\'à présent)\\n1x RRSTM14 - Slimline II Plateau - 1475mm(W)X2772mm(L)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 54,62 kg (120,42 lb)\\nLes rainures en T sur le haut et le bas des lattes du plateau du rack et des profils de bord accueillent des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Slimline II Plateau (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des pieds de rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie depuis le sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 240mm (9\'\')\\nPoids de l\'expédition :\\nPoids : 53.2kg (117lbs)', 'Libérez un espace intérieur précieux en installant votre matériel, vos rangements et vos jouets sur le toit de votre fourgon grâce au kit de galerie Slimline II pour une Ford Tourneo/Transit Custom LWB. Cette galerie est solide, durable et fiable - tout ce dont vous avez besoin lorsque vous devez transporter tout ce que vous possédez.', 'Kit de galerie Slimline II pour une Ford Tourneo / Transit Custom LWB (2013-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 10:52:41', NULL, NULL, 9.4, 53.2, 6009542214559, 'ZA', 'EUR', 1626.05, '7616.99', 10, 0),
(230, 1, 2, NULL, NULL, NULL, 'Ford Tourneo/Transit Custom SWB (2013-actuel) Kit Galerie de toit Slimline II - par Front Runner', 'KRFT004T', 'Libérez un espace intérieur précieux en montant vos équipements, vos rangements et vos jouets sur le toit de votre van avec le Kit Galerie de toit Slimline II de Ford Tourneo/Transit Custom SWB (2013-actuel). Cette galerie est solide, durable et fiable - tout ce dont vous avez besoin lorsque vous êtes susceptible de transporter tout ce que vous possédez.', 440, 1730, NULL, 1474.78992, 1769.747904, 'Composé de :\\n1x FAFT003 - Rail de pied Ford Tourneo_Transit CustomSWB(2013-Cur)\\n1x RRSTM12 - Plateau SLII - 1475mm(W)X2368mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 48.26kg (106.39lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids à la livraison :\\nPoids : 49.4kg (109lbs)', 'Libérez un espace intérieur précieux en montant vos équipements, vos rangements et vos jouets sur le toit de votre van avec le Kit Galerie de toit Slimline II de Ford Tourneo/Transit Custom SWB (2013-actuel). Cette galerie est solide, durable et fiable - tout ce dont vous avez besoin lorsque vous êtes susceptible de transporter tout ce que vous possédez.', 'Ford Tourneo/Transit Custom SWB (2013-actuel) Kit Galerie de toit Slimline II - par Front Runner', 'Galerie|Kit de Galerie Slimline II|ALL ROOF RACKS|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 10:52:45', NULL, NULL, 10.2, 49.4, 6009542214566, 'ZA', 'EUR', 1474.79, '8708.29.90', 10, 0),
(231, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une GMC Canyon (2015-jusqu’à présent) - de Front Runner', 'KRGC001T', 'Le kit de galerie Slimline IIde 1358mm/53.5\'\' contient le plateaux Slimline II, un déflecteur de vent et2 pieds de rails pour monter le plateau Slimline II sur votre ChevroletColorado. Le forage est nécessaire pour l’installation.', 455, 1730, NULL, 836.13445, 1003.36134, 'KRGC001T Kit de galerie SlimlineII pour une GMC Canyon (2015-jusqu’à présent) - de Front Runner\\nContient:\\n1 x FACC001 - Pieds derails pour une Chev Colorado/GMC Canyon (2015-jusqu’à présent) - de FrontRunner\\n1 x RRST07 Plateau SlimlineII - 1255mm (largeur) X 1358mm (longueur) - de Front Runner\\nMatériel utilisé:\\nAluminium T6 en époxy noir\\n3CR12 acierinoxydable\\n\\nPoids approximatif d’installation: 26kg\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barretransversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que lagalerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toitavec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur duplateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer lahauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez lahauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds de railspour déterminer la hauteur de la galerie à partir du point le plus haut du toitde votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 455mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 245mm (10\'\')\\nPoids de la livraison :\\nPoids :30.1kg', 'Le kit de galerie Slimline IIde 1358mm/53.5\'\' contient le plateaux Slimline II, un déflecteur de vent et2 pieds de rails pour monter le plateau Slimline II sur votre ChevroletColorado. Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour une GMC Canyon (2015-jusqu’à présent) - de Front Runner', 'Kit de Galerie Slimline II|Galerie|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:52:48', NULL, NULL, 9.645675, 29.8, 6009542250243, 'ZA', 'EUR', 836.134, '7616.99', 2, 0),
(232, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour la benne de la GMC Canyon Roll Top 5.1’ (2015-jusqu’à présent) - de Front Runner', 'KRGC002T', 'Ce kit contientune galerie qui est montée au-dessus de la benne de votre Roll Top GMC Canyon (2015-jusqu’àprésent). Ce kit pour une benne de Pick-Up contient le plateau Slimline II(1425mm x 1358mm), 2 rails, 2 pieds universels qui correspondent aux rails et 2pieds support Roll Top.', 455, 1730, NULL, 1121.84874, 1346.218488, 'KRGC002T Kit de galerie Slimline II pour la benne de laGMC Canyon Roll Top 5.1’ (2015-jusqu’à présent) - de Front Runner\\n2 x LASS026 - Pieds (paire) universels/ hauts d’une benne de Pick-Up - de Front Runner\\n2 x LASS028 - Pieds support pour unePick-Up Roll Top - de Front Runner\\n1 x RRAC902 - Kit de boulons pour labenne de la Ford F150 2004-2014\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm(largeur) x 1358mm (longueur) - de Front Runner \\n1 x TRBU002 - Rails pour une benne dePick-Up 1200mm (longueur) - de Front Runner\\n\\nMatériel utilisé: \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatifd’installation: 30kg \\n\\nLa rainure en T sur le haut et sur lebas du plateau de la barre transversale convient pour un boulon de 8mm(standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\n\\nSi votre galerie Slimline II a besoinde pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur despieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoinde pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à lahauteur des pieds de rails pour déterminer la hauteur de la galerie à partir dupoint le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 455mm \\nLongueur 1620mm \\nHauteur 280mm \\n\\nPoids de la livraison :\\nPoids : 34,5kg', 'Ce kit contientune galerie qui est montée au-dessus de la benne de votre Roll Top GMC Canyon (2015-jusqu’àprésent). Ce kit pour une benne de Pick-Up contient le plateau Slimline II(1425mm x 1358mm), 2 rails, 2 pieds universels qui correspondent aux rails et 2pieds support Roll Top.', 'Kit de galerie Slimline II pour la benne de la GMC Canyon Roll Top 5.1’ (2015-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 10:52:51', NULL, NULL, 11.023628, 34.6, 6009542249452, 'ZA', 'EUR', 1121.849, '7616.99', 10, 0),
(233, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une GWM C20R (2010-2014) - de Front Runner', 'KRGC003T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM C20R. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain qui s’accrochentaux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 450, 1730, NULL, 743.69748, 892.436976, 'KRGC003T Kit degalerie Slimline II pour une GWM C20R (2010-2014) - de Front Runner\\nContient:\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GORR053 - Rail élevé extérieurGrab-On / No. 4 - de Front Runner \\n2 x GORR071 - Rail élevéintérieur Grab-on / B - de Front Runner\\n1 x RRAC904- espaceur plastique pour base de pied de rail / 10mm (paire)\\n1 x RRSTA06- Plateau Slimline II - 1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 19kg\\n\\nLa rainure en T sur le haut et sur le bas du plateaude la barre transversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\n\\nPoids de la livraison :Poids: 22,1kg', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM C20R. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain qui s’accrochentaux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une GWM C20R (2010-2014) - de Front Runner', 'VEHICLE SPECIFIC GEAR|Galerie|Galeries de toit pour rails d\'origine/ OEM', 0, 1, '2022-01-07 10:52:55', NULL, NULL, 5.511814, 23.2, 6009542252193, 'ZA', 'EUR', 743.697, '7616.99', 10, 0),
(234, 1, 2, NULL, NULL, NULL, 'GMC Canyon Pick-Up Truck (2004-Current) Slimline II Load Bed Rack Kit - by Front Runner', 'KRGM001T', 'This kit creates a full size rack that sits above your GMC Canyon 2004+ truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1475mm x 1358mm), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks.Drilling may be required for installation.', 450, 1730, NULL, 928.57143, 1114.285716, 'KRGM001T - GMC Canyon Pick-Up Truck (2004-Current) Slimline II Load Bed Rack Kit - by Front Runner \\nConsisting of:\\n2 x LASS026 - Universal Load Bed Leg 188mm (Pair) - by Front Runner 1 x RRSTJ07 - Slimline II Tray - 1425mm(W) X 1358mm(L) - by Front Runner 1 x TRBU001 - Pick-Up Load Bed Tracks / 1000mm(L) - by Front Runner \\n\\nMaterial used:\\nBlack epoxy powder-coated T6 aluminium \\n3CR12 Stainless Steel\\nApproximate Installed Weight 26kg (58lbs)\\nThe t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.\\nTo determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/ 2) to the height of the Foot, Grab-on Foot or Strap-On Foot listed above.\\nIf your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Legs to determine the height of the rack from your vehicle’s rain gutters.\\nIf your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof.\\nShipping Dimensions:\\nWidth450mm (18)Length1615mm (64)Height 140mm (6)\\nShipping Weight:\\nWeight30.4kg (66.9lbs)', 'This kit creates a full size rack that sits above your GMC Canyon 2004+ truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1475mm x 1358mm), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks.Drilling may be required for installation.', 'GMC Canyon Pick-Up Truck (2004-Current) Slimline II Load Bed Rack Kit - by Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:53:00', NULL, NULL, 5.511814, 31.4, 6009542231747, 'ZA', 'EUR', 928.571, '7616.99', 10, 0),
(235, 1, 2, NULL, NULL, NULL, 'GMC Sierra Pick-Up Truck (1987-Current) Slimline II Load Bed Rack Kit - by Front Runner', 'KRGM004T', 'This kit creates a full size rack that sits above your GMC Sierra Pick-Up Truck 1987+ truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1475mm x 1358mm), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks.Drilling may be required for installation. ', 455, 1730, NULL, 953.78151, 1144.537812, 'KRGM004T - GMC Sierra Pick-Up Truck (1987-Current) Slimline II Load Bed Rack Kit - by Front Runner \\nConsisting of:\\n2 x LASS026 - Universal Load Bed Leg 188mm (Pair) - by Front Runner 1 x RRSTM07 - Slimline II Tray - 1475mm(W) X 1358mm(L) - by Front Runner 1 x TRBU001 - Pick-Up Load Bed Tracks / 1000mm(L) - by Front Runner \\n\\nMaterial used:\\nBlack epoxy powder-coated T6 aluminium \\n3CR12 Stainless Steel\\nApproximate Installed Weight 27kg (58lbs)\\nThe t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.\\nTo determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/ 2) to the height of the Foot, Grab-on Foot or Strap-On Foot listed above.\\nIf your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Legs to determine the height of the rack from your vehicle’s rain gutters.\\nIf your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof.\\nShipping Dimensions:\\nWidth0mm (0)Length0mm (0)Height 0mm (0)\\nShipping Weight:\\nWeight30.9kg (67.9lbs)', 'This kit creates a full size rack that sits above your GMC Sierra Pick-Up Truck 1987+ truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1475mm x 1358mm), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks.Drilling may be required for installation. ', 'GMC Sierra Pick-Up Truck (1987-Current) Slimline II Load Bed Rack Kit - by Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:53:03', NULL, NULL, 11.023628, 31.6, 6009542231778, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(236, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour GWM M4 (2014-actuel) - de Front Runner', 'KRGM007T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM M4. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 455, 1730, NULL, 735.29412, 882.352944, '2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR052 - Rail élevéextérieurGrab-On / N° 3 - de Front Runner\\n2 x GORR070 - Rail élevéintérieurGrab-On / A - de Front Runner\\n1 x RRAC904 - Espaceur en plastiquepour pied de rail / 10mm (paire)\\n1 x RRSTA06 - Plateau Slimline II -1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1156mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 20kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids: 22,8kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM M4. Cesystème s’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour GWM M4 (2014-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 10:53:06', NULL, NULL, 11.220478, 23.1, 6009542252179, 'ZA', 'EUR', 735.294, '7616.99', 10, 0),
(237, 1, 2, NULL, NULL, NULL, 'GMC Sierra 1500 / Benne à chargement courte (2007-actuel) Kit de galerie pour benne Slimline II - par Front Runner', 'KRGM008T', 'Transportez encore plus avec ce kit de galerie complet et résistant pour GMC Sierra 1500, qui vous permettra de libérer votre précieux espace de chargement pour le matériel.', 445, 1730, NULL, 1088.23529, 1305.882348, 'Composé de :\\n3 x LASS026 - Pieds universels pour benne de chargement / Grand (paire) - par Front Runner\\n1 x RRSTP08 - Plateau SLII - 1575mm(L)X1560mm(L)\\n1 x TRBU002 - rails pour benne de chargement Bakkie / 1200mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 35,3 kg (77,8 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 445mm (18.0\'\')\\nLongueur : 1730mm (68,0\'\')\\nHauteur : 285mm (11,0\'\')\\nPoids de la livraison :\\n35,8kg (79.0lbs)', 'Transportez encore plus avec ce kit de galerie complet et résistant pour GMC Sierra 1500, qui vous permettra de libérer votre précieux espace de chargement pour le matériel.', 'GMC Sierra 1500 / Benne à chargement courte (2007-actuel) Kit de galerie pour benne Slimline II - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 10:53:10', NULL, NULL, 11.2, 35.8, 6009542283562, 'ZA', 'EUR', 1088.235, '7616.99', 10, 0),
