(244, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une GWM Steed 6 (2018-actuel) - de Front Runner', 'KRGS001T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM Steed 6.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 450, 1730, NULL, 743.69748, 892.436976, 'Contient:\\n2 x GOFR001 -Base de pied de rail (Paire) -de Front Runner\\n2 x GORR053 - Rail élevé extérieurGrab-On /No. 4 - de Front Runner\\n2 x GORR072 - Rail élevé intérieur Grab-on / C - deFront Runner\\n1 x RRAC904- espaceur plastique pour base depied de rail / 10mm (paire)\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extra étroit (paire) / 1165mm (largeur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 20kg\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455mm\\nLongueur 1610mm\\nHauteur 285mm\\n\\nPoids de la livraison :Poids : 22,8kg', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre GWM Steed 6.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II pour une GWM Steed 6 (2018-actuel) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:53:50', NULL, NULL, 5.511814, 23.2, 6009542252186, 'ZA', 'EUR', 743.697, '7616.99', 10, 0),
(245, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 3/4 pour une Mercedes Classe G (1979-2017) - par Front Runner', 'KRGW001L', 'Le kit de galerie Slimline II 3/4 de 1964mm pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 6 pieds de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1205.88235, 1447.05882, 'KRGW001L - Kit de galerie Slimline II 3/4 pour une Mercedes Classe G (1979-2017) - par Front Runner\\nComposé de :\\n3 x LASS104 -Pied nº 4 170mm (Paire)\\n1 x RRSTM10 - Plateau Slimline II - 1475mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 32kg (71lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n37.5kg (82.6lbs)', 'Le kit de galerie Slimline II 3/4 de 1964mm pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 6 pieds de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II 3/4 pour une Mercedes Classe G (1979-2017) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:53:54', NULL, NULL, 5.511814, 37.6, 6009542225685, 'ZA', 'EUR', 1205.882, '8708.29.90', 10, 0),
(246, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Gelandewagen Classe G (1979-2017) - par Front Runner', 'KRGW004L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1390.7563, 1668.90756, 'KRGW004L - Kit de galerie Slimline II pour une Mercedes Gelandewagen Classe G (1979-2017) - par Front Runner\\nComposé de :\\n4x LASS027 - Entretoise de pied 6mm (Paire)\\n4 x LASS104 -Pied nº 4 170mm (Paire)\\n1 x RRSTM11 - Plateau Slimline II - 1475mm (largeur) x 2166mm (longueur)\\n1x WDST009 - Déflecteur de vent de 20mm / 1345mm(l)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 43.56kg (96.03lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n41.95kg (92.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Mercedes Gelandewagen Classe G (1979-2017) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:53:56', NULL, NULL, 5.511814, 42, 6009542225692, 'ZA', 'EUR', 1390.756, '8708.29.90', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(247, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mercedes Gelandewagen (1979-2017) / Montage pour gouttière - de Front Runner', 'KRGW007', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 170mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1580, NULL, 289.91597, 347.899164, 'KRGW007 - Barres de toit de Front Runner / Kit pour une Mercedes Classe G\\n\\nComposé de :\\n2 x LASS104 - Pied N° 4 170mm (Paire) - de Front Runner\\n1 x LBSK017 - Paire de barres de toit 1475mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :8kg (17lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm(5\'\')\\nLongueur : 1580mm(62\'\')\\nHauteur : 175mm(7\'\')\\n\\nPoids de la livraison:\\n8.9kg (19.6lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 170mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Mercedes Gelandewagen (1979-2017) / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:54:01', NULL, NULL, 6.889767, 9, 6009542232065, 'ZA', 'EUR', 289.916, '8708.29.90', 10, 0),
(248, 1, 2, NULL, NULL, NULL, 'Kit de 3/4 galerie Slimline II pour une Mercedes Classe G / Haut - de Front Runner', 'KRGWT01L', 'Le kit de3/4galerie Slimline II de 1964mm/77.3\'\' pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1205.88235, 1447.05882, 'KRGWT01L -Kit de 3/4 galerie Slimline II pour une Mercedes Classe G / Haut - de Front Runner\\n\\nComposé de :\\n3 x LASS105 -Pied nº 5 190mm (Paire)\\n1 x RRSTM10 - Plateau Slimline II - 1475mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 32kg (71lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm(6\'\')\\n\\nPoids de la livraison :\\n37.8kg (83.1lbs)', 'Le kit de3/4galerie Slimline II de 1964mm/77.3\'\' pour une Mercedes Classe G contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de 3/4 galerie Slimline II pour une Mercedes Classe G / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:54:02', NULL, NULL, 5.511814, 37.8, 6009542225708, 'ZA', 'EUR', 1205.882, '7616.99', 10, 0),
(249, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Classe G (1979-2017) / Haut- de Front Runner', 'KRGWT04L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Mercedes Classe G contient un plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 1382.35294, 1658.823528, 'KRGWT04L - Kit de galerie pour une Mercedes Classe G / Haut- Slimline II de Front Runner\\n\\nComposé de :\\n4 x LASS107 -Pied nº 5225mm (Paire)\\n1 x RRSTM11 - Plateau Slimline II - 1475mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 37kg (82lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm(18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm(6\'\')\\n\\nPoids de la livraison :\\n43.4kg (95.5lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour u