(250, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Holden Colorado/GMC Canyon DC (2012-jusqu’à présent) - de Front Runner', 'KRHC001T', ' La galerie Slimline II pour toute la longueur du toit de 1165mm contient un plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Holden Colorado/GMC Canyon double cabine 2012+. Le plateau peut facilement être installé en utilisant les points de montage existants. Le forage dépend du modèle.', 440, 1730, NULL, 794.11765, 952.94118, ' \\nKRHC001T - Slimline II pour un Holden Colorado/GMC Canyon DC (2012-jusqu’à présent) \\n  \\nContient : \\n1 x FAIK001 - Pieds de rails Isuzu DTeq (Paire) \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm(longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 24kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\n  \\nLargeur : 630mm \\nLongueur : 1640mm \\nHauteur : 160mm \\n  Poids de la livraison : 27,6kg', ' La galerie Slimline II pour toute la longueur du toit de 1165mm contient un plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Holden Colorado/GMC Canyon double cabine 2012+. Le plateau peut facilement être installé en utilisant les points de montage existants. Le forage dépend du modèle.', 'Kit de galerie Slimline II pour un Holden Colorado/GMC Canyon DC (2012-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:54:09', NULL, NULL, 9.6, 29.4, 6009542239101, 'ZA', 'EUR', 794.118, '7616.99', 6, 0),
