(259, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Hyundai Kona (2018 - jusqu\'à présent) de Front Runner', 'KRHK001T', 'Votre Hyundai Kona (2018-jusqu\'à présent) est prêt à explorer avec le kit de galerie de toit Slimline II. Transportez votre équipement d\'aventure et votre chargement sur le toit tout en libérant de l\'espace intérieur pour les passagers afin que vous puissiez construire votre aventure et partir.', 440, 1720, NULL, 668.06723, 801.680676, 'KRHK001T -Kit de galerie Slimline II pour une Hyundai Kona (2018 - jusqu\'à présent) de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR012 - Grips extérieurs de rail Flush / No. 3\\n2x GOFR032 - Grips intérieurs de rail Flush / C\\n1x RRAC904 - Entretoise plastique pour pied de rail / 10mm (paire)\\n1x RRSTA06 - Plateau SLII - 1165mm(W)X1156mm(L)\\n1x WDST011 - Déflecteur de vent 20mm extra étroits /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 22.64kg (49.91lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 150mm (6\'\')\\nPoids de la livraison :\\nPoids : 22.4kg (49lbs)', 'Votre Hyundai Kona (2018-jusqu\'à présent) est prêt à explorer avec le kit de galerie de toit Slimline II. Transportez votre équipement d\'aventure et votre chargement sur le toit tout en libérant de l\'espace intérieur pour les passagers afin que vous puissiez construire votre aventure et partir.', 'Kit de galerie Slimline II pour une Hyundai Kona (2018 - jusqu\'à présent) de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:54:44', NULL, NULL, 5.9, 22.4, 6009542219608, 'ZA', 'EUR', 668.067, '7616.99', 10, 0),
(260, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne pour HSP Silverback Hard Lid / 1255(W) x 1156(L) - par Front Runner', 'KRHL001T', 'Ce kit permet de créer une galerie pleine qui s\'installe au-dessus de la benne de votre Pickup lorsqu\'elle est équipée d\'un couvercle rigide HSP Silverback. Ce kit de galerie Slimline II contient le plateau Slimline II (1255 mm x 1156 mm), 2 rails et 4 pieds de montage.', 450, 1730, NULL, 726.89076, 872.268912, 'KRHL001T - Kit de galerie de benne pour HSP Silverback Hard Lid / 1255(W) x 1156(L) - par Front Runner\\nComposé de :\\n2 x FASS013 - Pieds / 60mm-70mm - par Front Runner\\n1 x RRSTD06 - Plateau Slimline II - 1255mm(L) X 1156mm(L) - par Front Runner\\n1 x TRCA003 - Rails de hardtop / 1150mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 21kg (47lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et des profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de porte-bagages de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur du porte-bagages par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 260mm (10\'\')\\nPoids de l\'expédition :\\nPoids 24,6 kg (54,2 lbs)', 'Ce kit permet de créer une galerie pleine qui s\'installe au-dessus de la benne de votre Pickup lorsqu\'elle est équipée d\'un couvercle rigide HSP Silverback. Ce kit de galerie Slimline II contient le plateau Slimline II (1255 mm x 1156 mm), 2 rails et 4 pieds de montage.', 'Kit de galerie de benne pour HSP Silverback Hard Lid / 1255(W) x 1156(L) - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up', 0, 1, '2022-01-07 10:55:09', NULL, NULL, 10.236226, 24.6, 6009542264820, 'ZA', 'EUR', 726.891, '7616.99', 10, 0),
(261, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Hyundai Santa Fe (2017-actuel) - de Front Runner', 'KRHS001T', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Hyundai Santa Fe (DM). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 676.47059, 811.764708, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR032 - Pied Grab-On intérieur pour barres Flush / C - de Front Runner\\n1 x RRSTD05 - Plateau Slimline II - 1255mm (largeur) x 954mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 18kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 270mm\\nPoids de la livraison :\\nPoids : 21,0kg', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Hyundai Santa Fe (DM). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Hyundai Santa Fe (2017-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:15', NULL, NULL, 10.629927, 21.6, 6009542243603, 'ZA', 'EUR', 676.471, '7616.99', 10, 0),
(262, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Hyundai Tucson (2016-actuel) - de Front Runner', 'KRHT004T', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Hyundai Tucson (TL). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 760.5042, 912.60504, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR030 - Pied Grab-On intérieur pour barres Flush / A - de Front Runner\\n1 x RRSTD06 - Plateau Slimline II - 1255mm (largeur) x 1156mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 20kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 23,7kg', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Hyundai Tucson (TL). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Hyundai Tucson (2016-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:18', NULL, NULL, 10.629927, 24.3, 6009542243610, 'ZA', 'EUR', 760.504, '8708.29', 10, 0),
(263, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Hyundai Tuscan (2004-2009) - de Front Runner', 'KRHT005T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Hyundai Tuscan(2004-2009). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'KRHT005T - Kit de galerie de toit SlimlineII pour une Hyundai Tuscan (2004-2009) - de Front Runner\\nContient:\\n2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR070 - Rail élevéintérieurGrab-On / A - de Front Runner\\n1 x RRSTA06 - Plateau Slimline II -1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 20kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids: 22,8kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Hyundai Tuscan(2004-2009). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Hyundai Tuscan (2004-2009) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:20', NULL, NULL, 11.220478, 22.8, 6009542252728, 'ZA', 'EUR', 710.084, '8708.29', 10, 0),
(264, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Hummer H3 - de Front Runner', 'KRHU001T', 'Ce kit de galerie complète de toit Slimline II de 1560 mm de long pour le Hummer H3 contient un plateau Slimline II, un déflecteur de vent, 2 rails, 12 grandes plaques de goujon et 6 pieds.', 450, 1730, NULL, 852.94118, 1023.529416, 'Composé de :\\n1 x FASS011 - Stud Plate Kit / Grand Set de 12 - par Front Runner\\n3 x FASS012 - Foot Set / 40mm-50mm - par Front Runner\\n1 x RRSTG08 - Plateau Slimline II - 1345mm(L) X 1560mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 27,5 kg (60,7 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n31,9kg (70,0lbs)', 'Ce kit de galerie complète de toit Slimline II de 1560 mm de long pour le Hummer H3 contient un plateau Slimline II, un déflecteur de vent, 2 rails, 12 grandes plaques de goujon et 6 pieds.', 'Kit de galerie Slimline II pour un Hummer H3 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:25', NULL, NULL, 5.511814, 31.9, 6009542221571, 'ZA', 'EUR', 852.941, '7616.99', 8, 0),
(265, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Hummer H3 / Pieds - de Front Runner', 'KRHU003', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 110, 1385, NULL, 205.88235, 247.05882, 'KRHU003 - Kit de barres de toit pour un Hummer H3 / Pieds\\n\\nContient :\\n2 x FASS012 - Paire de Pied / 40mm-50mm - de Front Runner\\n1 x LBSK014 - Paire de barres de toit 1255mm (l) - de Front Runner\\n1 x WDLB001 - Déflecteur de vent / 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 5kg (11lbs) \\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 110mm(4\'\')\\nLongueur : 1385mm(55\'\')\\nHauteur : 130mm(5\'\')\\n\\nPoids de la livraison :\\n6.0kg (13.3lbs)', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour un Hummer H3 / Pieds - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:28', NULL, NULL, 5.118113, 6, 6009542232072, 'ZA', 'EUR', 205.882, '7616.99', 8, 0);
