(266, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Hummer H3 / Haut - de Front Runner', 'KRHUT01T', 'Ce kit de galerie complète Slimline II de 1560 mm de long pour le Hummer H3 contient un plateau Slimline II, un déflecteur de vent, 2 rails, 12 grandes plaques à goujons et 6 pieds. Ce kit plus haut permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie.', 450, 1730, NULL, 852.94118, 1023.529416, 'KRHUT01T -Kit de galerie Slimline II pour un Hummer H3 / Haut - de Front Runner\\nComposé de :\\n1 x FASS011 - Stud Plate Kit / Grand Set de 12 - par Front Runner\\n3 x FASS013 - Foot Set / 60mm-70mm - par Front Runner\\n1 x RRSTG08 - Plateau Slimline II - 1345mm(L) X 1560mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 28,0 kg (61,7 livres)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n32,3kg (71,0lbs)', 'Ce kit de galerie complète Slimline II de 1560 mm de long pour le Hummer H3 contient un plateau Slimline II, un déflecteur de vent, 2 rails, 12 grandes plaques à goujons et 6 pieds. Ce kit plus haut permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie.', 'Kit de galerie Slimline II pour un Hummer H3 / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:28', NULL, NULL, 5.511814, 32.3, 6009542221588, 'ZA', 'EUR', 852.941, '7616.99', 8, 0),
(267, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Isuzu RT50/85/2nd Gén DC (2013-2019) - de Front Runner', 'KRID008T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 Foot rails pour installer le plateau Slimline II sur votre Isuzu Double Cabine.Le perçage n\'est pas nécessaire.', 450, 1730, NULL, 794.11765, 952.94118, 'KRID008T - Kit de galerie pour un Isuzu DC 2013-jusqu’à présent (Montage avec pieds de rail) - Slimline II de Front Runner\\n\\nContient :\\n1 x FAIK001 - Pieds de rail pour un Isuzu DTeq (Paire G/D) 56mm\\n1 x RRSTA07 - Plateau Slimline II - 1165mm mm (largeur) x 1358mm(longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 24kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 27,6kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 Foot rails pour installer le plateau Slimline II sur votre Isuzu Double Cabine.Le perçage n\'est pas nécessaire.', 'Kit de galerie Slimline II pour un Isuzu RT50/85/2nd Gén DC (2013-2019) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:55:32', NULL, NULL, 5.511814, 28.4, 6009542226620, 'ZA', 'EUR', 794.118, '8708.29.90', 6, 0),
(268, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II de benne avec Roll Top pour un Isuzu D-Max X-Terrain (2020-jusqu\'à présent) - de Front Runner', 'KRID010T', 'Transportez votre équipement d\'aventure et vos jouets en toute confiance lorsque vous gardez votre roll top pour une tranquillité d\'esprit absolue. Ces galeries résistantes au tout-terrain se montent facilement et laissent votre benne libre pour d\'autres utilisations.', 440, 1730, NULL, 693.27731, 831.932772, 'KRID010T -Kit de galerie Slimline II pour benne avec Roll Top pour Isuzu D-Max X-Terrain (2020-jusqu\'à présent)\\n\\nComposé de :\\n2x FASS016 - Pieds plats (paire) / 65mm\\n1x RRSTG06 - Plateau SLII - 1345mm(W)X1156mm(L)\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 23,29kg (51,35lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre Kit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie utilise des rails de pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pieds pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 240mm (9\'\')\\nPoids à la livraison :\\nPoids : 24kg (53lbs)', 'Transportez votre équipement d\'aventure et vos jouets en toute confiance lorsque vous gardez votre roll top pour une tranquillité d\'esprit absolue. Ces galeries résistantes au tout-terrain se montent facilement et laissent votre benne libre pour d\'autres utilisations.', 'Kit de galerie Slimline II de benne avec Roll Top pour un Isuzu D-Max X-Terrain (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 10:55:37', NULL, NULL, 9.4, 24, 6009542214207, 'ZA', 'EUR', 693.277, '7616.99', 10, 0),
(269, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Isuzu D-Max RG/3ème Gén (2020-jusqu\'à présent) - de Front Runner', 'KRID011T', 'Votre D-Max vous emmènera hors des sentiers battus et ce kit de galerie Slimline II pour une Isuzu D-Max sécurisera tous vos équipements d\'aventure préférés afin que vous puissiez explorer en toute confiance.', 440, 1730, NULL, 810.92437, 973.109244, 'KRID011T -Kit de galerie Slimline II pour une Isuzu D-Max RG/3ème Gén (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n1x FAIK002 - Foot rails Isuzu D-Max/Mazda BT 50 (2019 - jusqu\'à présent)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatérieux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 27,28kg (60,14lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids à la livraison :\\nPoids : 27.57kg (61lbs)', 'Votre D-Max vous emmènera hors des sentiers battus et ce kit de galerie Slimline II pour une Isuzu D-Max sécurisera tous vos équipements d\'aventure préférés afin que vous puissiez explorer en toute confiance.', 'Kit de galerie Slimline II pour une Isuzu D-Max RG/3ème Gén (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:39', NULL, NULL, 10.2, 27.6, 6009542214498, 'ZA', 'EUR', 810.924, '7616.99', 7, 0),
(270, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un International Scout II (1971-1980) - de Front Runner', 'KRIS001T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un International Scout II contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie.', 450, 1730, NULL, 1281.51261, 1537.815132, 'KRIS001T - Kit de galerie Slimline II pour un International Scout II (1971-1980) - de Front Runner\\nContient :\\n4 x LASS027 - Écarteur de pied 6mm (Paire) - de Front Runner\\n4 x LASS103 - Pied nº 3 155mm (Paire) - de Front Runner\\n1 x RRSTJ10 - Plateau Slimline II - 1425mm (largeur) x 1964mm(longueur) - de Front Runner\\nMatériel utilisé :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 34kg (75lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 255mm\\nPoids de la livraison :\\nPoids : 39.8kg (87.5lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un International Scout II contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie.', 'Kit de galerie Slimline II pour un International Scout II (1971-1980) - de Front Runner', 'Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 10:55:44', NULL, NULL, 10.039376, 40, 6009542244877, 'ZA', 'EUR', 1281.513, '8708.29.90', 10, 0),
(271, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Jeep Cherokee Sport XJ - par Front Runner', 'KRJC002L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Jeep Cherokee Sport XJ contient un plateau Slimline II, un déflecteur de vent et 6 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1096.63866, 1315.966392, 'KRJC002L - Kit de galerie Slimline II pour une Jeep Cherokee Sport XJ - par Front Runner\\nCompose de :\\n2 x LASS101 -Pied nº 1 120mm (Paire)\\n1 x LASS102 - Pied nº 2 130mm (Paire)\\n1 x RRSTG10 - Plateau Slimline II - 1345mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 30kg (67lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n35.2kg (77.5lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Jeep Cherokee Sport XJ contient un plateau Slimline II, un déflecteur de vent et 6 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Jeep Cherokee Sport XJ - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:49', NULL, NULL, 5.511814, 35.2, 6009542225722, 'ZA', 'EUR', 1096.639, '8708.29.90', 10, 0),
(272, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Jeep Cherokee Sport / Montage pour gouttière - par Front Runner', 'KRJC006', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1445, NULL, 264.70588, 317.647056, 'KRJC006 - Kit de barres de toit pour une Jeep Cherokee Sport / Montage pour gouttière - par Front Runner\\nComposé de :\\n2 x LASS101 - Pied N° 1 120mm (Paire)\\n1 x LBSK015 - Barres de toit 1345mm (Paire)\\n1 x WDLB001 - Déflecteur de vent de 10mm\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 7kg (16lbs)\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1445mm (57\'\')\\nHauteur 175mm (7\'\')\\nPoids de la livraison:\\n8.2kg (18.1lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Jeep Cherokee Sport / Montage pour gouttière - par Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:52', NULL, NULL, 6.889767, 8.3, 6009542232102, 'ZA', 'EUR', 264.706, '7616.99', 10, 0),
(273, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Jeep Cherokee KL (2014-actuel) - de Front Runner', 'KRJC009T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Jeep CherokeeKL. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 455, 1730, NULL, 785.71429, 942.857148, 'Contient: \\n2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR053 - Rail élevéextérieurGrab-On / N° 4 - de Front Runner\\n2 x GORR072 - Rail élevéintérieurGrab-On / C - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 21kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids: 24,3kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Jeep CherokeeKL. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Jeep Cherokee KL (2014-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:53', NULL, NULL, 11.220478, 24.5, 6009542252421, 'ZA', 'EUR', 785.714, '7616.99', 10, 0),
