okee Sport XJ contient un plateau Slimline II, un déflecteur de vent et 6 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Jeep Cherokee Sport XJ / Haut - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:55:57', NULL, NULL, 5.511814, 35.3, 6009542225739, 'ZA', 'EUR', 1130.252, '8708.29.90', 10, 0),
(275, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour une Jeep Gladiator JT (2019-jusqu’à présent) - de Front Runner', 'KRJG002T', 'Ce kit crée une galerie pleine s\'installe au-dessus de la benne de votre Jeep Gladiator JT. Ce kit de galerie Slimline II contient le plateau Slimline II (1425mm x 1358mm) et 4 pieds de benne universels qui se montent dans les rails de benne existants d\'origine.', 455, 1730, NULL, 869.7479, 1043.69748, 'KRJG002T - Kit de galerie de benne Slimline II pour une Jeep Gladiator JT (2019-jusqu’à présent) - de Front Runner\\nComposé de :\\n2 x LASS026 - Pied de benne universel / haut (paire) - de Front Runner\\n1 x RRAC901 - Kit d\'écrous de benne / Toyota Tacoma 2004+/Tundra 2007+ - de Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425 mm largeur x 1358 mm longueur ) de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 24kg (52lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 280mm (11\'\')\\nPoids de la livraison :\\nPoids 27.6kg (60.7lbs)', 'Ce kit crée une galerie pleine s\'installe au-dessus de la benne de votre Jeep Gladiator JT. Ce kit de galerie Slimline II contient le plateau Slimline II (1425mm x 1358mm) et 4 pieds de benne universels qui se montent dans les rails de benne existants d\'origine.', 'Kit de galerie de benne Slimline II pour une Jeep Gladiator JT (2019-jusqu’à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 10:56:00', NULL, NULL, 11.023628, 27.6, 6009542263397, 'ZA', 'EUR', 869.748, '8708.29.90', 10, 0),
(276, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Jeep Grand Cherokee WK2 (2011 - jusqu’à présent) - de Front Runner', 'KRJG004T', 'La galerie Slimline II pour toute la longueur du toit de 1560mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Jeep Grand Cherokee WK2 2011+. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 869.7479, 1043.69748, 'KRJG004T - Kit de galerie pour une Jeep Grand Cherokee WK2 2011+ - Slimline II de Front Runner\\n\\nContient:\\n1 x FAJG001 - Pieds de rails pour une Jeep Grand Cherokee WKII (Pair G/D) 75mm\\n1 x RRSTD08 - Plateau Slimline II - 1255mm (largeur) x 1560mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 27kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 31,6kg', 'La galerie Slimline II pour toute la longueur du toit de 1560mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Jeep Grand Cherokee WK2 2011+. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Jeep Grand Cherokee WK2 (2011 - jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:56:26', NULL, NULL, 5.511814, 31.4, 6009542228860, 'ZA', 'EUR', 869.748, '8708.29.90', 10, 0),
(277, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Extrême pour une Jeep Gladiator JT (2019-jusqu\'à présent) - de Front Runner', 'KRJG005T', 'Ce kit de support Slimline II contient tous les composants nécessaires pour monter la galerie de toit Slimline II sur une Jeep Gladiator JT, y compris le plateau Slimline II (1425 mm x 1560 mm), le système de montage extrême de la Jeep et un déflecteur de vent.\\nCe système de galerie robuste, sophistiqué, performant et presque indestructible vous permet de retirer rapidement les panneaux Freedom et fonctionne avec le toit rigide ou sans toit du tout.', 520, 1730, NULL, 1138.65546, 1366.386552, 'KRJG005T -Kit de galerie de toit extrême pour uneJeep Gladiator JT (2019-actuel) - de Front Runner\\nComposé de :\\n1 x FAJL004 - Jeep Wrangler JL (2018-Current) galerie de toit pour galerie de toit avant - de Front Runner\\n1 x FAJT001 - Rails de pied de la Jeep Gladiator JT (2019-jusqu\'à présent) - de Front Runner\\n1 x FAJT002 - Supports intérieurs de la Jeep Gladiator (2019-jusqu\'à présent) - de Front Runner\\n1 x RRSTJ08 - Plateau Slimline II - 1425mm(L) X 1560mm(L) - de Front Runner\\n1 x WDST006 - Paire de déflecteurs de vent de 45 mm de large / 1345 mm(L) - deFront Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 35kg (78lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule (™s) et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule (™s).\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 520mm (20\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 450mm (18\'\')\\nPoids de l\'expédition :\\nPoids 41.0kg (90.1lbs)', 'Ce kit de support Slimline II contient tous les composants nécessaires pour monter la galerie de toit Slimline II sur une Jeep Gladiator JT, y compris le plateau Slimline II (1425 mm x 1560 mm), le système de montage extrême de la Jeep et un déflecteur de vent.\\nCe système de galerie robuste, sophistiqué, performant et presque indestructible vous permet de retirer rapidement les panneaux Freedom et fonctionne avec le toit rigide ou sans toit du tout.', 'Kit de galerie de toit Extrême pour une Jeep Gladiator JT (2019-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 10:56:29', NULL, NULL, 17.716545, 41, 6009542265087, 'ZA', 'EUR', 1138.655, '7616.99', 6, 0),
(278, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Grab-On Slimline II pour une Jeep Grand Cherokee (1999-2010) - de Front Runner', 'KRJG007T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Hyundai Tuscan(2004-2009). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 455, 1730, NULL, 777.31092, 932.773104, 'Kit de galerie de toit Grab-On Slimline IIpour une Jeep Grand Cherokee (1999-2010) - de Front Runner\\nContient:\\n2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR071 - Rail élevéintérieurGrab-On / B - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 21kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids: 24,3kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Hyundai Tuscan(2004-2009). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Grab-On Slimline II pour une Jeep Grand Cherokee (1999-2010) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:56:56', NULL, NULL, 11.220478, 24.4, 6009542252704, 'ZA', 'EUR', 777.311, '8708.29.90', 10, 0),
(279, 1, 2, NULL, NULL, NULL, 'Kit de galerie extrême Slimline II pour une Jeep Gladiator JL 4Portes Mojave/Diesel (2018 - jusqu\'à présent) - de Front Runner', 'KRJG008T', 'Transportez votre équipement d\'aventure, vos jouets et votre chargement là où seul votre Jeep Gladiator peut aller tout en ayant de la place pour plus d\'équipments et de passagers avec le Kit de galerie extrême Slimline II pour une Jeep Gladiator JL 4Portes Mojave/Diesel (2018 - jusqu\'à présent). Construisez votre prochaine aventure dès maintenant.', 445, 1720, NULL, 1180.6723, 1416.80676, 'KRJG008T -Kit de galerie extrême Slimline II pour une Jeep Gladiator JL 4Portes Mojave/Diesel (2018 - jusqu\'à présent) - de Front Runner\\nComposé de :\\n1x FAJL004 - Support galerie pour barre avant Jeep Wrangler JL (2018-jusqu\'à présent)\\n1x FAJL007 - Support de capot pout Jeep Gladiator JT/JL (Mojave/Diesel)\\n1x FAJT001 - Foot Rails pour Jeep Gladiatorr JT (2019-jusqu\'à présent)\\n1x FAJT002 - Supports intérieurs pour Jeep Gladiator (2019-jusqu\'à présent)\\n1x RRSTJ08 - Plateau SLII - 1425mm(L)X1560mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 42.29kg (93.23lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur : 445mm (18\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 490mm (19\'\')\\nPoids d\'expédition :\\nPoids : 43kg (95lbs)', 'Transportez votre équipement d\'aventure, vos jouets et votre chargement là où seul votre Jeep Gladiator peut aller tout en ayant de la place pour plus d\'équipments et de passagers avec le Kit de galerie extrême Slimline II pour une Jeep Gladiator JL 4Portes Mojave/Diesel (2018 - jusqu\'à présent). Construisez votre prochaine aventure dès maintenant.', 'Kit de galerie extrême Slimline II pour une Jeep Gladiator JL 4Portes Mojave/Diesel (2018 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|ALL ROOF RACKS|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:57:00', NULL, NULL, 19.3, 43, 6009542218373, 'ZA', 'EUR', 1180.672, '7616.99', 6, 0),
