ngueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 31,7kg', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1762mm contient le plateau Slimline II, un déflecteur devent et 3 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Jeep Renegade. Ce système s’installe facilement enutilisant les pieds solides tout-terrain qui s’accrochent aux barreslongitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Jeep Renegade (2014-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:57:13', NULL, NULL, 11.220478, 32.4, 6009542252407, 'ZA', 'EUR', 1088.235, '8708.29.90', 10, 0),
(283, 1, 2, NULL, NULL, NULL, 'Kit de galerie extrême pour une Jeep Wrangler JK 2 Portes (2007-2018) - par Front Runner', 'KRJW001T', 'Ce kit de galerie Slimline II contient tous les composants nécessaires pour monter la galerie de toit Slimline II sur une Jeep JK 2 portes 2007-2018, y compris le plateau Slimline II (1425 mm x 1762 mm), le système de montage extrême de la Jeep et un déflecteur de vent.\\nCe système de galerie robuste, sophistiqué, performant et presque indestructible vous permet de retirer rapidement les panneaux Freedom et fonctionne avec le toit rigide ou sans toit du tout.', 455, 1725, NULL, 1323.52941, 1588.235292, 'KRJW001T - Kit de galerie extrême pour une Jeep Wrangler JK 2 portes (2007-2018) - par Front Runner\\nComposé de :\\n1 x FAJK009 - Jeep Wrangler JK 2 portes et 4 supports de montants avant - par Front Runner\\n1 x FAJK010 - Jeep Wrangler JK 2 Door New rail de pied - par Front Runner\\n1 x FAJK011 - Jeep Wrangler JK 2 Door Nouveaux supports intérieurs - par Front Runner\\n1 x RRSTJ09 - Plateau Slimline II - 1425mm(L) X 1762mm(L) - par Front Runner\\n1 x WDST006 - Paire de déflecteurs de vent de 45 mm de large aux lèvres / 1345 mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 37kg (82lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1725mm (68\'\')\\nHauteur 400mm (16\'\')\\nPoids de l\'expédition :\\nPoids 43.1kg (94.8lbs)', 'Ce kit de galerie Slimline II contient tous les composants nécessaires pour monter la galerie de toit Slimline II sur une Jeep JK 2 portes 2007-2018, y compris le plateau Slimline II (1425 mm x 1762 mm), le système de montage extrême de la Jeep et un déflecteur de vent.\\nCe système de galerie robuste, sophistiqué, performant et presque indestructible vous permet de retirer rapidement les panneaux Freedom et fonctionne avec le toit rigide ou sans toit du tout.', 'Kit de galerie extrême pour une Jeep Wrangler JK 2 Portes (2007-2018) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:57:16', NULL, NULL, 15.7, 42, 6009542265049, 'ZA', 'EUR', 1323.529, '8708.29.90', 10, 0);
