terminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 515mm (20.0\'\')\\nLongueur : 1730mm (68.0\'\')\\nHauteur : 470mm (19.0\'\')\\nPoids de la livraison :\\n45.2kg (99.0lbs)', 'Ce kit de galerie Slimline II contient tous les composants nécessaires au montage de la galerie de transport de matériel Slimline II sur une Jeep JL 2 portes, comprenant le plateau Slimline II (1425 mm x 1762 mm), le système de montage extrême de la Jeep et un déflecteur de vent.\\nCe système de galerie robuste, sophistiqué, haute performance et presque indestructible vous permet de retirer rapidement les panneaux Freedom et fonctionne avec le toit rigide ou sans toit du tout.', 'Kit de galerie de toit extrême pour une Jeep Wrangler JL 2 portes (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:57:38', NULL, NULL, 18.5, 45.2, 6009542265025, 'ZA', 'EUR', 1323.529, '8708.29.90', 10, 0),
