(297, 1, 2, NULL, NULL, NULL, 'Kit de 1/2 galerie Slimline II pour une Jeep Wrangler JL 4 Portes (2018 - jusqu\'à présent) / Haut- de Front Runner', 'KRJW032T', 'Lorsqu\'une ½ galerie est tout ce dont vous avez besoin pour transporter votre équipement d\'aventure, vos gadgets et votre cargaison là où seul votre Jeep Wrangler JL 4 portes (2018-jusqu\'à présent) peut aller, ce kit de 1/2 galerie Slimline II vous aidera à construire votre prochaine aventure.', 440, 1730, NULL, 735.2941, 882.35292, 'KRJW032T -Kit de 1/2 galerie Slimline II pour une Jeep Wrangler JL 4 Portes (2018 - jusqu\'à présent) / Haut- de Front Runner\\nComposé de :\\n1x LASS027 - Entretoise de jambe 6mm (paire)\\n3x LASS036 - Pied de montage pour une Jeep JL/JT / 170mm (Paire)\\n1x RRSTM07 - Plateau SLII - 1475mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 32.92kg (72.58lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids de la livraison :\\nPoids : 32kg (70lbs)', 'Lorsqu\'une ½ galerie est tout ce dont vous avez besoin pour transporter votre équipement d\'aventure, vos gadgets et votre cargaison là où seul votre Jeep Wrangler JL 4 portes (2018-jusqu\'à présent) peut aller, ce kit de 1/2 galerie Slimline II vous aidera à construire votre prochaine aventure.', 'Kit de 1/2 galerie Slimline II pour une Jeep Wrangler JL 4 Portes (2018 - jusqu\'à présent) / Haut- de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 10:58:41', NULL, NULL, 10.2, 32, 6009542221731, 'ZA', 'EUR', 735.294, '7616.99', 6, 0),
