(299, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Kia Sportage (2015-actuel) - de Front Runner', 'KRKS003T', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Kia Sportage (QL). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 676.47059, 811.764708, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR012 - Pied Grab-On extérieur pour barres Flush / No. 3 - de Front Runner\\n2 x GOFR032 - Pied Grab-On intérieur pour barres Flush / C - de Front Runner\\n1 x RRSTD05 - Plateau Slimline II - 1255mm (largeur) x 954mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 17kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 20,2kg', 'La galerie Slimline II pour toute la longueur du toit de 954mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Kia Sportage (QL). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Kia Sportage (2015-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:58:50', NULL, NULL, 5.511814, 21.6, 6009542243627, 'ZA', 'EUR', 676.471, '7616.99', 10, 0),
