(302, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Kia Sorento MQ4 (2020-jusqu\'à présent) - de Front Runner', 'KRKS007T', 'Transportez tout votre équipement au dessus de votre Kia Sorento MQ4 avec ce kit de galerie de toit Slimline II, élégant, robuste (et facile à monter).', 460, 1730, NULL, 953.78151, 1144.537812, 'KRKS007T -Kit de galerie Slimline II pour un Kia Sorento MQ4 (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x GOFR001 - Pieds de rail affleurant\\n3x GOFR014 - Poignées extérieures de rail affleurant / n° 6\\n3x GOFR035 - Poignées intérieures de rail affleurant / F\\n1x RRSTA08 - Plateau SLII - 1165mm(L)X1560mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm à bord extra étroit /1165mm\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif du montage : 54,38 kg (119,89 lb)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nPoids : 460mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids de la livraison :\\nPoids : 27,2 kg (60 lbs)', 'Transportez tout votre équipement au dessus de votre Kia Sorento MQ4 avec ce kit de galerie de toit Slimline II, élégant, robuste (et facile à monter).', 'Kit de galerie Slimline II pour un Kia Sorento MQ4 (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:59:02', NULL, NULL, 6.1, 27.2, 6009542213255, 'ZA', 'EUR', 953.782, '8708.29.90', 10, 0),
(303, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Kia Telluride (2020-jusqu\'à présent) - de Front Runner', 'KRKT001T', 'Transportez vos jouets et équipements d\'aventure préférés sur le toit et laissez les trois rangées ouvertes pour transporter votre famille et vos amis grâce au kit de galerie Slimline II pour Kia Telluride (2020-jusqu\'à présent).', 440, 1730, NULL, 1147.05882, 1376.470584, 'KRKT001T -Kit de galerie Slimline II pour Kia Telluride (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GOFR012 - Grips extérieurs de rail affleurant / No. 3\\n3x GOFR030 - Grips intérieurs pour rail affleurant / A\\n3x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (Paire)\\n1x RRSTD09 - Plateau SLII - 1255mm(W)X1762mm(L)\\n1x WDST010 - Paire étroite de déflecteurs de vent 20mm /1255mm(W)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 32.39kg (71.41lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 30.8kg (68lbs)', 'Transportez vos jouets et