(304, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une benne de Pick-Up / 1255mm(l) x 1358mm(L) - de Front Runner', 'KRLB001T', ' Ce kit crée une galerie qui s\'installe sur toute la longueur de votre benne de Pick-Up. Le kit de galerie Slimline II contient un plateau Slimline II (1255mm x 1358mm), 2 rails et 4 pieds universels pour une benne de Pick-Up qui correspondent aux rails.', 450, 1730, NULL, 861.34454, 1033.613448, ' \\nKRLB001T - Kit de galerie pour une benne de Pick-Up / 1255mm (largeur) x 1358mm(longueur) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS026 - Pieds Universels pour une benne de Pick-Up 188mm (Paire) \\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n1 x TRBU001 - Rails pour une benne de Pick-Up 1000mm (Paire) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 24kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 28,0kg', ' Ce kit crée une galerie qui s\'installe sur toute la longueur de v