(307, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une benne de Pick-Up / 1475mm (l) - de Front Runner', 'KRLB006', 'Les barres de toit pour une benne de Pick-Up peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 188mm, 2 barres de toit de 1475mm, 2 rails pour une benne de Pick-Up et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur la benne de votre véhicule. ', 130, 1580, NULL, 357.14286, 428.571432, 'KRLB006 - Barres de toit pour une benne de Pick-Up de Front Runner - 1475mm\\nContient :\\n2 x LASS026 - Paire de pieds universels pour benne de pick-up - de Front Runner\\n1 x LBSK017 - Pair de barres de toit / 1475mm - de Front Runner\\n1 x TRBU001- Rails pour une benne de Pick-Up / 1000mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :9kg (20lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 130mm(5\'\')\\nLongueur : 1580mm(62\'\')\\nHauteur : 220mm(9\'\')\\n\\nPoids de la livraison:\\n10.6kg (23.3lbs)', 'Les barres de toit pour une benne de Pick-Up peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 188mm, 2 barres de toit de 1475mm, 2 rails pour une benne de Pick-Up et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur la benne de votre véhicule. ', 'Kit de barres de toit pour une benne de Pick-Up / 1475mm (l) - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 10:59:25', NULL, NULL, 8.661422, 11.9, 6009542232140, 'ZA', 'EUR', 357.143, '8708.29.90', 10, 0),
