(329, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Pick-Up Land Rover Defender (1983-2016) - de Front Runner', 'KRLD009L', ' Le kit de galerie Slimline II de 752mm pour toute la longueur de la benne d’un Land Rover Defender Pick-Up contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 626.05042, 751.260504, 'KRLD009L - Kit de galerie pour un Pick-Up Land Rover Defender (1983-2016) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS104 - Pied N° 4 (Paire) 170mm \\n1 x RRSTJ04 - Plateau Slimline II - 1425mm (largeur) x 752mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 19kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  \\nPoids de la livraison : 22,0kg', ' Le kit de galerie Slimline II de 752mm pour toute la longueur de la benne d’un Land Rover Defender Pick-Up contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour un Pick-Up Land Rover Defender (1983-2016) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:01:51', NULL, NULL, 5.511814, 21.9, 6009542227665, 'ZA', 'EUR', 626.05, '7616.99', 10, 0),
(330, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour un Land Rover Discovery 2 - de Front Runner', 'KRLD010L', ' Le kit de galerie Slimline II 1/2 de 1358mm pour un Land Rover Discovery 2 contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 953.78151, 1144.537812, ' \\nKRLD010L - Kit de galerie (1/2) pour un Land Rover Discovery 2 - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS109 - Pied nº 9 265mm (Paire) \\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\nPoids approximatif d’installation : 25kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 29,3kg', ' Le kit de galerie Slimline II 1/2 de 1358mm pour un Land Rover Discovery 2 contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II 1/2 pour un Land Rover Discovery 2 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:01:54', NULL, NULL, 5.511814, 29, 6009542225777, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(331, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Discovery 2 - de Front Runner', 'KRLD012L', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Land Rover Discovery 2 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 1205.88235, 1447.05882, ' \\nKRLD012L - Kit de galerie pour un Land Rover Discovery 2 - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n3 x LASS109 - Pied nº 9 265mm (Paire) \\n1 x RRSTJ10 - Plateau Slimline II - 1425mm (largeur) x 1964mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\nPoids approximatif d’installation : 33kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 38,4kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Land Rover Discovery 2 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour un Land Rover Discovery 2 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:01:56', NULL, NULL, 5.511814, 38.6, 6009542225784, 'ZA', 'EUR', 1205.882, '8708.29.90', 10, 0),
(332, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Land Rover Defender / Montage pour gouttière - de Front Runner', 'KRLD024', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 225mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 130, 1540, NULL, 298.31933, 357.983196, 'KRLD024 - Kit de barres de toit pour un Land Rover Defender / Montage pour gouttière - de Front Runner\\n\\nComposé de :\\n2 x LASS107 - Pied N° 7 225mm (Paire) - de Front Runner\\n1 x LBSK016 - Paire de barres de toit 1425mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :8kg (18lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur :130mm (5\'\')\\nLongueur : 1540mm (61\'\')\\nHauteur : 195mm (8\'\')\\n\\nPoids de la livraison:\\n9.5kg (21.0lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 225mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour un Land Rover Defender / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:01:58', NULL, NULL, 7.677169, 9.6, 6009542232164, 'ZA', 'EUR', 298.319, '8708.29.90', 10, 0),
(333, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Land Rover Discovery 2 / Montage pour gouttière - de Front Runner', 'KRLD026', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 265mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 130, 1540, NULL, 306.72269, 368.067228, 'KRLD026 - Barres de toit de Front Runner / Kit pour un Land Rover Discovery 2\\nContient :\\n2 x LASS105 - Pied N° 5 190mm (Paire) - de Front Runner\\n1 x LBSK016 - Paire de barres de toit / 1425mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent / 10mm - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 8kg (17lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 130mm (5\'\')\\nLongueur : 1540mm (61\'\')\\nHauteur : 195mm (8\'\')\\nPoids de la livraison:\\n9.7kg (21.4lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 265mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour un Land Rover Discovery 2 / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:01:59', NULL, NULL, 7.677169, 9.8, 6009542232195, 'ZA', 'EUR', 306.723, '8708.29.90', 10, 0),
(334, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Discovery LR3/LR4 - de Front Runner', 'KRLD028T', 'La galerie Slimline II pour toute la longueur du toit de2166mm/85.3\'\' contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau Slimline II sur votre Land Rover Discovery LR3/LR4. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 1172.26891, 1406.722692, 'KRLD028T - Kit de galerie pour un Land Rover LR3 LR4 Discovery - Slimline II de Front Runner\\nComposé de :\\n1 x FALD003 - Foot rails pour un Land Rover DiscoveryLR3 + LR4\\n1 x RRSTD11 - Plateau Slimline II - 1255mm(W)X2166mm(L)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 39.97kg (88.12lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm(18\'\')\\nLongueur : 1615mm (68\'\')\\nHauteur : 140mm(6\'\')\\nPoids de la livraison :\\n41.63kg (92lbs)', 'La galerie Slimline II pour toute la longueur du toit de2166mm/85.3\'\' contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau Slimline II sur votre Land Rover Discovery LR3/LR4. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour un Land Rover Discovery LR3/LR4 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|CURRENT PROMOTIONS|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:02:00', NULL, NULL, 5.511814, 41.6, 6009542232744, 'ZA', 'EUR', 1172.269, '8708.29.90', 10, 0),
(335, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 3/4 pour un Land Rover Discovery LR3/LR4 - par Front Runner', 'KRLD029T', 'La galerie Slimline II 3/4 de 1560mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Land Rover Discovery LR3/LR4. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 878.15126, 1053.781512, 'KRLD029T - Kit de galerie 3/4 pour un Land Rover LR3 LR4 Discovery (Montage avec pieds de rail) - Slimline II de Front Runner\\nComposé de :\\n1 x FALD004 - Pieds de rail MKII 72,5mm pour un Discovery\\n1 x RRSTD08 - Plateau Slimline II - 1255mm (largeur) x 1560mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 28kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 32,8kg', 'La galerie Slimline II 3/4 de 1560mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Land Rover Discovery LR3/LR4. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II 3/4 pour un Land Rover Discovery LR3/LR4 - par Front Runner', 'Galerie|Kit de Galerie Slimline II|CURRENT PROMOTIONS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:02:25', NULL, NULL, 5.511814, 32.1, 6009542232737, 'ZA', 'EUR', 878.151, '8708.29.90', 10, 0),
(336, 1, 2, NULL, NULL, NULL, 'Kit de 3/4 galerie Slimline II pour un Land Rover Defender 110 / Haut - de Front Runner', 'KRLD030L', 'Le kit de galerie Slimline II 3/4 de 2166mm pour un Land Rover Defender 110 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut\' permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1281.51261, 1537.815132, 'KRLD030L -Kit de 3/4 galerie Slimline II pour un Land Rover Defender 110 / Haut - de Front Runner\\nComposé de :\\n3 x LASS108 - No 8 Leg 250mm ( paire )\\n1 x RRSTJ11 - Plateau Slimline II - 1425mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 35kg (76lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm(6\'\')\\n\\nPoids de la livraison : 40.1kg (88.3lbs)', 'Le kit de galerie Slimline II 3/4 de 2166mm pour un Land Rover Defender 110 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut\' permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de 3/4 galerie Slimline II pour un Land Rover Defender 110 / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:02:29', NULL, NULL, 5.511814, 40.5, 6009542235288, 'ZA', 'EUR', 1281.513, '8708.29.90', 10, 0),
(337, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Discovery Sport - de Front Runner', 'KRLD031T', ' La galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Land Rover Discovery Sport. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 1037.81513, 1245.378156, ' \\nKRLD031T - Kit de galerie Slimline II pour un Land Rover Discovery \\n  \\nContient : \\n3 x FALD006 - Pied de rail pour un Land Rover Discovery Sport \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTD09 - Plateau Slimline II - 1255mm (largeur) x 1762mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 32kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 37,2kg', ' La galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Land Rover Discovery Sport. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour un Land Rover Discovery Sport - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:03:03', NULL, NULL, 5.511814, 37.4, 6009542240169, 'ZA', 'EUR', 1037.815, '8708.29.90', 4, 0),
(338, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover All-New Discovery (2017-jusqu’à présent) - de Front Runner', 'KRLD032T', 'La galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 4 pieds de rail pour monter le plateau Slimline II sur votre Land Rover All-New Discovery (L462). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. Cette galerie est compatible avec l’antenne ‘aileron requin’.\\nNOTE : Vous aurez besoin des rails de Land Rover pour l’installation de la galerie.', 455, 1730, NULL, 945.37815, 1134.45378, 'KRLD032T - Kit de galerie Slimline II pour un Land Rover All-new Discovery (2017 - jusqu\'à présent) - de Front Runner\\nContient :\\n1 x FALD007 - Pied de rail pour un Land Rover All-new Discovery - de Front Runner\\n1 x RRSTD08 - Plateau Slimline II - 1255mm (largeur) x 1762mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 27kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm\\nLongueur 1615mm\\nHauteur 250mm\\nPoids de la livraison : 31,9kg', 'La galerie Slimline II pour toute la longueur du toit de 1762mm contient le plateau Slimline II, un déflecteur de vent et 4 pieds de rail pour monter le plateau Slimline II sur votre Land Rover All-New Discovery (L462). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. Cette galerie est compatible avec l’antenne ‘aileron requin’.\\nNOTE : Vous aurez besoin des rails de Land Rover pour l’installation de la galerie.', 'Kit de galerie Slimline II pour un Land Rover All-New Discovery (2017-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:03:08', NULL, NULL, 9.842525, 32, 6009542241777, 'ZA', 'EUR', 945.378, '8708.29.90', 10, 0),
(339, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover New Defender 110 - de Front Runner', 'KRLD034T', 'Initiez votre Defender à de nouvelles aventures avec ce nouveau kit de rail de pied pour Defender. Conçu pour permettre à votre Defender de traverser les terrains les plus difficiles du monde tout en s\'harmonisant avec le design épuré, votre Defender sera à l\'aise sur route comme en dehors.', 440, 1730, NULL, 1315.12605, 1578.15126, 'KRLD034T - Kit galerie Slimline II pour un Land Rover New Defender 110\\nComposé de :\\n1 x FALD008 - Foot rails pour un Land Rover Defender L663 ( 2020-jusqu\'à présent) - par Front Runner\\n1 x RRSTD11 - Slimline II Plateau - 1255mm(L) X 2166mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 43.97kg (96.94lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur 440mm (17,3\'\')\\nLongueur 1730mm (68,1\'\')\\nHauteur 245mm (10\'\')\\nPoids de l\'expédition :\\nPoids 42kg (92lbs)', 'Initiez votre Defender à de nouvelles aventures avec ce nouveau kit de rail de pied pour Defender. Conçu pour permettre à votre Defender de traverser les terrains les plus difficiles du monde tout en s\'harmonisant avec le design épuré, votre Defender sera à l\'aise sur route comme en dehors.', 'Kit de galerie Slimline II pour un Land Rover New Defender 110 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:03:14', NULL, NULL, 9.6, 42, 6009542200095, 'ZA', 'EUR', 1315.126, '8708.29.90', 10, 0),
(340, 1, 2, NULL, NULL, NULL, 'Kit de galerie 3/4 Slimline II pour un Land Rover 110 (1983-2016) - de Front Runner', 'KRLD035T', 'Lorsque vous n\'avez pas besoin d\'une galerie complète, le kit de galerie 3/4 Slimline II pour un Land Rover Defender 110 (1983-2016) est la solution parfaite pour transporter votre équipement d\'aventure, tout en gardant votre espace de chargement intérieur libre pour d\'autres utilisations.', 440, 1720, NULL, 1474.78992, 1769.747904, 'KRLD035T - Kit de galerie 3/4 Slimline II pour un Land Rover 110 (1983-2016) - de Front Runner\\nComposé de :\\n4x LASS107 - No 7 Leg 225mm (Paire)\\n1x RRSTJ11 - Plateau SLII - 1425mm(W)X2166mm(L)\\n1x WDST009 - Paire de déflecteurs de vent 20mm de large / 1345mm(W)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 42,74 kg (94,23lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur : 440mm (17\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 280mm (11\'\')\\nPoids d\'expédition :\\nPoids : 43.4kg (95lbs)', 'Lorsque vous n\'avez pas besoin d\'une galerie complète, le kit de galerie 3/4 Slimline II pour un Land Rover Defender 110 (1983-2016) est la solution parfaite pour transporter votre équipement d\'aventure, tout en gardant votre espace de chargement intérieur libre pour d\'autres utilisations.', 'Kit de galerie 3/4 Slimline II pour un Land Rover 110 (1983-2016) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:03:18', NULL, NULL, 11, 43.4, 6009542219349, 'ZA', 'EUR', 1474.79, '8708.29.90', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(341, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover New Defender 110 avec rails d\'origine - de Front Runner', 'KRLD037T', 'Il est temps d\'initier votre tout nouveau Defender à de nouvelles aventures. Conçue pour faire traverser à votre Defender les terrains les plus difficiles du monde, cette galerie de toit Land Rover New Defender Slimline II est à l\'aise sur route comme en dehors. Bienvenue dans la nouvelle ère de l\'aventurier.', 440, 1730, NULL, 785.71429, 942.857148, 'KRLD037T- Kit de galerie Slimline II pour Land Rover New Defender 110 avec rails d\'origine - par Front Runner\\nComposé de :\\n3x FASS013 - Set de pieds / 60mm - 70mm\\n3x RRAC930 - Kit de montage sur rail OEM Land Rover New Defender (L663)\\n1x RRSTD08 - Plateau SLII - 1255mm(W)X1560mm(L)\\n1x WDST009 - Paire de déflecteurs de vent 20mm à lèvre large / 1345mm(W)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 54.34kg (119.8lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre Kit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie utilise des rails de pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pieds pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 150mm (6\'\')\\nPoids à la livraison :\\nPoids : 27.6kg (60.8lbs)', 'Il est temps d\'initier votre tout nouveau Defender à de nouvelles aventures. Conçue pour faire traverser à votre Defender les terrains les plus difficiles du monde, cette galerie de toit Land Rover New Defender Slimline II est à l\'aise sur route comme en dehors. Bienvenue dans la nouvelle ère de l\'aventurier.', 'Kit de galerie Slimline II pour un Land Rover New Defender 110 avec rails d\'origine - de Front Runner', 'Galerie|Kit de Galerie Slimline II|ALL ROOF RACKS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:03:21', NULL, NULL, 5.9, 27.6, 6009542266282, 'ZA', 'EUR', 785.714, '8708.29.90', 10, 0),
(342, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Land Rover New Defender 90/110 - de Front Runner', 'KRLD038', 'Transportez votre équipement sur le toit de votre Land Rover New Defender 90/110 avec ce kit de barres de toit à profil bas. Ce kit permet d\'utiliser de nombreux accessoires de galerie Front Runner, sans avoir besoin d\'installer une galerie de toit complète.', 150, 1385, NULL, 247.8992, 297.47904, 'KRLD038 -Kit de barres de toit pour un Land Rover New Defender 90/110 - de Front Runner\\nComposé de :\\n2x FASS017 - Ensemble de pieds / 75mm-85mm\\n1x LBSK014 - Paire de barres de toit 1255mm(l)\\n1x RRAC044 - Kit de capuchons pour convertir des lattes en barres de toit\\n2x RRAC930 - Kit de montage sur rail OEM Land Rover New Defender (L663)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nPoids approximatif installé : 6.1kg (13.45lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 150mm (6\'\')\\nLongueur : 1385mm (55\'\')\\nHauteur : 145mm (6\'\')\\nPoids de la livraison :\\nPoids : 5.89kg (13lbs)', 'Transportez votre équipement sur le toit de votre Land Rover New Defender 90/110 avec ce kit de barres de toit à profil bas. Ce kit permet d\'utiliser de nombreux accessoires de galerie Front Runner, sans avoir besoin d\'installer une galerie de toit complète.', 'Kit de barres de toit pour un Land Rover New Defender 90/110 - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:03:33', NULL, NULL, 5.7, 5.9, 6009542227221, 'ZA', 'EUR', 247.899, '7616.99', 10, 0),
(343, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Defender 90 (2020-jusqu\'à présent) - de Front Runner', 'KRLD039T', 'Équipez votre Land Rover Defender 90 de 2020 jusqu\'à présent pour vos plus grandes aventures avec ce kit de galerie de toit Slimline II.', 440, 1730, NULL, 1121.8487, 1346.21844, 'KRLD039T -Kit de galerie Slimline II pour un Land Rover Defender 90 (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n1x FALD010 - Foot Rails pour un Land Rover Defender 90 (2020-jusqu\'à présent)\\n1x RRSTD09 - Plateau SLII - 1255mm(l)X1762mm(L)\\nMatériel utilisé :\\nPoudre époxy noire - aluminium T6\\nAcier haute résistance\\nPoids approximatif installé : 37.28kg (82.19lbs)La rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 255mm (10\'\')\\nPoids de la livraison :\\nPoids : 38kg (84lbs)', 'Équipez votre Land Rover Defender 90 de 2020 jusqu\'à présent pour vos plus grandes aventures avec ce kit de galerie de toit Slimline II.', 'Kit de galerie Slimline II pour un Land Rover Defender 90 (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:03:36', NULL, NULL, 10, 38, 6009542235509, 'ZA', 'EUR', 1121.849, '8708.29.90', 0, 0),
(344, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour un Land Rover Defender (1983-2016) - de Front Runner', 'KRLDT01L', ' Le kit de galerie Slimline II 1/2 de 1358mm pour un Land Rover Defender contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 869.7479, 1043.69748, 'KRLDT01L - Kit de galerie (1/2) pour un Land Rover Defender (1983-2016) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS108 - Pied nº 8 250mm (Paire) \\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 25kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  \\nPoids de la livraison : 29,2kg', ' Le kit de galerie Slimline II 1/2 de 1358mm pour un Land Rover Defender contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II 1/2 pour un Land Rover Defender (1983-2016) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:03:37', NULL, NULL, 5.511814, 31.5, 6009542226217, 'ZA', 'EUR', 869.748, '8708.29.90', 10, 0),
