(353, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour une Lexus GX460 - de Front Runner', 'KRLE009T', ' La galerie Slimline II 1/2 de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Lexus GX460. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 844.53782, 1013.445384, ' \\nKRLE009T - Kit de galerie 1/2 pour une Lexus GX460 - Slimline II de Front Runner \\n  \\nContient : \\n1 x FATP001 - Pieds de rails pour une Toyota Prado 150 (Paire G/D) 65mm \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTD06 - Plateau Slimline II - 1255mm (largeur) x 1156mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 25kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 28,7kg', ' La galerie Slimline II 1/2 de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Lexus GX460. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II 1/2 pour une Lexus GX460 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:04:28', NULL, NULL, 5.511814, 29.6, 6009542227054, 'ZA', 'EUR', 844.538, '7616.99', 10, 0),
(354, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour Land Rover Freelander (2006-2014) - de Front Runner', 'KRLF002T', 'Transformez votre Land Rover Freelander (2006-2014) en véhicule d\'exploration avec ce kit de galerie de toit Slimline II. L\'installation est simple et sans perçage, vous pouvez donc prendre la route aussi vite que le temps que cela vous prend pour attacher votre équipement.', 445, 1730, NULL, 760.5042, 912.60504, 'KRLF002T - Kit de galerie de toit Slimline II pour Land Rover Freelander (06-14)\\nComposé de :\\n1x FALF002 - Land Rover Freelander (2006-2014) Rails de pieds\\n1x RRSTD08 - Plateau SLII - 1255mm(W)X1560mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 29,85 kg (65,81lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour déterminer la hauteur de la galerie à partir de la couronne (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 445 mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 315mm (12\'\')\\nPoids à l\'expédition :\\nPoids : 31kg (68lbs)', 'Transformez votre Land Rover Freelander (2006-2014) en véhicule d\'exploration avec ce kit de galerie de toit Slimline II. L\'installation est simple et sans perçage, vous pouvez donc prendre la route aussi vite que le temps que cela vous prend pour attacher votre équipement.', 'Kit de galerie de toit Slimline II pour Land Rover Freelander (2006-2014) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:04:30', NULL, NULL, 12.4, 31, 6009542218335, 'ZA', 'EUR', 760.504, '8708.29.90', 10, 0),
(355, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Lada Niva 4x4 - de Front Runner', 'KRLN001T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II et un déflecteur de vent ainsi que 4 pieds de gouttière pour monter le plateau Slimline II sur votre Lada Niva 4x4. S’installe facilement et aucun forage n’est nécessaire.', 450, 1730, NULL, 810.92437, 973.109244, 'KRLN001T Kit de galerie Slimline II pour une LadaNiva 4x4 - de Front Runner\\nComposé de :\\n2 x LASS102 - Setde pieds No 2 130mm - de Front Runner\\n1 x RRSTG07 -Plateau Slimline II - 1345mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier inoxydable 3CR12\\nPoids approximatif d’installation :23kg (51lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison :\\n27.0kg (59.3lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II et un déflecteur de vent ainsi que 4 pieds de gouttière pour monter le plateau Slimline II sur votre Lada Niva 4x4. S’installe facilement et aucun forage n’est nécessaire.', 'Kit de galerie Slimline II pour une Lada Niva 4x4 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:04:55', NULL, NULL, 5.511814, 27, 6009542252100, 'ZA', 'EUR', 810.924, '8708.29.90', 10, 0),
(356, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Lexus RX (2016-actuel) - de Front Runner', 'KRLR001T', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de rail pour monter le plateau Slimline II sur votre Lexus RX (AL20). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 970.58824, 1164.705888, 'Contient :\\n3 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n3 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n3 x GOFR031 - Pied Grab-On intérieur pour barres Flush / B - de Front Runner\\n1 x RRSTD06 - Plateau Slimline II - 1255mm (largeur) x 1156mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 21kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 24,0kg', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de rail pour monter le plateau Slimline II sur votre Lexus RX (AL20). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Lexus RX (2016-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:04:58', NULL, NULL, 5.511814, 26, 6009542243719, 'ZA', 'EUR', 970.588, '8708.29', 4, 0),
(357, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour rails de toit pour un Lexus RX 350 (2003-2012) - de Front Runner', 'KRLR002T', 'Ce kit de galerie Slimline II pleine grandeur de 1156mm/45,5\'\' de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour fixer le plateau Slimline II aux rails de toit de votre Lexus RX 350. Ce système s\'installe facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou de l\'équipementier. Aucun perçage n\'est nécessaire.', 455, 1730, NULL, 684.87395, 821.84874, 'KRLR002T -Kit de galerie Slimline II pour rails de toit pour un Lexus RX 350 (2003-2012) - de Front Runner\\nComposé de :\\n2 x GOFR001 - Embase de pied de rail (paire) - par Front Runner\\n2 x GOFR033 - Poignées intérieures de rail affleurant / D - par Front Runner\\n2 x GORR052 - Prise extérieure du rail surélevé / n° 3 - par Front Runner\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(L) X 1156mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 19kg (42lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et des profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de porte-bagages de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur du porte-bagages par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 205mm (8\'\')\\nPoids de l\'expédition :\\nPoids : 22,3 kg (49,0 lb)', 'Ce kit de galerie Slimline II pleine grandeur de 1156mm/45,5\'\' de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour fixer le plateau Slimline II aux rails de toit de votre Lexus RX 350. Ce système s\'installe facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou de l\'équipementier. Aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II pour rails de toit pour un Lexus RX 350 (2003-2012) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:00', NULL, NULL, 8.07087, 22.3, 6009542264486, 'ZA', 'EUR', 684.874, '8708.29', 10, 0),
(358, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi ASX (2010actuel) - de Front Runner', 'KRMA001T', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Mitsubishi ASX (RVR). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 592.43697, 710.924364, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pieds extérieurs pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR034 - Pieds intérieurs pour barres Flush / E - de Front Runner\\n1 x RRSTA04 - Plateau Slimline II - 1165mm (largeur) x 752mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 16kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 18,3kg', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Mitsubishi ASX (RVR). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi ASX (2010actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:03', NULL, NULL, 5.511814, 19.6, 6009542243658, 'ZA', 'EUR', 592.437, '8708.29.90', 10, 0),
(359, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Mazda BT50 (2020-jusqu\'à présent) - de Front Runner', 'KRMB001T', 'Avec un véhicule aussi abouti que le Mazda BT50, vous allez vouloir partager votre prochaine aventure avec vos amis. Le kit de galerie de toitSlimline II pourMazda BT50 de Front Runner vous permet de monter votre équipement d\'aventure sur le toit afin de libérer l\'espace de chargement intérieur pour que vous puissiez partir à l\'aventure sans compromettre ce que vous emmenez, ou qui vous emmenez.', 440, 1730, NULL, 810.92437, 973.109244, 'KRMB001T -Kit de galerie Slimline II pour Mazda BT50 (2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n1x FAIK002 - Rails de pied Isuzu D-Max/Mazda BT 50 (2020-actuel)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 27,28kg (60,14lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids à la livraison :\\nPoids : 27.57kg (61lbs)', 'Avec un véhicule aussi abouti que le Mazda BT50, vous allez vouloir partager votre prochaine aventure avec vos amis. Le kit de galerie de toitSlimline II pourMazda BT50 de Front Runner vous permet de monter votre équipement d\'aventure sur le toit afin de libérer l\'espace de chargement intérieur pour que vous puissiez partir à l\'aventure sans compromettre ce que vous emmenez, ou qui vous emmenez.', 'Kit de galerie Slimline II pour Mazda BT50 (2020-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:06', NULL, NULL, 10.2, 27.6, 6009542217666, 'ZA', 'EUR', 810.924, '7616.99', 7, 0);
