(360, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mazda BT50 Double Cab (2012-2020) - de Front Runner', 'KRMB003T', 'Libérez un espace intérieur et un espace de benne précieux, et transportez votre chargement, votre équipement d\'aventure et vos jouets sur votre toit avec ce Kit de galerie Slimline II pour une Mazda BT50 Double Cab (2012-2020).', 445, 1715, NULL, 684.87395, 821.84874, 'KRMB003T -Kit de galerie Slimline II pour une Mazda BT50 Double Cab (2012-2020) - de Front Runner\\nComposé de :\\n1x FASS012 - Set de pieds / 40mm - 50mm\\n1x FASS014 - Set de pieds - coudé / 65mm\\n1x RRSTD06 - Plateau SLII - 1255mm(W)X1156mm(L)\\n1x TRFR001 - Rails pour Ford Ranger (2012-jusqu\'à présent) / 1200mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 24.49kg (53.99lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur : 445mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids d\'expédition :\\nPoids : 25.4kg (56lbs)', 'Libérez un espace intérieur et un espace de benne précieux, et transportez votre chargement, votre équipement d\'aventure et vos jouets sur votre toit avec ce Kit de galerie Slimline II pour une Mazda BT50 Double Cab (2012-2020).', 'Kit de galerie Slimline II pour une Mazda BT50 Double Cab (2012-2020) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:05:32', NULL, NULL, 10.6, 25.4, 6009542219431, 'ZA', 'EUR', 684.874, '7616.99', 10, 0),
(361, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) - par Front Runner', 'KRMC004L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mitsubishi Colt DC (1990-1998) contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 768.90756, 922.689072, 'KRMC004L - Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) - par Front Runner\\nComposé de :\\n2 x LASS101 -Pied nº 1 120mm (Paire)\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 22kg (49lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm / 2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n26.1kg (57.5lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mitsubishi Colt DC (1990-1998) contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:34', NULL, NULL, 5.511814, 25.9, 6009542226231, 'ZA', 'EUR', 768.908, '7616.99', 10, 0),
(362, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mitsubishi Colt DC (1990-1998) / Montage pour gouttière - par Front Runner', 'KRMC010', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1385, NULL, 256.30252, 307.563024, 'KRMC010 - Kit de barres de toit pour une Mitsubishi Colt DC (1990-1998) / Montage pour gouttière - par Front Runner\\nComposé de :\\n2 x LASS101 - Pied N° 1 120mm (Paire)\\n1 x LBSK014 - Barres de toit (Paire) 1255mm\\n1 x WDLB001 - Déflecteur de vent de 10mm\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 7kg (15lbs)\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1385mm (55\'\')\\nHauteur : 170mm (7\'\')\\nPoids de la livraison:\\n8.0kg (17.6lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Mitsubishi Colt DC (1990-1998) / Montage pour gouttière - par Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:38', NULL, NULL, 6.692917, 8.2, 6009542232232, 'ZA', 'EUR', 256.303, '7616.99', 10, 0),
(363, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Mercedes Classe C Estate (2014 - actuel) - de Front Runner', 'KRMC012T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contientle plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pourmonter le plateau Slimline II sur votre Mercedes Classe C Estate. Le plateaus’installe facilement en installant le pied sur la barre longitudinale Flush. Leforage n’est pas nécessaire.', 450, 1730, NULL, 802.52101, 963.025212, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire) - deFront Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barresFlush / No. 6 - de Front Runner\\n2 x GOFR031 - Pied Grab-On intérieur pour barresFlush / B - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(largeur) x 1358mm (longueur) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 21kg\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1620mm\\nHauteur 205mm\\n\\nPoids de la livraison :Poids : 24,4kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contientle plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pourmonter le plateau Slimline II sur votre Mercedes Classe C Estate. Le plateaus’installe facilement en installant le pied sur la barre longitudinale Flush. Leforage n’est pas nécessaire.', 'Kit de galerie Slimline II pour Mercedes Classe C Estate (2014 - actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:38', NULL, NULL, 8.07087, 24.6, 6009542249421, 'ZA', 'EUR', 802.521, '7616.99', 6, 0),
(364, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une MINI Countryman (2017-actuel) - de Front Runner', 'KRMC013T', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1156mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre MINI Countryman (2017-jusqu’à présent). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'Contient :\\n2 x GOFR001 - Base de pied de rail (Paire)- de Front Runner\\n2 x GORR052 - Rail élevé extérieur Grab-On/ N° 3 - de Front Runner\\n2 x GORR071 - Rail élevé intérieur Grab-On/ B - de Front Runner\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm paireextra étroite / 1165mm largeur - de Front Runner\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 20kg \\nLa rainure en T sur le haut et sur le basdu plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin depieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin depieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455mm \\nLongueur 1610mm \\nHauteur 285mm \\n\\nPoids de la livraison :Poids : 22,7kg', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1156mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre MINI Countryman (2017-jusqu’à présent). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II pour une MINI Countryman (2017-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 11:05:42', NULL, NULL, 11.220478, 22.9, 6009542252308, 'ZA', 'EUR', 710.084, '7616.99', 10, 0),
(365, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) / Haut - par Front Runner', 'KRMCT04L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mitsubishi Colt DC (1990-1998) contient un plateau Slimline II, un déflecteur de vent et 4 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 768.90756, 922.689072, 'KRMCT04L - Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) / Haut - par Front Runner\\nContient:\\n2 x LASS102 - Pied nº 2 130mm (Paire)\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 23kg (50lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n26.2kg (57.6lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mitsubishi Colt DC (1990-1998) contient un plateau Slimline II, un déflecteur de vent et 4 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour une Mitsubishi Colt DC (1990-1998) / Haut - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:46', NULL, NULL, 5.511814, 25.9, 6009542226248, 'ZA', 'EUR', 768.908, '7616.99', 10, 0),
(366, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Mahindra DC - de Front Runner', 'KRMD001L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mahindra DC contient un plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 911.76471, 1094.117652, 'KRMD001L - Kit de galerie pour une Mahindra DC - Slimline II de Front Runner\\n\\nContient:\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n2 x LASS103 - Pied nº 3 155mm (Paire)\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 24kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 28,3kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mahindra DC contient un plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour un Mahindra DC - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:49', NULL, NULL, 5.511814, 28, 6009542225838, 'ZA', 'EUR', 911.765, '7616.99', 10, 0),
(367, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Delica L300 Toit Haut (1986-1999) - de Front Runner', 'KRMD002T', 'Le kit de galerie Slimline II pour toute la longueur du toit de2570mm/ 101.2\'\'pour unMitsubishi Delica L300contient le plateau Slimline II, un déflecteur de vent et 8 pièds de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1432.77311, 1719.327732, 'KRMD002T - Kit de galerie Slimline II pour une Mitsubishi Delica L300 (1986-1999) - par Front Runner\\nComposé de :\\n4 x LASS107 - No 7 Leg 225mm (paire) - par Front Runner\\n1 x RRSTG13 - Plateau Slimline II - 1345mm(L) X 2570mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 40kg (87lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 270mm (11\'\')\\nPoids de l\'expédition :\\nPoids 46.0kg (101.2lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de2570mm/ 101.2\'\'pour unMitsubishi Delica L300contient le plateau Slimline II, un déflecteur de vent et 8 pièds de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Mitsubishi Delica L300 Toit Haut (1986-1999) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:52', NULL, NULL, 10.629927, 46, 6009542265438, 'ZA', 'EUR', 1432.773, '8708.29.90', 10, 0),
(368, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Delica Space Gear L400 (1994-2007) - de Front Runner', 'KRMD003T', 'Emmenez votre Mitsubishi Delica Space Gear L400 (1994-2007) vers de nouveaux horizons avec ce kit de galerie de toit Front Runner Slimline II. Libérez un espace de chargement intérieur précieux en fixant facilement votre équipement d\'aventure et vos jouets sur la galerie de toit qui a été conçue pour résister au tout-terrain.', 450, 1720, NULL, 1399.15966, 1678.991592, 'KRMD003T -Kit de galerie Slimline II pour une Mitsubishi Delica Space Gear L400 (1994-2007) - par Front Runner\\nComposé de :\\n1x LASP104 - No 4 Plus Leg 180mm (paire)\\n1x LASS027 - Entretoise de pied 6mm (paire)\\n2x LASS105 - Pied No 5 190mm (paire)\\n1x LASS106 - Pied n°6 195mm (paire)\\n1x RRAC174 - Déflecteur de vent pour galeire à profil bas/1165MM/1255mm(W)\\n1x RRSTG11 - Plateau SLII - 1345mm(Largeur)X2166mm(Longueur)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 43,11kg (95,04lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de barres de toit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la barre par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 450 mm (18\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 220mm (9\'\')\\nPoids à l\'expédition :\\nPoids : 42.8kg (94lbs)', 'Emmenez votre Mitsubishi Delica Space Gear L400 (1994-2007) vers de nouveaux horizons avec ce kit de galerie de toit Front Runner Slimline II. Libérez un espace de chargement intérieur précieux en fixant facilement votre équipement d\'aventure et vos jouets sur la galerie de toit qui a été conçue pour résister au tout-terrain.', 'Kit de galerie Slimline II pour une Mitsubishi Delica Space Gear L400 (1994-2007) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:05:56', NULL, NULL, 8.7, 42.8, 6009542218427, 'ZA', 'EUR', 1399.16, '8708.29', 10, 0),
(369, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Delica L300 à toit bas (1986-1999) - de Front Runner', 'KRMD004T', 'Emmenez votre Mitsubishi Delica L300 à toit bas de 1986 à 1999 vers de nouvelles aventures avec ce kit de galerie de toit Slimline II. Chargez votre équipement d\'aventure sur le toit pour libérer un espace intérieur précieux. Construisez votre propre aventure avec les accessoires Front Runner maintenant.', 440, 1720, NULL, 1432.77311, 1719.327732, 'KRMD004T -Kit de galerie Slimline II pour une Mitsubishi Delica L300 à toit bas (1986-1999) - de Front Runner\\nComposé de :\\n4x LASS027 - Entretoise de jambe 6mm (paire)\\n4x LASS101 - No 1 Pied 120mm (Paire)\\n1x RRSTG13 - Plateau SLII - 1345mm(L)X2570mm(L)\\n1x WDST009 - Paire de déflecteurs de vent 20mm de large / 1345mm(W)\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé :43.87kg (96.72lbs)\\nLes rails en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm/2\'\') à la hauteur du pied ou du pied Grab-on indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des Foot Rails, ajoutez la hauteur du plateau Slimline II (50 mm/2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids de la livraison :\\nPoids : 44.4kg (98lbs)', 'Emmenez votre Mitsubishi Delica L300 à toit bas de 1986 à 1999 vers de nouvelles aventures avec ce kit de galerie de toit Slimline II. Chargez votre équipement d\'aventure sur le toit pour libérer un espace intérieur précieux. Construisez votre propre aventure avec les accessoires Front Runner maintenant.', 'Kit de galerie Slimline II pour une Mitsubishi Delica L300 à toit bas (1986-1999) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:06:00', NULL, NULL, 10.6, 45, 6009542220826, 'ZA', 'EUR', 1432.773, '8708.29.90', 10, 0),
(370, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Mahindra DC / Large - de Front Runner', 'KRMDT01L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mahindra DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 920.16807, 1104.201684, 'KRMDT01L - Kit de galerie pour une Mahindra DC/ Large - Slimline II de Front Runner\\n\\nContient:\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n3 x LASS104 - Pied nº 4 170mm (Paire)\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 24kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 28,4kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Mahindra DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour un Mahindra DC / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:03', NULL, NULL, 5.511814, 28.1, 6009542226255, 'ZA', 'EUR', 920.168, '7616.99', 10, 0),
(371, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Mitsubishi Eclipse Cross (2019-actuel) - par Front Runner', 'KRME001T', 'La galerie Slimline II pour toute lalongueur du toit de 1358 mm contient le plateau Slimline II, un déflecteur devent et 4 paires de pieds de rail pour monter le plateau Slimline II sur votreMitsubishi Eclipse Cross. Le plateau s’installe facilement en installant les pieds aux rails de toit existants de l\'usine ou de l\'équipementier. Le forage n’est pas nécessaire.', 450, 1730, NULL, 819.32773, 983.193276, 'Composé de :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pieds extérieurs pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR033 - Pieds intérieurs pour barres Flush / D - de Front Runner\\n2 x RRAC904 - Espaceur en plastique pour base de pied de rail / 10 mm (paire)\\n1 x RRSTA07 - Plateau Slimline II - 1165 mm (largeur) x 1358 mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 21kg (45lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm (18\'\')\\nLongueur 610mm (24\'\')\\nHauteur 215mm (8\'\')\\nPoids de la livraison :\\nPoids : 23.9kg (52.6lbs)', 'La galerie Slimline II pour toute lalongueur du toit de 1358 mm contient le plateau Slimline II, un déflecteur devent et 4 paires de pieds de rail pour monter le plateau Slimline II sur votreMitsubishi Eclipse Cross. Le plateau s’installe facilement en installant les pieds aux rails de toit existants de l\'usine ou de l\'équipementier. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Mitsubishi Eclipse Cross (2019-actuel) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:26', NULL, NULL, 8.464571, 24.4, 6009542261102, 'ZA', 'EUR', 819.328, '8708.29', 10, 0),
(372, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz GLA (2014 - jusqu\'à présent) - de Front Runner', 'KRMG002T', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Mercedes Benz GLA (X156). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 592.43697, 710.924364, 'KRMG002T -Kit de galerie Slimline II pour une Mercedes Benz GLA (2014 - jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR032 - Pied Grab-On intérieur pour barres Flush / C - de Front Runner\\n1 x RRSTA04 - Plateau Slimline II - 1165mm (largeur) x 752mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 16kg (36lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm(64\'\')\\nHauteur 270mm(11\'\')\\nPoids de la livraison :\\nPoids :19.1kg (42.0lbs)', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Mercedes Benz GLA (X156). Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mercedes Benz GLA (2014 - jusqu\'à présent) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie|Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:06:30', NULL, NULL, 10.629927, 19.6, 6009542243665, 'ZA', 'EUR', 592.437, '7616.99', 10, 0),
(373, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz GLC (2016 - jusqu\'à présent) - de Front Runner', 'KRMG003T', 'Ce kit galerie complète de 1358 mm de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour le montage du plateau Slimline II sur les rails de toit de votre Mercedes Benz GLC (X253). Ce système se monte facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.\\nRemarque : ne convient pas au GLC Coupé (C253).', 450, 1730, NULL, 802.52101, 963.025212, 'KRMG003T -Kit de galerie Slimline II pour une Mercedes Benz GLC (2016 - jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 - Base de pied de rail (paire) - par Front Runner\\n2 x GOFR014 - Poignées extérieures de rail affleurant / No. 6 - par Front Runner\\n2 x GOFR031 - Grips intérieurs de rail affleurant / B - par Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(L) X 1358mm(L) - par Front Runner\\n1 x WDST011 - Paire de déflecteurs de vent 20mm à bord extra étroit / 1165mm(L) - par Front Runner\\nMatériau utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier inoxydable 3CR12\\nPoids approximatif au montage : 21 kg (46lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450 mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 270mm (11\'\')\\nPoids à la livraison :\\nPoids 24.6kg (54.0lbs)', 'Ce kit galerie complète de 1358 mm de long contient le plateau Slimline II, le déflecteur d\'air et 2 paires de pieds de fixation pour le montage du plateau Slimline II sur les rails de toit de votre Mercedes Benz GLC (X253). Ce système se monte facilement grâce à des pieds tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.\\nRemarque : ne convient pas au GLC Coupé (C253).', 'Kit de galerie Slimline II pour une Mercedes Benz GLC (2016 - jusqu\'à présent) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie|Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:06:33', NULL, NULL, 10.629927, 24.6, 6009542243672, 'ZA', 'EUR', 802.521, '7616.99', 6, 0),
(374, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Gelandewagen SWB (1979-2011) - par Front Runner', 'KRMG004T', 'Ce kit de galerie de toit Slimline II de 1762 mm de long pour Mercedes Gelandewagen SWB contient un plateau Slimline II et un déflecteur d\'air, ainsi que 6 pieds de montage de gouttière pour fixer le plateau au véhicule. S\'installe facilement, sans perçage.', 455, 1730, NULL, 1121.84874, 1346.218488, 'KRMG004T - Kit de galerie Slimline II pour une Mercedes Gelandewagen SWB (1979-2011) - par Front Runner\\nComposé de :\\n3 x LASS104 -Pied n°4 170mm (Paire) - de Front Runner\\n1 x RRSTM09 - Plateau Slimline II - 1475mm (largeur) x 1762mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation:30kg (66lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 455mm(18\'\')\\nLongueur : 1615mm(64\'\')\\nHauteur : 250mm(10\'\')\\nPoids de livraison :\\n34.9kg (76.8lbs)', 'Ce kit de galerie de toit Slimline II de 1762 mm de long pour Mercedes Gelandewagen SWB contient un plateau Slimline II et un déflecteur d\'air, ainsi que 6 pieds de montage de gouttière pour fixer le plateau au véhicule. S\'installe facilement, sans perçage.', 'Kit de galerie Slimline II pour une Mercedes Gelandewagen SWB (1979-2011) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:36', NULL, NULL, 9.842525, 35.4, 6009542252117, 'ZA', 'EUR', 1121.849, '8708.29.90', 10, 0),
(375, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes GL (2006-2012) - de Front Runner', 'KRMG006T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1762mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes GL.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 450, 1730, NULL, 1012.60504, 1215.126048, 'KRMG006T -Kit de galerie Slimline II pour une Mercedes GL (2006-2012) - de Front Runner\\nComposé de :\\n3 x GOFR001 - Base de pied de rail (paire) - par Front Runner\\n3 x GORR052 - Pied Grab-On extérieure du rail surélevé / n° 3 - par Front Runner\\n3 x GORR071 - Pied Grab-on intérieure du rail surélevé / B - par Front Runner\\n1 x RRAC904 - Entretoise plastique pour pied de rail / 10mm (paire)\\n1 x RRSTA09 - Plateau Slimline II - 1165mm(L) X 1762mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 25kg (56lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 29,6 kg (65 lbs)', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 1762mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes GL.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie Slimline II pour une Mercedes GL (2006-2012) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:38', NULL, NULL, 5.511814, 29.6, 6009542252391, 'ZA', 'EUR', 1012.605, '7616.99', 10, 0),
(376, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes GLE (2013 - jusqu\'à présent) - de Front Runner', 'KRMG007T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm/69.4\'\' contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds d\'accroche pour monter le plateau aux rails de toit de votre Mercedes GLE. Ce système s\'installe facilement grâce à des pieds résistants au tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.', 450, 1730, NULL, 1046.21849, 1255.462188, 'KRMG007T -Kit de galerie Slimline II pour une Mercedes GLE (2013 - jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GORR051 - Griffes extérieures de rail surélevé / No. 2\\n3x GORR070 - Grips intérieurs de rail surélevé / A\\n2x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA09 - Plateau SLII - 1165mm(W)X1762mm(L)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 29.58kg (65.21lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\nPoids : 29.49kg (65lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm/69.4\'\' contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds d\'accroche pour monter le plateau aux rails de toit de votre Mercedes GLE. Ce système s\'installe facilement grâce à des pieds résistants au tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine/de l\'équipementier. Aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Mercedes GLE (2013 - jusqu\'à présent) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:42', NULL, NULL, 5.511814, 29.5, 6009542252377, 'ZA', 'EUR', 1046.218, '8708.29.90', 10, 0),
