, un déflecteur de vent et 2pieds de rail pour monter le plateau Slimline II sur votre G-Class. Le plateaus’installe facilement en utilisant les points de montage existants. Le foragen’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mercedes Benz G-Class (2018-jusqu\'à présent) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:06:46', NULL, NULL, 9.448824, 42.1, 6009542260495, 'ZA', 'EUR', 1415.966, '8708.29.90', 6, 0),
