ur votre G-Class. Le plateau s’installefacilement en utilisant les points de montage existants. Le forage n’est pasnécessaire.', 'Kit de 1/2 galerie Slimline II pour une Mercedes Benz G-Class (2018-jusqu\'à présent) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:06:51', NULL, NULL, 9.448824, 33, 6009542260488, 'ZA', 'EUR', 1071.429, '7616.99', 6, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(379, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Mercedes Benz GLE (W167) (2019-actuel) - par Front Runner', 'KRMG010T', 'Partez à l\'aventure dans le confort de votre véhicule de luxe avec ce kit de galerie de toit GLE de Mercedes Benz. Facile à installer, ou à retirer, en utilisant vos rails d\'usine pour une flexibilité optimale. Ce kit a été conçu pour être robuste en tout-terrain, pour des performances sur route et hors route.', 0, 0, NULL, 802.52101, 963.025212, 'KRMG010T -Kit de galerie Slimline II pour Mercedes Benz GLE (W167) (2019-actuel) - par Front Runner\\nComposé de :\\n2 x GOFR001 - Socle de rail de pied (paire) - par Front Runner\\n2 x GORR052 - Grappin extérieur de rail surélevé / n° 3 - par Front Runner\\n2 x GORR074 - Prise intérieure du rail surélevé / E - par Front Runner\\n1 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire)\\n1 x RRSTA07 - Slimline II Plateau - 1165mm(L) X 1358mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 21kg (47lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 440mm (17\'\')\\nLongueur 1720mm (68\'\')\\nHauteur 150mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 24,7 kg (54,4 lb)', 'Partez à l\'aventure dans le confort de votre véhicule de luxe avec ce kit de galerie de toit GLE de Mercedes Benz. Facile à installer, ou à retirer, en utilisant vos rails d\'usine pour une flexibilité optimale. Ce kit a été conçu pour être robuste en tout-terrain, pour des performances sur route et hors route.', 'Kit de galerie Slimline II pour Mercedes Benz GLE (W167) (2019-actuel) - par Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:06:55', NULL, NULL, 0, 0, 6009542266084, 'ZA', 'EUR', 802.521, '7616.99', 10, 0),
(380, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour rails de toit pour une Mercedes Benz GLB (X247) (2019 - jusqu\'à présent) - de Front Runner', 'KRMG011T', 'Votre Mercedes GLB a été conçue pour être polyvalente, passant sans effort du véhicule familial au véhicule tout-terrain. Ce kit de galerie de toit Slimline II ajoute encore plus de polyvalence à vos aventures en vous offrant un espace de chargement précieux sur le toit et plus de 55 accessoires au choix.', 440, 1730, NULL, 903.36134, 1084.033608, 'KRMG011T -Kit de galerie Slimline II pour rails de toit pour une Mercedes Benz GLB (X247) (2019 - jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x GOFR001 - Socle de rail de pied (paire) - par Front Runner\\n3 x GORR052 - Grappin extérieur de rail surélevé / n° 3 - par Front Runner\\n3 x GORR074 - Prise de rail intérieur surélevé / E - par Front Runner\\n2 x RRAC904 - Entretoise plastique pour base de rail de pied / 10mm (paire) - par Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(L) X 1358mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 24kg (52.9lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur 440mm (17,3\'\')\\nLongueur 1730mm (68,1\'\')\\nHauteur 150mm (5,9\'\')\\nPoids de l\'expédition :\\nPoids 25.8kg (56.9lbs)', 'Votre Mercedes GLB a été conçue pour être polyvalente, passant sans effort du véhicule familial au véhicule tout-terrain. Ce kit de galerie de toit Slimline II ajoute encore plus de polyvalence à vos aventures en vous offrant un espace de chargement précieux sur le toit et plus de 55 accessoires au choix.', 'Kit de galerie Slimline II pour rails de toit pour une Mercedes Benz GLB (X247) (2019 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:07:00', NULL, NULL, 6.3, 25.8, 6009542201580, 'ZA', 'EUR', 903.361, '8708.29.90', 10, 0),
(381, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz GL (X164) (2006-2012) - de Front Runner', 'KRMG012T', 'Vous n\'avez pas besoin d\'une installation permanente de galerie de toit pour débloquer votre prochaine aventure. Le kit de galerie de toit Slimline II pour la Mercedes Benz GL (X164) 2006-2012 s\'installe sur vos rails d\'usine, sans perçage, avec des pieds résistants aux conditions extrêmes. Vous pouvez profiter de l\'utilité des accessoires de galerie Front Runner, tout en conservant la possibilité de retirer la galerie à tout moment.', 440, 1730, NULL, 1012.605, 1215.126, 'KRMG012T -Kit de galerie Slimline II pour une Mercedes Benz GL (X164) (2006-2012) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GORR053 - Griffes extérieures de rail surélevé / No. 4\\n3x GORR071 - Griffes intérieures de rail surélevé / B\\n1x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA09 - Plateau SLII - 1165mm(l)X1762mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 28.6kg (63.05lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids de la livraison :\\nPoids : 30kg (66lbs)', 'Vous n\'avez pas besoin d\'une installation permanente de galerie de toit pour débloquer votre prochaine aventure. Le kit de galerie de toit Slimline II pour la Mercedes Benz GL (X164) 2006-2012 s\'installe sur vos rails d\'usine, sans perçage, avec des pieds résistants aux conditions extrêmes. Vous pouvez profiter de l\'utilité des accessoires de galerie Front Runner, tout en conservant la possibilité de retirer la galerie à tout moment.', 'Kit de galerie Slimline II pour une Mercedes Benz GL (X164) (2006-2012) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:07:05', NULL, NULL, 6.3, 30, 6009542232577, 'ZA', 'EUR', 1012.605, '8708.29.90', 10, 0),
(382, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Mercedes ML - de Front Runner', 'KRMM002T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1560mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes ML .Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 440, 1730, NULL, 978.9916, 1174.78992, 'KRMM002T Kit de galerie de toit Slimline IIpour une MercedesML (2006-2011) - de Front Runner\\nContient:\\n2 x GOFR001 -Base de pied de rail(Paire) - de Front Runner\\n2 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR070 - Rail élevéintérieurGrab-On / A - de Front Runner\\n1 x RRSTA08 - Plateau Slimline II -1165mm (largeur) x 1560mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 22kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids: 26,0kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1560mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes ML .Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Mercedes ML - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:08', NULL, NULL, 6.3, 27.8, 6009542252384, 'ZA', 'EUR', 978.992, '8708.29.90', 10, 0),
(383, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Outlander (2015-actuel) - de Front Runner', 'KRMO001T', 'Ce kit de galerie complète de toit Slimline II de 1358mm/53,5\'\' de long contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de préhension pour le montage du plateau Slimline II sur les rails de toit de votre Mitsubishi Outlander (PHEV). Ce système s\'installe facilement avec des pieds résistants pour le tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou du fabricant. Aucun perçage n\'est nécessaire.', 450, 1730, NULL, 928.57143, 1114.285716, 'Composé de :\\n3 x GOFR001 - Rail de pied (paire) - par Front Runner\\n3 x GOFR014 - Poignées extérieures à encastrement dans le rail / n° 6 - par Front Runner\\n3 x GOFR034 - Poignées intérieures d\'accrochage à rail affleurant / E - par Front Runner\\n1 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire)\\n1 x RRSTD07 - Plateau Slimline II - 1255mm(L) X 1358mm(L) - par Front Runner\\n\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif au montage 22 kg (48 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'accrochage ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\n\\nDimensions de livraison :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 270mm (11\'\')\\n\\nPoids de la livraison :\\nPoids : 25,3 kg (55,7 livres)', 'Ce kit de galerie complète de toit Slimline II de 1358mm/53,5\'\' de long contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de préhension pour le montage du plateau Slimline II sur les rails de toit de votre Mitsubishi Outlander (PHEV). Ce système s\'installe facilement avec des pieds résistants pour le tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou du fabricant. Aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi Outlander (2015-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:12', NULL, NULL, 10.629927, 26, 6009542243900, 'ZA', 'EUR', 928.571, '8708.29.90', 10, 0),
(384, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Outlander 2 Génération (2007-2013) - par Front Runner', 'KRMO002T', 'Sortez votre Mitsubishi Outlander 2 Gen et restez dehors grâce à cette construction entièrement métallique et à ce système de galerie à revêtement en poudre. Le montage rapide et sûr des accessoires prépare facilement votre Outlander à toute aventure, tandis que la conception modulaire vous permet de retirer des lattes pour dégager l\'accès aux toits ou d\'ajouter des lattes pour une plate-forme de galerie complète.', 440, 1730, NULL, 768.90756, 922.689072, 'Composé de :\\n2 x GOFR001 - Socle de rail de pied (paire) - par Front Runner\\n2 x GORR053 - Grappin extérieur de rail surélevé / n° 4 - par Front Runner\\n2 x GORR070 - Prise intérieure du rail surélevé / A - par Front Runner\\n1 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire) - par Front Runner\\n1 x RRSTD06 - Plateau Slimline II - 1255mm(L) X 1156mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 22,5kg (49,6lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du Plateau Slimline II (50mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 440mm (17,3\'\')\\nLongueur 1730mm (68,1\'\')\\nHauteur 150mm (5,9\'\')\\nPoids de l\'expédition :\\nPoids : 22,8 kg (50,3 lb)', 'Sortez votre Mitsubishi Outlander 2 Gen et restez dehors grâce à cette construction entièrement métallique et à ce système de galerie à revêtement en poudre. Le montage rapide et sûr des accessoires prépare facilement votre Outlander à toute aventure, tandis que la conception modulaire vous permet de retirer des lattes pour dégager l\'accès aux toits ou d\'ajouter des lattes pour une plate-forme de galerie complète.', 'Kit de galerie Slimline II pour une Mitsubishi Outlander 2 Génération (2007-2013) - par Front Runner', 'Galerie|ALL ROOF RACKS|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:07:15', NULL, NULL, 6.3, 22.8, 6009542200118, 'ZA', 'EUR', 768.908, '8708.29', 10, 0),
(385, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour Mitsubishi Pajero/Montero CK (3rd GEN) SWB - de Front Runner', 'KRMP003', 'Lorsque vous n\'avez pas besoin d\'une galerie complète Front Runner, mais que vous souhaitez tout de même gagner un espace intérieur précieux et transporter votre matériel en toute confiance, les barres de charge Front Runner offrent une solution à profil bas et à faible encombrement qui vous permettra de faire passer votre matériel partout.', 115, 1610, NULL, 306.72269, 368.067228, 'KRMP003 -Kit de barres de toit pour Mitsubishi Pajero/Montero CK (3rd GEN) SWB\\nComposé de :\\n2x FASS012 - Paire de pieds / 40mm - 50mm - de Front Runner\\n1x LBSK014 - Paire de barres de toit 1255mm(l) - de Front Runner\\n1x TRMP002 - Rails pour Mitsubishi Pajero CK (3rd Gen)SWB / 1600mm(L) - de Front Runner\\n1x WDLB001 - Déflecteur de vent de barre de charge / 10mm - de Front Runner\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 19.02kg (41.93lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\n\\nLargeur : 115 mm (5\'\')\\nLongueur : 1610mm (63\'\')\\nHauteur : 250mm (10\'\')\\nPoids de la livraison :\\nPoids : 9.4kg (21lbs)', 'Lorsque vous n\'avez pas besoin d\'une galerie complète Front Runner, mais que vous souhaitez tout de même gagner un espace intérieur précieux et transporter votre matériel en toute confiance, les barres de charge Front Runner offrent une solution à profil bas et à faible encombrement qui vous permettra de faire passer votre matériel partout.', 'Kit de barres de toit pour Mitsubishi Pajero/Montero CK (3rd GEN) SWB - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:20', NULL, NULL, 9.8, 9.4, 6009542214252, 'ZA', 'EUR', 306.723, '7616.99', 2, 0),
(386, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB - de Front Runner', 'KRMP004T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm/61.4\'\' pour unMitsubishi Pajero/Montero CK (3e génération) SWBcontient le plateau Slimline II, un déflecteur de vent, 2 rails et 8 pieds de montage pour monter le plateau sur votre véhicule.Le forage est nécessaire pour l’installation.', 450, 1730, NULL, 911.76471, 1094.117652, 'KRMP004T -Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB - de Front Runner\\nComposé de :\\n2 x FASS012 - Paire de pieds / 40mm-50mm - par Front Runner\\n1 x FASS013 - Paire de pieds / 60mm-70mm - par Front Runner\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(L) X 1560mm(L) - par Front Runner\\n1 x TRMP002 - Rails pour Mitsubishi Pajero CK (3rd Gen) SWB / 1600mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 28,7 kg (63,3 livres)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n34,2kg (75.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm/61.4\'\' pour unMitsubishi Pajero/Montero CK (3e génération) SWBcontient le plateau Slimline II, un déflecteur de vent, 2 rails et 8 pieds de montage pour monter le plateau sur votre véhicule.Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:22', NULL, NULL, 5.511814, 34.2, 6009542222035, 'ZA', 'EUR', 911.765, '7616.99', 2, 0),
(387, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero LWB (1991-1999) - de Front Runner', 'KRMP007L', ' Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Mitsubishi Pajero LWB (1991-1999) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1273.10924, 1527.731088, ' \\nKRMP007L - Kit de galerie pour une Mitsubishi Pajero LWB (1991-1999) - Slimline II de Front Runner \\n  \\nContient : \\n2 x LASP104 - Pied Plus nº 4 180mm (Paire) \\n1 x LASS104 - Pied nº 4 170mm (Paire) \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTG11 - Plateau Slimline II - 1345mm (largeur) x 2166mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 33kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 38,0kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Mitsubishi Pajero LWB (1991-1999) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero LWB (1991-1999) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:27', NULL, NULL, 5.511814, 38, 6009542225845, 'ZA', 'EUR', 1273.109, '7616.99', 10, 0),
(388, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport (2008-2015) - de Front Runner', 'KRMP009T', 'Ce kit de galerie complet de 1762mm/69,4\'\' de long pour le transport de matériel Slimline II pour le Mitsubishi Pajero Sport (2008-2015) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. L\'installation peut nécessiter un perçage.', 450, 1730, NULL, 987.39496, 1184.873952, 'Composé de :\\n3 x FASS012 - Foot Set / 40mm-50mm - par Front Runner\\n1 x RRSTA09 - Plateau Slimline II - 1165mm(L) X 1762mm(L) - par Front Runner\\n1 x TRMP004 - Mitsubishi Pajero Sport Tracks / 1900mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 30,4 kg (67,1 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n34.0kg (75.0lbs)', 'Ce kit de galerie complet de 1762mm/69,4\'\' de long pour le transport de matériel Slimline II pour le Mitsubishi Pajero Sport (2008-2015) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. L\'installation peut nécessiter un perçage.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport (2008-2015) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:30', NULL, NULL, 5.511814, 34, 6009542224350, 'ZA', 'EUR', 987.395, '7616.99', 5, 0),
(389, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero SWB (2ième génération) - de Front Runner', 'KRMP012T', 'Ce kit de galerie complète Slimline II de 1560mm/61,4\'\' de long pour le transport de matériel sur le toit du Mitsubishi Pajero/Montero SWB 2nd Gen contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. L\'installation nécessite un forage.', 450, 1730, NULL, 911.76471, 1094.117652, 'Composé de :\\n2 x FASS012 - Foot Set / 40mm-50mm - par Front Runner\\n1 x FASS013 - Foot Set / 60mm-70mm - par Front Runner\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(L) X 1560mm(L) - par Front Runner\\n1 x TRMP005 - Mitsubishi Pajero SWB Tracks / 1620mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 28,7 kg (63,2 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n34,2kg (75.0lbs)', 'Ce kit de galerie complète Slimline II de 1560mm/61,4\'\' de long pour le transport de matériel sur le toit du Mitsubishi Pajero/Montero SWB 2nd Gen contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. L\'installation nécessite un forage.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero SWB (2ième génération) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:34', NULL, NULL, 5.511814, 34.2, 6009542222011, 'ZA', 'EUR', 911.765, '8708.29.90', 0, 0),
(390, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mitsubishi Pajero LWB / Montage sur gouttière - de Front Runner', 'KRMP014', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 155mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1445, NULL, 273.10924, 327.731088, 'KRMP014 -Kit de barres de toit pour une Mitsubishi Pajero LWB / Montage sur gouttière - de Front Runner\\n\\nContient :\\n2 x LASS103 - Pied N° 3 155mm (Paire) - de Front Runner\\n1 x LBSK015 - Paire de barres de toit 1345mm l - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 7kg (16lbs) \\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1445mm (57\'\')\\nHauteur :175mm (7\'\')\\n\\nPoids de la livraison : 8.5kg (18.8lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 155mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Mitsubishi Pajero LWB / Montage sur gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:37', NULL, NULL, 6.889767, 8.6, 6009542232256, 'ZA', 'EUR', 273.109, '8708.29.90', 10, 0),
(391, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mitsubishi Pajero Sport / Pieds AND Rails - de Front Runner', 'KRMP016', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1165mm, 2 rails pour une Mitsubishi Pajero Sport de 1900mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 120, 1910, NULL, 323.52941, 388.235292, 'KRMP016 - Kit de barres de toit pour une Mitsubishi Pajero Sport / Pieds Rails - de Front Runner \\n\\nContient:\\n2 x FASS012 - Paire de Pieds / 40mm-50mm - de Front Runner\\n1 x LBSK013 - Paire de Barres de toit 1165mm - de Front Runner\\n1 x TRMP004 - Rails pour une Pajero Sport / 1900mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :9kg (19lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm(5\'\')\\nLongueur : 1910mm(75\'\')\\nHauteur : 180mm(7\'\')\\n\\nPoids de la livraison:\\n9.9kg (21.8lbs)', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1165mm, 2 rails pour une Mitsubishi Pajero Sport de 1900mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour une Mitsubishi Pajero Sport / Pieds AND Rails - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:38', NULL, NULL, 7.086618, 9.9, 6009542232270, 'ZA', 'EUR', 323.529, '7616.99', 5, 0),
(392, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mitsubishi Pajero SWB (1992-1999) / Rails AND Pieds - de Front Runner', 'KRMP017', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 2 pieds de 40mm, 2 pieds de 60mm, 2 barres de toit de 1165mm, 2 rails pour une Mitsubishi Pajero SWB de 1620mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 110, 1625, NULL, 298.31933, 357.983196, 'KRMP017 - Barres de toit 1165mm de Front Runner / Kit pour une Mitsubishi Pajero SWB \\n\\nComposé de :\\n1 x FASS001 - Pied 40mm (Paire)\\n1 x FASS003 - Pied 60mm (Paire)\\n1 x LBSK013 - Barres de toit 1165mm (Paire)\\n1 x TRMP005 - Rails pour une Pajero SWB 1620mm (Paire G/D)\\n1 x WDLB001 - Déflecteur de vent de 10mm\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :8kg (18lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 110mm(4\'\')\\nLongueur : 1625mm (64\'\')\\nHauteur : 180mm(7\'\')\\n\\nPoids de la livraison :\\n9.4kg (20.7lbs)', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 2 pieds de 40mm, 2 pieds de 60mm, 2 barres de toit de 1165mm, 2 rails pour une Mitsubishi Pajero SWB de 1620mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour une Mitsubishi Pajero SWB (1992-1999) / Rails AND Pieds - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:07:38', NULL, NULL, 7.086618, 9.4, 6009542232287, 'ZA', 'EUR', 298.319, '7616.99', 0, 0),
(393, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport (Séries QE) - de Front Runner', 'KRMP017T', 'La galerie Slimline II pour toute la longueur du toit de 1964mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Pajero Sport (Séries QE). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 1054.62185, 1265.54622, 'KRMP017T - Kit de galerie Slimline II pour une Pajero Sport (Séries QE)\\n\\nContient:\\n1 x FAMP002 - Pieds de rails 90mm pour une Mitsubishi Pajero Sport Séries QE\\n1 x RRSTA10 - Plateau Slimline II - 1165mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 32kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 37,8kg', 'La galerie Slimline II pour toute la longueur du toit de 1964mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Pajero Sport (Séries QE). Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport (Séries QE) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:08:00', NULL, NULL, 5.511814, 37.1, 6009542239439, 'ZA', 'EUR', 1054.622, '8708.29.90', 4, 0),
(394, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero CK/BK LWB - de Front Runner', 'KRMP018T', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre Mitsubishi Pajero CK/BK LWB. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 440, 1730, NULL, 1231.09244, 1477.310928, 'KRMP018T - Kit de galerie Slimline II pour une Mitsubishi Pajero 2006 - jusqu’à présent\\nComposé de :\\n1 x FAMP001 - Pied de rail pour une Mitsubishi Pajero CK LWB 81mm\\n1 x RRSTD11 - Plateau Slimline II - 1255mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 34kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 630mm\\nLongueur : 1640mm\\nHauteur : 160mm\\nPoids de la livraison : 39,4kg', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre Mitsubishi Pajero CK/BK LWB. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero CK/BK LWB - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:08:05', NULL, NULL, 9.6, 42, 6009542241289, 'ZA', 'EUR', 1231.092, '8708.29.90', 10, 0),
(395, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II Grab-On pour une Mitsubishi Pajero Sport (2008-2016) - de Front Runner', 'KRMP021T', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1762mm contient le plateau Slimline II, un déflecteur devent et 3 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Mitsubishi Pajero Sport (2008-2016). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 1012.60504, 1215.126048, 'Contient:\\n3 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n3 x GORR052 - Rail élevéextérieurGrab-On / N° 3 - de Front Runner\\n2 x GORR071 - Rail élevéintérieurGrab-On / B - de Front Runner\\n1 x RRAC904 - Espaceur en plastiquepour pied de rail / 10mm (paire)\\n1 x RRSTA09 - Plateau Slimline II -1165mm (largeur) x 1762mm (longueur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 25kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 28,9kg', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1762mm contient le plateau Slimline II, un déflecteur devent et 3 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Mitsubishi Pajero Sport (2008-2016). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II Grab-On pour une Mitsubishi Pajero Sport (2008-2016) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:10', NULL, NULL, 11.220478, 29.6, 6009542252285, 'ZA', 'EUR', 1012.605, '7616.99', 10, 0),
(396, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero SWB (2006-actuel) - de Front Runner', 'KRMP022T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre MitsubishiPajero SWB. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 455, 1730, NULL, 735.29412, 882.352944, 'Composé de :\\n2 x GOFR001 - Base de pied de rail (paire) - de Front Runner\\n2 x GORR052 - Rail élevé extérieur Grab-On / N° 3 - de Front Runner\\n2 x GORR071 - Rail élevé intérieur Grab-On / B - de Front Runner\\n1 x RRAC904 - Espaceur en plastique pour base de pied de rail / 10mm (paire)\\n1 x RRSTA06 - Plateau Slimline II - 1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extra étroit (paire) / 1165mm (largeur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 20kg (43lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 285mm (11\'\')\\nPoids de la livraison :\\nPoids : 22.7kg (49.9lbs)', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre MitsubishiPajero SWB. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero SWB (2006-actuel) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 11:08:13', NULL, NULL, 11.220478, 23.1, 6009542252360, 'ZA', 'EUR', 735.294, '7616.99', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(397, 1, 2, NULL, NULL, NULL, 'Mitsubishi Pajero L040 (1982-1990) Slimline II Roof Rack Kit - by Front Runner', 'KRMP023T', 'Gear up your 1982-1990 Mitsubishi Pajero L040 for your greatest adventures with this Slimline II Roof Rack Kit. Installation is simple and drill-free, so you can get on the road as quick as you can strap your gear in.', 440, 1730, NULL, 1323.5294, 1588.23528, 'KRMP023T - Mitsubishi Pajero L040 (1982-1990) Slimline II Roof Rack Kit - by Front RunnerConsisting of: 4x LASS104 - No 4 Leg 170mm (Pair)1x RRSTG12 - SLII Tray - 1345mm(W)X2368mm(L)Material Used:Black epoxy powder - coated T6 aluminiumHigh strength steelApproximate Installed Weight: 41.09kg (90.59lbs) The t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.To determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Foot or Grab-on Foot listed above.If your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Legs to determine the height of the rack from your vehicle\'s rain gutters.If your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof.Shipping Dimensions:Width: 440mm (17\'\')Length: 1730mm (68\'\')Height: 270mm (11\'\')Shipping Weight:Weight: 44kg (97lbs)', 'Gear up your 1982-1990 Mitsubishi Pajero L040 for your greatest adventures with this Slimline II Roof Rack Kit. Installation is simple and drill-free, so you can get on the road as quick as you can strap your gear in.', 'Mitsubishi Pajero L040 (1982-1990) Slimline II Roof Rack Kit - by Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:17', NULL, NULL, 10.6, 44, 6009542232690, 'ZA', 'EUR', 1323.529, '8708.29.90', 10, 0),
(398, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB - de Front Runner', 'KRMPT04T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm/61.4\'\' pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB contient un plateau Slimline II, un déflecteur de vent 2 rails et 6 pieds. Ce kit ‘haut’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. Le forage est nécessaire pour l’installation.', 450, 1730, NULL, 920.16807, 1104.201684, 'KRMPT04T - Kit de galerie pour une Mitsubishi Pajero CK (3ième génération) SWB - Slimline II de Front Runner\\nContient:\\n3 x FASS003 - Pied 60mm (Paire)\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(l) X 1560mm(L) - de Front Runner\\n1 x TRMP002 - Rails pour une Pajero CK SWB 1600mm (Paire G/D)- de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 29.0kg (64.0lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64.0\'\')\\nHauteur : 140mm(6.0\'\')\\n\\nPoids de la livraison :\\n34.5kg (76.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm/61.4\'\' pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB contient un plateau Slimline II, un déflecteur de vent 2 rails et 6 pieds. Ce kit ‘haut’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero/Montero CK (3ième génération) SWB - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:20', NULL, NULL, 5.511814, 34.4, 6009542220918, 'ZA', 'EUR', 920.168, '8708.29.90', 2, 0),
(399, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero LWB (1991-1999) / Haut - de Front Runner', 'KRMPT07L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Mitsubishi Pajero LWB (1991-1999) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1205.88235, 1447.05882, 'KRMPT07L - Kit de galerie pour une Mitsubishi Pajero LWB (1991-1999) / Large - Slimline II de Front Runner\\n\\nComposé de :\\n2 x LASS105 - Pied nº 5 190mm (Paire)\\n1 x LASS106 - Pied nº 6 195mm (Paire)\\n1 x RRSTG11 - Plateau Slimline II - 1345mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation:33kg (72lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison :\\n38.1kg (83.9lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Mitsubishi Pajero LWB (1991-1999) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero LWB (1991-1999) / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:22', NULL, NULL, 5.511814, 38.2, 6009542226262, 'ZA', 'EUR', 1205.882, '7616.99', 10, 0),
(400, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport / Large - de Front Runner', 'KRMPT09T', 'Ce kit de galerie complète de toit Slimline II de 1762mm/69,4\'\' de long pour le transport de matériel sur la Mitsubishi Pajero Sport contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. Ce kit plus grand permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie. Des perçages peuvent être nécessaires pour l\'installation.', 450, 1730, NULL, 995.79832, 1194.957984, 'KRMPT09T - Kit de galerie de toit Mitsubishi Pajero Sport Slimline II / Grand - par Front Runner\\nComposé de :\\n3 x FASS013 - Foot Set / 60mm-70mm - par Front Runner\\n1 x RRSTA09 - Plateau Slimline II - 1165mm(L) X 1762mm(L) - par Front Runner\\n1 x TRMP004 - Mitsubishi Pajero Sport Tracks / 1900mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 30,8 kg (68,0 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n34,4kg (76,0lbs)', 'Ce kit de galerie complète de toit Slimline II de 1762mm/69,4\'\' de long pour le transport de matériel sur la Mitsubishi Pajero Sport contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. Ce kit plus grand permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie. Des perçages peuvent être nécessaires pour l\'installation.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero Sport / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:25', NULL, NULL, 5.511814, 34.4, 6009542224787, 'ZA', 'EUR', 995.798, '7616.99', 5, 0),
(401, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Pajero SWB (1991-1999) / Large - de Front Runner', 'KRMPT12T', 'Ce kit de galerie complète Slimline II de 1560mm/61,4\'\' de long pour le toit du Mitsubishi Pajero SWB (1991-1999) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. Ce kit plus grand permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie. Des perçages sont nécessaires pour l\'installation.', 450, 1730, NULL, 911.76471, 1094.117652, 'Composé de :\\n2 x FASS012 - Foot Set / 40mm-50mm - par Front Runner\\n1 x FASS013 - Foot Set / 60mm-70mm - par Front Runner\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(L) X 1560mm(L) - par Front Runner\\n1 x TRMP005 - Mitsubishi Pajero SWB Tracks / 1620mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 28,7 kg (63,2 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n34,2kg (75.0lbs)', 'Ce kit de galerie complète Slimline II de 1560mm/61,4\'\' de long pour le toit du Mitsubishi Pajero SWB (1991-1999) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds. Ce kit plus grand permet de monter les tables Front Runner ou d\'autres accessoires compatibles sous la galerie. Des perçages sont nécessaires pour l\'installation.', 'Kit de galerie Slimline II pour une Mitsubishi Pajero SWB (1991-1999) / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:51', NULL, NULL, 5.511814, 34.2, 6009542222028, 'ZA', 'EUR', 911.765, '7616.99', 0, 0),
(402, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Mahindra Scorpio - de Front Runner', 'KRMS001L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Mahindra Scorpio contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1180.67227, 1416.806724, 'KRMS001L - Kit de galerie pour une Mahindra Scorpio - Slimline II de Front Runner\\n\\nContient:\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n2 x LASS105 - Pied nº 5 190mm (Paire)\\n1 x LASS106 - Pied nº 6 195mm (Paire)\\n1 x RRSTJ10 - Plateau Slimline II - 1425mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 32kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\n\\nPoids de la livraison : 37,3kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Mahindra Scorpio contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour un Mahindra Scorpio - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:54', NULL, NULL, 5.511814, 37.5, 6009542225852, 'ZA', 'EUR', 1180.672, '7616.99', 10, 0),
(403, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails OEM (2006-jusqu\'à présent) / Haut- par Front Runner', 'KRMS002T', 'Ce kit de galerie de toit Slimline II de3120mm/122.8\'\' de long et full size pour le Sprinter Mercedes Benz ( 2006 - jusqu\'à présent) contient 2 plateaux Slimline II, un déflecteur de vent et 12 pieds. S\'installe facilement sur les rails de toit d\'origine , sans qu\'il soit nécessaire de percer.', 440, 1730, NULL, 1869.7479, 2243.69748, 'KRMS002T -Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170\'\'/L3/LWB avec rails OEM (2006-jusqu\'à présent) / Haut- par Front Runner\\nComposé de :\\n6 x FASS013 - Pieds / 60mm-70mm - par Front Runner\\n6 x RRAC907 - Stud Plate MB Sprinter Track\\n2 x RRSTM08 - Plateau Slimline II - 1475mm(L) x 1560mm(L) - par Front Runner\\n1 x WDST009 - Déflecteur de vent 20mm paire de large à lèvres / 1345mm(W) - par Front Runner\\n Matériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 51kg (112lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et des profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de porte-bagages de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur du porte-bagages par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 215mm (8\'\')\\nPoids de l\'expédition :\\nPoids : 59,4 kg (130,7 lbs)', 'Ce kit de galerie de toit Slimline II de3120mm/122.8\'\' de long et full size pour le Sprinter Mercedes Benz ( 2006 - jusqu\'à présent) contient 2 plateaux Slimline II, un déflecteur de vent et 12 pieds. S\'installe facilement sur les rails de toit d\'origine , sans qu\'il soit nécessaire de percer.', 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails OEM (2006-jusqu\'à présent) / Haut- par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:08:57', NULL, NULL, 12.2, 61, 6009542264585, 'ZA', 'EUR', 1869.748, '8708.29.90', 10, 0),
(404, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Mahindra Scorpio / Montage pour gouttière - de Front Runner', 'KRMS003', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1545, NULL, 289.91597, 347.899164, 'KRMS003 - Barres de toit 1425mm de Front Runner / Kit pour une Mahindra Scorpio\\nContient :\\n2 x LASS105 - Pied N° 5 190mm (Paire) - de Front Runner\\n1 x LBSK016 - Paire de barres de toit / 1425mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent / 10mm - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 8kg (17lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1545mm (61\'\')\\nHauteur :175mm (7\'\')\\nPoids de la livraison:\\n8.9kg (19.7lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Mahindra Scorpio / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:09:01', NULL, NULL, 6.889767, 9.1, 6009542232294, 'ZA', 'EUR', 289.916, '7616.99', 10, 0),
(405, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 144in/170in / L2/L3 / MWB/LWB avec rails OEM (2006-jusqu\'à présent) - de Front Runner', 'KRMS004T', 'Le kit de galerie Slimline II pour toute la longueur du toit de2772mm/109\'\' pour une Mercedes Benz Sprinter contient le plateau Slimline II, un déflecteur de vent et 8 pieds. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. Ce kit de galerie correspond uniquement au \'toit haut\', il ne correspond pas au \'toit standard/bas\'.', 450, 1730, NULL, 1449.57983, 1739.495796, 'KRMS004T - Kit de galerie pour une Mercedes Benz Sprinter (2006-jusqu’à présent) - Slimline II de Front Runner\\n\\nComposé de :\\n4 x FASS013 - Jeu de pieds / 60mm-70mm - par Front Runner\\n4 x RRAC907 - Piste de sprint MB à plaque de goujon\\n1 x RRSTM14 - Plateau Slimline II - 1475mm(L) X 2772mm(L) - par Front Runner\\n1 x WDST009 - Paire de déflecteurs de vent de 20 mm de large / 1345 mm(L) - par Front Runn\\n\\nMatériaux utilisés:\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 39kg (86lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur :