eur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1800mm (71\'\')\\nHauteur 390mm (15\'\')\\nPoids de l\'expédition :\\nPoids : 79.3 kg (174.5 lbs)', 'Ce kit de galerie de toit complète Slimline II de 3928mm/154,7\'\' de long pour le Mercedes Benz Sprinter sans rails OEM, contient 2 plateaux Slimline II, un déflecteur de vent, un ensemble de rails et 16 pieds. Ce kit plus haut offre de l\'espace pour le montage des tables Front Runner ou d\'autres accessoires compatibles sous le porte-bagages. Un perçage est nécessaire pour l\'installation.', 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/ LWB sans rails d\'origine (2006-jusqu\'à présent) / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:09:49', NULL, NULL, 15.354339, 79.3, 6009542265452, 'ZA', 'EUR', 2626.05, '8708.29.90', 10, 0),
(412, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails d\'origine OEM (2006-actuel) - par Front Runner', 'KRMS011T', 'Ce kit de galerie de toit complète Slimline II de 3928mm/154,7\'\' de long pour le Sprinter Mercedes Benz avec rails OEM, contient 2 plateaux Slimline II, un déflecteur de vent et 16 pieds. S\'installe facilement sur les points de montage de l\'usine sans qu\'il soit nécessaire de percer.', 450, 1730, NULL, 2239.4958, 2687.39496, 'KRMS011T - Mercedes Sprinter 170\'\'/LWBw/oOEMTRK(\'06-actuel )SLII\\nComposé de :\\n8 x FASS012 - Jeu de pieds / 40mm-50mm - par Front Runner\\n8 x RRAC907 - Piste de sprint MB à plaque de goujon\\n2 x RRSTM10 - Plateau Slimline II - 1475mm(L) X 1964mm(L) - par Front Runner\\n1 x WDST009 - Paire de déflecteurs de vent de 20 mm de large aux lèvres / 1345 mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 61kg (135lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 354mm (14\'\')\\nPoids de l\'expédition :\\nPoids 71,1kg (156,5lbs)', 'Ce kit de galerie de toit complète Slimline II de 3928mm/154,7\'\' de long pour le Sprinter Mercedes Benz avec rails OEM, contient 2 plateaux Slimline II, un déflecteur de vent et 16 pieds. S\'installe facilement sur les points de montage de l\'usine sans qu\'il soit nécessaire de percer.', 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails d\'origine OEM (2006-actuel) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:09:53', NULL, NULL, 13.937015, 71.1, 6009542265476, 'ZA', 'EUR', 2239.496, '7613.00', 10, 0),
(413, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails d\'origine (2006-jusqu\'à présent) / Haut - de Front Runner', 'KRMS012T', 'Ce kit de galerie de toit complète Slimline II de 3928mm/154,7\'\' de long pour le Mercedes Benz Sprinter avec rails OEM, contient 2 plateaux Slimline II, un déflecteur de vent et 16 pieds. Ce kit plus haut offre de l\'espace pour le montage des tables Front Runner ou d\'autres accessoires compatibles sous la galerie. S\'installe facilement sur les points de montage d\'usine sans qu\'il soit nécessaire de percer.', 450, 1730, NULL, 2264.70588, 2717.647056, 'KRMS012T - Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170\'\'/L3/LWB avec rails d\'origine (2006-jusqu\'à présent) / Haut - de Front Runner\\nComposé de :\\n8 x FASS013 - Jeu de pieds / 60mm-70mm - par Front Runner\\n8 x RRAC907 - Piste de Sprinter MB à plaque de goujon\\n2 x RRSTM10 - Plateau Slimline II - 1475mm(L) X 1964mm(L) - par Front Runner\\n1 x WDST009 - Paire de déflecteurs de vent de 20 mm de large 1345 mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 62kg (136lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 354mm (14\'\')\\nPoids de l\'expédition :\\nPoids 72,1kg (158,6lbs)', 'Ce kit de galerie de toit complète Slimline II de 3928mm/154,7\'\' de long pour le Mercedes Benz Sprinter avec rails OEM, contient 2 plateaux Slimline II, un déflecteur de vent et 16 pieds. Ce kit plus haut offre de l\'espace pour le montage des tables Front Runner ou d\'autres accessoires compatibles sous la galerie. S\'installe facilement sur les points de montage d\'usine sans qu\'il soit nécessaire de percer.', 'Kit de galerie Slimline II pour une Mercedes Benz Sprinter 170in/L3/LWB avec rails d\'origine (2006-jusqu\'à présent) / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:09:57', NULL, NULL, 13.937015, 72.1, 6009542265469, 'ZA', 'EUR', 2264.706, '8708.29.90', 10, 0),
(414, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour uneMahindra Scorpio / Large - de Front Runner', 'KRMST01L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Mahindra Scorpio contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1197.47899, 1436.974788, 'KRMST01L - Kit de galerie pour une Mahindra Scorpio / Large - Slimline II de Front Runner\\n\\nContient:\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n2 x LASS107 - Pied nº 7 225mm (Paire)\\n1 x LASS108 - Pied nº 8 250mm (Paire)\\n1 x RRSTJ10 - Plateau Slimline II - 1425mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 33kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 38,2kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour une Mahindra Scorpio contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour uneMahindra Scorpio / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:10:02', NULL, NULL, 5.511814, 38.3, 6009542226279, 'ZA', 'EUR', 1197.479, '7616.99', 10, 0);
