(415, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Mitsubishi Triton/L200/5ième génération (2015-jusqu’à présent) - de Front Runner', 'KRMT002T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Mitsubishi Triton double cabine. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 768.90756, 922.689072, 'KRMT002T - Kit de galerie pour une Mitsubishi Triton/L200/5ième génération (2015 - jusqu’à présent) - Slimline II de Front Runner\\nComposé de :\\n1 x FAMT001 - Pieds de rails pour une Mitsubishi Triton L200 5ième génération (Paire G/D) 82mm\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 25kg (55lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm(18\'\')\\nLongueur : 1615mm(64\'\')\\nHauteur : 140mm(6\'\')\\nPoids de la livraison : 29.3kg (64.5lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Mitsubishi Triton double cabine. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Mitsubishi Triton/L200/5ième génération (2015-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:10:04', NULL, NULL, 5.511814, 28.6, 6009542237008, 'ZA', 'EUR', 768.908, '8708.29.90', 10, 0),
(416, 1, 2, NULL, NULL, NULL, 'Kit de galerie pour une Mercedes Benz V-Class LWB (2014-jusqu’à présent) - de Front Runner', 'KRMV006T', 'La galerieSlimline II pour toute la longueur du toit de 2772mm contient le plateauSlimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateauSlimline II sur votre Mercedes Benz V-Class. S’installe facilement en utilisantles points de montage d’origine. Le forage n’est pas nécessaire.', 455, 1730, NULL, 1542.01681, 1850.420172, 'KRMV006T - Kit de galerie pour une Mercedes BenzV-Class (2014-jusqu’à présent) - de Front Runner\\nContient: \\n1 x FAMV001 - Pieds de railpour une Mercedes Benz V Class (2014-jusqu’à présent) - de Front Runner\\n1 x RRSTJ14 - Plateau SlimlineII - 1425mm (largeur) x 2772mm (longueur) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 44kg\\n\\nLa rainure en T sur le haut et sur le bas duplateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que lagalerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toitavec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455mm\\nLongueur 1615mm\\nHauteur 235mm\\n\\nPoidsde livraison :\\nPoids : 51.6kg', 'La galerieSlimline II pour toute la longueur du toit de 2772mm contient le plateauSlimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateauSlimline II sur votre Mercedes Benz V-Class. S’installe facilement en utilisantles points de montage d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie pour une Mercedes Benz V-Class LWB (2014-jusqu’à présent) - de Front Runner', 'Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galerie|Galeries pour camionettes', 0, 1, '2022-01-07 11:10:09', NULL, NULL, 9.251974, 52.9, 6009542251738, 'ZA', 'EUR', 1542.017, '8708.29.90', 10, 0),
(417, 1, 2, NULL, NULL, NULL, 'Kit de 1/2 galerie pour une Mercedes Benz V-Class LWB (2014-jusqu’à présent) - de Front Runner', 'KRMV007T', 'La galerieSlimline II pour toute la longueur du toit de 1358mm/ 53.5\'\' contient le plateauSlimline II, un déflecteur de vent et 2 foot rails pour monter le plateauSlimline II sur votre Mercedes Benz V-Class. S’installe facilement en utilisantles points de montage d’origine. Le forage n’est pas nécessaire.\\nNOTE : Ce kit convient uniquement à l\'empattement long de 3200mm/125.98\'\' (Longueur du véhicule : 5140mm/202.36\'\').', 455, 1730, NULL, 995.79832, 1194.957984, 'KRMV007T Kit de1/2galerie pour une MercedesBenz V-Class (2014-jusqu’à présent) - de Front Runner\\nComposé de :\\n1 x FAMV001 - Pieds de rail pour une Mercedes Benz V Class (2014-jusqu’à présent) - de Front Runner\\n1 x RRSTJ07 - PlateauSlimline II - 1425mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids de livraison :\\nPoids : 36.6kg(80.6lbs)', 'La galerieSlimline II pour toute la longueur du toit de 1358mm/ 53.5\'\' contient le plateauSlimline II, un déflecteur de vent et 2 foot rails pour monter le plateauSlimline II sur votre Mercedes Benz V-Class. S’installe facilement en utilisantles points de montage d’origine. Le forage n’est pas nécessaire.\\nNOTE : Ce kit convient uniquement à l\'empattement long de 3200mm/125.98\'\' (Longueur du véhicule : 5140mm/202.36\'\').', 'Kit de 1/2 galerie pour une Mercedes Benz V-Class LWB (2014-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:10:14', NULL, NULL, 9.842525, 37.1, 6009542251684, 'ZA', 'EUR', 995.798, '8708.29.90', 10, 0),
(418, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Mercedes Viano (2003-2014) - de Front Runner', 'KRMV009T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1964mm contient leplateau Slimline II, un déflecteur de vent et 3 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes Viano(2003-2014). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 455, 1730, NULL, 1214.28571, 1457.142852, 'Contient:\\n3 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n3 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR070 - Rail élevéintérieurGrab-On / A - de Front Runner\\n2 x RRAC904 - Espaceur en plastiquepour base de pied de rail / 10mm (paire)\\n1 x RRSTG10 - Plateau Slimline II -1345mm (largeur) x 1964mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 30kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 34,5kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1964mm contient leplateau Slimline II, un déflecteur de vent et 3 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Mercedes Viano(2003-2014). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Mercedes Viano (2003-2014) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:10:18', NULL, NULL, 11.220478, 35.4, 6009542252322, 'ZA', 'EUR', 1214.286, '8708.29', 10, 0),
(419, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Mercedes Benz V-Class XLWB (2014-jusqu\'à présent) - de Front Runner', 'KRMV010T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 2772 mm contient le plateau Slimline II, undéflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II survotre V-Class XLWB. Le plateau s’installe facilement en utilisant les points demontage existants. Le forage n’est pas nécessaire.', 455, 1730, NULL, 1525.21008, 1830.252096, 'KRMV010T - Kit de galerie de toit Slimline II pourune Mercedes Benz V-Class XLWB\\nComposé de :\\n1 x FAMV002 - Foot Rails pour une Mercedes BenzV-Class XLWB (2014-jusqu’à présent) - de Front Runner\\n1 x RRSTJ14 - Plateau Slimline II - 1425 mml x 2772 mm L- de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 51.98kg (114.6lbs)\\nLa rainure en T sur le haut et sur le bas du plateaude la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation dela galerie pour que la galerie ne touche pas le pavillon du véhicule, bienvérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur dela patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds,ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pourdéterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds derails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedsde rails pour déterminer la hauteur de la galerie à partir du point le plushaut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 455 mm(18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 235 mm(9\'\')\\n\\nPoids de la livraison :\\n51.53kg (113lbs)', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 2772 mm contient le plateau Slimline II, undéflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II survotre V-Class XLWB. Le plateau s’installe facilement en utilisant les points demontage existants. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Mercedes Benz V-Class XLWB (2014-jusqu\'à présent) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II|Galeries pour camionettes', 0, 1, '2022-01-07 11:10:22', NULL, NULL, 9.251974, 51.5, 6009542260297, 'ZA', 'EUR', 1525.21, '8708.29.90', 9, 0),
(420, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II ½ pour une Mercedes Benz V-Class XLWB (2014-jusqu\'à présent) - de Front Runner', 'KRMV011T', 'Ce kit de galerie Slimline II 1/2 de 1358mm/53.5” contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau Slimline II sur votre V-Class XLWB. Le plateaus’installe facilement en utilisant les points de montage existants. Le foragen’est pas nécessaire.', 455, 1730, NULL, 978.9916, 1174.78992, 'KRMV011T - Kit de galerie de toit SlimlineII 1/2 pour une Mercedes Benz V-Class XLWB\\nComposé de :\\n1 x FAMV002 - Foot rails pour uneMercedes Benz V-Class XLWB (2014-jusqu’à présent) - de Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425 mmlargeur x 1358 mm longueur - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 35.84kg (79.01lbs)\\nLa rainure en T sur le haut et sur le basdu plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin depieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin depieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 455 mm(18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 240mm (9\'\')\\nPoids de la livraison : \\n35.72kg (79lbs)', 'Ce kit de galerie Slimline II 1/2 de 1358mm/53.5” contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau Slimline I