(428, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Navara/Frontier D23 3ième Gén (2004-2020) - de Front Runner', 'KRNN002T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour installer le plateau Slimline II sur votre Nissan Navara/Frontier D23 Double Cabine. Le forage est nécessaire.', 450, 1730, NULL, 819.32773, 983.193276, 'KRNN002T -Kit de galerie Slimline II pour une Nissan Navara/Frontier D23 3ième Gén (2004-2020) - de Front Runner\\nComposé de :\\n1 x FANN002 - Pied de rail pour une Nissan Navara/Frontier D23 DC - de Front Runner\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 26kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 240mm\\nPoids de la livraison :\\nPoids : 30,3kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour installer le plateau Slimline II sur votre Nissan Navara/Frontier D23 Double Cabine. Le forage est nécessaire.', 'Kit de galerie Slimline II pour une Nissan Navara/Frontier D23 3ième Gén (2004-2020) - de Front Runner', 'Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galerie|Galeries pour benne', 0, 1, '2022-01-07 11:11:43', NULL, NULL, 9.448824, 30.7, 6009542244136, 'ZA', 'EUR', 819.328, '8708.29.90', 9, 0),
(429, 1, 2, NULL, NULL, NULL, 'Kit Galerie de toit Slimline II pour Nissan NV200 (2009-actuel) - par Front Runner', 'KRNN003T', 'Transportez encore plus de matériel avec votre Nissan NV200 Compact Cargo (2009-actuel) grâce au Kit Galerie de toit Slimline II. Gardez l\'intérieur de votre van ouvert et flexible en transportant votre équipement d\'aventure ou de travail sur votre toit.', 440, 1805, NULL, 928.57143, 1114.285716, 'Composé de :\\n2x FASS012 - Set de pieds / 40mm - 50mm\\n1x FASS013 - Jeu de pieds / 60mm - 70mm\\n1x RRSTD08 - Plateau SLII - 1255mm(W)X1560mm(L)\\n1x TRAC010 - Rail universel non percé / 1800mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 29.86kg (65.83lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profils de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1805mm (71\'\')\\nHauteur : 270mm (11\'\')\\nPoids à la livraison :\\nPoids : 29.2kg (64lbs)', 'Transportez encore plus de matériel avec votre Nissan NV200 Compact Cargo (2009-actuel) grâce au Kit Galerie de toit Slimline II. Gardez l\'intérieur de votre van ouvert et flexible en transportant votre équipement d\'aventure ou de travail sur votre toit.', 'Kit Galerie de toit Slimline II pour Nissan NV200 (2009-actuel) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|ALL ROOF RACKS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:11:48', NULL, NULL, 10.6, 29.2, 6009542217673, 'ZA', 'EUR', 928.571, '8708.29.90', 10, 0),
(430, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Navara (2014-jusqu\'à présent) - de Front Runner', 'KRNN004T', 'La galerie Slimline II pour toute la longueur du toit de 1156mm/45.5” contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab On pour monter le plateau Slimline II sur votre Nissan Navara. Le plateau s’installe facilement en installant le pied sur les rails d\'origines. Aucune modification n’est nécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'KRNN004T- Kit de galerie Slimline II pour une Nissan Navara (2014-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n2 x GORR053 - Rail élevéextérieurGrab-On / N° 4 - de Front Runner\\n2 x GORR072 - Rail élevéintérieurGrab-On / C - de Front Runner\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 20kg (43lbs)\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm(18\'\')\\nLongueur1610mm(63\'\')\\nHauteur285mm(11\'\')\\n\\nPoidsde la livraison :Poids : 22.7kg (50.0lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1156mm/45.5” contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab On pour monter le plateau Slimline II sur votre Nissan Navara. Le plateau s’installe facilement en installant le pied sur les rails d\'origines. Aucune modification n’est nécessaire.', 'Kit de galerie Slimline II pour une Nissan Navara (2014-jusqu\'à présent) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:11:51', NULL, NULL, 11.220478, 22.9, 6009542252353, 'ZA', 'EUR', 710.084, '8708.29.90', 10, 0),
(431, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Patrol Y61 - par Front Runner', 'KRNP004L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Nissan Patrol Y61 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1239.4958, 1487.39496, 'KRNP004L - Kit de galerie Slimline II pour une Nissan Patrol Y61 - par Front Runner\\nComposé de :\\n3 x No°1 Pied 120mm (paire) - par Front Runner\\n1 x No°2 Pied 130mm (paire) - par Front Runner\\n1 x RRSTG11 - Slimline II Plateau - 1345mm(L) X 2166mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 34kg (74lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\n39.2kg (86.2lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour une Nissan Patrol Y61 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Nissan Patrol Y61 - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:11:54', NULL, NULL, 5.511814, 39.2, 6009542225869, 'ZA', 'EUR', 1239.496, '8708.29.90', 10, 0),
(432, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Nissan Patrol / Montage pour gouttière - de Front Runner', 'KRNP009', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1455, NULL, 264.70588, 317.647056, 'KRNP009 - Kit de barres de toit pour une Nissan Patrol / Montage pour gouttière - par Front Runner\\nComposé de :\\n2 x LASS101 - Pied N° 1 120mm (Paire)\\n1 x LBSK015 - Barres de toit 1345mm (Paire)\\n1 x WDLB001 - Déflecteur de vent de 10mm\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 7kg (16lbs)\\nLLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1455mm (57\'\')\\nHauteur : 170mm (7\'\')\\nPoids de la livraison :\\n8.2kg (18.1lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Nissan Patrol / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:11:59', NULL, NULL, 6.692917, 8.3, 6009542232355, 'ZA', 'EUR', 264.706, '8708.29.90', 10, 0),
(433, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Nissan Patrol Y60 - de Front Runner', 'KRNP010L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour un Nissan Patrol Y60 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage sur gouttières pour installer le plateau sur votre véhicule. ', 450, 1730, NULL, 1289.91597, 1547.899164, 'KRNP010L - Kit de galerie Slimline II pour un Nissan Patrol Y60 - par Front Runner\\nComposé de :\\n4 x LASS101 - Pied nr. 1 120mm (Paire)\\n1 x RRSTJ11 - Plateau Slimline II - 1425mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés:\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 35kg (76lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm /2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de la livraison :\\n40.4kg (88.8lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour un Nissan Patrol Y60 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage sur gouttières pour installer le plateau sur votre véhicule. ', 'Kit de galerie Slimline II pour un Nissan Patrol Y60 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:12:00', NULL, NULL, 5.511814, 40.7, 6009542241128, 'ZA', 'EUR', 1289.916, '7616.99', 10, 0),
(434, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Patrol/Armada Y62 (2010-jusqu’à présent) - de Front Runner', 'KRNP011T', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre Nissan Patrol/Armada Y62. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 455, 1730, NULL, 1289.91597, 1547.899164, 'KRNP011T - Kit de galerie Slimline II pour une Nissan Patrol/Armada Y62 (2010-jusqu’à présent)\\nContient :\\n1 x FANP001 - Pied de rail pour une Nissan Patrol/Armada Y62 (2010-jusqu’à présent)\\n1 x RRSTG11 - Plateau Slimline II - 1345mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 39kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm\\nLongueur 1615mm\\nHauteur 240mm\\nPoids de la livraison : 45,2kg', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre Nissan Patrol/Armada Y62. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Nissan Patrol/Armada Y62 (2010-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:12:25', NULL, NULL, 9.448824, 45.1, 6009542241760, 'ZA', 'EUR', 1289.916, '7616.99', 10, 0);
