(435, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Patrol Y61 / Haut- de Front Runner', 'KRNPT06L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Nissan Patrol contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1281.51261, 1537.815132, 'KRNPT06L - Kit de galerie Slimline II pour une Nissan Patrol Y61 / Haut- de Front Runner\\n\\nContient:\\n1 x LASS027 - Écarteur de pied 6mm (Paire)\\n4 x LASS103 - Pied nº 3 155mm (Paire)\\n1 x RRSTG11 - Plateau Slimline II - 1345mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 34kg (76lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur :140mm (6\'\')\\n\\nPoids de la livraison : 40.0kg (88.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Nissan Patrol contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Nissan Patrol Y61 / Haut- de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:12:30', NULL, NULL, 5.511814, 40, 6009542225876, 'ZA', 'EUR', 1281.513, '8708.29.90', 10, 0),
(436, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Nissan Patrol Y60/ Haut- de Front Runner', 'KRNPT10L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour un Nissan Patrol Y60 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie. La galerie s’installe facilement sans devoir forer dans le toit.', 450, 1730, NULL, 1306.72269, 1568.067228, 'KRNPT10L - Kit de galerie Slimline II pour un Nissan Patrol Y60/ Haut- de Front Runner\\n\\nContient:\\n4 x LASS103 - Pied nr. 3 155mm (Paire)\\n1 x RRSTJ11 - Plateau Slimline II - 1425mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés:\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation:35kg (77lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur140mm (6\'\')\\n\\nPoids de la livraison : 41.0kg (90.1lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour un Nissan Patrol Y60 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour installer le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie. La galerie s’installe facilement sans devoir forer dans le toit.', 'Kit de galerie Slimline II pour un Nissan Patrol Y60/ Haut- de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:12:33', NULL, NULL, 5.511814, 41.3, 6009542241371, 'ZA', 'EUR', 1306.723, '7616.99', 10, 0),
(437, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Qashqai (2006-2013) - de Front Runner', 'KRNQ001T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm/53.5”contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab On pour monter le plateau Slimline II sur votre Nissan Qashqai (2006-2013). Le plateau s’installe facilement en installant le pied sur les rails d\'origines. Aucune modification n’est nécessaire.', 450, 1730, NULL, 810.92437, 973.109244, 'KRNQ001T - Kit de galerie de toit Slimline II pour une Nissan Qashqai (2006-2013) - deFront Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR050 - Grips extérieur de rail surélevé / No. 1\\n2x GORR074 - Grips intérieur de rail surélevé / E\\n1x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\n1x WDST011 - Déflecteurs de vent 20mm /1165mm\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 24.37kg (53.73lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur450mm(18\'\')\\nLongueur1615mm(64\'\')\\nHauteur140mm(6\'\')\\n\\nPoidsde la livraison :\\nPoids : 24.79kg (55lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1358mm/53.5”contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab On pour monter le plateau Slimline II sur votre Nissan Qashqai (2006-2013). Le plateau s’installe facilement en installant le pied sur les rails d\'origines. Aucune modification n’est nécessaire.', 'Kit de galerie Slimline II pour une Nissan Qashqai (2006-2013) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:12:38', NULL, NULL, 5.511814, 24.8, 6009542252346, 'ZA', 'EUR', 810.924, '7616.99', 10, 0),
(438, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Qashqai (2013-actuel) - par Front Runner', 'KRNQ002T', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1358mm/53.5” contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Nissan Qashqai. Ce système s’installe facilement enutilisant les pieds solides tout-terrain qui s’accrochent aux barreslongitudinales d’origine. Le forage n’est pas nécessaire.', 450, 1730, NULL, 794.11765, 952.94118, 'Composé de :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n2 x GORR070 - Rail élevé intérieur Grab-On / A - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extra étroit (paire) / 1156mm (largeur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 21kg (46lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 285mm (11\'\')\\nPoids de la livraison :\\nPoids : 24.4kg (53.6lbs)', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1358mm/53.5” contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Nissan Qashqai. Ce système s’installe facilement enutilisant les pieds solides tout-terrain qui s’accrochent aux barreslongitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Nissan Qashqai (2013-actuel) - par Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:13:03', NULL, NULL, 5.511814, 24.5, 6009542252278, 'ZA', 'EUR', 794.118, '7616.99', 10, 0),
(439, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour une Nissan Titan Pick Up (2003-jusqu\'à présent) - par Front Runner', 'KRNT003T', 'Ce kit permet de créer une galerie pleine grandeur qui se place au-dessus de la benne du Nissan Titan. Ce kit de galerie Slimline II contient le plateau Slimline II (1475 mm x 1358 mm), 2 rails et 4 pieds universels pour la caisse du pick-up qui s\'adaptent aux rails. L\'installation peut nécessiter un perçage.', 450, 1730, NULL, 953.78151, 1144.537812, 'KRNT003T -Kit de galerie de benne Slimline II pour une Nissan Titan Pick Up (2003-jusqu\'à présent) - par Front Runner\\nComposé de :\\n2 x LASS026 - Pied de lit de charge universel / grand (paire) - par Front Runner\\n1 x RRSTM07 - Plateau Slimline II - 1475mm(L) X 1358mm(L) - par Front Runner\\n1 x TRBU001- Chenilles de plateau de chargement pour pick-up / 1000mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 27kg (60lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule (™s).\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 31,6 kg (69,6 lbs)', 'Ce kit permet de créer une galerie pleine grandeur qui se place au-dessus de la benne du Nissan Titan. Ce kit de galerie Slimline II contient le plateau Slimline II (1475 mm x 1358 mm), 2 rails et 4 pieds universels pour la caisse du pick-up qui s\'adaptent aux rails. L\'installation peut nécessiter un perçage.', 'Kit de galerie de benne Slimline II pour une Nissan Titan Pick Up (2003-jusqu\'à présent) - par Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:13:07', NULL, NULL, 5.511814, 31.6, 6009542231839, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(440, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Nissan Xterra N50 - de Front Runner', 'KRNX005T', 'La galerie Slimline II pour toute la longueur du toit de 1964mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Nissan Xterra N50. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 1071.42857, 1285.714284, 'KRNX005T - Kit de galerie Slimline II pour une Nissan Xterra N50 - de Front Runner\\n\\nContient:\\n1 x FANX002 - Pied de rails pour une Nissan Xterra\\n1 x RRSTA10 - Plateau Slimline II - 1165mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 32kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 36,8kg', 'La galerie Slimline II pour toute la longueur du toit de 1964mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Nissan Xterra N50. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Nissan Xterra N50 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:13:10', NULL, NULL, 5.511814, 36.6, 6009542234144, 'ZA', 'EUR', 1071.429, '8708.29.90', 5, 0),
