\nLargeur : 450mm (18\'\')\\nLongueur : 1610mm (63\'\')\\nHauteur : 215mm (8\'\')\\nPoids de livraison :\\nPoids 24.4kg (53.7lbs)', 'La galerie Slimline II pour toute lalongueur du toit de 1358 mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur les barresde toit de votre Nissan X-Trail. Ce système s\'installe facilement avec despieds résistants hors route qui s\'agrippent aux barres de toit existantes del\'usine. Aucun perçage requis.', 'Kit de galerie Slimline II pour une Nissan X-Trail (2013-actuel) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:13:13', NULL, NULL, 8.464571, 24.4, 6009542260884, 'ZA', 'EUR', 777.311, '7616.99', 10, 0),
