(446, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Porsche 924 - de Front Runner', 'KRPN001T', 'Vous n\'avez pas besoin d\'un SUV ou d\'un camion pour partir en exploration. Transformez votre Porsche 924 en un véhicule d\'aventure ultime avec ce kit de galerie Slimline II. Transportez tous vos jouets préférés avec de l\'espace intérieur à revendre afin d\'emporter tout ce dont vous avez besoin pour explorer l\'extérieur avec style.', 440, 1730, NULL, 752.10084, 902.521008, 'KRPN001T -Kit de galerie Slimline II pour Porsche 924\\nComposé de :\\n2x LASD102 - No 2 Leg Diagonal 130mm (Paire)\\n2x RRAC034 - Supports inter-plateaux\\n1x RRSTA05 - Plateau SLII - 1165mm(W)X954mm(L)\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 21,74kg (47,93lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre Kit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie utilise des rails de pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pieds pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids à la livraison :\\nPoids : 43.4kg (95lbs)', 'Vous n\'avez pas besoin d\'un SUV ou d\'un camion pour partir en exploration. Transformez votre Porsche 924 en un véhicule d\'aventure ultime avec ce kit de galerie Slimline II. Transportez tous vos jouets préférés avec de l\'espace intérieur à revendre afin d\'emporter tout ce dont vous avez besoin pour explorer l\'extérieur avec style.', 'Kit de galerie Slimline II pour une Porsche 924 - de Front Runner', 'Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:13:33', NULL, NULL, 10.2, 43.4, 6009542217611, 'ZA', 'EUR', 752.101, '8428.90', 5, 0),
(447, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour un Peugeot Rifter (2018-jusqu\'à présent) - de Front Runner', 'KRPR001T', 'Gardez le grand espace intérieur que votre Peugeot Rifter offre ouvert et flexible avec ce kit de galerie de toit Slimline II pour un Peugeot Rifter (2018-jusqu\'à présent). Transportez votre équipement d\'aventure et votre chargement sur le toit, où que votre aventure vous mène.', 440, 1835, NULL, 1197.47899, 1436.974788, 'KRPR001T -Kit de galerie de toit Slimline II pour un Peugeot Rifter (2018-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x FASS012 - Paire de pieds / 40mm - 50mm\\n1x RRSTD07 - Plateau SLII - 1255mm(W)X1358mm(L)\\n1x TRAC002 - Rail universel / 1400mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 26.98kg (59.48lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1835mm (72\'\')\\nHauteur : 265mm (10\'\')\\nPoids de la livraison :\\nPoids : 34.2kg (75lbs)', 'Gardez le grand espace intérieur que votre Peugeot Rifter offre ouvert et flexible avec ce kit de galerie de toit Slimline II pour un Peugeot Rifter (2018-jusqu\'à présent). 