(452, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) - par Front Runner', 'KRRR002L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Rover Range Rover (1970-1996) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1239.4958, 1487.39496, 'KRRR002L - Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) - par Front Runner\\nContient:\\n1 x LASS101 - Pied N° 1 120mm (Paire)\\n2 x LASS102 - Pied N° 2 130mm (Paire)\\n1 x RRSTM10 - Plateau Slimline II - 1475mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 époxy noir\\nAcier inoxydable 3CR12\\nPoids approximatif d’installation: 32kg (70lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n37.0kg (81.4lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Rover Range Rover (1970-1996) contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage pour gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:14:20', NULL, NULL, 5.511814, 37.1, 6009542225883, 'ZA', 'EUR', 1239.496, '8708.29.90', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(453, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour un Land Rover Range Rover (1970-1996) / Montage pour gouttière - par Front Runner', 'KRRR005', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 130mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 175, 1565, NULL, 281.51261, 337.815132, 'KRRR005 - Kit de barres de toit pour un Land Rover Range Rover (1970-1996) / Montage pour gouttière - par Front Runner\\nComposé de :\\n2 x LASS102 - Pied N° 2 130mm (Paire)\\n1 x LBSK017 - Barres de toit (Paire) 1475mm\\n1 x WDLB001 - Déflecteur de vent de 10mm\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 7kg (16lbs)\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 175mm(7\'\')\\nLongueur : 1565mm (62\'\')\\nHauteur : 120mm (5\'\')\\nPoids de la livraison:\\n8.6kg (18.9lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 130mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour un Land Rover Range Rover (1970-1996) / Montage pour gouttière - par Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:14:25', NULL, NULL, 4.724412, 8.7, 6009542232393, 'ZA', 'EUR', 281.513, '7616.99', 10, 0),
