(459, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) / Haut - de Front Runner', 'KRRRT02L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Range Rover (1970-1996) contient le plateau Slimline II, un déflecteur de vent et 6 pieds de montage pour gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1189.07563, 1426.890756, 'KRRRT02L - Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) / Haut - par Front Runner\\nComposé de :\\n1 x LASS102 - Pied N° 2 130mm (Paire)\\n2 x LASS103 - Pied N° 3 155mm (Paire)\\n1 x RRSTP10 - Plateau Slimline II - 1575mm (largeur) x 1964mm (longueur)\\nMatériaux utilisés :\\nAluminium T6 époxy noir\\nAcier inoxydable\\nPoids approximatif d’installation: 38.17kg (84.15lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n37.3kg (82.1lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm pour un Range Rover (1970-1996) contient le plateau Slimline II, un déflecteur de vent et 6 pieds de montage pour gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour un Land Rover Range Rover (1970-1996) / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:14:43', NULL, NULL, 5.511814, 37.3, 6009542225890, 'ZA', 'EUR', 1189.076, '7616.99', 10, 0),
(460, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Renault Sandero (2012-actuel) - de Front Runner', 'KRRS001T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Renault Sandero.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'Contient:\\n2 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n2 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR071 - Rail élevéintérieurGrab-On / B - de Front Runner\\n1 x RRSTA06 - Plateau Slimline II -1165mm (largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 20kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 22,7kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Renault Sandero.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II pour une Renault Sandero (2012-actuel) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:14:47', NULL, NULL, 11.220478, 22.8, 6009542252681, 'ZA', 'EUR', 710.084, '7616.99', 10, 0),
(461, 1, 2, NULL, NULL, NULL, 'Kit de barres pour benne de pickup avec un couvre HSP Electric Roll R/ 1575 (L) - de Front Runner', 'KRRT001', 'Ajoutez ce kit de barres de toit pour pick-up avec Roll Top afin de libérer l\'espace de votre benne et de transporter votre équipement d\'aventure et vos gadgets par-dessus votre couvre HSP Electric Roll R.', 160, 1340, NULL, 247.89916, 297.478992, 'KRRT001 -Kit de barres pour benne de pickup avec un couvre HSP Electric Roll R/ 1575 (L) - de Front Runner\\nComposé de :\\n2x LASS028 - Pieds de montage pour Pick-Up avec Roll Top\\n1x LBSK018 - Paire de barres de toit 1575mm (L)\\n1x TRCA009 - Rails d\'auvent / 1400mm (L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nPoids approximatif installé : 11.26kg (24.82lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de charge, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 160mm (6\'\')\\nLongueur : 1340mm (53\'\')\\nHauteur : 200mm (8\'\')\\nPoids de la livraison :\\nPoids : 6.6kg (15lbs)', 'Ajoutez ce kit de barres de toit pour pick-up avec Roll Top afin de libérer l\'espace de votre benne et de transporter votre équipement d\'aventure et vos gadgets par-dessus votre couvre HSP Electric Roll R.', 'Kit de barres pour benne de pickup avec un couvre HSP Electric Roll R/ 1575 (L) - de Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:16:02', NULL, NULL, 7.9, 6.6, 6009542220987, 'ZA', 'EUR', 247.899, '7616.99', 2, 0),
(462, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour Pick-up avec Roll Top / 1425(Largeur) x 1358(Longueur) - par Front Runner', 'KRRT001T', 'Ce kit permet de créer une galerie de pleine taille qui s\'installe au-dessus de la benne de votre pick-up lorsqu\'il est équipé d\'une couverture Roll Top. Ce kit de galerie Slimline II contient le plateau Slimline II (1425mm x 1358mm) et 4 pieds de Pickup Roll Top qui s\'adaptent aux rails existants d\'usine/OEM dans votre couverture Roll Top.', 455, 1730, NULL, 886.55462, 1063.865544, 'KRRT001T - Kit de galerie de benne Slimline II pour Pick-up avec Roll Top / 1425(Largeur) x 1358(Longueur) - par Front Runner\\nComposé de :\\n2 x LASS028 - Pieds de pick-up avec Roll-Top - par Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm(W) X 1358mm(L) - par Front Runner\\nMatériaux utilisés :\\nRevêtement époxy noir T6 aluminium\\n3CR12 Acier inoxydable\\nPoids installé approximatif : 24 kg (53 lbs)\\nLes rainures en T sur le dessus et le dessous des lamelles et des profilés de bordure des plateaux de rayonnages s\'adaptent aux boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre porte-bagages de toit Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied à saisir ou du pied à sangle mentionnée ci-dessus.\\nSi votre kit de barres de toit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur du support à partir des gouttières de votre véhicule.\\nSi votre kit de barres de toit Slimline II utilise des pieds de fixation, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des barres de toit pour déterminer la hauteur du support à partir de la couronne (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 235mm (9\'\')\\nPoids à l\'expédition :\\nPoids 27.8kg (61.2lbs)', 'Ce kit permet de créer une galerie de pleine taille qui s\'installe au-dessus de la benne de votre pick-up lorsqu\'il est équipé d\'une couverture Roll Top. Ce kit de galerie Slimline II contient le plateau Slimline II (1425mm x 1358mm) et 4 pieds de Pickup Roll Top qui s\'adaptent aux rails existants d\'usine/OEM dans votre couverture Roll Top.', 'Kit de galerie de benne Slimline II pour Pick-up avec Roll Top / 1425(Largeur) x 1358(Longueur) - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:16:04', NULL, NULL, 9.251974, 27.8, 6009542261843, 'ZA', 'EUR', 886.555, '7616.99', 10, 0),
