\\nPoids à l\'expédition :\\nPoids 28.1kg (61.8lbs)', 'Ce kit crée uneétagère pleine grandeur qui se place au-dessus du plateau de chargement devotre Pickup\'s lorsqu\'elle est équipée d\'un couvercle à rouleau. Ce kit degalerie de toit Slimline II contient le plateau Slimline II (1475mm x 1358mm)et 4 supports pour pieds de rouleau Pickup qui s\'intègrent dans les railsd\'usine/OEM existants de votre couvercle de rouleau.', 'Kit de galerie de benne Slimline II pour Pickup avec Roll Top Slimline II / 1475(L) x 1358(L) - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:16:32', NULL, NULL, 5.9, 28.9, 6009542261850, 'ZA', 'EUR', 911.765, '8708.29.90', 10, 0),
