(468, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour benne de avec Roll Top / 1475(W) x 1560(L) - par Front Runner', 'KRRT004T', 'Ce kit permet de créer une galerie de taille pleine qui s\'installe au-dessus de la benne de votre Pickup lorsqu\'il est équipé d\'un Roll Top Cover. Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm x 1560mm) et 6 supports de jambe de Pickup Roll Top qui s\'adaptent aux rails existants d\'usine/OEM dans votre Roll Top Cover.', 455, 1730, NULL, 1079.83193, 1295.798316, 'KRRT004T -Kit de galerie Slimline II pour benne de avec Roll Top / 1475(W) x 1560(L) - par Front Runner\\nComposé de :\\n3 x LASS028 - Montage de la patte supérieure du pick-up - par Front Runner\\n1 x RRSTM08 - Plateau Slimline II - 1475mm(W) x 1560mm(L) - par Front Runner\\nMatériaux utilisés :\\nRevêtement époxy noir T6 aluminium\\n3CR12 Acier inoxydable\\nPoids installé approximatif : 28 kg (61lbs)\\nLes rainures en T sur le dessus et le dessous des lamelles et des profilés de bordure des plateaux de rayonnages s\'adaptent aux boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre porte-bagages de toit Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied à saisir ou du pied à sangle mentionnée ci-dessus.\\nSi votre kit de barres de toit Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur du support à partir des gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des garde-pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des garde-pieds pour déterminer la hauteur de la galerie depuis la couronne (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 235mm (9\'\')\\nPoids à l\'expédition :\\nPoids 32.3kg (71.1lbs)', 'Ce kit permet de créer une galerie de taille pleine qui s\'installe au-dessus de la benne de votre Pickup lorsqu\'il est équipé d\'un Roll Top Cover. Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm x 1560mm) et 6 supports de jambe de Pickup Roll Top qui s\'adaptent aux rails existants d\'usine/OEM dans votre Roll Top Cover.', 'Kit de galerie Slimline II pour benne de avec Roll Top / 1475(W) x 1560(L) - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:17:06', NULL, NULL, 9.251974, 32.3, 6009542261874, 'ZA', 'EUR', 1079.832, '7616.99', 10, 0),
(469, 1, 2, NULL, NULL, NULL, 'Pickup Roll Top Slimline II Load Bed Rack Kit / 1425(W) x 1762(L) - by Front Runner', 'KRRT005T', 'This kit creates a full-size rack that sits above your Pickup Truck\'s load bed when fitted with a Roll Top Cover. This Slimline II cargo carrying rack kit contains the Slimline II tray (1425mm x 1762mm) and 6 Pickup Roll Top Leg Mounts that fit into the existing factory/OEM tracks in your Roll Top Cover.', 455, 1730, NULL, 1147.05882, 1376.470584, 'KRRT005T - Bakkie Roll Top Slimline II Load Bed Rack Kit / 1425(W) x 1762(L) - by Front Runner  Consisting of: 3x LASS028 - Pick-Up Roll Top Leg Mount1x RRSTJ09 - SLII Tray - 1425mm(W)X1762mm(L) Material Used: Black epoxy powder - coated T6 aluminium High strength steel Approximate Installed Weight: 34.42kg (75.88lbs) The t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.To determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Foot or Grab-on Foot listed above.If your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Legs to determine the height of the rack from your vehicle\'s rain gutters.If your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof. Shipping Dimensions: Width: 455mm (18\'\') Length: 1730mm (68\'\') Height: 235mm (9\'\') Shipping Weight: Weight: 34.59kg (76lbs)', 'This kit creates a full-size rack that sits above your Pickup Truck\'s load bed when fitted with a Roll Top Cover. This Slimline II cargo carrying rack kit contains the Slimline II tray (1425mm x 1762mm) and 6 Pickup Roll Top Leg Mounts that fit into the existing factory/OEM tracks in your Roll Top Cover.', 'Pickup Roll Top Slimline II Load Bed Rack Kit / 1425(W) x 1762(L) - by Front Runner', 'Galerie|Galerie pour benne de Pick-Up', 0, 1, '2022-01-07 11:17:10', NULL, NULL, 9.251974, 34.6, 6009542261881, 'ZA', 'EUR', 1147.059, '7616.99', 10, 0),
