(480, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour un Ford Ranger Wildtrak avec Roll Top (2014-jusqu\'à présent) - de Front Runner', 'KRRT016T', 'Ce kit permet de créer une galerie de taille complète qui se place au-dessus de la benne de votre Ford Ranger Wildtrak lorsqu\'il est équipé d\'un couvre Roll Top de protection. Ce kit de galerie de transport de matériel Slimline II contient le Plateau Slimline II (1425mm x 1156mm) et 6 pieds de montage pour Pick-up Roll Top qui s\'adaptent aux rails existants de votre Roll Top Cover.', 450, 1730, NULL, 903.3613, 1084.03356, 'KRRT016T -Kit de galerie de benne Slimline II pour un Ford Ranger Wildtrak avec Roll Top (2014-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3 x LASS028 - Pied de montage pour Pick-up avec Roll Top\\n3x RRAC962 - Plaque de goujon pour montage sur rail\\n1 x RRSTJ06 - Plateau SLII -1425mm(l)X1156mm(L)\\nMatériel utilisé :\\nAluminium T6 en époxy noir\\nAcier haute résistancePoids approximatif d’installation :27.44kg (60.49lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 450mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur :230mm (9\'\')\\nPoids de la livraison :\\n25.91kg (57lbs)', 'Ce kit permet de créer une galerie de taille complète qui se place au-dessus de la benne de votre Ford Ranger Wildtrak lorsqu\'il est équipé d\'un couvre Roll Top de protection. Ce kit de galerie de transport de matériel Slimline II contient le Plateau Slimline II (1425mm x 1156mm) et 6 pieds de montage pour Pick-up Roll Top qui s\'adaptent aux rails existants de votre Roll Top Cover.', 'Kit de galerie de benne Slimline II pour un Ford Ranger Wildtrak avec Roll Top (2014-jusqu\'à présent) - de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:17:53', NULL, NULL, 9.055123, 25.9, 6009542263366, 'ZA', 'EUR', 903.361, '8708.29.90', 10, 0),
(481, 1, 2, NULL, NULL, NULL, 'Kit Slimline II pour benne pick-up / 1425(L) x 1358(L) / haut- par Front Runner', 'KRRT023T', 'Transportez encore plus avec ce kit de galerie complet et résistant. Libérez l\'espace de chargement de votre matériel de benne lorsque vous gardez la tranquillité d\'esprit que procure votre roll top.', 450, 1725, NULL, 1037.81513, 1245.378156, 'Composé de :\\n3 x LASS033 - Pick Up Roll Top Montage pour rouleaux / moyen (paire)\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm(L) X 1358mm(L) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif du montage : 30,0 kg (66,1 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1725mm (68,0\'\')\\nHauteur : 270mm (11.0\'\')\\nPoids de la livraison :\\n34.0kg (75.0lbs)', 'Transportez encore plus avec ce kit de galerie complet et résistant. Libérez l\'espace de chargement de votre matériel de benne lorsque vous gardez la tranquillité d\'esprit que procure votre roll top.', 'Kit Slimline II pour benne pick-up / 1425(L) x 1358(L) / haut- par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:17:58', NULL, NULL, 10.6, 34, 6009542283623, 'ZA', 'EUR', 1037.815, '7616.99', 10, 0),
