 / 1425(W) x 1358(L) -de Front Runner', 'Galerie|Galerie pour benne de Pick-Up|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:18:45', NULL, NULL, 7.7, 28, 6009542213262, 'ZA', 'EUR', 995.798, '8708.29', 10, 0),
(492, 1, 2, NULL, NULL, NULL, 'Kit de galerie de benne Slimline II pour un Ford Ranger Raptor avec un Securi Lid (2020- jusqu\'à présent) - par Front Runner', 'KRRT034T', 'Gardez votre benne sécurisé tout en transportant votre équipement d\'aventure préféré avec ce kit de galerie de benne Slimline II pour un Ford Ranger Raptor avec un Securi Lid (2020- jusqu\'à présent) qui se monte facilement sur les rails d\'usine.', 440, 1730, NULL, 886.55462, 1063.865544, 'KRRT034T-Kit de galerie de benne Slimline II pour un Ford Ranger Raptor avec un Securi Lid (2020- jusqu\'à présent) - par Front Runner\\nComposé de :\\n3x LASS030 - Pied de benne universel / moyen (paire)\\n1x RRSTM07 - Plateau SLII - 1475mm(W)X1358mm(L)\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé :28.36kg (62.52lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied de fixation indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des pieds de rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 250mm (6\'\')\\nPoids de l\'expédition :\\nPoids : 29.4kg (65lbs)', 'Gardez votre benne sécurisé tout en transportant votre équipement d\'aventure préféré avec ce kit de galerie de benne Slimline II pour un Ford Ranger Raptor avec un Securi Lid (2020- jusqu\'à présent) qui se monte facilement sur les rails d\'usine.', 'Kit de galerie de benne Slimline II pour un Ford Ranger Raptor avec un Securi Lid (2020- jusqu\'à présent) - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:18:48', NULL, NULL, 9.8, 29.4, 6009542218304, 'ZA', 'EUR', 886.555, '8708.29.90', 10, 0),
