\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 29kg (64lbs)', 'Vous n\'avez pas besoin d\'une installation permanente de galerie de toit pour débloquer votre prochaine aventure. Le kit de galerie de toit Slimline II pour le Subaru Ascent s\'installe sur vos rails d\'usine, sans perçage, avec des pieds résistants aux conditions extrêmes. Vous pouvez profiter de l\'utilité des accessoires de galerie Front Runner, tout en conservant la possibilité de retirer la galerie à tout moment.', 'Kit de galerie Slimline II pour une Subaru Ascent (2018 - jusqu\'à présent) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:18:50', NULL, NULL, 6.3, 29, 6009542231952, 'ZA', 'EUR', 1012.605, '8708.29.90', 10, 0);
