(496, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki Jimny - de Front Runner', 'KRSJ002T', ' La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Suzuki Jimny. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. ', 450, 1730, NULL, 752.10084, 902.521008, ' \\nKRSJ002T - Kit de galerie pour une Suzuki Jimny - Slimline II de Front Runner \\n  \\nContient : \\n1 x FASJ002 - Pied de rail pour une Suzuki Jimny 70mm \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 23kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 27,0kg', ' La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Suzuki Jimny. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. ', 'Kit de galerie Slimline II pour une Suzuki Jimny - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:19:04', NULL, NULL, 10.4, 28, 6009542231969, 'ZA', 'EUR', 752.101, '8708.29.90', 10, 0),
(497, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki Jimny (2018-jusqu\'à présent) - de Front Runner', 'KRSJ003T', 'La galerie Slimline II pour toute la longueur du toit de1560mm contient le plateau Slimline II et un déflecteur de vent ainsi que 6pieds de gouttière pour monter le plateau Slimline II sur votre Suzuki Jimny 2018+.S’installe facilement et aucun forage n’est nécessaire.', 455, 1730, NULL, 953.78151, 1144.537812, 'KRSJ003T -Kit de galerie Slimline II pour une Suzuki Jimny (2018-jusqu\'à présent) - par Front Runner\\nComposé de :\\n3 x LASS102 - Set de pieds No 2 130mm - de Front Runner\\n1 x RRSTG08 - Plateau Slimline II - 1345mm (largeur) x 1560mm (longueur) - de Front Runner\\n1x WDST009 - Déflecteur de vent de 20mm / 1345mm(l)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 30.89kg (68.1lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 455mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 250mm (10\'\')\\nPoids de la livraison :\\nPoids 31.5kg (69.3lbs)', 'La galerie Slimline II pour toute la longueur du toit de1560mm contient le plateau Slimline II et un déflecteur de vent ainsi que 6pieds de gouttière pour monter le plateau Slimline II sur votre Suzuki Jimny 2018+.S’installe facilement et aucun forage n’est nécessaire.', 'Kit de galerie Slimline II pour une Suzuki Jimny (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:19:09', NULL, NULL, 9.842525, 31.5, 6009542252070, 'ZA', 'EUR', 953.782, '8708.29.90', 10, 0),
(498, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki Jimny (2018-jusqu’à présent) / Haut - de Front Runner', 'KRSJ005T', 'Le kit de galerie Slimline II pour toute lalongueur du toit de 1560mm/61.4\'\' pour une Suzuki Jimny 2018+ contient le plateauSlimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pourmonter le plateau sur votre véhicule. Ce kit large permet d’avoir de la placepour monter une table de camping de Front Runner ou d’autres accessoires endessous de la galerie. La galerie s’installe facilement sans devoir forer.', 440, 1730, NULL, 945.37815, 1134.45378, 'KRSJ005T - Kit de galerie de toit SlimlineII pour une Suzuki Jimny (2018 - jusqu’à présent) - de Front Runner\\nComposé de :\\n3 x LASS103 - Pied n° 3 155 mm (paire) - deFront Runner\\n1 x RRSTG08 - Plateau Slimline II - 1345mm largeurX 1560 mm longueur - by Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 27kg (59lbs)\\nLa rainure en T sur le haut et sur le basdu plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin depieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin depieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur260mm (10\'\')\\nPoids de la livraison :\\nPoids :31.0kg (68.2lbs)', 'Le kit de galerie Slimline II pour toute lalongueur du 