(499, 1, 2, NULL, NULL, NULL, 'Kit de 3/4 galerie Slimline II pour une Suzuki Jimny (2018-jusqu’à présent) - de Front Runner', 'KRSJ006T', 'Le kit de galerie Slimline II pour3/4la longueur du toit de 1156mm/45.5\'\' pour une Suzuki Jimny 2018+ contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 455, 1730, NULL, 752.10084, 902.521008, 'KRSJ006T - Kit de galerie de toit ¾ Slimline II pour une Suzuki Jimny (2018-jusqu’à présent) - par Front Runner\\nComposé de :\\n2 x LASS102 - Pied n° 2 130 mm (paire) - de Front Runner\\n1 x RRSTG06 - Plateau Slimline II - 1345mm largeur X 1156 mm longueur - by Front Runner\\n1 x WDST009 - Déflecteur de vent de 20 mm/ 1345 mm (l)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 30.89kg (68.1lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455 mm (18\'\')\\nLongueur 1730mm (68\'\')\\nHauteur 260 mm (10\'\')\\nPoids :\\n31.5kg (69lbs)', 'Le kit de galerie Slimline II pour3/4la longueur du toit de 1156mm/45.5\'\' pour une Suzuki Jimny 2018+ contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de 3/4 galerie Slimline II pour une Suzuki Jimny (2018-jusqu’à présent) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:19:19', NULL, NULL, 10.236226, 25.7, 6009542260242, 'ZA', 'EUR', 752.101, '8708.29.90', 10, 0),
(500, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Suzuki Jimny (2018 - jusqu\'à présent) - de Front Runner', 'KRSJ007', 'Un kit de barres de toit montées sur gouttière, utilisées pour transporter du matériel sur le toit de votre véhicule lorsque vous n\'avez pas besoin d\'une galerie de toit Front Runner complète. Cette solution à profil bas et à encombrement réduit comprend 4 pieds de montage pour gouttière de 130 mm, 2 barres de toit de 1345 mm, 1 déflecteur de vent de 10 mm pour barre de toit et des instructions de montage - tous les éléments nécessaires pour monter les barres de toit Front Runner sur un véhicule avec gouttière.', 205, 600, NULL, 264.70588, 317.647056, 'KRSJ007 - Kit de barres de toit pour Suzuki Jimny (2018 - jusqu\'à présent) - par Front Runner\\nComposé de :\\n2 x LASS102 - No 2 Pied 130mm (Paire) - par Front Runner\\n1 x LBSK015 - Paire de barres de toit 1345mm(L) - par Front Runner\\n1 x WDLB001 - Déflecteur de vent pour barre de toit / 10mm - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier inoxydable 3CR12\\nPoids installé approximatif : 7 kg (16lbs)\\nLes rainures en T situées en haut et en bas des lattes peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de charge (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de charge (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nSi votre kit de barre de toit utilise des rails, ajoutez la hauteur de la barre de charge (22 mm/ 7/8\'\') à la hauteur des rails indiqués ci-dessus pour déterminer la hauteur du support à partir de la couronne (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 205 mm (8\'\')\\nLongueur 600 mm (24\'\')\\nHauteur 75mm (3\'\')\\nPoids à l\'expédition :\\nPoids 8.3kg (18.3lbs)', 'Un kit de barres de toit montées sur gouttière, utilisées pour transporter du matériel sur le toit de votre véhicule lorsque vous n\'avez pas besoin d\'une galerie de toit Front Runner complète. Cette solution à profil bas et à encombrement réduit comprend 4 pieds de montage pour gouttière de 130 mm, 2 barres de toit de 1345 mm, 1 déflecteur de vent de 10 mm pour barre de toit et des instructions de montage - tous les éléments nécessaires pour monter les barres de toit Front Runner sur un véhicule avec gouttière.', 'Kit de barres de toit pour une Suzuki Jimny (2018 - jusqu\'à présent) - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:19:23', NULL, NULL, 2.952757, 8.3, 6009542261171, 'ZA', 'EUR', 264.706, '8708.29.90', 10, 0),
(501, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Subaru Outback (2015-2019) - de Front Runner', 'KRSO002T', 'Ce kit de galerie de toit Slimline II complet de1156mmde long pour le transport de matériel dans la Subaru Outback contient un plateau Slimline II, un déflecteur de vent et 4 pieds. Il s\'installe facilement sur les points de montage de l\'usine sans qu\'il soit nécessaire de le percer.', 450, 1730, NULL, 617.64706, 741.176472, 'KRSO002T - Kit Galerie de toit Slimline II pour Subaru Outback (2015-2019) - par Front Runner\\nComposé de :\\n1x FASO001 - Set de pieds pour Subaru Outback(2015-Curr)\\n1x RRSTA06 - Plateau SLII - 1165mm(W)X1156mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm à bord extra étroit /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 20.36kg (44.89lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 450 mm (18\'\')\\nLongueur : 1610mm (63\'\')\\nHauteur : 200mm (8\'\')\\nPoids à la livraison :\\nPoids : 23.21kg (51lbs)', 'Ce kit de galerie de toit Slimline II complet de1156mmde long pour le transport de matériel dans la Subaru Outback contient un plateau Slimline II, un déflecteur de vent et 4 pieds. Il s\'installe facilement sur les points de montage de l\'usine sans qu\'il soit nécessaire de le percer.', 'Kit de galerie Slimline II pour une Subaru Outback (2015-2019) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:19:24', NULL, NULL, 7.87402, 23.2, 6009542247755, 'ZA', 'EUR', 617.647, '7616.99', 1, 0),
(502, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II Grab-On pour une Subaru Outback (2000-2004) - de Front Runner', 'KRSO003T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Subaru Outback(2000-2004). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 455, 1730, NULL, 777.31092, 932.773104, 'Contient:\\n2 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n2 x GORR052 - Rail élevéextérieurGrab-On / N° 3 - de Front Runner\\n2 x GORR070 - Rail élevéintérieurGrab-On / A - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 21kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :\\nPoids : 24,2kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Subaru Outback(2000-2004). Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II Grab-On pour une Subaru Outback (2000-2004) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:19:29', NULL, NULL, 11.220478, 24.4, 6009542252650, 'ZA', 'EUR', 777.311, '7616.99', 10, 0),
(503, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Subaru Outback Wilderness (2022-jusqu\'à présent) - de Front Runner', 'KRSO004T', 'You don’t need a permanent roof rack installation to unlock your next adventure. The Slimline II Roof Rail Rack Kit for the 2022-Current Subaru Outback Wilderness installs onto your factory rails, drill-free, with off-road tough feet. You can enjoy the utility of Front Runner rack accessories, while maintaining the ability to remove the rack at any time.', 440, 1730, NULL, 953.7815, 1144.5378, 'KRSO004T -Kit de galerie Slimline II pour une Subaru Outback Wilderness (2022-jusqu\'à présent) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GORR053 - Griffes extérieures de rail surélevé / No. 4\\n3x GORR070 - Grips intérieurs de rail surélevé / A\\n2x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA08 - Plateau SLII - 1165mm(W)X1560mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 26,64 kg (58,73 lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids de la livraison\\nPoids : 28kg (62lbs)', 'You don’t need a permanent roof rack installation to unlock your next adventure. The Slimline II Roof Rail Rack Kit for the 2022-Current Subaru Outback Wilderness installs onto your factory rails, drill-free, with off-road tough feet. You can enjoy the utility of Front Runner rack accessories, while maintaining the ability to remove the rack at any time.', 'Kit de galerie Slimline II pour une Subaru Outback Wilderness (2022-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:19:33', NULL, NULL, 6.3, 28, 6009542224503, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(504, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki SX4 (2013-actuel) - de Front Runner', 'KRSS001T', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Suzuki SX4. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 626.05042, 751.260504, 'KRSS001T - Kit de galerie Slimline II pour une Suzuki SX4 (2013-jusqu’à présent)\\nContient :\\n2 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n2 x GOFR014 - Pied Grab-On pour barres Flush / No. 6 - de Front Runner\\n2 x GOFR035 - Pied Grab-On arrière pour barres Flush / F - de Front Runner\\n1 x RRSTD04 - Plateau Slimline II - 1255mm (largeur) x 752mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 16kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 19,1kg', 'La galerie Slimline II pour toute la longueur du toit de 752mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de rail pour monter le plateau Slimline II sur votre Suzuki SX4. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Suzuki SX4 (2013-actuel) - de Front Runner', 'Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galerie', 0, 1, '2022-01-07 11:19:37', NULL, NULL, 5.511814, 20.5, 6009542243689, 'ZA', 'EUR', 626.05, '7616.99', 10, 0),
(505, 1, 2, NULL, NULL, NULL, 'Kit galerie Slimline II sur rail pour Skoda Superb II (2008-2015) - par Front Runner', 'KRSS003T', 'Emmenez votre Skoda Superb II 2008 - 2015 vers de nouvelles aventures avec ce Kit Galerie de toit Slimline II. Chargez votre équipement d\'aventure et votre matériel sur le toit pour créer votre propre aventure maintenant.', 445, 1715, NULL, 684.87395, 821.84874, 'Comprenant :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR051 - Grips extérieurs de rail surélevé / No. 2\\n2x GORR070 - Grips intérieurs de rail surélevé / A\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 23.4kg (51.59lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie sur rail Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 445 mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\nPoids : 23.4kg (51lbs)', 'Emmenez votre Skoda Superb II 2008 - 2015 vers de nouvelles aventures avec ce Kit Galerie de toit Slimline II. Chargez votre équipement d\'aventure et votre matériel sur le toit pour créer votre propre aventure maintenant.', 'Kit galerie Slimline II sur rail pour Skoda Superb II (2008-2015) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:19:40', NULL, NULL, 6.1, 23.4, 6009542218434, 'ZA', 'EUR', 684.874, '8708.29.90', 10, 0),
(506, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki Grand Vitara (2007-2014) - de Front Runner', 'KRSV001T', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Grand Vitara (2007-2014) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds.', 450, 1730, NULL, 1029.41176, 1235.294112, ' \\nKRSV001T - Kit de galerie pour une Suzuki Grand Vitara (2007-2014) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FASS002 - Pied 40mm (Paire) \\n1 x FASS003 - Pied 60mm (Paire) \\n1 x FASS005 - Pied 70mm (Paire) \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTD09 - Plateau Slimline II - 1255mm (largeur) x 1762mm(longueur) x 50mm (hauteur) \\n1 x TRSV001 - Rails pour une Suzuki Vitara 1850mm (Paire G/D) \\n  \\nMatériaux utilisés : \\nAluminium T6 époxy noir \\nAcier inoxydable 3CR12 \\n  \\nPoids approximatif d’installation : 29kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 33,4kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Grand Vitara (2007-2014) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 6 pieds.', 'Kit de galerie Slimline II pour une Suzuki Grand Vitara (2007-2014) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:19:42', NULL, NULL, 5.511814, 33.3, 6009542223636, 'ZA', 'EUR', 1029.412, '8708.29.90', 10, 0),
(507, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Suzuki Grand Vitara (2015-jusqu\'à présent) - de Front Runner', 'KRSV002T', 'La galerie Slimline II pour toute la longueur du toit de 1156mm/45.5” contient le plateau Slimline II, un déflecteur de vent et 6 paires de pieds Grab On pour monter le plateau Slimline II sur votre Suzuki Vitara, y compris le facelift de 2018. Le plateau s’installe facilement en installant le pied sur les rails d\'origines. Aucune modification n’est nécessaire.', 455, 1730, NULL, 735.29412, 882.352944, 'KRSV002T - Suzuki Grand Vitara (2015-présent) Kit galerie Slimline II pour barre flush - de Front Runner\\nComposé de :\\n2 x GOFR001 - base de pied pour rail (Pair) - de Front Runner \\n1 x GOFR014 - pince extérieur pour barre flush / No. 6 - de Front Runner \\n1 x GOFR031 - pince intérieur pour barre flush / B - de Front Runner \\n1 x RRSTA06 - plateau Slimline II - 1165mm(W) X 1156mm(L) - de Front Runner\\nMatériaux ulitisés:\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 19kg (43lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm(18\'\')\\nLongueur 1610mm(63\'\')\\nHauteur 275mm(11\'\')\\nPoids de la livraison 