tde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Subaru XV(2012-2017). Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Subaru XV Crosstrek (2012-2017) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:20:14', NULL, NULL, 5.511814, 24.4, 6009542252773, 'ZA', 'EUR', 785.714, '7616.99', 10, 0),
(509, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Subaru XV Crosstrek (2018-jusqu\'à présent) - de Front Runner', 'KRSX005T', 'Ce kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur les barres surélevées de votre Subaru XV. Ce système s’installe facilement en utilisant les pieds solides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 450, 1730, NULL, 777.31092, 932.773104, 'KRSX005T -Kit de galerie de toit Slimline II pour une Subaru XV Crosstrek (2018-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 -Base de pied de rail (Paire) -de Front Runner\\n2 x GORR052 - Rail élevé extérieurGrab-On /N° 3 - de Front Runner\\n2 x GORR070 - Rail élevé intérieurGrab-On / A- de Front Runner\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(W) X 1358mm(L) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extra étroit(paire) / 1156mm (l) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 21kg (46lbs)\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 450mm(18\'\')\\nLongueur : 1615mm(64\'\')\\nHauteur : 140mm(6\'\')\\n\\nPoids de la livraison :\\nPoids : 24.4kg (53.7lbs)', 'Ce kit de galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur les barres surélevées de votre Subaru XV. Ce système s’installe facilement en utilisant les pieds solides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Subaru XV Crosstrek (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:20:18', NULL, NULL, 5.511814, 24.4, 6009542252742, 'ZA', 'EUR', 777.311, '8708.29.90', 10, 0),
(510, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Skoda Yeti (2009-2017) - de Front Runner', 'KRSY001T', 'Transformez les rails d\'origine de votre Skoda Yeti pour libérer un espace intérieur précieux et continuer à emporter votre équipement d\'aventure et vos gadgets préférés avec le kit de galerie Slimline II pour un Skoda Yeti (2009-2017).', 440, 1720, NULL, 785.71429, 942.857148, 'KRSY001T -Kit de galerie Slimline II pour un Skoda Yeti (2009-2017) - de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR053 - Grips extérieurs de rail surélevé / No. 4\\n2x GORR072 - Grips intérieurs de rail surélevé / C\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm extra étroits /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 24.17 kg (53.29lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 150mm (6\'\')\\nPoids de la livraison :\\nPoids : 25.2kg (55lbs)', 'Transformez les rails d\'origine de votre Skoda Yeti pour libérer un espace intérieur précieux et continuer à emporter votre équipement d\'aventure et vos gadgets préférés avec le kit de galerie Slimline II pour un Skoda Yeti (2009-2017).', 'Kit de galerie Slimline II pour un Skoda Yeti (2009-2017) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:20:23', NULL, NULL, 5.9, 25.2, 6009542220260, 'ZA', 'EUR', 785.714, '8708.29.90', 10, 0),
(511, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Condor - de Front Runner', 'KRTC001L', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Toyota Condor contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 1012.60504, 1215.126048, ' \\nKRTC001L - Kit de galerie pour une Toyota Condor - Slimline II de Front Runner \\n  \\nContient : \\n2 x LASS105 - Pied N° 5 190mm (Paire) 1 x LASS106 - Pied N° 6 195mm (Paire) 1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTD09 - Plateau Slimline II - 1255mm (largeur) x 1762mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\nPoids approximatif d’installation : 28kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 33,0kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Toyota Condor contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour une Toyota Condor - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:20:26', NULL, NULL, 5.511814, 33.1, 6009542227009, 'ZA', 'EUR', 1012.605, '7616.99', 10, 0),
(512, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Condor / Montage pour gouttière - de Front Runner', 'KRTC003', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1420, NULL, 281.51261, 337.815132, 'KRTC003 - Barres de toit 1345mm de Front Runner / Kit pour une Toyota Condor\\n\\nContient:\\n2 x LASS105 - Pied N° 5 190mm (Paire) - de Front Runner\\n1 x LBSK015 - Paire de barres de toit / 1345mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent / 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :8kg (17lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm(5\'\')\\nLongueur : 1420mm(56\'\')\\nHauteur : 220mm(9\'\')\\n\\nPoids de la livraison:\\n8.8kg (19.3lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Condor / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:20:29', NULL, NULL, 8.661422, 8.8, 6009542232423, 'ZA', 'EUR', 281.513, '8708.29.90', 10, 0);
