(517, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota 4Runner (5ième gén) - de Front Runner', 'KRTF054T', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et un set de pieds de rails pour monter le plateau Slimline II sur votre Toyota 4Runner 5ième génération. Le kit vous permet d\'installer la galerie de façon permanente, ou de la monter sans perçage pour la retirer plus facilement en cas de besoin.', 450, 1730, NULL, 1197.47899, 1436.974788, 'KRTF054T - Kit de galerie Slimline II pour une Toyota 4runner (2010-jusqu’à présent)\\nComposé de :\\n1 x FATF006 - Pieds de rail 93mm pour une Toyota 4runner (2009-jusqu’à présent)\\n1 x RRSTD11 - Plateau Slimline II - 1255mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 41.379kg (91.22lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : \\n41.84kg (92lbs)', 'La galerie Slimline II pour toute la longueur du toit de 2166mm contient le plateau Slimline II, un déflecteur de vent et un set de pieds de rails pour monter le plateau Slimline II sur votre Toyota 4Runner 5ième génération. Le kit vous permet d\'installer la galerie de façon permanente, ou de la monter sans perçage pour la retirer plus facilement en cas de besoin.', 'Kit de galerie Slimline II pour une Toyota 4Runner (5ième gén) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:20:53', NULL, NULL, 5.511814, 41.8, 6009542238395, 'ZA', 'EUR', 1197.479, '7616.99', 2, 0),
(518, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour un Toyota 4Runner (2ème génération) - par Front Runner', 'KRTF057T', 'Qui dit que les vieux pick-up ne peuvent pas vivre de nouvelles aventures ? Transportez votre matériel d\'aventure préféré sur votre toit avec ce kit de galerie Slimline II pour un Toyota 4Runner (2ème génération).', 440, 1730, NULL, 1096.63866, 1315.966392, 'KRTF057T -Kit de galerie Slimline II pour un Toyota 4Runner (2ème génération) - par Front Runner\\nComposé de :\\n2x FASS012 - Pieds / 40mm - 50mm\\n2x FASS013 - Pieds / 60mm - 70mm\\n1x RRSTA10 - Plateau SLII - 1165mm(W)X1964mm(L)\\n1x TRCA004 - Rails pour Hardtop / 1500mm(W)\\n1x TRCA008 - Rails universels 140mm\\n1x VACC016 - Outil pour écrou à gorge / M6/M8\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 32.62kg (71.91lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied de fixation indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des pieds de rails, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids de l\'expédition :\\nPoids : 32.8kg (72lbs)', 'Qui dit que les vieux pick-up ne peuvent pas vivre de nouvelles aventures ? Transportez votre matériel d\'aventure préféré sur votre toit avec ce kit de galerie Slimline II pour un Toyota 4Runner (2ème génération).', 'Kit de galerie Slimline II pour un Toyota 4Runner (2ème génération) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:20:59', NULL, NULL, 10.6, 32.8, 6009542217697, 'ZA', 'EUR', 1096.639, '8708.29.90', 10, 0),
