(523, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Hilux Revo DC (2016 - jusqu’à présent) - de Front Runner', 'KRTH011T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Toyota Hilux Revo Double Cabine. Vous devez forer dans le toit de votre véhicule pour insérer les pièces d’installation, un gabarit est fourni pour placer le trou.', 620, 1730, NULL, 819.32773, 983.193276, 'KRTH011T - Kit de galerie pour une Toyota Hilux Revo DC (2016 - jusqu’à présent) - Slimline II de Front Runner\\nComposé de :\\n1 x FATH002 - Rail pour une Toyota Hilux Revo DC 2016+ 91mm (Paire G/D)\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 24kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 27,7kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour installer le plateau Slimline II sur votre Toyota Hilux Revo Double Cabine. Vous devez forer dans le toit de votre véhicule pour insérer les pièces d’installation, un gabarit est fourni pour placer le trou.', 'Kit de galerie Slimline II pour une Toyota Hilux Revo DC (2016 - jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:21:38', NULL, NULL, 6.299216, 28.8, 6009542236575, 'ZA', 'EUR', 819.328, '8708.29.90', 10, 0),
(524, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Hilux (2005-2015) / Pieds AND Rails - de Front Runner', 'KRTH012', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 2 pieds de 40mm, 2 pieds de 65mm, 2 barres de toit de 1165mm, 2 rails pour une Toyota Hilux de 1240mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 115, 1290, NULL, 306.72269, 368.067228, 'KRTH012 - Kit de barres de toit pour une Toyota Hilux (2005-2015) / Pieds Rails - par Front Runner\\nComposé de :\\n1 x FASS001 - Pied 40mm (Paire)\\n1 x FASS014 - Pied 65mm (Paire)\\n1 x LBSK013 - Barres de toit 1165mm (Paire)\\n1 x TRTH001 - Rails pour une Hilux 05 de 1240mm (Paire G/D)\\n1 x WDLB001 - Déflecteur de vent de 10mm\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 8kg (17lbs)\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur de votre toit jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm/ 7/8\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 115mm (5\'\')\\nLongueur : 1290mm (51\'\')\\nHauteur : 240mm (9\'\')\\nPoids de la livraison:\\n8.9kg (19.5lbs)', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 2 pieds de 40mm, 2 pieds de 65mm, 2 barres de toit de 1165mm, 2 rails pour une Toyota Hilux de 1240mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour une Toyota Hilux (2005-2015) / Pieds AND Rails - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:42', NULL, NULL, 9.448824, 8.9, 6009542232447, 'ZA', 'EUR', 306.723, '8708.29.90', 10, 0),
(525, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Hilux Revo DC (2016-jusqu’à présent) / profil bas - de Front Runner', 'KRTH012T', '﻿La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail profil bas pour monter le plateau Slimline II sur votre Toyota Hilux Revo 2016+. Le forage est nécessaire pour l’installation.', 455, 1730, NULL, 802.52101, 963.025212, 'KRTH012T - Kit de galerie Slimline II pour une Hilux Revo DC (2016-jusqu’à présent) / profil bas - de Front Runner\\nComposé de :\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x FATH003 - Pieds de rail / profil bas pour une Toyota Hilux Revo DC (2016-jusqu’à présent) - de Front Runner\\nMatériel utilisé :\\nAluminium T6 en époxy noir\\nAcier haute résistance\\nPoids approximatif d’installation : 25kg (55lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm (18\'\')\\nLongueur 1620mm (64\'\')\\nHauteur 240mm (9\'\')\\nPoids de la livraison :\\nPoids : 29.1kg (64.0lbs)', '﻿La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail profil bas pour monter le plateau Slimline II sur votre Toyota Hilux Revo 2016+. Le forage est nécessaire pour l’installation.', 'Kit de galerie Slimline II pour une Hilux Revo DC (2016-jusqu’à présent) / profil bas - de Front Runner', 'Kit de Galerie Slimline II|Galerie|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:21:42', NULL, NULL, 9.448824, 28.6, 6009542248516, 'ZA', 'EUR', 802.521, '8708.29.90', 10, 0),
(526, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Hilux DC (1988-1997) / Montage pour gouttière - de Front Runner', 'KRTH013', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1370, NULL, 256.30252, 307.563024, 'KRTH013 - Kit de barres de toit pour une Toyota Hilux DC (1988-1997) / Montage pour gouttière - de Front Runner\\n\\nComposé de :\\n2 x LASS101 - Pied N° 1 120mm (Paire) - de Front Runner\\n1 x LBSK014 - Paire de barres de toit 1255mm (Paire) - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :7kg (15lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm(5\'\')\\nLongueur : 1370mm(54\'\')\\nHauteur : 180mm(7\'\')\\n\\nPoids de la livraison:\\n8.0kg (17.6lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 120mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Hilux DC (1988-1997) / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:47', NULL, NULL, 7.086618, 8.2, 6009542232454, 'ZA', 'EUR', 256.303, '8708.29.90', 10, 0),
(527, 1, 2, NULL, NULL, NULL, 'Kit galerie pour benne de chargement Toyota Hilux Legend RS Slimline II - par Front Runner', 'KRTH013T', 'Transportez encore plus dans votre Toyota Hilux grâce à ce kit de galerie complet et résistant, qui libère le précieux espace de chargement de votre benne.', 445, 1730, NULL, 693.27731, 831.932772, 'Composé de :\\n2x FASS016 - Pieds plats (paire) / 65mm\\n1x RRSTG06 - Plateau SLII - 1345mm(W)X1156mm(L)\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 48,2 kg (106.26lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nPoids : 445 mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 240mm (9\'\')\\nPoids à la livraison :\\nPoids : 23.8kg (52lbs)', 'Transportez encore plus dans votre Toyota Hilux grâce à ce kit de galerie complet et résistant, qui libère le précieux espace de chargement de votre benne.', 'Kit galerie pour benne de chargement Toyota Hilux Legend RS Slimline II - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 11:21:48', NULL, NULL, 9.4, 23.8, 6009542213286, 'ZA', 'EUR', 693.277, '7616.99', 10, 0),
(528, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Hilux (1988-1997) / Haut - de Front Runner', 'KRTHT01L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' pour une Toyota Hilux (1988-1997) contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 701.68067, 842.016804, 'KRTHT01L - Kit de galerie Slimline II pour une Toyota Hilux (1988-1997) / Haut - de Front Runner\\n\\nContient:\\n2 x LASS103 - Pied n° 3 155mm (Paire)\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 23kg (50lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\n\\nPoids de la livraison : 26.4kg (58.2lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' pour une Toyota Hilux (1988-1997) contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour une Toyota Hilux (1988-1997) / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:50', NULL, NULL, 5.511814, 26.2, 6009542225920, 'ZA', 'EUR', 701.681, '7616.99', 10, 0),
(529, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Hilux (1999-2004) / Large - de Front Runner', 'KRTHT03T', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Hilux (1999-2004) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie.', 450, 1730, NULL, 819.32773, 983.193276, ' \\nKRTHT03T - Kit de galerie pour une Toyota Hilux (1999 - 2004) / Large - Slimline II de Front Runner \\n  \\nContient : \\n1 x FASS002 - Pied 50mm (Paire) \\n1 x FASS003 - Pied 60mm (Paire) \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x RRAC021 - Adaptateur de pied entre la barre transversale (Paire) \\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n1 x TRTH002 - Rails pour une Hilux D/Cab 1280mm (Paire) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 24kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 27,6kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Hilux (1999-2004) contient le plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie.', 'Kit de galerie Slimline II pour une Toyota Hilux (1999-2004) / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:53', NULL, NULL, 5.511814, 27, 6009542221274, 'ZA', 'EUR', 819.328, '7616.99', 0, 0),
(530, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Hilux (2005-2015) / Haut - par Front Runner', 'KRTHT08T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Hilux (2005-2015) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 735.29412, 882.352944, 'KRTHT08T - Kit de galerie Slimline II pour une Toyota Hilux (2005-2015) / Haut - par Front Runner\\nComposé de :\\n1 x FASS003 - Pied 60mm (Paire)\\n1 x FASS006 - Pied 75mm HX (Paire) angle de 75mm\\n1 x RRAC021 - Adaptateur de pied entre la barre transversale (Paire)\\n1 x RRSTA07 - Plateau Slimline II - 1165mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n1 x TRTH001 - Rails pour une Hilux 05 1240mm (Paire G/D)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 23.0kg (50.8lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64.0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n26.3kg (58.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Hilux (2005-2015) contient un plateau Slimline II, un déflecteur de vent, 2 rails et 4 pieds. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Toyota Hilux (2005-2015) / Haut - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:56', NULL, NULL, 5.511814, 26.3, 6009542221281, 'ZA', 'EUR', 735.294, '8708.29.90', 10, 0),
(531, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 3/4 pour une Toyota Land Cruiser 76 - de Front Runner', 'KRTL014L', 'Le kit de galerie Slimline II 3/4 de 2166mm pour une Toyota Land Cruiser 76 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1264.7059, 1517.64708, 'KRTL014L - Kit de galerie 3/4 pour une Toyota Land Cruiser 76 - Slimline II de Front Runner\\n\\nContient:\\n4 x LASS104 - No 4 Leg 170mm (paire) - par Front Runner\\n1 x RRSTG11 - Plateau Slimline II - 1345mm(L) X 2166mm(L) - par Front Runner\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 34kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 40,0kg', 'Le kit de galerie Slimline II 3/4 de 2166mm pour une Toyota Land Cruiser 76 contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II 3/4 pour une Toyota Land Cruiser 76 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|CURRENT PROMOTIONS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:21:59', NULL, NULL, 5.511814, 40, 6009542225937, 'ZA', 'EUR', 1264.706, '8708.29.90', 10, 0),
