(533, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 3/4 pour une Toyota Land Cruiser 78 - de Front Runner', 'KRTL018L', 'Ce kit de galerie complète Slimline II3/4de 2166mm/85,3\'\' de long pour le transport de matériel sur le toit du Toyota Land Cruiser 78 contient un plateau Slimline II et un déflecteur de vent, ainsi que 8 pieds de montage de gouttière pour fixer le plateau au véhicule. Il s\'installe facilement sans qu\'il soit nécessaire de percer.', 450, 1730, NULL, 1340.33613, 1608.403356, 'KRTL018L - Kit galerie de toit3/4pour Toyota Land Cruiser 78 Slimline II - par Front Runner\\nComposé de :\\n1 x LASD105 - No 5 Leg Diagonal 190mm (paire) - par Front Runner\\n3 x LASS105 - No 5 Leg 190mm (paire) - par Front Runner\\n1 x RRSTJ11 - Plateau Slimline II - 1425mm(L) X 2166mm(L) - par Front Runner\\n1 x WDST009 - Paire de déflecteurs de vent de 20mm de large aux lèvres / 1345mm(W) - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif au montage : 41,2 kg (90,8 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1615mm (64,0\'\')\\nHauteur : 140mm (6.0\'\')\\nPoids de la livraison :\\n40,4kg (89.0lbs)', 'Ce kit de galerie complète Slimline II3/4de 2166mm/85,3\'\' de long pour le transport de matériel sur le toit du Toyota Land Cruiser 78 contient un plateau Slimline II et un déflecteur de vent, ainsi que 8 pieds de montage de gouttière pour fixer le plateau au véhicule. Il s\'installe facilement sans qu\'il soit nécessaire de percer.', 'Kit de galerie Slimline II 3/4 pour une Toyota Land Cruiser 78 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:22:08', NULL, NULL, 5.511814, 40.4, 6009542228976, 'ZA', 'EUR', 1340.336, '8708.29.90', 10, 0),
(534, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour une Toyota Land Cruiser 80 - de Front Runner', 'KRTL019L', ' Le kit de galerie Slimline II 1/2 de 1358mm pour une Toyota Land Cruiser 80 contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 802.52101, 963.025212, ' \\nKRTL019L - Galerie 1/2 pour une Toyota Land Cruiser 80 - Slimline II de Front Runner \\n  \\nContient : \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n2 x LASS101 - Pied n° 1 120mm (Paire) 1 x RRSTG07 - Plateau Slimline II - 1345mm (largeur) x 1358mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 23kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 27,2kg', ' Le kit de galerie Slimline II 1/2 de 1358mm pour une Toyota Land Cruiser 80 contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II 1/2 pour une Toyota Land Cruiser 80 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:22:12', NULL, NULL, 5.511814, 26.7, 6009542227962, 'ZA', 'EUR', 802.521, '7616.99', 10, 0),
(535, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 80 - de Front Runner', 'KRTL020L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' pour une Toyota Land Cruiser 80 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1189.07563, 1426.890756, 'KRTL020L - Kit de galerie Slimline II pour une Toyota Land Cruiser 80 - par Front Runner\\nComposé de :\\n2 x LASS027 - Entretoise de jambe 6mm (paire) - par Front Runner\\n4 x LASS102 - No 2 Leg 130mm (paire) - par Front Runner\\n1 x RRSTG10 - Plateau Slimline II - 1345mm(L) X 1964mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 32kg (71lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule (™s) et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule (™s).\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids 37.7kg (82.9lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' pour une Toyota Land Cruiser 80 contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 80 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:22:14', NULL, NULL, 5.511814, 37.7, 6009542225951, 'ZA', 'EUR', 1189.076, '8708.29.90', 10, 0),
(536, 1, 2, NULL, NULL, NULL, 'Kit de galerie pour une Toyota Land Cruiser 79 DC Pickup Slimline II - de Front Runner', 'KRTL022L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Land Cruiser DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 911.76471, 1094.117652, 'KRTL022L - Kit de galerie pour une Toyota Land Cruiser 79 DC Pickup Slimline II - de Front Runner \\n\\nContient:\\n3 x LASS103 - Pied n° 3 155mm (Paire)\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 26kg (57lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\n\\nPoids de la livraison : 30.3kg (66.5lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm pour une Toyota Land Cruiser DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter 