(541, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 100/Lexus LX470 - de Front Runner', 'KRTL029T', 'La galerie Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Toyota Land Cruiser 100/Lexus LX470. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 1197.47899, 1436.974788, 'KRTL029T - Kit de galerie pour une Toyota Land Cruiser 100 - Slimline II de Front Runner\\nContient :\\n1 x FATL002 - Pied de rail pour une Toyota Land Cruiser 100 (Paire G/D) 63mm\\n1 x RRSTG10 - Plateau Slimline II - 1345mm (largeur) x 1964mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 36kg (78lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm(18\'\')\\nLongueur : 1615mm(64\'\')\\nHauteur : 140mm(6\'\')\\nPoids de la livraison : 41.5kg (91.3lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1964mm/77.3\'\' contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Toyota Land Cruiser 100/Lexus LX470. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 100/Lexus LX470 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:22:57', NULL, NULL, 5.511814, 41.8, 6009542227733, 'ZA', 'EUR', 1197.479, '8708.29.90', 10, 0),
(542, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 79 DC Pick-Up - de Front Runner', 'KRTL030L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm pour une Toyota Land Cruiser DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 978.9916, 1174.78992, 'KRTL030L - Kit de galerie Slimline II pour une Toyota Land Cruiser 79 DC Pick-Up - de Front Runner\\n\\nContient:\\n3 x LASS103 - Pied N° 3 155mm (Paire)\\n1 x RRSTJ08 - Plateau Slimline II - 1425mm (largeur) x 1560mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 28kg (61lbs) \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\n\\nPoids de la livraison :32.4kg (71.2lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1560mm pour une Toyota Land Cruiser DC contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 79 DC Pick-Up - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:23:02', NULL, NULL, 5.511814, 32.3, 6009542227979, 'ZA', 'EUR', 978.992, '8708.29.90', 10, 0),
