ta Land Cruiser 100. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de 1/2 galerie Slimline II pour une Toyota Land Cruiser 100 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:06', NULL, NULL, 5.511814, 33.4, 6009542229195, 'ZA', 'EUR', 886.555, '7616.99', 10, 0),
