 plateau Slimline II sur votre Toyota Land Cruiser 200. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II 1/2 pour une Toyota Land Cruiser 200 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:09', NULL, NULL, 5.511814, 33, 6009542229201, 'ZA', 'EUR', 827.731, '8708.29.90', 10, 0),
(545, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 60 - par Front Runner', 'KRTL033L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour toutes les séries 60 et 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1231.09244, 1477.310928, 'KRTL033L - Kit de galerie Slimline II pour une Toyota Land Cruiser 60 - par Front Runner\\nComposé de :\\n1 x LASD103 - Pied Diagonal N° 3 155mm (Paire)\\n2 x LASS102 - Pied N° 2 130mm (Paire)\\n1 x RRSTJ11 - Plateau Slimline II - 1425mm (largeur) x 2166mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 33kg (73lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n38.6kg (85.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm pour toutes les séries 60 et 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour installer une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 60 - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:12', NULL, NULL, 5.511814, 39, 6009542234106, 'ZA', 'EUR', 1231.092, '8708.29.90', 4, 0),
(546, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Land Cruiser 76 / Montage sur gouttière - de Front Runner', 'KRTL035', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 155mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1555, NULL, 281.51261, 337.815132, 'KRTL035 - Kit de barres de toit pour une Toyota Land Cruiser 76 / Montage sur gouttière - de Front Runner\\n\\nContient:\\n2 x LASS103 - Pied N° 3 155mm (Paire)\\n1 x LBSK016 - Barres de toit 1425mm (Paire)\\n1 x WDLB001 - Déflecteur de vent de 10mm\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 7kg (16lbs) \\n\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière. \\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm\\nLongueur : 1555mm\\nHauteur : 175mm\\n\\nPoids de la livraison: 8.7kg (19.2lbs) ', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 155mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Land Cruiser 76 / Montage sur gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:37', NULL, NULL, 6.889767, 8.8, 6009542232508, 'ZA', 'EUR', 281.513, '8708.29.90', 10, 0),
(547, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Land Cruiser 75/79 / Montage pour gouttière - de Front Runner', 'KRTL036', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 130mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 115, 1555, NULL, 273.10924, 327.731088, 'KRTL036 - Kit de barres de toit pour une Toyota Land Cruiser 75/79 / Montage pour gouttière - de Front Runner\\n\\nComposé de :\\n2 x LASS102 - Pied N° 2 130mm (Paire) - de Front Runner\\n1 x LBSK016 - Barres de toit 1425mm (Paire) - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation 7kg (16lbs) \\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 115mm (5\'\')\\nLongueur :1555mm (61\'\')\\nHauteur :180mm (7\'\')\\n\\nPoids de la livraison:\\n8.4kg (18.6lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 130mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Land Cruiser 75/79 / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:38', NULL, NULL, 7.086618, 8.6, 6009542232515, 'ZA', 'EUR', 273.109, '8708.29.90', 10, 0),
