(549, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Land Cruiser 78 3 portes / Montage pour gouttière - de Front Runner', 'KRTL038', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1545, NULL, 289.91597, 347.899164, 'KRTL038 - Kit de barres de toit pour une Toyota Land Cruiser 78 3 portes / Montage pour gouttière - de Front Runner\\n\\nContient:\\n2 x LASS105 - Pied N° 5 190mm (Paire) - de Front Runner\\n1 x RRAC044 - Kit de capuchons en plastique pour les barres de toit (Set de 4) - de Front Runner\\n2 x RRSS1425 - Barres transversales standards de 1425mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation 7kg \\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1545mm (61\'\')\\nHauteur : 175mm(7\'\')\\n\\nPoids de la livraison:\\n8.3kg (18.4lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Land Cruiser 78 3 portes / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:23:41', NULL, NULL, 6.889767, 8.5, 6009542238418, 'ZA', 'EUR', 289.916, '8708.29.90', 10, 0),
(550, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Toyota Land Cruiser SC Pick-Up Truck - par Front Runner', 'KRTL039T', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 752mm pour votre ToyotaLand Cruiser Pick-Up contient le plateau Slimline II, un déflecteur de vent ainsique 4 pieds de support pour les gouttières pour monter le plateau sur votrevéhicule. Ce système s’installe facilement et aucun forage n’est nécessaire.', 455, 1730, NULL, 617.64706, 741.176472, 'KRTL039T - Kit de galerie de toit Slimline II pour une Toyota Land Cruiser SC Pick-Up Truck- par Front Runner\\nComposé de :\\n2 x LASS103 - Pieds n°3 155mm (paire) - de Front Runner\\n1 x RRSTJ04 - Plateau Slimline II - 1425mm (largeur) x 752mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 19kg (41lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 250mm (10\'\')\\nPoids de la livraison :\\n21.9kg (48.1lbs)', 'Ce kit degalerie Slimline II pour toute la longueur du toit de 752mm pour votre ToyotaLand Cruiser Pick-Up contient le plateau Slimline II, un déflecteur de vent ainsique 4 pieds de support pour les gouttières pour monter le plateau sur votrevéhicule. Ce système s’installe facilement et aucun forage n’est nécessaire.', 'Kit de galerie de toit Slimline II pour une Toyota Land Cruiser SC Pick-Up Truck - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:23:42', NULL, NULL, 9.842525, 22.9, 6009542252926, 'ZA', 'EUR', 617.647, '8708.29.90', 10, 0),
(551, 1, 2, NULL, NULL, NULL, 'Kit de 3/4 galerie pour une Toyota Land Cruiser 78 / Haut - de Front Runner', 'KRTL040T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Toyota Land Cruiser 78 Séries contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit plus haut dispose d\'un espace pour monter les tables Front Runner ou d\'autres accessoires compatibles sous la galeire. La galerie s’installe facilement sans devoir forer.', 455, 1730, NULL, 1348.7395, 1618.4874, 'KRTL040T -Kit de 3/4 galerie pour une Toyota Land Cruiser 78 / Haut - de Front Runner\\nComposé de :\\n4x LASS107 - No 7 Pied 225mm (Paire)\\n1x RRSTJ11 - Plateau SLII - 1425mm(W)X2166mm(L)\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 41.83kg (92.22lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 455mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 280mm (11\'\')\\nPoids de la livraison :\\nPoids : 40.48kg (89lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2166mm/85.3\'\' pour une Toyota Land Cruiser 78 Séries contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit plus haut dispose d\'un espace pour monter les tables Front Runner ou d\'autres accessoires compatibles sous la galeire. La galerie s’installe facilement sans devoir forer.', 'Kit de 3/4 galerie pour une Toyota Land Cruiser 78 / Haut - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Kit de Galerie Slimline II|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:23:47', NULL, NULL, 11.023628, 40.5, 6009542260303, 'ZA', 'EUR', 1348.74, '8708.29.90', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(552, 1, 2, NULL, NULL, NULL, 'Toyota Land Cruiser 60 Slimline II Roof Rack Kit / Tall - by Front Runner', 'KRTL041T', 'This 2166mm/85.3\'\' long, full-size, Slimline II cargo carrying roof rack kit for the 60 Series Toyota Land Cruiser contains the Slimline II Tray and Wind Deflector, as well as 6 Gutter Mount Legs for mounting the Tray to the vehicle. This taller kit has space for mounting the Front Runner tables or other compatible accessories under the rack. Installs easily with no drilling required.', 450, 1730, NULL, 1247.89916, 1497.478992, 'KRTL041T - Toyota Land Cruiser 60 Slimline II Roof Rack Kit / Tall - by Front Runner \\nConsisting of:\\n1 x LASD105 - No 5 Leg Diagonal 190mm (Pair) - by Front Runner 2 x LASS104 - No 4 Leg 170mm (Pair) - by Front Runner 1 x RRSTJ11 - Slimline II Tray - 1425mm(W) X 2166mm(L) - by Front Runner \\n\\nMaterial used:\\nBlack epoxy powder-coated T6 aluminium \\n3CR12 Stainless Steel\\nApproximate Installed Weight 34kg (75lbs)\\nThe t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.\\nTo determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/ 2) to the height of the Foot, Grab-on Foot or Strap-On Foot listed above.\\nIf your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Legs to determine the height of the rack from your vehicle’s rain gutters.\\nIf your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof.\\nShipping Dimensions:\\nWidth450mm (18)Length610mm (24)Height 405mm (16)\\nShipping Weight:\\nWeight39.5kg (86.8lbs)', 'This 2166mm/85.3\'\' long, full-size, Slimline II cargo carrying roof rack kit for the 60 Series Toyota Land Cruiser contains the Slimline II Tray and Wind Deflector, as well as 6 Gutter Mount Legs for mounting the Tray to the vehicle. This taller kit has space for mounting the Front Runner tables or other compatible accessories under the rack. Installs easily with no drilling required.', 'Toyota Land Cruiser 60 Slimline II Roof Rack Kit / Tall - by Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:24:12', NULL, NULL, 15.94489, 39.5, 6009542260891, 'ZA', 'EUR', 1247.899, '8708.29.90', 10, 0),
(553, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 200/Lexus LX570 / Profil bas - de Front Runner', 'KRTL042T', 'Chargez votre Land Cruiser avec ce kit de galerie de toit pour Slimline II - aucun perçage n\'est nécessaire.', 450, 1725, NULL, 1163.86555, 1396.63866, 'KRTL042T - Kit de galerie Slimline II pour une Toyota Land Cruiser 200/Lexus LX570 / Profil bas - par Front Runner\\nComposé de :\\n1 x FATL003 - Toyota Land Cruiser 200 rails de pied / profil bas - par Front Runner\\n1 x RRSTD11 - Plateau Slimline II - 1255mm(L) X 2166mm(L) - par Front Runner\\nMatériaux utilisés :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif au montage : 38,6 kg (85,0 lb)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1725mm (68,0\'\')\\nHauteur : 250mm (10.0\'\')\\nPoids de la livraison :\\n39.0kg (86.0lbs)', 'Chargez votre Land Cruiser avec ce kit de galerie de toit pour Slimline II - aucun perçage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 200/Lexus LX570 / Profil bas - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:24:16', NULL, NULL, 9.8, 39, 6009542283708, 'ZA', 'EUR', 1163.866, '8708.29.90', 8, 0),
(554, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour Toyota Land Cruiser 40 (1960-1984) - de Front Runner', 'KRTL043T', 'Chargez votre Land Cruiser 40 avec ce kit pratique de porte-bagages de toit pour le transport de marchandises Slimline II. Sa hauteur supplémentaire permet de monter une table Front Runner ou tout autre accessoire compatible directement en dessous.', 450, 1720, NULL, 1130.2521, 1356.30252, 'KRTL043T -Kit de galerie de toit Slimline II pour Toyota Land Cruiser 40 (1960-1984) - de Front Runner\\nComposé de :\\n3 x LASS104 - No 4 Leg 170mm (paire) - par Front Runner\\n1 x RRSTP09 - Plateau SLII - 1575mm(L)X1762mm(L)\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 36,7 kg (81,0 lb)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions d\'expédition :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1720mm (68,0\'\')\\nHauteur : 260mm (10.0\'\')\\nPoids de l\'expédition :\\n36,4 kg (80,0 lbs)', 'Chargez votre Land Cruiser 40 avec ce kit pratique de porte-bagages de toit pour le transport de marchandises Slimline II. Sa hauteur supplémentaire permet de monter une table Front Runner ou tout autre accessoire compatible directement en dessous.', 'Kit de galerie de toit Slimline II pour Toyota Land Cruiser 40 (1960-1984) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:24:21', NULL, NULL, 10.2, 36.4, 6009542283715, 'ZA', 'EUR', 1130.252, '8708.29.90', 10, 0),
(555, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Toyota Land Cruiser 76/ profil bas - de Front Runner', 'KRTL044T', 'Cette version à profil bas du Kit Galerie Slimline II pour Toyota Land Cruiser 76 est placée plus bas sur le toit, ce qui permet un accès plus facile et une esthétique élégante. Le montage est facile et ne nécessite aucun perçage.', 440, 1730, NULL, 1365.54622, 1638.655464, 'Composé de :\\n4x LASS027 - Entretoise de jambe 6mm (paire)\\n4x LASS103 - No 3 Leg 155mm (Paire)\\n1x RRSTG12 - Plateau SLII - 1345mm(W)X2368mm(L)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 42,1 kg (92.81lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 260mm (10\'\')\\nPoids à la livraison :\\nPoids : 42.4kg (93lbs)', 'Cette version à profil bas du Kit Galerie Slimline II pour Toyota Land Cruiser 76 est placée plus bas sur le toit, ce qui permet un accès plus facile et une esthétique élégante. Le montage est facile et ne nécessite aucun perçage.', 'Kit de galerie Slimline II pour Toyota Land Cruiser 76/ profil bas - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:24:24', NULL, NULL, 10.2, 42.4, 6009542217970, 'ZA', 'EUR', 1365.546, '7616.99', 10, 0),
(556, 1, 2, NULL, NULL, NULL, 'Kit de 1/2 galerie Slimline II pour une Toyota Land Cruiser 80 / Haut - de Front Runner', 'KRTLT19L', 'Le kit de1/2galerie Slimline II de 1358mm/53.5\'\'pour toutes les séries 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 810.92437, 973.109244, 'KRTLT19L - Kit de galerie Slimline II 1/2 pour une Toyota Land Cruiser 80 / Haut - par Front Runner\\nComposé de :\\n2 x LASS103 - Pied n° 3 155mm (Paire)\\n1 x RRSTG07 - Plateau Slimline II - 1345mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 24kg (52lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm (18\'\')\\nLongueur : 1615mm (64\'\')\\nHauteur : 140mm (6\'\')\\nPoids de la livraison :\\n27.4kg (60.2lbs)', 'Le kit de1/2galerie Slimline II de 1358mm/53.5\'\'pour toutes les séries 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 4 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires compatibles en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de 1/2 galerie Slimline II pour une Toyota Land Cruiser 80 / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:24:26', NULL, NULL, 5.511814, 27, 6009542230924, 'ZA', 'EUR', 810.924, '7616.99', 10, 0),
(557, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 80 / Haut - de Front Runner', 'KRTLT20L', 'Le kit de galerie Slimline II pour toute la longueur du toit de1964mm/77.3\'\'pour toutes les séries 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 1205.88235, 1447.05882, 'KRTLT20L - Kit de galerie Slimline II pour une Toyota Land Cruiser 80 / Haut - par Front Runner\\nComposé de :\\n2 x LASS027 - Entretoise de jambe 6mm (paire) - par Front Runner\\n4 x LASS103 - No 3 Leg 155mm (paire) - par Front Runner\\n1 x RRSTG10 - Plateau Slimline II - 1345mm(L) X 1964mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 33kg (72lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm/ 2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 140mm (6\'\')\\nPoids de l\'expédition :\\nPoids 38.2kg (84.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de1964mm/77.3\'\'pour toutes les séries 80 de la Toyota Land Cruiser contient le plateau Slimline II, un déflecteur de vent et 6 pièces de montage sur gouttières pour monter le plateau sur votre véhicule. Ce kit ‘haut’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 80 / Haut - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:24:29', NULL, NULL, 5.511814, 37.7, 6009542225999, 'ZA', 'EUR', 1205.882, '8708.29.90', 10, 0),
(558, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Land Cruiser 78 / Large - de Front Runner', 'KRTLT25L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Toyota Land Cruiser 78 contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage de gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1651.2605, 1981.5126, 'KRTLT25L - Kit de galerie pour une Toyota Land Cruiser 78 / Large - Slimline II de Front Runner\\n\\nContient:\\n1 x LASD110 - Pied Diagonal n° 10 280mm (Paire)4 x LASS107 - Pied n° 7 225mm (Paire)1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n1 x RRSTJ14 - Plateau Slimline II - 1425mm (largeur) x 2772mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 44kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 51,5kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Toyota Land Cruiser 78 contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage de gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Land Cruiser 78 / Large - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:24:30', NULL, NULL, 5.511814, 52.2, 6009542226002, 'ZA', 'EUR', 1651.261, '8708.29.90', 10, 0),
