(565, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Prado 95 / Montage pour gouttière - de Front Runner', 'KRTP016', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 170mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 120, 1448, NULL, 273.10924, 327.731088, 'KRTP016 - Barres de toit 1345mm de Front Runner / Kit pour une Toyota Land Prado 95\\n\\nContient:\\n2 x LASS104 - Pied N° 4 170mm (Paire) - de Front Runner\\n1 x LBSK015 - Paire de barres de toit 1345mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent de 10mm\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation :7kg (16lbs)\\n\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 120mm (5\'\')\\nLongueur : 1448mm (57\'\')\\nHauteur : 175mm(7\'\')\\n\\nPoids de la livraison:\\n8.6kg (18.9lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 170mm, 2 barres de toit de 1345mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Prado 95 / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:24:53', NULL, NULL, 6.889767, 8.7, 6009542232539, 'ZA', 'EUR', 273.109, '7616.99', 10, 0),
(566, 1, 2, NULL, NULL, NULL, 'Toyota Pick-Up Truck (1988-1994) Slimline II Load Bed Rack Kit - by Front Runner', 'KRTP016T', 'This kit creates a full size rack that sits above your Toyota\'s (1988-1994) truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1255mm/49.5\'\' (W) x 1358mm/53.5\'\' (L)), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks Drilling may be required for installation..', 450, 1730, NULL, 928.57143, 1114.285716, 'KRTP016T - Toyota Pick-Up Truck (1988-1994) Slimline II Load Bed Rack Kit - by Front Runner \\nConsisting of:\\n2 x LASS026 - Universal Load Bed Leg 188mm (Pair) - by Front Runner 1 x RRSTD07 - Slimline II Tray - 1255mm(W) X 1358mm(L) - by Front Runner 1 x TRBU001 - Pick-Up Load Bed Tracks / 1000mm(L) - by Front Runner \\n\\nMaterial used:\\nBlack epoxy powder-coated T6 aluminium \\n3CR12 Stainless Steel\\nApproximate Installed Weight 25kg (54lbs)\\nThe t-slots on the tops and bottoms of the rack tray slats and edge profiles accommodate standard 8mm bolts.\\nTo determine the approximate height from your vehicle’s roof to the top of your Slimline II Roof Rack, add the height of the Slimline II Tray (50mm/ 2) to the height of the Foot, Grab-on Foot or Strap-On Foot listed above.\\nIf your Slimline II Roof Rack kit uses Legs, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Legs to determine the height of the rack from your vehicle’s rain gutters.\\nIf your Slimline II Roof Rack kit uses Foot Rails, add the height of the Slimline II Tray (50mm/ 2\'\') to the height of the Foot Rails to determine the height of the rack from the crown (highest point) of the vehicles roof.\\nShipping Dimensions:\\nWidth450mm (18)Length1615mm (64)Height 140mm (6)\\nShipping Weight:\\nWeight28.7kg (63.1lbs)', 'This kit creates a full size rack that sits above your Toyota\'s (1988-1994) truck bed. This Slimline II cargo carrying rack kit contains the Slimline II tray (1255mm/49.5\'\' (W) x 1358mm/53.5\'\' (L)), 2 Tracks, and 4 Pick-Up Truck Bed Universal Legs that fit into the Tracks Drilling may be required for installation..', 'Toyota Pick-Up Truck (1988-1994) Slimline II Load Bed Rack Kit - by Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:24:55', NULL, NULL, 5.511814, 29.5, 6009542231853, 'ZA', 'EUR', 928.571, '7616.99', 10, 0),
(567, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Quantum - de Front Runner', 'KRTQ003L', ' Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Toyota Quantum contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 1567.22689, 1880.672268, ' \\nKRTQ003L - Kit de galerie pour une Toyota Quantum - Slimline II de Front Runner \\n  \\nContient : \\n4 x LASS106 - Pied N° 6 195mm (Paire) 1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTJ14 - Plateau Slimline II - 1425mm (largeur) x 2772mm (longueur) x 50mm (hauteur) \\n1 x WDST009 - Déflecteur de vent 20mm Large (Paire) 1345+ mm \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 43kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 50,2kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Toyota Quantum contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Quantum - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:24:58', NULL, NULL, 5.511814, 49.5, 6009542227887, 'ZA', 'EUR', 1567.227, '7616.99', 4, 0),
(568, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Toyota Quantum / Montage pour gouttière - de Front Runner', 'KRTQ004', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 119, 1551, NULL, 289.91597, 347.899164, 'KRTC003 - Barres de toit 1345mm de Front Runner / Kit pour une Toyota Condor\\nContient :\\n2 x LASS105 - Pied N° 5 190mm (Paire) - de Front Runner\\n1 x LBSK016 - Paire de barres de toit / 1425mm - de Front Runner\\n1 x WDLB001 - Déflecteur de vent / 10mm - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 8kg (17lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de livraison :\\nLargeur : 119mm (5\'\')\\nLongueur : 1551mm (61\'\')\\nHauteur : 178mm (7\'\')\\nPoids de la livraison:\\n8.9kg (19.7lbs)', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1425mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barres de toit pour une Toyota Quantum / Montage pour gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:25:00', NULL, NULL, 7.007878, 9.1, 6009542232546, 'ZA', 'EUR', 289.916, '7616.99', 10, 0),
(569, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Quantum Toit Bas (2004 - jusqu’à présent) - de Front Runner', 'KRTQ005L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2272mm/89.5\'\' pour une Toyota Quantum Toit Bas contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 620, 1730, NULL, 1575.63025, 1890.7563, 'KRTQ005L - Kit de galerie pour une Toyota Quantum Pavillon Bas (2004 - jusqu’à présent) - Slimline II de Front Runner\\n\\nContient:\\n4 x LASS102 - Pied N° 2 130mm (Paire)\\n1 x RRSTM14 - Plateau Slimline II - 1475mm (largeur) x 2772mm (longueur) - de Front Runner\\n1 x WDST009 - Déflecteur de vent 20mm Large (Paire) 1345l mm - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 43kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 620mm (24\'\')\\nLongueur : 1635mm (64\'\')\\nHauteur : 160mm (6\'\')\\nPoids de la livraison :49.7kg (109.3lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2272mm/89.5\'\' pour une Toyota Quantum Toit Bas contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Quantum Toit Bas (2004 - jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:25:01', NULL, NULL, 6.299216, 48.8, 6009542235455, 'ZA', 'EUR', 1575.63, '7616.99', 10, 0),
(570, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Toyota Rav4 (2006-2018) - de Front Runner', 'KRTR002T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Toyota Rav4.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 785.71429, 942.857148, 'Composé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR052 - Poignées extérieures de rail surélevé / No. 3\\n2x GORR071 - Grips intérieurs de rail surélevé / B\\n1x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 48.76kg (107.5lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 455 mm (18\'\')\\nLongueur : 1610mm (63\'\')\\nHauteur : 285mm (11\'\')\\nPoids à la livraison :\\nPoids : 24.44kg (54lbs)', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Toyota Rav4.Ce système s’installe facilement en utilisant les pieds solides tout-terrainqui s’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II pour une Toyota Rav4 (2006-2018) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:25:06', NULL, NULL, 11.220478, 24.4, 6009542252759, 'ZA', 'EUR', 785.714, '8708.29.90', 10, 0);
