(571, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Toyota Rush (2018-actuel) - de Front Runner', 'KRTR003T', 'Ce kit de galerie Slimline IIpour toute la longueur du toit de 1358 mm contient le plateau Slimline II, undéflecteur de vent et 2 paires de pieds Rail Grip pour monter le plateauSlimline II sur les rails flush de votre Toyota Rush. Ce système s’installefacilement en utilisant les pieds solides tout-terrain qui s’accrochent auxbarres longitudinales d’origine. Le forage n’est pas nécessaire.', 455, 1730, NULL, 768.90756, 922.689072, 'Contient:\\n2 x GOFR001 -Base de pied de rail (paire) - de Front Runner\\n2 x GOFR014 - Poignées extérieures de rail flush / N° 6 - de FrontRunner\\n2 x GOFR032 - Poignées intérieuresde rail flush / C - de FrontRunner\\n1 x RRSTA07 - Plateau Slimline II - 1165 mm (largeur) x 1358 mm(longueur) - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 20 kg\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barretransversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied de fixation de la galerie pour que lagalerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toitavec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur degalerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez lahauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pourdéterminer la hauteur de la galerie à partir du point le plus haut du toit devotre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455 mm\\nLongueur 1610 mm\\nHauteur 205 mm\\n\\nPoids de la livraison :\\nPoids : 23,8 kg', 'Ce kit de galerie Slimline IIpour toute la longueur du toit de 1358 mm contient le plateau Slimline II, undéflecteur de vent et 2 paires de pieds Rail Grip pour monter le plateauSlimline II sur les rails flush de votre Toyota Rush. Ce système s’installefacilement en utilisant les pieds solides tout-terrain qui s’accrochent auxbarres longitudinales d’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Toyota Rush (2018-actuel) - de Front Runner', 'Galerie|VEHICLE SPECIFIC GEAR|Galeries de toit pour rails d\'origine/ OEM', 0, 1, '2022-01-07 11:25:10', NULL, NULL, 8.07087, 23.9, 6009542260327, 'ZA', 'EUR', 768.908, '7616.99', 10, 0),
(572, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Rav4 (2019-jusqu\'à présent) - de Front Runner', 'KRTR004T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' pour une Toyota Rav4 2019+ contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 450, 1730, NULL, 743.69748, 892.436976, 'KRTR004T - Kit galerie de toit pour Toyota Rav4 (2019-actuel) SLII\\nComposé de :\\n1 x FATR001 - Rails de pied pour Toyota Rav4 (2019-actuel) - par Front Runner\\n1 x RRSTD07 - Plateau Slimline II - 1255mm(L) X 1358mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 21kg (47lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 260mm (10\'\')\\nPoids de la livraison\\nPoids 24.9kg (54.8lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 1358mm/53.5\'\' pour une Toyota Rav4 2019+ contient le plateau Slimline II, un déflecteur de vent et 2 foot rails pour monter le plateau sur votre véhicule. La galerie s’installe facilement sans devoir forer.', 'Kit de galerie Slimline II pour une Toyota Rav4 (2019-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:25:13', NULL, NULL, 10.236226, 24.9, 6009542261997, 'ZA', 'EUR', 743.697, '8708.29.90', 10, 0),
(573, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour uneToyota Rav4 Adventure (2019-jusqu\'à présent) - de Front Runner', 'KRTR005T', 'Vous avez choisi le RAV4 Adventure pour une bonne raison. Préparez-vous pour les expéditions hors route pour lesquelles il est né avec le kit de galerie Slimline II du Toyota RAV4 Adventure (2019 - jusqu\'à présent).', 440, 1730, NULL, 710.08403, 852.100836, 'KRTR005T -Kit de galerie Slimline II pour uneToyota Rav4 Adventure (2019-jusqu\'à présent) - de Front Runner\\nComposé de :\\n1x FATR002 - Foot rails pour le Toyota Rav4 Adventure (2019-jusqu\'à présent)\\n1x RRSTD07 - Plateau SLII - 1255mm(l)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 29,01 kg (63,96lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 270mm (11\'\')\\nPoids de la livraison :\\nPoids : 30kg (66lbs)', 'Vous avez choisi le RAV4 Adventure pour une bonne raison. Préparez-vous pour les expéditions hors route pour lesquelles il est né avec le kit de galerie Slimline II du Toyota RAV4 Adventure (2019 - jusqu\'à présent).', 'Kit de galerie Slimline II pour uneToyota Rav4 Adventure (2019-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:25:18', NULL, NULL, 10.6, 30, 6009542220277, 'ZA', 'EUR', 710.084, '7616.99', 6, 0),
(574, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Tacoma (2005-jusqu’à présent) - de Front Runner', 'KRTT002T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Tacoma Double Cabine 2005+. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. Compatible avec l’antenne ‘aileron requin’. ', 450, 1730, NULL, 810.92437, 973.109244, 'KRTT002T - Kit de galerie Slimline II pour une Toyota Tacoma (2005-jusqu’à présent) - de Front Runner\\nContient:\\n1 x FATT002 - Pied de rail pour une Toyota Tacoma 2005+ (Paire G/D) 81mm\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation: 26kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 30,4kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Tacoma Double Cabine 2005+. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire. Compatible avec l’antenne ‘aileron requin’. ', 'Kit de galerie Slimline II pour une Toyota Tacoma (2005-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:25:22', NULL, NULL, 5.511814, 29.9, 6009542236964, 'ZA', 'EUR', 810.924, '8708.29.90', 5, 0),
(575, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Toyota Etios Cross - de Front Runner', 'KRTT004T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Toyota Etios Cross. Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 450, 1730, NULL, 802.52101, 963.025212, '2 x GOFR001 -Base de pied derail (Paire) - de Front Runner\\n2 x GORR055 - Rail élevéextérieurGrab-On / N° 6 - de Front Runner\\n2 x GORR073 - Rail élevéintérieurGrab-On / D - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1156mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 21kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur450mm\\nLongueur1615mm\\nHauteur140mm\\n\\nPoidsde la livraison :Poids : 24,4kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1358mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Toyota Etios Cross. Ce système s’installe facilement en utilisant les piedssolides tout-terrain qui s’accrochent aux barres longitudinales d’origine. Leforage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Toyota Etios Cross - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:25:27', NULL, NULL, 5.511814, 24.6, 6009542252803, 'ZA', 'EUR', 802.521, '7616.99', 10, 0),
(576, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Tacoma Pick-Up (2005-jusqu’à présent) - de Front Runner', 'KRTT900T', 'Ce kit offreune galerie pour la benne de la Toyota Tacoma (2005 + avec des railslongitudinaux d’origine). Ce kit de galerie Slimline II contient le plateauSlimline II (1425mm/56.1\'\' (larg.) x 1358mm/53.5\'\' (long.)) et 4 piedsuniversels pour benne de Pick-Up qui s’installent facilement en utilisant lesrails longitudinaux d’origine.Aucun forage n\'est nécessaire.', 450, 1730, NULL, 869.7479, 1043.69748, 'KRTT900T - Kit de galerie pour une Toyota Tacoma Pick-Up (2005-jusqu’à présent) - Slimline II de Front Runner\\nContient :\\n2 x LASS026 - Set de pied universel 188mm (paire) - de Front Runner\\n1 x RRAC901 - Kit d’écrous / Toyota Tacoma 2004+/Tundra 2007+ - de Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 24kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 27,8kg', 'Ce kit offreune galerie pour la benne de la Toyota Tacoma (2005 + avec des railslongitudinaux d’origine). Ce kit de galerie Slimline II contient le plateauSlimline II (1425mm/56.1\'\' (larg.) x 1358mm/53.5\'\' (long.)) et 4 piedsuniversels pour benne de Pick-Up qui s’installent facilement en utilisant lesrails longitudinaux d’origine.Aucun forage n\'est nécessaire.', 'Kit de galerie Slimline II pour une Toyota Tacoma Pick-Up (2005-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 11:25:32', NULL, NULL, 5.511814, 27.6, 6009542229003, 'ZA', 'EUR', 869.748, '8708.29.90', 10, 0),
(577, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une benne d’une Toyota Tacoma (2005 - jusqu’à présent) - de Front Runner', 'KRTT901T', 'Ce kit de barres de toit contient une paire de barres de toit Front Runner d’une largeur de 1425mm, 2 paires de pieds Front Runner et tous les composants nécessaires pour installer les barres de toit sur les barres longitudinales d’origine d’une Tacoma 2005+.', 130, 1270, NULL, 289.91597, 347.899164, 'KRTT901T - Kit de barres de toit pour une benne d’une Toyota Tacoma (2005 - jusqu’à présent) - de Front Runner\\nContient :\\n2 x LASS026 - Pied universel de 188mm (Paire) - de Front Runner\\n1 x LBSK015 - Paire de barres de toit de 1425mm (largeur) - de Front Runner\\n1 x RRAC901 - Kit d\'écrous / Toyota Tacoma 2004+/Tundra 2007+ - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation 7kg\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière.\\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 130mm\\nLongueur : 1270mm\\nHauteur : 240mm\\nPoids de la livraison : 7,9kg', 'Ce kit de barres de toit contient une paire de barres de toit Front Runner d’une largeur de 1425mm, 2 paires de pieds Front Runner et tous les composants nécessaires pour installer les barres de toit sur les barres longitudinales d’origine d’une Tacoma 2005+.', 'Kit de barres de toit pour une benne d’une Toyota Tacoma (2005 - jusqu’à présent) - de Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:25:57', NULL, NULL, 9.448824, 8, 6009542229010, 'ZA', 'EUR', 289.916, '7616.99', 10, 0),
(578, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Tacoma Xtra Cab Pick-Up 2 portes (2001-jusqu’à présent) - de Front Runner', 'KRTT903T', 'Ce kit offre une galerie pour la benne de la Toyota Tacoma Xtra Cab 2 portes (2001-jusqu’à présent). Ce kit de galerie Slimline II contient le plateau Slimline II (1425mm (larg.) x 1358mm (long.)), 2 rails et 4 pieds universels pour benne de Pick-Up qui s’installent sur les rails.', 450, 1730, NULL, 928.57143, 1114.285716, 'KRTT903T - Kit de galerie pour une Toyota Tacoma Xtra Cab 2 portes Pick-Up (2001-jusqu’à présent) - Slimline II de Front Runner\\nContient :\\n2 x LASS026 - Set de pied universel 188mm (Paire) - de Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x TRBU001 - Rail pour benne de Pick-Up/ 1000mm (L) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 26kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 30,4kg', 'Ce kit offre une galerie pour la benne de la Toyota Tacoma Xtra Cab 2 portes (2001-jusqu’à présent). Ce kit de galerie Sli