(581, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Tundra (2007-jusqu’à présent) - de Front Runner', 'KRTT950T', 'Ce kit offre une galerie pour la benne de la Toyota Tundra (2007+ avec des rails longitudinaux d’origine). Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm (larg.) x 1358mm (long.)) et 4 pieds universels pour benne de Pick-Up qui s’installent facilement en utilisant les rails longitudinaux d’origine.', 450, 1730, NULL, 894.95798, 1073.949576, 'KRTT950T - Kit de galerie pour une Toyota Tacoma Tundra (2007-jusqu’à présent) - Slimline II de Front Runner\\nContient :\\n2 x LASS026 - Set de pied universel 188mm (Paire) - de Front Runner\\n1 x RRAC901 - Kit d’écrous / Toyota Tacoma 2004+/Tundra 2007+ - de Front Runner\\n1 x RRSTM07 - Plateau Slimline II - 1475mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 24kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 28,3kg', 'Ce kit offre une galerie pour la benne de la Toyota Tundra (2007+ avec des rails longitudinaux d’origine). Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm (larg.) x 1358mm (long.)) et 4 pieds universels pour benne de Pick-Up qui s’installent facilement en utilisant les rails longitudinaux d’origine.', 'Kit de galerie Slimline II pour une Toyota Tundra (2007-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 11:26:08', NULL, NULL, 5.511814, 27.9, 6009542229027, 'ZA', 'EUR', 894.958, '7616.99', 10, 0),
(582, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une benne d’une Toyota Tundra (2007 - jusqu’à présent) - de Front Runner', 'KRTT951T', 'Ce kit de barres de toit contient une paire de barres de toit Front Runner d’une largeur de 1475mm, 2 paires de pieds Front Runner et tous les composants nécessaires pour installer les barres de toit sur les barres longitudinales d’origine d’une Tundra 2007+.', 240, 1490, NULL, 298.31933, 357.983196, 'KRTT951T - Kit de barres de toit pour une benne d’une Toyota Tundra (2007 - jusqu’à présent) - de Front Runner\\nContient :\\n2 x LASS026 - Pied universel de 188mm (Paire) - de Front Runner\\n1 x LBSK017 - Paire de barres de toit de 1475mm (largeur) - de Front Runner\\n1 x RRAC901 - Kit d\'écrous / Toyota Tacoma 2004+/Tundra 2007+ - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation :7kg (15lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 240mm(9\'\')\\nLongueur : 1490mm(59\'\')\\nHauteur : 130mm(5\'\')\\nPoids de la livraison :\\n8.0kg (17.6lbs)', 'Ce kit de barres de toit contient une paire de barres de toit Front Runner d’une largeur de 1475mm, 2 paires de pieds Front Runner et tous les composants nécessaires pour installer les barres de toit sur les barres longitudinales d’origine d’une Tundra 2007+.', 'Kit de barres de toit pour une benne d’une Toyota Tundra (2007 - jusqu’à présent) - de Front Runner', 'Barres de toit|Kit de barres de toit pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:26:13', NULL, NULL, 5.118113, 8.1, 6009542229034, 'ZA', 'EUR', 298.319, '7616.99', 10, 0),
(583, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Toyota Tundra (1999-jusqu’à présent) - de Front Runner', 'KRTT952T', 'Ce kit offre une galerie pour la benne de la Toyota Tundra (1999-jusqu’à présent). Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm (larg.) x 1358mm (long.)), 2 pieds et 4 pieds universels pour benne de Pick-Up qui s’installent facilement sur les rails.', 450, 1730, NULL, 953.78151, 1144.537812, 'KRTT952T - Kit de galerie pour une Toyota Tacoma Tundra (1999-jusqu’à présent) - Slimline II de Front Runner\\nContient :\\n2 x LASS026 - Set de pied universel 188mm (Paire) - de Front Runner\\n1 x RRSTM07 - Plateau Slimline II - 1475mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x TRBU001 - Rail pour benne de Pick-Up/ 1000mm (L) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 27kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison : 30,9kg', 'Ce kit offre une galerie pour la benne de la Toyota Tundra (1999-jusqu’à présent). Ce kit de galerie Slimline II contient le plateau Slimline II (1475mm (larg.) x 1358mm (long.)), 2 pieds et 4 pieds universels pour benne de Pick-Up qui s’installent facilement sur les rails.', 'Kit de galerie Slimline II pour une Toyota Tundra (1999-jusqu’à présent) - de Front Runner', 'Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:26:14', NULL, NULL, 5.511814, 31.6, 6009542231891, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
