(589, 1, 2, NULL, NULL, NULL, 'Toyota Tacoma (2005-actuel) Kit de galerie de chargement Retrax Slimline II - par Front Runner', 'KRTT958T', 'Cette galerie de chargement est spécialement conçue pour votre cover Retrax. Vous pouvez désormais transporter votre matériel sur le dessus de votre Retrax sans sacrifier le précieux espace de chargement de votre lit de chargement. Grâce à sa construction entièrement métallique et à ses composants à revêtement par poudre, vous pouvez explorer en toute confiance sur route ou en dehors.', 445, 1735, NULL, 978.9916, 1174.78992, 'KRTT958T - Toyota Tacoma (2005-actuel) Kit galerie de chargement Retrax Slimline II - par Front Runner\\nComposé de :\\n2 x LASS028 - Pieds pour cover - par Front Runner\\n1 x RRSTJ07 - Slimline II Plateau - 1425mm(L) X 1358mm(L) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 25,84kg (57lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du Slimline II Plateau (50mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\n\\nDimensions d\'expédition :\\nLargeur 445mm (17,5\'\')\\nLongueur 1735mm (68,3\'\')\\nHauteur 245mm (9,7\'\')\\n\\nPoids de l\'expédition :\\nPoids : 28,6 kg (63 livres)', 'Cette galerie de chargement est spécialement conçue pour votre cover Retrax. Vous pouvez désormais transporter votre matériel sur le dessus de votre Retrax sans sacrifier le précieux espace de chargement de votre lit de chargement. Grâce à sa construction entièrement métallique et à ses composants à revêtement par poudre, vous pouvez explorer en toute confiance sur route ou en dehors.', 'Toyota Tacoma (2005-actuel) Kit de galerie de chargement Retrax Slimline II - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour Roll Top / Hard top', 0, 1, '2022-01-07 11:26:33', NULL, NULL, 9.6, 28.6, 6009542200330, 'ZA', 'EUR', 978.992, '7616.99', 10, 0),
