 libérer votre précieux espace de chargement pour le matériel.', 'Toyota Tundra Crewmax 6,5\' (2007-actuel) Slimline II Kit de galerie de chargement pour benne - par Front Runner', 'Galerie|Galerie pour benne de Pick-Up|VEHICLE SPECIFIC GEAR|Galeries pour benne de Pickup', 0, 1, '2022-01-07 11:26:39', NULL, NULL, 11.4, 36.6, 6009542283739, 'ZA', 'EUR', 1180.672, '7616.99', 10, 0),
(592, 1, 2, NULL, NULL, NULL, 'Kit de double barres de toit pour une Toyota Tundra 5,5\' Crew Max (2007-jusqu\'à présent) - de Front Runner', 'KRTT961', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Toyota Tundra Crew Max grâce à cette paire de barres de chargement de benne pickup robustes, élégantes et surbaissées.', 1685, 150, NULL, 298.31933, 357.983196, 'KRTT961 -Kit de double barres de toit pour une Toyota Tundra 5,5\' Crew Max (2007-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x LASS026 - Pieds de benne à chargement universel / Grand (paire) - par Front Runner\\n1 x LBSK018 - Paire de barres de toit 1575mm(W) - par Front Runner\\n1 x RRAC901 - Kit d\'écrou de benne de chargement / Toyota Tacoma 2004+/Tundra 2007+ - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 8.5 kg (18.8 lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 1685mm (66.0\'\')\\nLongueur : 150mm (6.0\'\')\\nHauteur : 200mm (8.0\'\')\\nPoids de la livraison :\\n8.4kg (18.0lbs)', 'Transportez tout votre équipement d\'aventure en toute sécurité au-dessus de la benne de votre Toyota Tundra Crew Max grâce à cette paire de barres de chargement de benne pickup robustes, élégantes et surbaissées.', 'Kit de double barres de toit pour une Toyota Tundra 5,5\' Crew Max (2007-jusqu