(596, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Atlas (2018-jusqu\'à présent) - de Front Runner', 'KRVA002T', 'La galerie Slimline II pour toute la longueur du toit de 1560mm/61.4” contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-Onpour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Atlas.Ce système s\'installe facilement avec des pieds résistants hors route quis\'agrippent aux rails de toit existantes de l\'usine. Aucun perçage requis.', 450, 1730, NULL, 903.36134, 1084.033608, 'KRVA002T -Kit de galerie Slimline II pour une Volkswagen Atlas (2018-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2 x GOFR001 - Rail de pied (paire)\\n2 x GOFR013 - Poignées extérieures de rail affleurant / n° 4\\n2 x GOFR035 - Poignées intérieures pour rail encastré / F\\n1 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire)\\n1 x RRSTD08 - Plateau Slimline II - 1255mm(L) X 1560mm(L)\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé :26.67kg (58.8lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 450mm (18.0\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 200mm (8.0\'\')\\nPoids de la livraison :\\n27.32kg (60lbs)', 'La galerie Slimline II pour toute la longueur du toit de 1560mm/61.4” contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-Onpour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Atlas.Ce système s\'installe facilement avec des pieds résistants hors route quis\'agrippent aux rails de toit existantes de l\'usine. Aucun perçage requis.', 'Kit de galerie Slimline II pour une Volkswagen Atlas (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:26:51', NULL, NULL, 7.87402, 27.3, 6009542263052, 'ZA', 'EUR', 903.361, '7616.99', 10, 0),
(597, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Amarok - de Front Runner', 'KRVA003T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen Amarok. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 802.52101, 963.025212, 'KRVA003T - Kit de galerie pour une Volkswagen Amarok - Slimline II de Front Runner\\n\\nContient:\\n1 x FAVA001 - Pied de rail pour une VW Amarok (Paire G/D) 72mm\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 25kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 28,9kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen Amarok. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Volkswagen Amarok - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour benne', 0, 1, '2022-01-07 11:26:56', NULL, NULL, 5.511814, 29.2, 6009542225623, 'ZA', 'EUR', 802.521, '8708.29.90', 10, 0),
(598, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Atlas Cross Sport ( 2020-jusqu\'à présent) - de Front Runner', 'KRVA006T', 'Empilez l\'équipement d\'aventure à l\'aide de ce kit de galerie de toit Slimline II à profil bas pour Volkswagen Atlas Cross Sport .', 445, 1730, NULL, 953.78151, 1144.537812, 'KRVA006T -Kit de galerie de toit Slimline II pour une Volkswagen Atlas Cross Sport ( 2020-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR014 - Grips extérieurs de rail affleurant / No. 6\\n2x GOFR035 - Grips intérieurs de rail affleurant / F\\n3x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTD08 - Plateau SLII - 1255mm(l)X1560mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 53.95kg (118.94lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 445 mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 240mm (9\'\')\\nPoids de la livraison :\\nPoids : 26.2kg (58lbs)', 'Empilez l\'équipement d\'aventure à l\'aide de ce kit de galerie de toit Slimline II à profil bas pour Volkswagen Atlas Cross Sport .', 'Kit de galerie de toit Slimline II pour une Volkswagen Atlas Cross Sport ( 2020-jusqu\'à présent) - de Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:01', NULL, NULL, 9.4, 26.2, 6009542283760, 'ZA', 'EUR', 953.782, '7616.99', 10, 0),
(599, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Caddy/Cross Caddy (2015-2018) - de Front Runner', 'KRVC002T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1762mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre VolkswagenCaddy/Cross Caddy. Ce système s’installe facilement en utilisant lespieds solides tout-terrain qui s’accrochent aux barres longitudinalesd’origine. Le forage n’est pas nécessaire.', 455, 1730, NULL, 987.39496, 1184.873952, 'KRVC002TKit de galerie de toit Slimline II pour une Volkswagen Caddy/Cross Caddy(2015-2018) - de Front Runner\\nContient:\\n3 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n3 x GORR053 - Rail élevéextérieurGrab-On / N° 4 - de Front Runner\\n3 x GORR072 - Rail élevéintérieurGrab-On / C - de Front Runner\\n2 x RRAC904 - Espaceur en plastiquepour base de pied de rail / 10mm (paire)\\n1 x RRSTA09 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 26kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 29,9kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1762mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre VolkswagenCaddy/Cross Caddy. Ce système s’installe facilement en utilisant lespieds solides tout-terrain qui s’accrochent aux barres longitudinalesd’origine. Le forage n’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Volkswagen Caddy/Cross Caddy (2015-2018) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:04', NULL, NULL, 11.220478, 28.4, 6009542252582, 'ZA', 'EUR', 987.395, '8708.29.90', 10, 0),
(600, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Crafter - de Front Runner', 'KRVC003T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772 mm/69.4\'\' pour la Volkswagen Crafter contient un plateau Slimline II, un déflecteur de vent, 2 rails et 8 pieds de fixation. Le forage est nécessaire pour l\'installation.', 450, 1730, NULL, 1802.52101, 2163.025212, 'KRVC003T - Kit de galerie de toit Slimline II pour une Volkswagen Crafter\\nContient:\\n4 x FASS012 - Set de pied / 40 mm - 50 mm - de Front Runner\\n1 x RRSTM14 - Plateau Slimline II - 1475 mm largeur x 2772 mm longueur - de Front Runner\\n1 x TRMS001 - Rails Mercedes Sprinter (2006-jusqu’à présent) / 3082 mm - 4098 mm longueur - de Front Runner\\n1 x WDST009 - Déflecteur de vent 20 mm large paire / 1345 mm largeur - de Front Runner\\n\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 45 kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450 mm\\nLongueur 1615 mm\\nHauteur 140 mm\\n\\nPoids de la livraison :Poids : 52,7 kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772 mm/69.4\'\' pour la Volkswagen Crafter contient un plateau Slimline II, un déflecteur de vent, 2 rails et 8 pieds de fixation. Le forage est nécessaire pour l\'installation.', 'Kit de galerie de toit Slimline II pour une Volkswagen Crafter - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:08', NULL, NULL, 5.511814, 52.7, 6009542253794, 'ZA', 'EUR', 1802.521, '8708.29.90', 10, 0),
(601, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Crafter avec rails d\'origine / Haut- de Front Runner', 'KRVC004T', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm/ 109\'\' pour une Volkswagen Crafter avec rails d\'origine contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage pour monter le plateau sur votre véhicule.Ce kit plus haut offre de l\'espace pour le montage des tables Front Runner ou d\'autres accessoires compatibles sous la galerie.', 450, 1730, NULL, 1474.78992, 1769.747904, 'KRVC004T - Volkswagen Crafter avec rails d\'origine Slimline II Roof Rack Kit / Tall - par Front Runner\\nComposé de :\\n4 x FASS013 - Set de pied / 60 mm - 70 mm - de Front Runner\\n1 x RRSTM14 - Plateau Slimline II - 1475 mm largeur x 2772 mm longueur -de Front Runner\\n1 x WDST009 - Déflecteur de vent 20 mm large paire / 1345 mm largeur -de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 39 kg\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450 mm (18\'\')\\nLongueur 1615 mm (64\'\')\\nHauteur 140 mm(6\'\')\\nPoids de la livraison :\\nPoids : 45.5kg (100.0lbs)', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm/ 109\'\' pour une Volkswagen Crafter avec rails d\'origine contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage pour monter le plateau sur votre véhicule.Ce kit plus haut offre de l\'espace pour le montage des tables Front Runner ou d\'autres accessoires compatibles sous la galerie.', 'Kit de galerie de toit Slimline II pour une Volkswagen Crafter avec rails d\'origine / Haut- de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:12', NULL, NULL, 5.511814, 45.5, 6009542253824, 'ZA', 'EUR', 1474.79, '8708.29.90', 10, 0),
(602, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour Volkswagen Caddy (2010-2015) - par Front Runner', 'KRVC005T', 'Le Volkswagen Caddy peut transporter beaucoup de personnes ou de matériel, mais rarement les deux à la fois. Maintenant, vous n\'avez plus à sacrifier un espace intérieur crucial avec le kit de galerie de toit pour Volkswagen caddy de Front Runner. Laissez l\'intérieur libre pour plus d\'amis, ou même pour dormir, tout en fixant votre équipement d\'expédition et d\'aventure sur le toit. La construction hors route vous permet de choisir votre propre aventure en toute confiance.', 440, 1730, NULL, 1012.60504, 1215.126048, 'Composé de :\\n3 x GOFR001 - Socle de rail de pied (paire) - par Front Runner\\n3 x GOFR013 - Poignées extérieures de rail affleurant / n° 4 - par Front Runner\\n3 x GOFR035 - Poignées intérieures pour rail encastré / F - par Front Runner\\n2 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire)\\n1 x RRSTA08 - Plateau Slimline II - 1165mm(L) X 1560mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\n Matériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 25kg (54lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\n Dimensions de l\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 215mm (8\'\')\\nPoids de l\'expédition :\\nPoids 28,5kg (62,8lbs)', 'Le Volkswagen Caddy peut transporter beaucoup de personnes ou de matériel, mais rarement les deux à la fois. Maintenant, vous n\'avez plus à sacrifier un espace intérieur crucial avec le kit de galerie de toit pour Volkswagen caddy de Front Runner. Laissez l\'intérieur libre pour plus d\'amis, ou même pour dormir, tout en fixant votre équipement d\'expédition et d\'aventure sur le toit. La construction hors route vous permet de choisir votre propre aventure en toute confiance.', 'Kit de galerie de toit Slimline II pour Volkswagen Caddy (2010-2015) - par Front Runner', 'Galerie|ALL ROOF RACKS|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:16', NULL, NULL, 5.9, 26.9, 6009542265865, 'ZA', 'EUR', 1012.605, '7616.99', 10, 0),
(603, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Caddy Maxi (2015-2020) - de Front Runner', 'KRVC006T', 'Transformez vos rails d\'origine pour libérer un espace intérieur précieux et continuer à emporter votre équipement d\'aventure et vos jouets préférés avec le kit de rails de toit Slimline II de Volkswagen Caddy Maxi (2015-2020).', 445, 1715, NULL, 1063.02521, 1275.630252, 'KRVC006T -Kit de galerie Slimline II pour une Volkswagen Caddy Maxi (2015-2020) - de Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GORR053 - Grips extérieurs de rail surélevé / No. 4\\n3x GORR072 - Grips intérieurs de rail surélevé / C\\n2x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA09 - Plateau SLII - 1165mm(W)X1762mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm extra étroits /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 30.39kg (67lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 445mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids de la livraison :\\nPoids : 29kg (64lbs)', 'Transformez vos rails d\'origine pour libérer un espace intérieur précieux et continuer à emporter votre équipement d\'aventure et vos jouets préférés avec le kit de rails de toit Slimline II de Volkswagen Caddy Maxi (2015-2020).', 'Kit de galerie Slimline II pour une Volkswagen Caddy Maxi (2015-2020) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:20', NULL, NULL, 6.1, 29, 6009542220284, 'ZA', 'EUR', 1063.025, '8708.29', 10, 0),
