on :\\nPoids : 30kg (66lbs)', 'Ajoutez encore plus de versatilité à votre Volkswagen Caddy Maxi (2010-2015) et explorez davantage avec ce kit de galerie Slimline II. Transportez votre matériel d\'aventure et vos gadgets jusqu\'aux endroits secrets du camping tout en gardant de l\'espace intérieur pour plus de marchandises et de passagers.', 'Kit de galerie Slimline II pour une Volkswagen Caddy Maxi (2010-2015) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:22', NULL, NULL, 6.3, 30, 6009542220291, 'ZA', 'EUR', 1088.235, '8708.29.90', 10, 0),
(605, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE avec rails d\'origine (2017 - jusqu\'à présent) - de Front Runner', 'KRVC008T', 'Ajoutez encore plus de polyvalence à votre Volkswagen Crafter/MAN TGE avec rails d\'origine (2017-jusqu\'à présent) et explorez davantage avec ce kit de galerie Slimline II. Transportez votre équipement d\'aventure et vos jouets vers ces endroits de camping secrets tout en ayant de l\'espace intérieur pour plus de marchandises et de passagers.', 445, 1715, NULL, 1432.77311, 1719.327732, 'KRVC008T -Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE avec rails d\'origine (2017 - jusqu\'à présent) - de Front Runner\\n\\nComposé de :\\n4x FASS012 - Set de pieds / 40mm - 50mm\\n1x RRSTM14 - Plateau SLII - 1475mm(W)X2772mm(L)\\n1x WDST009 - Paire de déflecteurs de vent de 20mm de large / 1345mm(W)\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 44.06kg (97.14lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.Dimensions à la livraison :\\nLargeur : 445mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 230mm (9\'\')\\nPoids à la livraison :\\nPoids : 45.6kg (100lbs)', 'Ajoutez encore plus de polyvalence à votre Volkswagen Crafter/MAN TGE avec rails d\'origine (2017-jusqu\'à présent) et explorez davantage avec ce kit de galerie Slimline II. Transportez votre équipement d\'aventure et vos jouets vers ces endroits de camping secrets tout en ayant de l\'espace intérieur pour plus de marchandises et de passagers.', 'Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE avec rails d\'origine (2017 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:25', NULL, NULL, 9.1, 45.6, 6009542220314, 'ZA', 'EUR', 1432.773, '8708.29.90', 10, 0),
(606, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE sans rails d\'origine (2017 - jusqu\'à présent) - de Front Runner', 'KRVC009T', 'Ajoutez encore plus de possibilités à votre Volkswagen Crafter/MAN TGE sans rails d\'origine (2017-jusqu\'à présent) et explorez davantage avec ce kit de porte-bagages de toit Slimline II. Transportez votre matériel d\'aventure et vos jouets jusqu\'à ces endroits de camping secrets tout en gardant de l\'espace intérieur pour plus de équipments et de passagers.', 440, 1800, NULL, 1794.11765, 2152.94118, 'KRVC009T -Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE sans rails d\'origine (2017 - jusqu\'à présent) - de Front Runner\\n\\nComposé de :\\n3x FASS012 - Set de pieds / 40mm - 50mm\\n1x FASS017 - Set de pieds / 75mm-85mm\\n1x RRSTM14 - Plateau SLII - 1475mm(W)X2772mm(L)\\n1x TRMS001 - Rails pour Mercedes Sprinter (2006-Curr) - 3082-4098mmL\\n1x WDST009 - Paire de déflecteurs de vent 20mm de large / 1345mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids installé approximatif : 52.39 kg (115.5lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.Dimensions de la livraison :\\nLargeur : 440mm (17\'\')\\nLongueur : 1800mm (71\'\')\\nHauteur : 270mm (11\'\')\\nPoids de la livraison :\\nPoids : 52.6kg (116lbs)', 'Ajoutez encore plus de possibilités à votre Volkswagen Crafter/MAN TGE sans rails d\'origine (2017-jusqu\'à présent) et explorez davantage avec ce kit de porte-bagages de toit Slimline II. Transportez votre matériel d\'aventure et vos jouets jusqu\'à ces endroits de camping secrets tout en gardant de l\'espace intérieur pour plus de équipments et de passagers.', 'Kit de galerie Slimline II pour une Volkswagen Crafter/MAN TGE sans rails d\'origine (2017 - jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:28', NULL, NULL, 10.6, 52.6, 6009542220345, 'ZA', 'EUR', 1794.118, '8708.29.90', 10, 0),
(607, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen California T6.1 - de Front Runner', 'KRVC010T', 'Sentez-vous à l\'aise, peu importe où l\'aventure vous mène, en sachant que vous pouvez libérer un espace intérieur précieux tout en transportant votre équipement et vos gadgets préférés avec le kitde galerie Slimline II pour une Volkswagen California T6.1.', 445, 1715, NULL, 978.9916, 1174.78992, 'KRVC010T -Kit de galerie Slimline II pour une Volkswagen California T6.1 - de Front Runner\\nComposé de :\\n4x FASS012 - Paire de pieds / 40mm - 50mm\\n1x RRSTD10 - Plateau SLII - 1255mm(L)X1964mm(L)\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif installé : 30.92kg (68.17lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de la livraison :\\nLargeur : 445mm (18\'\')\\nLongueur : 1715mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids de la livraison :\\nPoids : 31.4kg (69lbs)', 'Sentez-vous à l\'aise, peu importe où l\'aventure vous mène, en sachant que vous pouvez libérer un espace intérieur précieux tout en transportant votre équipement et vos gadgets préférés avec le kitde galerie Slimline II pour une Volkswagen California T6.1.', 'Kit de galerie Slimline II pour une Volkswagen California T6.1 - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:30', NULL, NULL, 6.1, 31.4, 6009542220352, 'ZA', 'EUR', 978.992, '7616.99', 10, 0),
(608, 1, 2, NULL, NULL, NULL, 'Kit galerie sur rail Slimline II pour Volkswagen Golf Sportsvan (2014-2020) ​- par Front Runner', 'KRVG001T', 'Votre Volkswagen Golf Sportsvan (2014-2020) est prête pour la prochaine grande aventure, et vous ? Chargez votre équipement et votre matériel d\'aventure sur le toit pour libérer un espace intérieur précieux et créez votre propre aventure maintenant.', 440, 1730, NULL, 810.92437, 973.109244, 'Comprenant :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR014 - Grips extérieurs de rail affleurant / No. 6\\n2x GOFR035 - Grips intérieurs de rail affleurant / F\\n1x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 23.82kg (52.51lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la crémaillère et des profils de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 24.6kg (54lbs)', 'Votre Volkswagen Golf Sportsvan (2014-2020) est prête pour la prochaine grande aventure, et vous ? Chargez votre équipement et votre matériel d\'aventure sur le toit pour libérer un espace intérieur précieux et créez votre propre aventure maintenant.', 'Kit galerie sur rail Slimline II pour Volkswagen Golf Sportsvan (2014-2020) ​- par Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:52', NULL, NULL, 6.3, 24.6, 6009542220376, 'ZA', 'EUR', 810.924, '7616.99', 10, 0),
(609, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Kombi - de Front Runner', 'KRVK001L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Volkswagen Kombi contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage avec gouttières pour monter le plateau sur votre véhicule. Vous ne devez pas forer pour installer la galerie.', 450, 1730, NULL, 1592.43697, 1910.924364, 'KRVK001L - Kit de galerie pour une Volkswagen Kombi - Slimline II de Front Runner\\n\\nContient:\\n4 x LASS105 - Pied N° 5 190mm (Paire)\\n1 x RRSTM14 - Plateau Slimline II - 1475mm (largeur) x 2772mm (longueur)\\n1 x WDST009 - Déflecteur de vent 20mm Large (Paire) / 1345mm de largeur\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 44kg\\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 50,7kg ', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Volkswagen Kombi contient le plateau Slimline II, un déflecteur de vent et 8 pieds de montage avec gouttières pour monter le plateau sur votre véhicule. Vous ne devez pas forer pour installer la galerie.', 'Kit de galerie Slimline II pour une Volkswagen Kombi - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:27:55', NULL, NULL, 5.511814, 49, 6009542226026, 'ZA', 'EUR', 1592.437, '8708.29.90', 10, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(610, 1, 2, NULL, NULL, NULL, 'Kit de barre de charge monté sur gouttières pour Volkswagen T3 Transporter/Kombi - de Front Runner', 'KRVK003L', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 180, 1590, NULL, 281.51261, 337.815132, 'Volkswagen T3 Transporter/Kombi Kit de barre de charge / Support de gouttière - par Front Runner \\n\\nContient: \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n2 x LASS105 - Pied N° 5 190mm (Paire)\\n1 x LBSK017 - Barres de toit (Paire) 1475mm \\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable \\n\\nPoids approximatif d’installation : 7kg \\n\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière. \\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 180mm\\nLongueur : 1590mm\\nHauteur : 120mm\\nPoids de la livraison: 8,6kg', 'Les barres de toit avec un système de montage pour gouttières peuvent être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds pour gouttières de 190mm, 2 barres de toit de 1475mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur un véhicule avec gouttières. ', 'Kit de barre de charge monté sur gouttières pour Volkswagen T3 Transporter/Kombi - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:58', NULL, NULL, 4.724412, 8.8, 6009542226200, 'ZA', 'EUR', 281.513, '7616.99', 10, 0),
(611, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Volkswagen T2 Transporter / Montage sur gouttière - de Front Runner', 'KRVK004', 'Empilez l\'équipement d\'aventure à l\'aide de ces barres de charge Volkswagen T2 Transporter/Kombi surbaissées. Un bonus supplémentaire ? Ces bad boys peuvent être utilisés à l\'avenir dans le cadre d\'une galerie Front Runner complète.', 130, 1625, NULL, 323.52941, 388.235292, 'KRVK004 -Kit de barres de toit pour une Volkswagen T2 Transporter / Montage sur gouttière - de Front Runner\\nComposé de :\\n2 x LASS110 - No 10 Leg 280mm (paire) - de Front Runner\\n1 x LBSK017 - Paire de barres de toit 1475mm(W) - de Front Runner\\n1 x WDLB001 - Déflecteur de vent pour barre de charge / 10mm - de Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 10.0kg (22.1lbs)\\nLes rainures en T situées en haut et en bas des barres peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre kit de barre de toit, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur du pied, du pied à pince ou du pied à sangle indiqués ci-dessus.\\nSi votre kit de barres de toit utilise des pieds, ajoutez la hauteur de la barre de toit (22 mm/ 7/8\'\') à la hauteur des pieds indiqués ci-dessus pour déterminer la hauteur du support par rapport aux gouttières de votre véhicule.\\nDimensions pour la livraison :\\nLargeur : 130mm (5.0\'\')\\nLongueur : 1625mm (64,0\'\')\\nHauteur : 145mm (6.0\'\')\\nPoids de la livraison :\\n9.4kg (21.0lbs)', 'Empilez l\'équipement d\'aventure à l\'aide de ces barres de charge Volkswagen T2 Transporter/Kombi surbaissées. Un bonus supplémentaire ? Ces bad boys peuvent être utilisés à l\'avenir dans le cadre d\'une galerie Front Runner complète.', 'Kit de barres de toit pour une Volkswagen T2 Transporter / Montage sur gouttière - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:27:59', NULL, NULL, 5.7, 9.4, 6009542283777, 'ZA', 'EUR', 323.529, '7616.99', 10, 0),
(612, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen T5/T6 Transporter SWB (2003-jusqu’à présent) - de Front Runner', 'KRVK004T', 'La galerie Slimline II pour toute la longueur du toit de 2570mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen T5/T6 Transporter SWB. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 620, 1730, NULL, 1424.36975, 1709.2437, 'KRVK004T - Kit de galerie pour une Volkswagen T5/T6 Transporter SWB (2003-jusqu’à présent) - Slimline II de Front Runner\\n\\nContient:\\n1 x FAVT001 - Pied de rail pour une VW T5 Caravelle Transporter 97mm\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n1 x RRSTJ13 - Plateau Slimline II - 1425mm (largeur) x 2570mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 40kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 47,1kg', 'La galerie Slimline II pour toute la longueur du toit de 2570mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen T5/T6 Transporter SWB. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Volkswagen T5/T6 Transporter SWB (2003-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:28:01', NULL, NULL, 6.299216, 48.4, 6009542235363, 'ZA', 'EUR', 1424.37, '8708.29.90', 10, 0),
(613, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II 1/2 pour une Volkswagen T5 Transporter (2003-jusqu’à présent) - de Front Runner', 'KRVK005T', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen T5 Transporter. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 620, 1730, NULL, 878.15126, 1053.781512, 'KRVK005T - Kit de galerie 1/2 pour une Volkswagen T5 Transporter (2003-jusqu’à présent) - Slimline II de Front Runner\\n\\nContient:\\n1 x FAVT001 - Pied de rail pour une VW T5 Caravelle Transporter 97mm \\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n1 x RRSJ06 - Plateau Slimline II - 1425mm (largeur) x 1156mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 28kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\nPoids de la livraison : 32,0kg', 'La galerie Slimline II pour toute la longueur du toit de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rails pour monter le plateau Slimline II sur votre Volkswagen T5 Transporter. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II 1/2 pour une Volkswagen T5 Transporter (2003-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:28:06', NULL, NULL, 6.299216, 32.6, 6009542235424, 'ZA', 'EUR', 878.151, '8708.29.90', 10, 0),
