le plateau Slimline II sur votre 2003-2016 Volkswagen T5/T6 LWB. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Volkswagen T5/T6 Transporter LWB (2003-jusqu’à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:28:08', NULL, NULL, 6.299216, 52, 6009542243467, 'ZA', 'EUR', 1542.017, '8708.29.90', 10, 0),
(615, 1, 2, NULL, NULL, NULL, 'Kit de galerie 1/2 Slimline II pour une Volkswagen T5/T6 Transporter LWB (2003-2016) - de Front Runner', 'KRVK007T', 'Le kit de galerie 1/2 Slimline II de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre 2003-2016 Volkswagen T5/T6. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 995.79832, 1194.957984, 'KRVK007T - Kit de galerie 1/2 Slimline II pour une Volkswagen T5 Transporter LWB (2003-2016) - de Front Runner\\nContient :\\n1 x FAVT002 - Pied de rail pour une Volkswagen T5/T6 Caravelle/Transporter LWB - de Front Runner\\n1 x RRSTJ07 - Plateau Slimline II - 1425mm (largeur) x 1358mm (longueur) x 50mm (hauteur)\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 32kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1640mm\\nHauteur 160mm\\nPoids de la livraison : 37,3kg', 'Le kit de galerie 1/2 Slimline II de 1156mm contient le plateau Slimline II, un déflecteur de vent et 2 pieds de rail pour monter le plateau Slimline II sur votre 2003-2016 Volkswagen T5/T6. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie 1/2 Slimline II pour une Volkswagen T5/T6 Transporter LWB (2003-2016) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:28:34', NULL, NULL, 6.299216, 36.2, 6009542243511, 'ZA', 'EUR', 995.798, '8708.29.90', 10, 0),
(616, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Volkswagen T5/T6 (2003-jusqu\'à présent) avec Pop Top de SCA - de Front Runner', 'KRVK008T', 'Utilisez tout le précieux espace de transport de matériel que vous pouvez avec le kit de galerie Slimline II pour Volkswagen T5/T6 (2003-jusqu\'à présent) avec Pop Top de SCA. Montez plus de 55 accessoires sur ce qui était auparavant de l\'espace de toit gaspillé afin de pouvoir vous aventurer plus longtemps et explorer davantage.', 440, 1730, NULL, 785.71429, 942.857148, 'KRVK008T - Kit de galerie Slimline II pour Volkswagen T5/T6 (2003-jusqu\'à présent ) avec Pop Top de SCA - par Front Runner\\nComposé de :\\n3 x FASS012 - Pieds / 40mm-50mm - par Front Runner\\n3 x RRAC907 - Piste de sprint MB à plaque de goujon\\n1 x RRSTG07 - Plateau Slimline II - 1345mm(L) X 1358mm(L) - par Front Runner\\nMatériaux utilisés :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé : 24.8 kg (54.7 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'accrochage ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nHauteur : 150mm (5.9\'\')\\nLongueur : 1730mm (68.1\'\')\\nLargeur : 440mm (17.3\'\')\\nPoids de l\'expédition :\\n25.4Kg (56lbs)', 'Utilisez tout le précieux espace de transport de matériel que vous pouvez avec le kit de galerie Slimline II pour Volkswagen T5/T6 (2003-jusqu\'à présent) avec Pop Top de SCA. Montez plus de 55 accessoires sur ce qui était auparavant de l\'espace de toit gaspillé afin de pouvoir vous aventurer plus longtemps et explorer davantage.', 'Kit de galerie Slimline II pour Volkswagen T5/T6 (2003-jusqu\'à présent) avec Pop Top de SCA - de Front Runner', 'Galerie|Galeries pour camionettes|Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:29:00', NULL, NULL, 5.9, 25.4, 6009542283784, 'ZA', 'EUR', 785.714, '8708.29.90', 10, 0),
(617, 1, 2, NULL, NULL, NULL, 'Volkswagen T5/T6 (2003-actuel) kit de barres de charge pour toit ouvrant - par Front Runner', 'KRVK009', 'Empilez votre équipement d\'aventure à l\'aide de ces barres de charge Volkswagen T5/T6 à profil bas. Un bonus supplémentaire ? Ces bad boys peuvent être utilisés à l\'avenir dans le cadre d\'une galerie Front Runner complète.', 110, 1475, NULL, 205.88235, 247.05882, 'Composé de :\\n2 x FASS012 - Jeu de pieds / 40mm-50mm - par Front Runner\\n1 x LBSK015 - Paire de barres de toit 1345mm(W) - par Front Runner\\n2 x RRAC907 - Plaque de goujon MB Sprinter Rail\\n1 x WDLB001 - Déflecteur de vent à barre de charge / 10mm - par Front Runner\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif installé : 6,4 kg (14,1 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nLargeur : 110mm (4.0\'\')\\nLongueur : 1475mm (58.0\'\')\\nHauteur : 150mm (6.0\'\')\\nPoids de la livraison :\\n6,2kg (14,0lbs)', 'Empilez votre équipement d\'aventure à l\'aide de ces barres de charge Volkswagen T5/T6 à profil bas. Un bonus supplémentaire ? Ces bad boys peuvent être utilisés à l\'avenir dans le cadre d\'une galerie Front Runner complète.', 'Volkswagen T5/T6 (2003-actuel) kit de barres de charge pour toit ouvrant - par Front Runner', 'Kit de barres de toit|Barres de toit', 0, 1, '2022-01-07 11:29:04', NULL, NULL, 5.9, 6.2, 6009542283791, 'ZA', 'EUR', 205.882, '7616.99', 10, 0),
(618, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II / Haut /Volkswagen T2 Transporter/Kombi - par Front Runner', 'KRVK009T', 'Empilez l\'équipement d\'aventure à l\'aide de ce kit de galerie de toit Volkswagen T2 Transporter/Kombi Slimline II à profil bas.', 450, 1720, NULL, 1642.85714, 1971.428568, 'Composé de :\\n4x LASS110 - No 10 Leg 280mm (paire)\\n1x RRSTM14 - Plateau SLII - 1475mm(L)X2772mm(L)\\nMatériel utilisé :\\nPoudre époxy noire - aluminium revêtu T6\\nAcier à haute résistance\\nPoids approximatif du montage : 100,2 kg (220,9 livres)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative du toit de votre véhicule au sommet de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'appui indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions pour la livraison :\\nPoids : 450mm (18\'\')\\nLongueur : 1720mm (68\'\')\\nHauteur : 290mm (11\'\')\\nPoids de la livraison :\\nPoids : 50,8 kg (112 lbs)', 'Empilez l\'équipement d\'aventure à l\'aide de ce kit de galerie de toit Volkswagen T2 Transporter/Kombi Slimline II à profil bas.', 'Kit de galerie de toit Slimline II / Haut /Volkswagen T2 Transporter/Kombi - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:29:07', NULL, NULL, 11.4, 50.8, 6009542283807, 'ZA', 'EUR', 1642.857, '8708.29.90', 10, 0),
(619, 1, 2, NULL, NULL, NULL, 'Volkswagen T3 Transporter/Kombi Slimline II Kit Galerie de toit / Grand - par Front Runner', 'KRVKT01L', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Volkswagen Kombi contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 450, 1730, NULL, 1600.84034, 1921.008408, 'KRVKT01L - Kit de galerie pour une Volkswagen Kombi / Large - Slimline II de Front Runner\\n\\nContient:\\n4 x LASS106 - Pied N° 6 195mm (Paire)\\n1 x RRSTM14 - Plateau Slimline II - 1475mm (largeur) x 2772mm (longueur) x 50mm (hauteur)\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation: 41kg \\n\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison:\\nLargeur : 450mm\\nLongueur : 1615mm\\nHauteur : 140mm\\n\\nPoids de la livraison : 47,7kg', 'Le kit de galerie Slimline II pour toute la longueur du toit de 2772mm pour une Volkswagen Kombi contient le plateau Slimline II, un déflecteur de vent et 8 pièces de montage avec gouttières pour monter le plateau sur votre véhicule. Ce kit ‘large’ permet d’avoir de la place pour monter une table de camping de Front Runner ou d’autres accessoires en dessous de la galerie. La galerie s’installe facilement sans devoir forer. ', 'Volkswagen T3 Transporter/Kombi Slimline II Kit Galerie de toit / Grand - par Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:30', NULL, NULL, 5.511814, 49.3, 6009542226033, 'ZA', 'EUR', 1600.84, '8708.29.90', 4, 0),
