ur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 22,8kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1165mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Volkswagen PoloCross. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Volkswagen Polo Cross (2011-2016) - par Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:33', NULL, NULL, 11.220478, 23.1, 6009542252575, 'ZA', 'EUR', 743.697, '7616.99', 10, 0),
(621, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Polo Vivo (2009-2017) - par Front Runner', 'KRVP002T', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Volkswagen VivoCross. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 455, 1730, NULL, 710.08403, 852.100836, 'Contient :\\n2 x GOFR001 - Base de pied de rail (paire)- de Front Runner\\n2 x GORR051 - Rail élevé extérieur Grab-On/ N° 2 - de Front Runner\\n2 x GORR071 - Rail élevé intérieur Grab-On/ B - de Front Runner\\n1 x RRSTA06 - Plateau Slimline II - 1165mm(largeur) x 1156mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm extraétroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 20kg \\n\\nLa rainure en T sur le haut et sur le basdu plateau de la barre transversale convient pour un boulon de 8mm (standard).\\n\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\n\\nSi votre galerie Slimline II a besoin depieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\n\\nSi votre galerie Slimline II a besoin depieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455mm \\nLongueur 1610mm \\nHauteur 285mm \\n\\nPoids de la livraison :Poids : 22,8kg', 'Ce kitde galerie Slimline II pour toute la longueur du toit de 1156mm contient leplateau Slimline II, un déflecteur de vent et 2 paires de pieds Grab-On pourmonter le plateau Slimline II sur les barres surélevées de votre Volkswagen VivoCross. Ce système s’installe facilement en utilisant les pieds solidestout-terrain qui s’accrochent aux barres longitudinales d’origine. Le foragen’est pas nécessaire.', 'Kit de galerie de toit Slimline II pour une Volkswagen Polo Vivo (2009-2017) - par Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:38', NULL, NULL, 11.220478, 22.8, 6009542252568, 'ZA', 'EUR', 710.084, '7616.99', 10, 0),
(622, 1, 2, NULL, NULL, NULL, 'Kit galerie de toit pour Volkswagen Passat B8 Variant (2014-actuel) Slimline II - par Front Runner', 'KRVP003T', 'Ce kit de galerie de toit Slimline II de 1358 mm de long et de taille complète contient le plateau Slimline II, un déflecteur de vent et 3 paires de rails de pied pour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Passat B8 Variant. Ce système s\'installe facilement avec des pieds résistants tout terrain qui s\'accrochent aux rails de toit existants de d\'usine. Aucun forage n\'est nécessaire.', 455, 1730, NULL, 945.37815, 1134.45378, 'Composé de :\\n3 x GOFR001 - Socle de rail de pied (paire) - par Front Runner\\n3 x GOFR014 - Poignées extérieures de rail affleurant / n° 6 - par Front Runner\\n3 x GOFR035 - Poignées intérieures pour rail encastré / F - par Front Runner\\n2 x RRAC904 - Entretoise plastique pour embase de rail pied / 10mm (paire)\\n1 x RRSTA07 - Plateau Slimline II - 1165mm(L) X 1358mm(L) - par Front Runner\\n1 x WDST011 - Déflecteur de vent 20mm à lèvres extra étroites / 1165mm(W) - par Front Runner\\n Matériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 23kg (50lbs)\\nLes rainures en T sur le haut et le bas des lattes des plateaux de la galerie et les profilés de bordure permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiquée ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails de pied pour déterminer la hauteur de la galerie à partir du sommet (point le plus élevé) du toit du véhicule.\\n Dimensions de l\'expédition :\\nLargeur 455mm (18\'\')\\nLongueur 1610mm (63\'\')\\nHauteur 210mm (8\'\')\\nPoids de l\'expédition :\\nPoids 26,7kg (58,7lbs)', 'Ce kit de galerie de toit Slimline II de 1358 mm de long et de taille complète contient le plateau Slimline II, un déflecteur de vent et 3 paires de rails de pied pour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Passat B8 Variant. Ce système s\'installe facilement avec des pieds résistants tout terrain qui s\'accrochent aux rails de toit existants de d\'usine. Aucun forage n\'est nécessaire.', 'Kit galerie de toit pour Volkswagen Passat B8 Variant (2014-actuel) Slimline II - par Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:42', NULL, NULL, 6.1, 26, 6009542265896, 'ZA', 'EUR', 945.378, '7616.99', 10, 0),
(623, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour Volkswagen Touareg (2018-actuel) - par Front Runner', 'KRVT001T', 'Ce kit de galerie de toit complet Slimline II de 1358mm/53,5\'\' de long contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de fixation pour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Touareg. Ce système s\'installe facilement avec des pieds résistants pour le tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou du constructeur. Aucun perçage n\'est nécessaire.', 450, 1730, NULL, 894.95798, 1073.949576, 'Composé de :\\n2 x GOFR001 - Pied de rail (paire) - par Front Runner\\n2 x GOFR012 - Poignées extérieures de rail affleurant / No. 3 - par Front Runner\\n2 x GOFR035 - Poignées intérieures pour rail encastré / F - par Front Runner\\n2 x RRAC904 - Entretoise plastique pour embase de rail / 10mm (Paire)\\n1 x RRSTD07 - Plateau Slimline II - 1255mm(L) X 1358mm(L) - par Front Runner\\n1 x WDST010 - Déflecteur de vent 20mm à lèvres étroites / 1255mm(W) - par Front Runner\\nMatériel utilisé :\\nAluminium T6 revêtu de poudre époxy noire\\n3CR12 Acier inoxydable\\nPoids approximatif installé 23kg (50lbs)\\nLes rainures en T sur le dessus et le dessous des lattes des plateaux et les profils de bord permettent de recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied, du pied d\'appui ou du pied de sangle indiqués ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre kit de galerie de toit Slimline II utilise des rails pour les pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des rails pour les pieds afin de déterminer la hauteur de la galerie par rapport au sommet (point le plus élevé) du toit du véhicule.\\nDimensions d\'expédition :\\nLargeur 450mm (18\'\')\\nLongueur 1615mm (64\'\')\\nHauteur 210mm (8\'\')\\nPoids de l\'expédition :\\nPoids : 26,6 kg (58,6 livres)', 'Ce kit de galerie de toit complet Slimline II de 1358mm/53,5\'\' de long contient le plateau Slimline II, un déflecteur de vent et 2 paires de pieds de fixation pour monter le plateau Slimline II sur les rails de toit de votre Volkswagen Touareg. Ce système s\'installe facilement avec des pieds résistants pour le tout-terrain qui s\'accrochent aux rails de toit existants de l\'usine ou du constructeur. Aucun perçage n\'est nécessaire.', 'Kit de galerie de toit Slimline II pour Volkswagen Touareg (2018-actuel) - par Front Runner', 'Galerie|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:46', NULL, NULL, 8.267721, 26.6, 6009542265414, 'ZA', 'EUR', 894.958, '7616.99', 10, 0),
(624, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volkswagen Touareg (2003-2011) - de Front Runner', 'KRVT005T', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Volkswagen Touareg contient un plateau Slimline II, un déflecteur de vent et 6 pieds. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 450, 1730, NULL, 886.55462, 1063.865544, ' \\nKRVT005T - Kit de galerie pour une Volkswagen Touareg (2003-2011) - Slimline II de Front Runner \\n  \\nContient : \\n1 x FASS001 - Pied 40mm (Paire) 1 x FASS003 - Pied 60mm (Paire) 1 x FASS005 - Pied 70mm (Paire) 1 x FITT002 - Instructions de montage pour un véhicule spécifique \\n1 x RRSTD09 - Plateau Slimline II - 1255mm (largeur) x 1762mm (longueur) x 50mm (hauteur) \\n  \\nMatériaux utilisés : \\nAluminium T6 en époxy noir \\n3CR12 acier inoxydable \\n  \\nPoids approximatif d’installation : 25kg \\n  \\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard). \\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière. \\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule. \\n  \\nDimensions de livraison : \\nLargeur : 450mm \\nLongueur : 1615mm \\nHauteur : 140mm \\n  Poids de la livraison : 29,1kg', ' Le kit de galerie Slimline II pour toute la longueur du toit de 1762mm pour une Volkswagen Touareg contient un plateau Slimline II, un déflecteur de vent et 6 pieds. Le plateau s’installe facilement en utilisant les points de montage existants. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Volkswagen Touareg (2003-2011) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:50', NULL, NULL, 5.511814, 29.3, 6009542222530, 'ZA', 'EUR', 886.555, '8708.29.90', 10, 0),
(625, 1, 2, NULL, NULL, NULL, 'Kit de barres de toit pour une Volkswagen Touareg / Pieds - de Front Runner', 'KRVT007', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 110, 1385, NULL, 180.67227, 216.806724, 'KRVT007 - Barres de toit 1255mm de Front Runner / Kit pour une Volkswagen Touareg \\n\\nContient: \\n2 x FASS002 - Pied de 50mm (Paire)\\n1 x FITT002 - Instructions de montage pour un véhicule spécifique\\n1 x LBSK014 - Barre de toit 1255mm (Paire) \\n1 x WDLB001 - Déflecteur de vent de 10mm\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation 5kg \\n\\nLa rainure en T sur le haut et sur le bas de la barre transversale est standard 8mm le boulon.\\nPour déterminer la hauteur du toit de votre véhicule jusqu’aux barres de toit, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation. \\nSi vos barres de toit ont besoin de pieds, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds pour déterminer la hauteur de la galerie à partir de votre gouttière. \\nSi votre kit de barres de toit a besoin de pieds de rails, ajoutez la hauteur de la barre de toit (22mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur : 110mm\\nLongueur : 1385mm\\nHauteur : 130mm\\n\\nPoids de la livraison: 5,9kg', 'Les barres de toit avec des rails à fixer sur le pavillon peuvent également être utilisées pour transporter de l’équipement sur le toit de votre véhicule si vous n’avez pas besoin d’une galerie complète. Ce kit contient 4 pieds de 50mm, 2 barres de toit de 1255mm, 1 déflecteur de vent de 10mm et un guide d’installation. Le kit contient tous les composants nécessaires pour monter les barres de toit sur votre véhicule. ', 'Kit de barres de toit pour une Volkswagen Touareg / Pieds - de Front Runner', 'Barres de toit|Kit de barres de toit|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:53', NULL, NULL, 5.118113, 6, 6009542232560, 'ZA', 'EUR', 180.672, '7616.99', 10, 0),
(626, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen Tiguan (2007-2016) - de Front Runner', 'KRVT008T', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1358mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Volkswagen Tiguan (2007-2016). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 455, 1730, NULL, 777.31092, 932.773104, 'KRVT008TKit de galerie de toit Slimline II pour une Volkswagen Tiguan (2007-2016) - de FrontRunner\\nContient:\\n2 x GOFR001 -Base de pied derail (paire) - de Front Runner\\n2 x GORR051 - Rail élevéextérieurGrab-On / N° 2 - de Front Runner\\n2 x GORR071 - Rail élevéintérieurGrab-On / B - de Front Runner\\n1 x RRSTA07 - Plateau Slimline II -1165mm (largeur) x 1358mm (longueur) - de Front Runner\\n1 x WDST011 - Déflecteur de vent 20mmextra étroit (paire) / 1165mm (largeur) - de Front Runner\\n\\nMatériauxutilisés :\\nAluminiumT6 en époxy noir\\n3CR12acier inoxydable\\n\\nPoidsapproximatif d’installation : 21kg\\n\\nLarainure en T sur le haut et sur le bas du plateau de la barre transversaleconvient pour un boulon de 8mm (standard).\\n\\nPourdéterminer la hauteur du pied de fixation de la galerie pour que la galerie netouche pas le pavillon du véhicule, bien vérifier le bombé du toit avec unerègle afin d’effectuer la bonne hauteur de la patte de fixation.\\n\\nSivotre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateauSlimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerieà partir de votre gouttière.\\n\\nSivotre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur duplateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer lahauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\n\\nDimensionsde livraison :\\nLargeur455mm\\nLongueur1610mm\\nHauteur285mm\\n\\nPoidsde la livraison :Poids : 24,3kg', 'Ce kit de galerie Slimline II pour toute lalongueur du toit de 1358mm contient le plateau Slimline II, un déflecteur devent et 2 paires de pieds Grab-On pour monter le plateau Slimline II sur lesbarres surélevées de votre Volkswagen Tiguan (2007-2016). Ce systèmes’installe facilement en utilisant les pieds solides tout-terrain quis’accrochent aux barres longitudinales d’origine. Le forage n’est pasnécessaire.', 'Kit de galerie de toit Slimline II pour une Volkswagen Tiguan (2007-2016) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|Galerie|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:29:53', NULL, NULL, 11.220478, 24.4, 6009542252551, 'ZA', 'EUR', 777.311, '7616.99', 10, 0),
