(629, 1, 2, NULL, NULL, NULL, 'Kit de galerie de toit Slimline II pour une Volkswagen T4 Transporter (1990-2003) - de Front Runner', 'KRVT011T', 'La galerie Slimline II pour toute lalongueur du toit de 2772 mm pour la Volkswagen T4 Transporter (1990-2003) contient le plateau Slimline II, un déflecteur devent, 2 rails et 8 pieds. Le forage est nécessaire pour l’installation.', 455, 1730, NULL, 1500, 1800, 'KRVT011T Kit de galerie de toit Slimline IIpour une Volkswagen T4 Transporter (1990-2003) - de Front Runner\\nContient:\\n2 x FASS012 - set de pied / 40 mm - 50 mm - de FrontRunner\\n\\n2 x FASS013 - set de pied / 60 mm - 70 mm\\n1 x RRAC905 - kit d’installation pour une VolkswagenT4 Transporter RR\\n1 x RRSTD14 - plateau Slimline II - 1255mm largeurX 2772mm longueur - de Front Runner\\n2 x TRAC002 - rails universels / 1400mmlongueur - de Front Runner\\n\\nMatériaux utilisés : \\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\n\\nPoids approximatif d’installation : 40 kg \\nLa rainure en T sur le haut et sur le basdu plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied defixation de la galerie pour que la galerie ne touche pas le pavillon duvéhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer labonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin depieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des piedspour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin depieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteurdes pieds de rails pour déterminer la hauteur de la galerie à partir du pointle plus haut du toit de votre véhicule.\\n\\nDimensions de livraison :\\nLargeur 455 mm \\nLongueur 1610 mm \\nHauteur 285 mm \\n\\nPoids de la livraison :Poids : 46,6 kg', 'La galerie Slimline II pour toute lalongueur du toit de 2772 mm pour la Volkswagen T4 Transporter (1990-2003) contient le plateau Slimline II, un déflecteur devent, 2 rails et 8 pieds. Le forage est nécessaire pour l’installation.', 'Kit de galerie de toit Slimline II pour une Volkswagen T4 Transporter (1990-2003) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|VEHICLE SPECIFIC GEAR|Galeries pour camionettes', 0, 1, '2022-01-07 11:30:27', NULL, NULL, 11.220478, 46.8, 6009542253152, 'ZA', 'EUR', 1500, '8708.29.90', 10, 0),
(630, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour Volkswagen T-Roc (2017-jusqu\'à présent) - de Front Runner', 'KRVT012T', 'Faites-vous plaisir en créant plus d\'espace pour tous vos équipements et jouets avec ce Kit de galerie Slimline II pour Volkswagen T-Roc. Libérez l\'espace intérieur précieux en montant votre équipement sur le toit pour que vous ayez toujours de la place pour vos compagnons d\'aventure.', 455, 1730, NULL, 886.55462, 1063.865544, 'KRVT012T -Kit de galerie Slimline II pour Volkswagen T-Roc (2017-jusqu\'à présent) - de Front Runner\\nComposé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GOFR014 - Grips extérieurs de rail affleurant / No. 6\\n2x GOFR035 - Grips intérieurs de rail affleurant / F\\n4x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 24.66kg (54.37lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre gallérie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur : 455 mm (18\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\nPoids : 24.6kg (54lbs)', 'Faites-vous plaisir en créant plus d