(635, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volvo V60 (2018-jusqu\'à présent) - de Front Runner', 'KRVV001T', 'Votre Volvo V60 a été conçue pour être polyvalente et, avec l\'ajout du kit de galerie de toit Slimline II, elle peut atteindre son plein potentiel. Ce kit de galerie s\'installe facilement et rapidement pour que vous puissiez profiter des plus de 55 accessoires et être prêt pour toutes les aventures.', 440, 1730, NULL, 911.76471, 1094.117652, 'KRVV001T - Volvo V60 (2018-Actuel) Kit de galerie de toit Slimline II - par Front Runner\\nComposé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GOFR014 - Poignées extérieures de rail affleurant / No. 6\\n3x GOFR032 - Poignées intérieures de rail affleurant / C\\n2x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\n1x WDST011 - Déflecteur de vent 20mm bord extra étroit paire /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif du montage : 52.82kg (116.45lbs)\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de Foot Rails, ajoutez la hauteur du plateau Slimline II (50mm/ 2\'\') à la hauteur des Foot Rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nPoids : 440mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 160mm (6\'\')\\nPoids à la livraison :\\nPoids : 25.8kg (57lbs)', 'Votre Volvo V60 a été conçue pour être polyvalente et, avec l\'ajout du kit de galerie de toit Slimline II, elle peut atteindre son plein potentiel. Ce kit de galerie s\'installe facilement et rapidement pour que vous puissiez profiter des plus de 55 accessoires et être prêt pour toutes les aventures.', 'Kit de galerie Slimline II pour une Volvo V60 (2018-jusqu\'à présent) - de Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galeries de toit sportives /utilitaires', 0, 1, '2022-01-07 11:31:11', NULL, NULL, 6.3, 25.8, 6009542200415, 'ZA', 'EUR', 911.765, '7616.99', 10, 0),
(636, 1, 2, NULL, NULL, NULL, 'Kit Galerie de toit Slimline II pour Volkswagen Golf Variant MK6 (2009-2013) - par Front Runner', 'KRVV002T', 'Obtenez plus d\'espace pour transporter votre équipement d\'aventure préféré ou votre matériel sur votre Volkswagen Golf Variant MK6 (2009-2013) avec ce Kit Galerie de toit Slimline II polyvalent et robuste. Créez n\'importe quelle aventure avec notre large gamme d\'accessoires de galerie.', 440, 1730, NULL, 760.5042, 912.60504, 'Composé de :\\n2x GOFR001 - Base de pied de rail (paire)\\n2x GORR051 - Poignées extérieures de rail surélevé / No. 2\\n2x GORR071 - Grips intérieurs de rail surélevé / B\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\nMatériel utilisé :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 23.4kg (51.59lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\nPoids : 23.8kg (52lbs)', 'Obtenez plus d\'espace pour transporter votre équipement d\'aventure préféré ou votre matériel sur votre Volkswagen Golf Variant MK6 (2009-2013) avec ce Kit Galerie de toit Slimline II polyvalent et robuste. Créez n\'importe quelle aventure avec notre large gamme d\'accessoires de galerie.', 'Kit Galerie de toit Slimline II pour Volkswagen Golf Variant MK6 (2009-2013) - par Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:31:15', NULL, NULL, 6.1, 23.8, 6009542218007, 'ZA', 'EUR', 760.504, '7616.99', 10, 0),
(637, 1, 2, NULL, NULL, NULL, 'Kit galerie de toit Slimline II pour Volvo V90/V90CC (2016-actuel) - par Front Runner', 'KRVV003T', 'Libérez l\'espace intérieur de votre Volvo V90/V90CC (2016-actuel) en transportant votre équipement d\'aventure et votre matériel sur le toit avec ce Kit Galerie de toit Slimline II polyvalent et robuste. Avec des accessoires pour construire n\'importe quelle aventure, votre Volvo sera prête à explorer.', 440, 1730, NULL, 911.76471, 1094.117652, 'Composé de :\\n3x GOFR001 - Base de pied de rail (paire)\\n3x GOFR014 - Griffes extérieures de rail affleurant / No. 6\\n3x GOFR032 - Grips intérieurs pour rail affleurant / C\\n2x RRAC904 - Entretoise en plastique pour base de pied de rail / 10mm (paire)\\n1x RRSTA07 - Plateau SLII - 1165mm(W)X1358mm(L)\\n1x WDST011 - Paire de déflecteurs de vent 20mm bord extra étroit /1165mm\\nMatériaux utilisés :\\nAluminium T6 recouvert de poudre époxy noire\\nAcier haute résistance\\nPoids approximatif monté : 26.42kg (58.25lbs)\\nLes rainures en T situées en haut et en bas des lattes du plateau de la galerie et des profilés de bord peuvent recevoir des boulons standard de 8 mm.\\nPour déterminer la hauteur approximative entre le toit de votre véhicule et le haut de votre galerie Slimline II, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur du pied ou du pied d\'accrochage indiqué ci-dessus.\\nSi votre kit de galerie Slimline II utilise des pieds, ajoutez la hauteur du plateau Slimline II (50 mm) à la hauteur des pieds pour déterminer la hauteur de la galerie par rapport aux gouttières de votre véhicule.\\nSi votre Kit Galerie de toit Slimline II utilise des rails de pied, ajoutez la hauteur du plateau Slimline II (50mm/2\'\') à la hauteur des rails de pied pour déterminer la hauteur de la galerie depuis le sommet (point le plus haut) du toit du véhicule.\\nDimensions de livraison :\\nLargeur : 440 mm (17\'\')\\nLongueur : 1730mm (68\'\')\\nHauteur : 155mm (6\'\')\\nPoids à la livraison :\\n