.8kg (55lbs)', 'Ajoutez encore plus de capacité de transport de matériel à votre Volkswagen Golf Variant MK7 (2013-2020) avec le Kit Galerie Front Runner Slimline II. Transportez votre équipement d\'aventure et vos jouets sur le toit pour libérer de l\'espace intérieur afin de pouvoir explorer avec plus.', 'Kit Galerie Galerie Slimline II pour Volkswagen Golf Variant MK7 (2013-2020) - Front Runner', 'Galerie|Kit de Galerie Slimline II|Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 11:31:22', NULL, NULL, 6.1, 24.8, 6009542218069, 'ZA', 'EUR', 827.731, '7616.99', 10, 0),
(639, 1, 2, NULL, NULL, NULL, 'Kit de galerie Slimline II pour une Volvo XC90 (2014-2016) - de Front Runner', 'KRVX001T', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de rail pour monter le plateau Slimline II sur votre Volvo XC90. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 450, 1730, NULL, 920.16807, 1104.201684, 'Contient :\\n3 x GOFR001 - Base de pied de rail (Paire) - de Front Runner\\n3 x GOFR014 - Pied Grab-On extérieur pour barres Flush / No. 6 - de Front Runner\\n3 x GOFR030 - Pied Grab-On intérieur pour barres Flush / A - de Front Runner\\n1 x RRSTD07 - Plateau Slimline II - 1255mm (largeur) x 1358mm (longueur) - de Front Runner\\nMatériaux utilisés :\\nAluminium T6 en époxy noir\\n3CR12 acier inoxydable\\nPoids approximatif d’installation : 23kg\\nLa rainure en T sur le haut et sur le bas du plateau de la barre transversale convient pour un boulon de 8mm (standard).\\nPour déterminer la hauteur du pied de fixation de la galerie pour que la galerie ne touche pas le pavillon du véhicule, bien vérifier le bombé du toit avec une règle afin d’effectuer la bonne hauteur de la patte de fixation.\\nSi votre galerie Slimline II a besoin de pieds, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds pour déterminer la hauteur de galerie à partir de votre gouttière.\\nSi votre galerie Slimline II a besoin de pieds de rails, ajoutez la hauteur du plateau Slimline II (50mm) à la hauteur des pieds de rails pour déterminer la hauteur de la galerie à partir du point le plus haut du toit de votre véhicule.\\nDimensions de livraison :\\nLargeur 450mm\\nLongueur 1615mm\\nHauteur 140mm\\nPoids de la livraison :\\nPoids : 27,3kg', 'La galerie Slimline II pour toute la longueur du toit de 1358mm contient le plateau Slimline II, un déflecteur de vent et 3 paires de pieds de rail pour monter le plateau Slimline II sur votre Volvo XC90. Le plateau s’installe facilement en installant le pied sur la barre longitudinale Flush. Le forage n’est pas nécessaire.', 'Kit de galerie Slimline II pour une Volvo XC90 (2014-2016) - de Front Runner', 'Galeries de toit pour rails d\'origine/ OEM|VEHICLE SPECIFIC GEAR|Galerie|Kit de Galerie Slimline II', 0, 1, '2022-01-07 11:31:25', NULL, NULL, 5.511814, 27.7, 6009542243696, 'ZA', 'EUR', 920.168, '7616.99', 10, 0),
