(726, 1, 2, NULL, NULL, NULL, 'Support de phares sur pare-brise pour une Jeep Wrangler JK/JKU - de Front Runner', 'RRAC014', 'Montez rapidement et facilement des phares sur votre Jeep JK Wrangler avec les supports de phares sur pare-brise. ', 250, 260, NULL, 17.63866, 21.166392, 'Composé de :\\n2x Supports de phares\\nMatériau utilisé :\\nAcier époxy noir 3mm\\nDimensions du produit :\\n93mm (3.7\'\') L x 84mm (3.3\'\') l x 65mm (2.6\'\') H\\nPoids :\\n0.23kg (0.5lbs)', 'Montez rapidement et facilement des phares sur votre Jeep JK Wrangler avec les supports de phares sur pare-brise. ', 'Support de phares sur pare-brise pour une Jeep Wrangler JK/JKU - de Front Runner', 'Éclairage|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:22:43', NULL, NULL, 2.952757, 0.6, 6009542212791, 'ZA', 'EUR', 17.639, '7326.90.98', 7, 0),
(727, 1, 2, NULL, NULL, NULL, 'Adaptateurs pour fixer une barre de toit Thule sur galerie - de Front Runner', 'RRAC017', 'Ces adaptateurs vous permettent d’attacher les barres de toit Thule ou Aero et des accessoires Thule à une galerie de Front Runner. Vous pouvez également utiliser ces adaptateurs pour monter un plateau de la galerie Slimline II sur les barres de toit Thule.', 160, 335, NULL, 63.02521, 75.630252, 'Correspond à :\\nBarre de toit SLOTTED SQUARE et AERO Thule.\\n\\nMatériau utilisé:\\n2,5mm acier, fourni avec des pièces de montage pour des barres Aero et Square.\\n\\nContient :\\n4 x Adaptateurs et un kit de boulons et d’écrous\\n\\nDimensions du produit :\\nL 285mm (11.22\'\') x l 205mm (8.07\'\') x H 55mm (2.16\'\')\\n\\nPoids :\\n2kg (4.4lbs)', 'Ces adaptateurs vous permettent d’attacher les barres de toit Thule ou Aero et des accessoires Thule à une galerie de Front Runner. Vous pouvez également utiliser ces adaptateurs pour monter un plateau de la galerie Slimline II sur les barres de toit Thule.', 'Adaptateurs pour fixer une barre de toit Thule sur galerie - de Front Runner', 'Pièces pour galeries|Accessoires|RANGEMENT|SPORT|Vélo|Paddle|Surf|Neige|Pèche', 0, 1, '2022-01-07 12:22:47', NULL, NULL, 3.7, 2.2, 6009542216225, 'ZA', 'EUR', 63.025, '7326.90.98', 10, 0),
(728, 1, 2, NULL, NULL, NULL, 'Support de phares pour galerie - de Front Runner', 'RRAC022', 'Ces supports sont parfaits pour monter des phares ou des supports d’antenne. Ces supports en acier inoxydable sont fabriqués en époxy pour correspondre à la galerie et glissent dans le rebord du Slimline II pour une installation facile. ', 90, 120, NULL, 33.60504, 40.326048, 'Composé de :\\n2 x Supports ajustables\\nPièces d’installation\\nInstructions de montage\\n\\nMatériau utilisé :\\nAcier résistant à la corrosion en époxy noire\\n\\nDimensions du produit :\\n80mm (3.2\'\') L x 61mm (2.4\'\') W x 66mm (2.6\'\') H (Support individuel)\\n\\nPoids:\\n210g (7.4oz) (Paire)', 'Ces supports sont parfaits pour monter des phares ou des supports d’antenne. Ces supports en acier inoxydable sont fabriqués en époxy pour correspondre à la galerie et glissent dans le rebord du Slimline II pour une installation facile. ', 'Support de phares pour galerie - de Front Runner', 'Accessoires|Éclairage|Éclairage|Éclairage|ÉXPEDITION', 0, 1, '2022-01-07 12:22:50', NULL, NULL, 2.362206, 0.5, 6009542217888, 'ZA', 'EUR', 33.605, '7326.90.98', 10, 0),
(729, 1, 2, NULL, NULL, NULL, 'Support de hache - de Front Runner', 'RRAC023', 'La cage verrouillable en acier inoxydable maintient la tête de la hache en sécurité et à l’écart quand la hache est montée sur le côté de la galerie Slimline II de Front Runner. L’installation est super facile, glissez simplement les boulons et le support dans le rebord du plateau Slimline II et serrez.', 162, 335, NULL, 63.02521, 75.630252, 'Contient: \\nSupport de hache, tube en aluminium, protection en caoutchouc, support de poignée de hache, œillet d’arrimage M10 et kit d’écrous de et de boulons \\n\\nDimensions du produit: \\nLongueur 340mm x Largeur 160mm x Hauteur 85mm\\n\\nPoids: \\n1,8kg', 'La cage verrouillable en acier inoxydable maintient la tête de la hache en sécurité et à l’écart quand la hache est montée sur le côté de la galerie Slimline II de Front Runner. L’installation est super facile, glissez simplement les boulons et le support dans le rebord du plateau Slimline II et serrez.', 'Support de hache - de Front Runner', 'Accessoires|CAMPING|Outils & Autres|ALL CAMPING GEAR|CAMPER|ÉXPEDITION|Désensablage|Accessoires d’aide au franchissement|Aide au franchissement', 0, 1, '2022-01-07 12:23:15', NULL, NULL, 3.5, 1.4, 6009542218090, 'ZA', 'EUR', 63.025, '7326.90.98', 10, 0),
(730, 1, 2, NULL, NULL, NULL, 'Sangles à cliquets pour bêche, pelle AND rame - de Front Runner', 'RRAC024', 'Voici la solution pour transporter une bêche/pelle ou un outil avec une forme similaire comme une pagaie de canoë. Les sangles à cliquets sont fabriquées pour correspondre à différentes circonférences et assurent un serrage ferme sur les côtés d’une galerie Front Runner afin d’éviter les vibrations. Les verrous se détachent rapidement et ceci permet d’enlever la bêche/pelle facilement.', 125, 175, NULL, 54.62185, 65.54622, 'Matériaux utilisés : Acier inoxydable 3CR12 de 1,8 mm (0,07\'\'), revêtu de poudre noire. Constitué de : 2x support de bêche/pelle 2x boucle à cliquet 2x sangle d\'échelle 1x kit de boulons et écrous Dimensions du produit : L 120mm (4,72\'\') x l 90mm (3,54\'\') x H 65mm (2,55\'\') Poids : 0,6kg (1,322lbs)', 'Voici la solution pour transporter une bêche/pelle ou un outil avec une forme similaire comme une pagaie de canoë. Les sangles à cliquets sont fabriquées pour correspondre à différentes circonférences et assurent un serrage ferme sur les côtés d’une galerie Front Runner afin d’éviter les vibrations. Les verrous se détachent rapidement et ceci permet d’enlever la bêche/pelle facilement.', 'Sangles à cliquets pour bêche, pelle AND rame - de Front Runner', 'Accessoires|CAMPING|Outils & Autres|Aide au franchissement|Accessoires d’aide au franchissement|ALL CAMPING GEAR|KAYAKING & CANOEING|SKIING / SNOWBOARDING|OVERLANDING & EXPEDITION|CAMPER|ÉXPEDITION|Désensablage', 0, 1, '2022-01-07 12:23:18', NULL, NULL, 2.8, 0.2, 6009542222561, 'ZA', 'EUR', 54.622, '7326.90.98', 10, 0),
(731, 1, 2, NULL, NULL, NULL, 'Œillets d\'arrimage en acier inoxydable - de Front Runner', 'RRAC025', 'Ces œillets d’arrimage faciles à utiliser et rapides à installer, doivent être montés par les rainures en T au-dessus, en dessous et sur les côtés de la galerie Slimline II. Vendus en paire. ', 100, 170, NULL, 9.23529, 11.082348, 'Matériau utilisé:\\nAcier inoxydable\\n\\nContient : \\n2 x Œillets d’arrimage\\n2 x Boulons\\n2 x Rondelles en plastique\\n\\nPoids: \\n0,12kg', 'Ces œillets d’arrimage faciles à utiliser et rapides à installer, doivent être montés par les rainures en T au-dessus, en dessous et sur les côtés de la galerie Slimline II. Vendus en paire. ', 'Œillets d\'arrimage en acier inoxydable - de Front Runner', 'Accessoires|Rangement|Arrimage & Sécurisation|ALL STORAGE SYSTEMS|RANGEMENT|SPORT|CAMPER|Vélo|Paddle|Surf|Neige|Pèche|Rangement|Rangement|Rangement & Sacs', 0, 1, '2022-01-07 12:23:21', NULL, NULL, 0.590552, 0.1, 6009542220109, 'CN', 'EUR', 9.235, '7318.13.00', 10, 0),
(732, 1, 2, NULL, NULL, NULL, 'Bras repliable pour douche portable - de Front Runner', 'RRAC028', 'Montez la plaque de base sur les barres transversales sur le côté du plateau de la galerie Front Runner, cliquez ensuite et retirez le bras repliable pour y accrocher votre douche solaire ou votre douchette.', 120, 525, NULL, 54.62185, 65.54622, 'Matériaux utilisés : \\nAcier inoxydable en époxy noir 2,5mm\\nPoids léger et peut porter jusqu’à 20L d’eau accrochée sur le toit de la galerie \\n\\nContient: \\nBras repliable inférieur, bras repliable supérieur et un kit d’écrous et de boulons\\n\\nDimensions du produit: \\nLongueur 530mm x Largeur 120mm x Hauteur 90mm\\n\\nPoids:2kg', 'Montez la plaque de base sur les barres transversales sur le côté du plateau de la galerie Front Runner, cliquez ensuite et retirez le bras repliable pour y accrocher votre douche solaire ou votre douchette.', 'Bras repliable pour douche portable - de Front Runner', 'Accessoires|CAMPING|Outils & Autres|Eau|ALL CAMPING GEAR|FISHING|CYCLING|Douche|CAMPER|Carburant et Eau', 0, 1, '2022-01-07 12:23:25', NULL, NULL, 3.5, 1.8, 6009542223216, 'ZA', 'EUR', 54.622, '7326.90.98', 10, 0),
(733, 1, 2, NULL, NULL, NULL, 'Support d’auvent Easy-Out - de Front Runner', 'RRAC029', 'Montez le support d’auvent Easy-Out de Front Runner, ainsi que les autres marques populaires d’auvents, en toute sécurité sur la galerie Slimline II. Ce montage solide et sans forage offre une alternative raffinée pour les supports en L laids, trop larges et galvanisés. ', 121, 278, NULL, 54.62185, 65.54622, 'Contient :\\n3x Supports\\n1x Kit d’écrous et de boulons\\n\\nDimensions du produit :\\n49mm (1.92\'\') L x 128mm (5.03\'\') W x 87.5mm (3.44\'\') H\\nPoids :\\n1.36kg (2.99lbs)\\nMatériau utilisé :\\n3mm (0.118\'\') acier en époxy noir', 'Montez le support d’auvent Easy-Out de Front Runner, ainsi que les autres marques populaires d’auvents, en toute sécurité sur la galerie Slimline II. Ce montage solide et sans forage offre une alternative raffinée pour les supports en L laids, trop larges et galvanisés. ', 'Support d’auvent Easy-Out - de Front Runner', 'Accessoires|Tentes & auvents|CAMPING|CAMPER|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:23:28', NULL, NULL, 3.9, 1.4, 6009542223605, 'ZA', 'EUR', 54.622, '7326.90.98', 10, 0),
(734, 1, 2, NULL, NULL, NULL, 'Support universel pour monter des accessoires sur la Slimline II - par Front Runner', 'RRAC031', 'Les supports universels correspondent au profile latéral de la galerie Slimline II de Front Runner. Ces supports vous permettent de monter des accessoires sur votre galerie sans devoir forer.', 90, 115, NULL, 28.56303, 34.275636, 'Composé de :\\nUn set de trois supports avec des trous de montage pré-percés. Les rondelles, les boulons et les écrous sont inclus.\\nMatériau utilisé :\\nAcier en époxy noir.\\nDimensions du produit :\\nL 115mm (4.52\'\') l 90mm (3.54\'\') x H 55mm (2.16\'\')\\nPoids :\\n0.66kg (1.455lbs)', 'Les supports universels correspondent au profile latéral de la galerie Slimline II de Front Runner. Ces supports vous permettent de monter des accessoires sur votre galerie sans devoir forer.', 'Support universel pour monter des accessoires sur la Slimline II - par Front Runner', 'Accessoires|Tentes & auvents|RANGEMENT|Tentes et Auvents|Tentes et Auvents|CAMPING', 0, 1, '2022-01-07 12:23:30', NULL, NULL, 2.4, 0.6, 6009542223872, 'ZA', 'EUR', 28.563, '7326.90.98', 10, 0),
(735, 1, 2, NULL, NULL, NULL, 'Support universel d’auvent - de Front Runner', 'RRAC036', 'Attachez rapidement votre auvent à la galerie Slimline II de Front Runner, sans devoir forer. ', 336, 369, NULL, 79.83193, 95.798316, 'Composé de :\\n3 x Support d’auvent\\nKit d’écrous et de boulons\\nMatériau utilisé :\\nAcier époxy noir\\nPoids :\\n2kg (4.4lbs)', 'Attachez rapidement votre auvent à la galerie Slimline II de Front Runner, sans devoir forer. ', 'Support universel d’auvent - de Front Runner', 'Accessoires|Tentes & auvents|CAMPING|CAMPER|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:23:34', NULL, NULL, 3.1, 2.4, 6009542224381, 'ZA', 'EUR', 79.832, '7326.90.98', 10, 0),
(736, 1, 2, NULL, NULL, NULL, 'Kit de boulons de rechange pour le plateau Slimline II - de Front Runner', 'RRAC041', 'Des écrous et des boulons de rechange pour des composants perdus ou abîmés du Slimline II. ', 250, 280, NULL, 38.64706, 46.376472, 'Contient : \\n32 x Écrous nyloc M8\\n4 x Boulon tête bombée M6x16\\n28 x Boulon tête bombée M8x30\\n4 x Boulon tête bombée M8x45\\n2 x Pièces de jointure en aluminium (fin)\\n2 x Pièces de jointure en aluminium (épais)', 'Des écrous et des boulons de rechange pour des composants perdus ou abîmés du Slimline II. ', 'Kit de boulons de rechange pour le plateau Slimline II - de Front Runner', 'Galerie|Pièces pour galeries|SPARE COMPONENTS', 0, 1, '2022-01-07 12:23:36', NULL, NULL, 1.574804, 0.8, 6009542224909, 'ZA', 'EUR', 38.647, '7318.15.62', 10, 0),
(737, 1, 2, NULL, NULL, NULL, 'Support optionnel pour un réservoir d’eau de 42L - de Front Runner', 'RRAC042', 'Utilisez ce support pour monter un réservoir d’eau de 42L de Front Runner n\'importe où sur une galerie originale Slimline ou loin des barres latérales de manière perpendiculaire ou parallèle sur les barres transversales de la galerie Slimline II. ', 335, 365, NULL, 35.28571, 42.342852, 'Contient : \\n1x Remplacement pour le support arrière \\n1x Support avant\\nKit d’écrous et de boulons \\n\\nMatériau utilisé : \\nAcier inoxydable 3CR12 époxy noir\\n\\nPoids : \\n1,4kg', 'Utilisez ce support pour monter un réservoir d’eau de 42L de Front Runner n\'importe où sur une galerie originale Slimline ou loin des barres latérales de manière perpendiculaire ou parallèle sur les barres transversales de la galerie Slimline II. ', 'Support optionnel pour un réservoir d’eau de 42L - de Front Runner', 'Accessoires|Eau|Réservoirs & supports|CAMPER|ÉXPEDITION|Carburant et Eau', 0, 1, '2022-01-07 12:23:37', NULL, NULL, 3.1, 1, 6009542225500, 'ZA', 'EUR', 35.286, '7326.90.98', 10, 0),
(738, 1, 2, NULL, NULL, NULL, 'Kit de capuchons pour convertir des lattes en barres de toit - de Front Runner', 'RRAC044', 'Convertissez n’importe quelle taille de barre transversale en barre de toit avec ces capuchons en plastique. ', 150, 160, NULL, 15.95798, 19.149576, 'Contient : \\n4 x Capuchons en plastique\\n\\nMatériau utilisé: \\nPlastique - polypropylène\\n\\nDimensions du produit: \\nLargeur 91mm x Longueur 30mm x Hauteur 23mm\\n\\nPoids: \\n0,2kg', 'Convertissez n’importe quelle taille de barre transversale en barre de toit avec ces capuchons en plastique. ', 'Kit de capuchons pour convertir des lattes en barres de toit - de Front Runner', 'Pièces pour galeries|Barres de toit|Composants pour barres de toit|SPARE COMPONENTS', 0, 1, '2022-01-07 12:23:40', NULL, NULL, 1.574804, 0.1, 6009542226644, 'ZA', 'EUR', 15.958, '3926.90.97', 10, 0);
