(739, 1, 2, NULL, NULL, NULL, 'Support de planche de surf, planche à voile AND planche à rame Pro - de Front Runner', 'RRAC052', 'Le support sert à soutenir la plupart de planches de surf, planches à rame, planches à voile et planches de kitesurf. Il est spécialement conçu pour garder vos planches stables et sécurisées pendant un voyage à travers les routes les plus difficiles au monde. Le support contient un ajustement en largeur, une protection en coussinet et une comptabilité avec des planches universels pour le sport aquatique.', 330, 370, NULL, 158.82353, 190.588236, 'Composé de :\\n2 x Supports\\n2 x Sangles Stratchit\\nKit de boulons\\nMatériaux utilisés :\\nAcier en époxy noir\\nCoussinets en polyéthylène\\nDimensions du produit:\\nL 276mm (10.9\'\') x W 76mm (3\'\') x H 67mm (2.6\'\')\\nPoids:\\nSupport individuel: 0.6kg (1.3lbs)\\nKit entier : 2.9kg (6.4lbs)', 'Le support sert à soutenir la plupart de planches de surf, planches à rame, planches à voile et planches de kitesurf. Il est spécialement conçu pour garder vos planches stables et sécurisées pendant un voyage à travers les routes les plus difficiles au monde. Le support contient un ajustement en largeur, une protection en coussinet et une comptabilité avec des planches universels pour le sport aquatique.', 'Support de planche de surf, planche à voile AND planche à rame Pro - de Front Runner', 'Accessoires|SURFING|SPORT|Surf|Paddle', 0, 1, '2022-01-07 12:23:43', NULL, NULL, 3.1, 3.5, 6009542228556, 'ZA', 'EUR', 158.824, '7326.90.98', 10, 0),
(740, 1, 2, NULL, NULL, NULL, 'Porte casserole en fonte - de Front Runner', 'RRAC062', 'Ce support permet de transporterune casserole en fonte n° 2/3 en toute sécurité en se boulonnant sur votre galerie Slimline/Slimline II.', 245, 320, NULL, 66.38655, 79.66386, 'Composé de :\\nSupport pour une casserole en fonte n° 2 n° 3\\nSangle à cliquet\\nPièces d’installation\\nMatériau utilisé :\\nAcier revêtu en époxy noir\\nDimensions du produit :\\n276mm (10.9\'\') L x 229mm (9\'\') l x 133mm (5.2\'\') H\\nPoids :\\n2kg (4.4lbs)', 'Ce support permet de transporterune casserole en fonte n° 2/3 en toute sécurité en se boulonnant sur votre galerie Slimline/Slimline II.', 'Porte casserole en fonte - de Front Runner', 'Accessoires|CAMPING|Cuisine de camping|ALL CAMPING GEAR|CAMPER|Manger|Manger|Produits vedettes', 0, 1, '2022-01-07 12:23:46', NULL, NULL, 6.299216, 2.8, 6009542230580, 'ZA', 'EUR', 66.387, '7326.90.98', 10, 0),
(741, 1, 2, NULL, NULL, NULL, 'Support d’auvent Eezi-Awn Séries 1000/2000 - de Front Runner', 'RRAC063', 'Attachez facilement votre auvent Eezi-Awn Séries 1000/2000 à votre galerie Slimline II de Front Runner, sans devoir forer.', 120, 280, NULL, 54.62185, 65.54622, 'Composé de :\\n2 x Support d’auvent Front Runner\\nPièces d’installation\\nMatériau utilisé :\\nAcier époxy noir\\nDimensions du produit :\\n80mm Largeur x 70mm Profondeur x 120mm Hauteur\\nPoids :\\n1,4kg', 'Attachez facilement votre auvent Eezi-Awn Séries 1000/2000 à votre galerie Slimline II de Front Runner, sans devoir forer.', 'Support d’auvent Eezi-Awn Séries 1000/2000 - de Front Runner', 'Accessoires|Tentes & auvents|CAMPING|CAMPER|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:23:49', NULL, NULL, 4.3, 1.4, 6009542228617, 'ZA', 'EUR', 54.622, '7326.90.98', 10, 0),
(742, 1, 2, NULL, NULL, NULL, 'Support d’échelle télescopique / 2.6m - par Front Runner', 'RRAC064', 'Les supports sont montés sur la galerie Slimline II et permettent à l’échelle télescopique de s’appuyer fermement contre la galerie et préviennent que l’échelle glisse latéralement.', 150, 165, NULL, 9.23529, 11.082348, 'Contient : \\n2 x Support d’échelle\\nKit de pièces d’installation\\n\\nMatériau utilisé: \\nAcier inoxydable 3CR12 en époxy noir \\n\\nDimensions du produit: \\nLongueur 50mm x Largeur 60mm x Hauteur 15mm\\n\\nPoids: \\n0,1kg', 'Les supports sont montés sur la galerie Slimline II et permettent à l’échelle télescopique de s’appuyer fermement contre la galerie et préviennent que l’échelle glisse latéralement.', 'Support d’échelle télescopique / 2.6m - par Front Runner', 'Accessoires|Échelles|CYCLING|CAMPER', 0, 1, '2022-01-07 12:24:15', NULL, NULL, 1.968505, 0.2, 6009542228600, 'ZA', 'EUR', 9.235, '7326.90.98', 10, 0),
(743, 1, 2, NULL, NULL, NULL, 'Supports d\'auvents Bat Wing/Manta Wing - par Front Runner', 'RRAC074', 'Attachez facilement votre auvent Manta Wing ou Bat Wing à votre galerie Slimline II de Front Runner avec ces supports.', 170, 280, NULL, 83.19328, 99.831936, 'Contient :\\n2 x Support d’auvent\\nKit de boulons\\n\\nMatériau utilisé:\\nAcier époxy noir\\n\\nDimensions du produit:\\nL 152mm (6\'\') x W 85mm (3.3\'\') x H 198mm (7.8\'\')Poids :\\n2.8kg (6.2lbs)', 'Attachez facilement votre auvent Manta Wing ou Bat Wing à votre galerie Slimline II de Front Runner avec ces supports.', 'Supports d\'auvents Bat Wing/Manta Wing - par Front Runner', 'Accessoires|Tentes & auvents|CAMPING|CAMPER|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:24:17', NULL, NULL, 3.5, 2.9, 6009542228877, 'ZA', 'EUR', 83.193, '7326.90.98', 10, 0),
(744, 1, 2, NULL, NULL, NULL, 'Set de mousse de remplacement pour support de canoë/kayak ou planche de surf - de Front Runner', 'RRAC076', ' Un set de coussinets en mousse pour votre support de canoë/kayak ou planche de surf, au cas où votre set actuel serait endommagé, perdu ou usé. ', 250, 285, NULL, 15.11765, 18.14118, ' \\nContient : \\n4 coussinets en mousse \\n  \\nMatériau utilisé : \\nMousse polyéthylène cellulaire fermé réticulé \\n  \\nDimensions du produit : \\n230mm Longueur x 48mm Largeur x 12mm Hauteur (dimensions pour une pièce) \\n  \\nPoids : 170g', ' Un set de coussinets en mousse pour votre support de canoë/kayak ou planche de surf, au cas où votre set actuel serait endommagé, perdu ou usé. ', 'Set de mousse de remplacement pour support de canoë/kayak ou planche de surf - de Front Runner', 'SPARE COMPONENTS|FISHING|SPORT|Paddle|Surf', 0, 1, '2022-01-07 12:24:21', NULL, NULL, 1.181103, 0.1, 6009542230597, 'ZA', 'EUR', 15.118, '3926.90.97', 0, 0),
(745, 1, 2, NULL, NULL, NULL, 'Bras pliable pour auvent - de Front Runner', 'RRAC080', 'Combien de fois aviez-vous installé un auvent et découvert que l’ombre que vous aviez à midi est parti dans l’après-midi ? Voilà la raison pour laquelle Front Runner a créé un bras pliable pour auvent. Le bras peut pivoter en maintenant l’auvent et vous permet d’avoir le contrôle sur l’ombre que vous voulez. ', 910, 950, NULL, 491.59664, 589.915968, 'Contient :\\nBras pliant pour auvent\\nPièces d’installation\\nMatériau utilisé :\\nAcier époxy noir\\nDimensions du produit :\\n1234mm (48.6\'\') L x 356mm (14\'\') l x 120mm (4.7\'\') H\\n\\nPoids:\\n11.26kg (24.8lbs)', 'Combien de fois aviez-vous installé un auvent et découvert que l’ombre que vous aviez à midi est parti dans l’après-midi ? Voilà la raison pour laquelle Front Runner a créé un bras pliable pour auvent. Le bras peut pivoter en maintenant l’auvent et vous permet d’avoir le contrôle sur l’ombre que vous voulez. ', 'Bras pliable pour auvent - de Front Runner', 'Accessoires|Tentes & auvents|CAMPING|OVERLANDING & EXPEDITION|CAMPER|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:24:23', NULL, NULL, 6.299216, 17.8, 6009542231006, 'ZA', 'EUR', 491.597, '7326.90.98', 9, 0),
(746, 1, 2, NULL, NULL, NULL, 'Casserole en fonte AND Support - de Front Runner', 'RRAC081', ' Atteignez un niveau supérieur avec votre cuisine de camping en cuisinant sur le feu avec une casserole en fonte. Cette casserole nr° 3 et ce support solide se boulonnent rapidement et facilement sur n’importe quel plateau de Front Runner. ', 320, 315, NULL, 192.43697, 230.924364, ' \\nContient : \\nSupport \\nSangle avec cliquet \\nPièces d’installation \\nCasserole en fonte nr° 3 \\n  \\nMatériaux utilisés : \\nAcier inoxydable 3CR12 époxy noir \\nSangle en nylon \\nCasserole en fonte \\n  \\nDimensions du produit : \\n280mm Largeur x 280mm Profondeur x 343mm Hauteur \\n  \\nSpécifications de la casserole : \\nCasserole en fonte nr° 3 - capacité de 7,8l \\n  \\nDiamètre extérieur max. : \\n290mm \\n  \\nHauteur : \\n300mm \\n  \\nDiamètre extérieur max. du couvercle : \\n260mm \\n  \\nPoids total : 11,25kg', ' Atteignez un niveau supérieur avec votre cuisine de camping en cuisinant sur le feu avec une casserole en fonte. Cette casserole nr° 3 et ce support solide se boulonnent rapidement et facilement sur n’importe quel plateau de Front Runner. ', 'Casserole en fonte AND Support - de Front Runner', 'Accessoires|CAMPING|Cuisine de camping|ALL CAMPING GEAR|FISHING|CAMPER|Manger|ÉXPEDITION|Manger', 0, 1, '2022-01-07 12:24:28', NULL, NULL, 13.385834, 11.4, 6009542230955, 'ZA', 'EUR', 192.437, '7325.10.00', 10, 0),
(747, 1, 2, NULL, NULL, NULL, 'Kit de fermetures pour pied de rail - de Front Runner', 'RRAC082', 'Ces bouchons de fermeture scellent les points de montage du toit lorsque vous enlever la galerie Slimline II et le système de montage. De cette manière, vous avez un joint étanche afin d’éviter des fuites de votre toit pendant des conditions météorologiques extrêmes.', 150, 160, NULL, 15.95798, 19.149576, 'Contient :\\n12 x Bouchons de fermeture\\nPièce d’installation\\nGuide d’installation\\nMatériel utilisé :\\nPlastique polypropylène noir\\nDimensions du produit :\\nØ17mm x 5mm Hauteur\\nPoids :\\n80g', 'Ces bouchons de fermeture scellent les points de montage du toit lorsque vous enlever la galerie Slimline II et le système de montage. De cette manière, vous avez un joint étanche afin d’éviter des fuites de votre toit pendant des conditions météorologiques extrêmes.', 'Kit de fermetures pour pied de rail - de Front Runner', 'Galerie|Pièces pour galeries|SPARE COMPONENTS', 0, 1, '2022-01-07 12:24:32', NULL, NULL, 0.393701, 0.1, 6009542230900, 'ZA', 'EUR', 15.958, '3926.90.97', 10, 0),
(748, 1, 2, NULL, NULL, NULL, 'Kit de 4 outils - de Front Runner', 'RRAC093', 'Le kit de 4 outils pratiques et compacts sert à faire des ajustements rapides à la galerie et aux accessoires Front Runner. ', 150, 180, NULL, 30.21008, 36.252096, 'Contient :\\n1 x 5mm Clé hexagonale arrondie\\n1 x 4mm 5mm Clé hexagonale\\n1 x 10mm Clé à cliquet\\n1 x 13mm Clé à cliquet\\nMatériaux utilisés :\\nChrome vanadium\\nAcier à outils\\nDimensions du produit :\\n150mm Longueur x 100mm Largeur x 25mm Hauteur\\nPoids:\\n183g', 'Le kit de 4 outils pratiques et compacts sert à faire des ajustements rapides à la galerie et aux accessoires Front Runner. ', 'Kit de 4 outils - de Front Runner', 'Pièces pour galeries|Accessoires|CAMPING|Outils & Autres|SPARE COMPONENTS|CYCLING|Rangement|ÉXPEDITION|Rangement', 0, 1, '2022-01-07 12:24:33', NULL, NULL, 0.787402, 0.2, 6009542233246, 'ZA', 'EUR', 30.21, '8206.00.00', 10, 0),
(749, 1, 2, NULL, NULL, NULL, 'Porte vertical pour planche de surf - de Front Runner', 'RRAC095', 'Placez votre planche au-dessus, mais de manière verticale, sur votre galerie Slimline II de Front Runner. De cette manière, vous gardez de la place pour une tente de toit ou de l’équipement. Le support est conçu pour garder vos planches en sécurité pendant les voyages à travers les routes les plus difficiles au monde. Le support contient des ajustements en longueur, des protections en mousse et 2 positions de transport.', 160, 650, NULL, 226.05042, 271.260504, 'Contient :\\n2 x Support de planche\\n2 x Support de loquet pour galerie Slimline II\\n1 x Paire de Stratchit\\nPièces d’installation\\nGuide d’installation\\nMatériau utilisé :\\nAcier en époxy noir\\nAcier inoxydable 304\\nCoussinets en mousse\\nCaoutchouc\\nDimensions du produit :\\nDimensions extérieurs(support individuel):\\n559mm (22\'\') L x 85.5mm (3.4\'\') l x 98.5mm (3.9\'\') H\\nDimensions ouvertes (support individuel):\\n161mm (6.3\'\') L x 85.5mm (3.4\'\') l x 445mm (17.5\'\') H\\nPoids :\\n3.4kg (7.5lbs)', 'Placez votre planche au-dessus, mais de manière verticale, sur votre galerie Slimline II de Front Runner. De cette manière, vous gardez de la place pour une tente de toit ou de l’équipement. Le support est conçu pour garder vos planches en sécurité pendant les voyages à travers les routes les plus difficiles au monde. Le support contient des ajustements en longueur, des protections en mousse et 2 positions de transport.', 'Porte vertical pour planche de surf - de Front Runner', 'Accessoires|SURFING|SPORT', 0, 1, '2022-01-07 12:24:36', NULL, NULL, 5.118113, 3.6, 6009542234649, 'ZA', 'EUR', 226.05, '7326.90.98', 10, 0),
(750, 1, 2, NULL, NULL, NULL, 'Support GoPro - de Front Runner', 'RRAC098', 'Vous partez en aventure? Installez facilement votre camera GoPro sur votre galerie Slimline II de Front Runner ou aux barres de toit grâce à ce support solide.', 90, 120, NULL, 4.19328, 5.031936, 'Composé de :\\n1 x Support pour GoPro\\nPièces d’installation\\nGuide d’installation\\nMatériau utilisé:\\nAcier époxy noir 3mm\\nDimensions du produit:\\n25mm (1\'\') L x 18mm (0.7\'\') W x 33mm (1.3\'\') H\\nPoids:\\n25g (0.9oz)\\nNotes spéciales :\\nLe bras Pivot 3-Way pour GoPro (pièce d’installation) n’est pas inclus.', 'Vous partez en aventure? Installez facilement votre camera GoPro sur votre galerie Slimline II de Front Runner ou aux barres de toit grâce à ce support solide.', 'Support GoPro - de Front Runner', 'Accessoires|SPORT|Vélo|Paddle|Surf|Neige|Pèche|ÉXPEDITION', 0, 1, '2022-01-07 12:24:41', NULL, NULL, 2.4, 0.1, 6009542235073, 'ZA', 'EUR', 4.193, '7326.90.98', 10, 0),
(751, 1, 2, NULL, NULL, NULL, 'Déflecteur de vent pour un Land Rover Discovery LR3/LR4 - par Front Runner', 'RRAC102', 'Le déflecteur de vent améliore l’aérodynamique de votre galerie Slimline II de Front Runner et réduit le bruit du vent lorsque vous roulez à haute vitesse.', 255, 1450, NULL, 116.80672, 140.168064, 'Composé de :\\n1 x Déflecteur de vent\\n3 x Supports\\n1 x Lame en caoutchouc\\nPièces d’installation\\nGuide d’installation\\nMatériaux utilisés :\\nAluminium en époxy noir\\nAcier inoxydable 3CR12 en époxy noir\\nCaoutchouc EPDM\\nDimensions du produit :\\n157mm Longueur x 1174mm Largeur x 174mm Hauteur\\nPoids :\\n1,4kg', 'Le déflecteur de vent améliore l’aérodynamique de votre galerie Slimline II de Front Runner et réduit le bruit du vent lorsque vous roulez à haute vitesse.', 'Déflecteur de vent pour un Land Rover Discovery LR3/LR4 - par Front Runner', 'Pièces pour galeries|Accessoires|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:24:45', NULL, NULL, 1.968505, 2.3, 6009542235950, 'ZA', 'EUR', 116.807, '7616.99.90', 10, 0),
(752, 1, 2, NULL, NULL, NULL, 'Supports latéraux pour plaques de franchissement et de l\'équipement - de Front Runner', 'RRAC103', 'Ces supports solides permettent de monter une plaqueMAXTRAX, TRED pro et d’autres plaques de franchissement populaires avec des trous similaires sur le côté de n’importe quelle galerie Front Runner.', 160, 310, NULL, 121.84874, 146.218488, 'Contient : \\n2 x Support ajustable\\nPièces d’installation\\nGuide d’installation\\n\\nMatériaux utilisés : \\nAcier inoxydable 3CR12 époxy noir\\nÉléments de fixation en acier inoxydable\\n\\nDimensions du produit: \\n313mm Longueur x 65mm Largeur x 178mm Hauteur (par support individuel)\\n\\nPoids: \\n4,4kg (Par paire)', 'Ces supports solides permettent de monter une plaqueMAXTRAX, TRED pro et d’autres plaques de franchissement populaires avec des trous similaires sur le côté de n’importe quelle galerie Front Runner.', 'Supports latéraux pour plaques de franchissement et de l\'équipement - de Front Runner', 'Accessoires|Aide au franchissement|Accessoires d’aide au franchissement|Plaques à sable|ÉXPEDITION|Désensablage', 0, 1, '2022-01-07 12:24:51', NULL, NULL, 3.5, 2, 6009542235943, 'ZA', 'EUR', 121.849, '7326.90.98', 10, 0),
(753, 1, 2, NULL, NULL, NULL, 'Kit de support pour Rotopax - de Front Runner', 'RRAC112', ' Montez un réservoir d’eau, un réservoir de carburant ou le kit de secours RotoPax au côté latéral ou au-dessus d’une galerie Slimline II de Front Runner avec cette plaque solide et ce support latérale ajustable et inclinant. Les kits de montage Rotopax (RX-PM, RX-DLX-PM et RX-LOX-PM) doivent être utilisés en conjonction et sont VENDUS SÉPARÉMENT.  ', 365, 534, NULL, 113.44538, 136.134456, ' \\nContient : \\n1 x Plaque de montage RotoPax (RRAC105) \\n1 x Paire de support latéral RotoPax \\nPièces d’installation \\nGuide d’installation \\n  \\nMatériau utilisé : \\nAcier inoxydable 3CR12 en époxy noir \\n  \\nDimensions du produit : \\n97mm Longueur x 480mm Largeur x 243mm Hauteur \\n  \\nPoids : 2,88kg', ' Montez un réservoir d’eau, un réservoir de carburant ou le kit de secours RotoPax au côté latéral ou au-dessus d’une galerie Slimline II de Front Runner avec cette plaque solide et ce support latérale ajustable et inclinant. Les kits de montage Rotopax (RX-PM, RX-DLX-PM et RX-LOX-PM) doivent être utilisés en conjonction et sont VENDUS SÉPARÉMENT.  ', 'Kit de support pour Rotopax - de Front Runner', 'Accessoires|RACK ADVENTURE GEAR|ÉXPEDITION', 0, 1, '2022-01-07 12:24:55', NULL, NULL, 5.905515, 3.5, 6009542238487, 'ZA', 'EUR', 113.445, '7326.90.98', 10, 0),
(754, 1, 2, NULL, NULL, NULL, 'Adaptateur Thru Axle pour un porte vélo - de Front Runner', 'RRAC119', 'Transportez votre vélo sans risque grâce à cet adaptateur Thru Axle pour des axes de 100mm x 15mm et 110mm x 20mm ainsi que pour des Boost Hub de 110mm x 15mm.\\nNOTE: l’adaptateur Thru Axle doit être utilisé avec le porte vélo de Front Runner (RRAC118). ', 130, 180, NULL, 57.98319, 69.579828, 'Composé de :\\n1 x Adaptateur Thru Axle\\nInsert Boost Hub\\nGuide d’installation\\nMatériaux utilisés :\\nAcier en époxy noir\\nNylon\\nDimensions du produit :\\n143mm (5.6\'\') H x 106mm (4.2\'\') l x 71mm (2.8\'\') L\\nPoids :\\n400g (14.1oz)', 'Transportez votre vélo sans risque grâce à cet adaptateur Thru Axle pour des axes de 100mm x 15mm et 110mm x 20mm ainsi que pour des Boost Hub de 110mm x 15mm.\\nNOTE: l’adaptateur Thru Axle doit être utilisé avec le porte vélo de Front Runner (RRAC118). ', 'Adaptateur Thru Axle pour un porte vélo - de Front Runner', 'CYCLING|SPORT|Vélo', 0, 1, '2022-01-07 12:25:01', NULL, NULL, 2.8, 0.6, 6009542239552, 'ZA', 'EUR', 57.983, '7326.90.98', 10, 0),
(755, 1, 2, NULL, NULL, NULL, 'Sangle verrouillable pour bouchon du réservoir d’eau / 42L - de Front Runner', 'RRAC120', 'La sangle verrouillable correspond au réservoir d’eau 45L de Front Runner. Il garde votre réserve d’eau sécurisée et fixée sur votre galerie. ', 120, 520, NULL, 31.08403, 37.300836, 'Composé de :\\n1 x Sangle verrouillable\\nPièces d’installation\\nGuide d’installation\\nMatériaux utilisés:\\nAcier inoxydable 3CR12 en époxy noir\\nDimensions du produit :\\n477mm Longueur x 96mm Largeur x 113mm Hauteur\\nPoids :\\n700g', 'La sangle verrouillable correspond au réservoir d’eau 45L de Front Runner. Il garde votre réserve d’eau sécurisée et fixée sur votre galerie. ', 'Sangle verrouillable pour bouchon du réservoir d’eau / 42L - de Front Runner', '', 0, 1, '2022-01-07 12:25:05', NULL, NULL, 3.5, 0.9, 6009542239569, 'ZA', 'EUR', 31.084, '7326.90.98', 10, 0),
(756, 1, 2, NULL, NULL, NULL, 'Supports pour barre de lumière LED - de Front Runner', 'RRAC124', 'Ces supports universels permettent d’attacher une barre de lumière LED soit à l’avant de la galerie, soit en dessous de la galerie Front Runner.', 120, 170, NULL, 37.80672, 45.368064, 'Contient: \\n1 x Paire de support pour le dessous de la galerie (1 au côté gauche et 1 au côté droit)\\n1 x Paire de support pour l’avant de la galerie (1 au côté gauche et 1 au côté droit)\\nPièces d’installation\\nGuide d’installation\\n\\nMatériau utilisé: \\nAcier inoxydable 3CR12 époxy noir\\n\\nDimensions du produit:\\nSupport pour l’avant de la galerie:\\nLongueur 111mm x Largeur 82mm x Hauteur 56mm (Dimensions d’un support)\\n\\nSupport pour le dessous de la galerie:\\nLongueur 63mm x Largeur 48mm x Hauteur 63mm (Dimensions d’un support)\\n\\nPoids:\\n800g', 'Ces supports universels permettent d’attacher une barre de lumière LED soit à l’avant de la galerie, soit en dessous de la galerie Front Runner.', 'Supports pour barre de lumière LED - de Front Runner', 'Éclairage', 0, 1, '2022-01-07 12:25:10', NULL, NULL, 2.8, 1.1, 6009542241562, 'ZA', 'EUR', 37.807, '7326.90.98', 10, 0),
(757, 1, 2, NULL, NULL, NULL, 'Blocs en mousse pour protéger la galerie - de Front Runner', 'RRAC125', 'Transportez votre planche de surf, planche SUP, skis, snowboard, kayak, bois ou tous ce que vous désirez emporter et utilisez les blocs en mousse aérodynamique pour protéger vos barres transversales ou vos barres de toit.', 355.6, 610, NULL, 49.57983, 59.495796, 'Contient:\\n2 x Blocs en mousse\\n1 x Sac à emporter\\nMatériaux utilisés:\\n100% polyester protégé contre les rayonnements UV - Revêtement extérieur\\n100% polyester - Doublure\\nBloc en mousse en EPE (Polyéthylène extensible)\\nTissu maillé - Sac\\nDimensions du produit:\\n610mm Longueur x 203mm Largeur x 102mm Hauteur\\nPoids:\\n400g', 'Transportez votre planche de surf, planche SUP, skis, snowboard, kayak, bois ou tous ce que vous désirez emporter et utilisez les blocs en mousse aérodynamique pour protéger vos barres transversales ou vos barres de toit.', 'Blocs en mousse pour protéger la galerie - de Front Runner', 'Accessoires|SURFING|SKIING / SNOWBOARDING|URBAN LIVING|SPORT|Vélo|Paddle|Surf|Neige|Pèche', 0, 1, '2022-01-07 12:25:37', NULL, NULL, 6.00394, 0.5, 6009542241616, 'CN', 'EUR', 49.58, '3926.90.97', 10, 0),
