(759, 1, 2, NULL, NULL, NULL, 'Cales de charge ajustables pour galerie - de Front Runner', 'RRAC129', 'Les cales de charge ajustables Front Runner s\'utilisent pour fixer une variété d’équipement sur une galerie Front Runner.', 180, 280, NULL, 57.98319, 69.579828, 'Contient :\\n4 x Cales de charge pour galerie\\n4 x écrous à œil\\nPièces d’installation\\nGuide d’installation\\nMatériau utilisé :\\nAcier en époxy noir\\nDimensions du produit :\\n100mm (3.9\'\') L x 82mm (3.2\'\') W x 42mm (1.7\'\') H (Par support)\\nPoids :\\n1,04kg (Par set de 4)', 'Les cales de charge ajustables Front Runner s\'utilisent pour fixer une variété d’équipement sur une galerie Front Runner.', 'Cales de charge ajustables pour galerie - de Front Runner', 'Accessoires|Rangement|Arrimage & Sécurisation|ALL STORAGE SYSTEMS|FISHING|CYCLING|OVERLANDING & EXPEDITION|RANGEMENT|Vélo|Paddle|Surf|Neige|Pèche|Rangement|Rangement|Rangement & Sacs|CAMPING', 0, 1, '2022-01-07 12:25:46', NULL, NULL, 3.5, 1.2, 6009542244099, 'ZA', 'EUR', 57.983, '7326.90.98', 10, 0),
