(762, 1, 2, NULL, NULL, NULL, 'Cadenas pour accessoires de galerie / petit - de Front Runner', 'RRAC134', 'Gardez l’équipementsur votre galerie en sécurité grâce à ce cadenas à combinaison. À utiliser avecdes portes-hache, des tables, des prises hi-lift, des Wolfpacks et plus deFront Runner.', 10, 150, NULL, 9.23529, 11.082348, 'Contient :\\n1 x Cadenas à combinaison de 3 chiffres\\nMatériaux utilisés :\\nBoîtier : Alliage de zinc\\nNoyau interne : Alliage de zinc\\nCâble : Câble en acier Inoxydable recouvert de PVC\\nDimensions du produit :\\n87mm (3.4\'\') L x 30mm (1.2\'\') l x 39mm (1.5\'\') H\\nLongueur du câble :\\n100mm (3.9\'\')\\nLargeur du câble :\\n2.8mm (0.1\'\')\\nPoids :\\n30g (17oz)', 'Gardez l’équipementsur votre galerie en sécurité grâce à ce cadenas à combinaison. À utiliser avecdes portes-hache, des tables, des prises hi-lift, des Wolfpacks et plus deFront Runner.', 'Cadenas pour accessoires de galerie / petit - de Front Runner', 'Arrimage & Sécurisation', 0, 1, '2022-01-07 12:26:02', NULL, NULL, 0.787402, 0, 6009542245546, 'CN', 'EUR', 9.235, '8301.10.00', 10, 0),
