(764, 1, 2, NULL, NULL, NULL, 'Support de canoë, kayak AND SUP - de Front Runner', 'RRAC137', 'Nelaissez pas un terrain escarpé vous empêcher de trouver l’endroit parfait pourmettre votre canoë ou kayak. Le support de canoë et de kayak Front Runner estfabriqué pour l’aventure off-road et contient plusieurs angles de fixation, dumontage plat jusqu’au montage latérale, qui s’adaptent parfaitement à vosbesoins.', 210, 920, NULL, 335.29412, 402.352944, 'Contient :\\n2 x supports ajustables\\n4 x blocs en mousse\\n1 x paire de sangles d’arrimage stratchits\\n4 x écrous borgnes\\nComposants d\'installation\\nGuide de montage\\nMatériaux utilisés :\\nSupports ajustables :\\nAcier en époxy noir\\nBlocs en mousse EPE (Expandable Polyethylene) :\\nEnveloppe extérieure de polyester résistante aux rayons UV à 100%\\n100% polyester doublure\\nDimensions de produit (entièrement ouvert) :\\n700mm (27.6\'\') L x 75mm (3\'\') W x 112mm (4.4\'\') H (support simple)\\nPoids :\\n6.2kg (13.7lbs) (ensemble de support)', 'Nelaissez pas un terrain escarpé vous empêcher de trouver l’endroit parfait pourmettre votre canoë ou kayak. Le support de canoë et de kayak Front Runner estfabriqué pour l’aventure off-road et contient plusieurs angles de fixation, dumontage plat jusqu’au montage latérale, qui s’adaptent parfaitement à vosbesoins.', 'Support de canoë, kayak AND SUP - de Front Runner', 'FISHING|KAYAKING & CANOEING|SPORT|Accessoires|Paddle', 0, 1, '2022-01-07 12:26:30', NULL, NULL, 4, 6.7, 6009542247151, 'ZA', 'EUR', 335.294, '7326.90.98', 10, 0),
