(771, 1, 2, NULL, NULL, NULL, 'Support de vélo Pro - de Front Runner', 'RRAC148', 'Transportez votre vélo en toute sécurité avecle support de vélo professionnel. Laissez vos roues pour une installationfacile et un accès rapide. Le support de roue avant et le sangle à cliquet deroue arrière solides tout-terrain sont conçus afin d’avoir aucun contact entre lesupport et votre cadre. Idéal pour protéger des cadres en fibre de carbone oudes peintures en parfait état. Conduisez sur les routes les plus difficiles dumonde, sans souci.', 375, 1060, NULL, 452.94118, 543.529416, 'Composé de :\\n1 x support de vélo\\n1 x fixation de galerie pour un support de vélo\\n1 x support de roue arrière\\nPièces d’installation\\nGuide d’installation\\nMatériaux utilisés :\\nAcier ien époxy noir\\nPlastique\\nDimensions de produit :\\nSupport de vélo (fermé) :\\n825mm (32.5\'\') L x 205mm (8.1\'\') W x 100mm (3.9\'\') H\\nSupport de roue arrière :\\n230mm (9.1\'\') L x 170mm (6.7\'\') W x 70mm (2.8\'\') H\\nPoids :\\n9.4kg(20.7lbs)\\nRemarques :\\nConvient à toutes les tailles de vélo, y compris fatbikes', 'Transportez votre vélo en toute sécurité avecle support de vélo professionnel. Laissez vos roues pour une installationfacile et un accès rapide. Le support de roue avant et le sangle à cliquet deroue arrière solides tout-terrain sont conçus afin d’avoir aucun contact entre lesupport et votre cadre. Idéal pour protéger des cadres en fibre de carbone oudes peintures en parfait état. Conduisez sur les routes les plus difficiles dumonde, sans souci.', 'Support de vélo Pro - de Front Runner', 'CYCLING|URBAN LIVING|SPORT|Vélo|Accessoires', 0, 1, '2022-01-07 12:27:04', NULL, NULL, 3.93701, 9.5, 6009542249490, 'ZA', 'EUR', 452.941, '7326.90.98', 10, 0),
