(775, 1, 2, NULL, NULL, NULL, 'Support de montage des accessoires pour galerie de toit / grand - de Front Runner', 'RRAC158', 'Ce support de montage d\'accessoires pour galerie de toit vous permet de monter n\'importe quel accessoire de montage latéral sur votre galerie de toit.', 180, 275, NULL, 49.57983, 59.495796, 'Consiste en :\\n2 x supports de montage des accessoires de la galerie\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAluminium peint par poudrage noir\\nDimensions du produit :\\n210mm (8,3\'\') L x 50mm (2\'\') L x 104mm (4,1\'\') H\\nPoids :\\n750g (26,5oz)', 'Ce support de montage d\'accessoires pour galerie de toit vous permet de monter n\'importe quel accessoire de montage latéral sur votre galerie de toit.', 'Support de montage des accessoires pour galerie de toit / grand - de Front Runner', 'Accessoires|RACK SECURING |RACK ADVENTURE GEAR|SPORT|CAMP', 0, 1, '2022-01-07 12:28:03', NULL, NULL, 3.9, 1.2, 6009542261560, 'ZA', 'EUR', 49.58, '7616.99.90', 10, 0),
(776, 1, 2, NULL, NULL, NULL, 'Sac Typhoon - de Front Runner', 'RRAC159', 'Il pleut des cordes et vous êtes toujours en train d\'explorer. Prêt à affronter des conditions météorologiques extrêmes, le sac Typhoon est 100 % étanche à l\'eau et à la poussière. Sa taille s\'adapte facilement à tout, des vêtements aux produits de camping, en passant par les conteneurs de stockage Front Runner Cub Pack ou Flat Pack. Désencombrez l\'intérieur de votre véhicule avec ce sac prêt à être rangé sur une galerie, conçu pour garder tout votre équipement propre et sec lorsque vous vous aventurez sur la route ou en dehors.', 430, 435, NULL, 142.01681, 170.420172, 'Composé de :\\n1 x 90 L sac étanche Typhoon résistant à l’eau et à la poussière\\n1 x Plateau à placer dans le sac\\nMatériaux utilisés :\\n1000D PVC laqué TPE - Base\\n500D PVC laqué TPE - Corps principal\\nNylon balistique - Bretelle de portage\\nPU avec une couverture en nylon - la base du plateau\\nFinition :\\nDoubles bordures en noir et gris\\nDimensions du produit :\\n660 mm Longueur x 450 mm Largeur x 500 mm Hauteur (Ouvert)\\n660 mm Longueur x 450 mm Largeur x 250 mm Hauteur (Fermé)\\nPoids :\\n2,3 kg', 'Il pleut des cordes et vous êtes toujours en train d\'explorer. Prêt à affronter des conditions météorologiques extrêmes, le sac Typhoon est 100 % étanche à l\'eau et à la poussière. Sa taille s\'adapte facilement à tout, des vêtements aux produits de camping, en passant par les conteneurs de stockage Front Runner Cub Pack ou Flat Pack. Désencombrez l\'intérieur de votre véhicule avec ce sac prêt à être rangé sur une galerie, conçu pour garder tout votre équipement propre et sec lorsque vous vous aventurez sur la route ou en dehors.', 'Sac Typhoon - de Front Runner', 'Rangement|Boites & Sacs|Rangement & Sacs|Produits vedettes|CAMPING|RANGEMENT|Accessoires', 0, 1, '2022-01-07 12:28:05', NULL, NULL, 3.346458, 3, 6009542262628, 'CN', 'EUR', 142.017, '4202.32.10', 0, 0),
(777, 1, 2, NULL, NULL, NULL, 'Support de montage pour barre lumineuse LED 40in FX1000-CB SM - de Front Runner', 'RRAC160', 'Supports de barre lumineuse pour fixer la barre lumineuse LED FX1000-CB SM / 12V/24V / Montage simple, soit à l\'avant de votre galerie de toit Front Runner, soit en dessous. Ces supports sont dotés d\'un couvercle de protection pour protéger la barre lumineuse contre les petites pierres lorsqu\'elle n\'est pas utilisée.', 155, 1095, NULL, 83.19328, 99.831936, 'Consiste en :\\n1 x jeu de supports de montage avant (1 côté gauche et 1 côté droit)\\n1 x jeu de supports de montage en dessous (1 côté gauche et 1 côté droit)\\n1 protection\\nMatériel d\'installation\\nInstructions de montage\\nLes matériaux utilisés :\\nAcier inoxydable 3CR12 revêtu de poudre noire\\nAluminium revêtu de poudre noire\\nDimensions du produit :\\n1115mm (43,9\'\') L x 133mm (5,2\'\') L x 74mm (2,9\'\') H\\nPoids :\\n1,6kg (3,5lbs)', 'Supports de barre lumineuse pour fixer la barre lumineuse LED FX1000-CB SM / 12V/24V / Montage simple, soit à l\'avant de votre galerie de toit Front Runner, soit en dessous. Ces supports sont dotés d\'un couvercle de protection pour protéger la barre lumineuse contre les petites pierres lorsqu\'elle n\'est pas utilisée.', 'Support de montage pour barre lumineuse LED 40in FX1000-CB SM - de Front Runner', 'Accessoires|RACK SECURING |Éclairage|Éclairage|Éclairage', 0, 1, '2022-01-07 12:28:09', NULL, NULL, 6.102365, 2.4, 6009542263793, 'ZA', 'EUR', 83.193, '7326.90.98', 10, 0),
