(781, 1, 2, NULL, NULL, NULL, 'Point de connexion pour galerie de toit - de Front Runner', 'RRAC165', 'Obtenez de l\'énergie là où vous en avez le plus besoin grâce à ce Power Point sur le toit. Ce point d\'alimentation vous permet de placer votre source d\'énergie là où elle est vraiment nécessaire et alimente des lumières supplémentaires et d\'autres accessoires 12V.', 100, 180, NULL, 34.44538, 41.334456, 'Composé de :\\n1 x Couvercle\\n2 x fiches femelles Hella Plugs\\nMatériel d\'installation\\nInstructions de montage\\nLes matériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n72mm (2.8\'\') L x 112mm (4.4\'\') l x 50mm (2\'\') H\\nPoids :\\n300g (10.6oz)', 'Obtenez de l\'énergie là où vous en avez le plus besoin grâce à ce Power Point sur le toit. Ce point d\'alimentation vous permet de placer votre source d\'énergie là où elle est vraiment nécessaire et alimente des lumières supplémentaires et d\'autres accessoires 12V.', 'Point de connexion pour galerie de toit - de Front Runner', 'Accessoires|RACK ADVENTURE GEAR|Batterie|Gestion des batteries|Éclairage|Éclairage', 0, 1, '2022-01-07 12:28:45', NULL, NULL, 3, 0.4, 6009542264127, 'ZA', 'EUR', 34.445, '8536.90.95', 10, 0),
