(784, 1, 2, NULL, NULL, NULL, 'Kit de montage rapide pour auvents - de Front Runner', 'RRAC169', 'Si vous ne voulez pas garder votre auvent sur votre véhicule tout le temps, Front Runner\'s Quick Release Awning Mount Kit vous donne la liberté de monter ou d\'enlever votre auvent en quelques secondes, et sans outils. Les 2 verrous verrouillables vous donnent la sécurité et la tranquillité d\'esprit .', 180, 280, NULL, 125.21008, 150.252096, 'Composé de :\\n1 x Paire de supports de fixation rapide pour auvents\\nMatériel d\'installation\\nInstructions de montage\\nLes matériaux utilisés :\\nAcier revêtu de poudre noire\\nAcier inoxydable 316\\nAcier inoxydable304\\nDimensions du produit : (Par support assemblé)\\n160mm (6.3\'\') L x 80mm (3.2\'\') l x 105mm (4.1\'\') H\\nPoids :\\n2.1Kg (4.6lbs)\\nCapacité de charge :\\n20kg (44.1lbs)', 'Si vous ne voulez pas garder votre auvent sur votre véhicule tout le temps, Front Runner\'s Quick Release Awning Mount Kit vous donne la liberté de monter ou d\'enlever votre auvent en quelques secondes, et sans outils. Les 2 verrous verrouillables vous donnent la sécurité et la tranquillité d\'esprit .', 'Kit de montage rapide pour auvents - de Front Runner', 'Accessoires|RACK SECURING |Tentes & auvents|CAMPING|CAMP|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:28:57', NULL, NULL, 3.5, 2.7, 6009542263977, 'ZA', 'EUR', 125.21, '7326.90.98', 10, 0),
(785, 1, 2, NULL, NULL, NULL, 'Support d\'extension de robinet - de Front Runner', 'RRAC170', 'Étendez votre robinet de réservoir d’eau loin de votre véhicule pour faire verser l’eau stockée sans effort lors de n’importe quelle aventure.', 160, 330, NULL, 63.02521, 75.630252, 'Consiste en :\\n1 x support de rallonge de robinet\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier inoxydable 3CR12 peint par poudrage noir\\nDimensions du produit :\\n315mm (12,4\'\') L x 187mm (7,4\'\') L x 73mm (2,9\'\') H\\nPoids :\\n1,3kg (2,9lbs)', 'Étendez votre robinet de réservoir d’eau loin de votre véhicule pour faire verser l’eau stockée sans effort lors de n’importe quelle aventure.', 'Support d\'extension de robinet - de Front Runner', 'Accessoires|RACK CAMPING ESSENTIALS|Eau|Tuyaux & pompes|ÉXPEDITION|Carburant et Eau|Réservoirs & supports|Douche|CAMPER', 0, 1, '2022-01-07 12:29:22', NULL, NULL, 3.5, 1, 6009542264707, 'ZA', 'EUR', 63.025, '7326.90.98', 10, 0),
(786, 1, 2, NULL, NULL, NULL, 'Support de boîte de matériel à fixation rapide - de Front Runner', 'RRAC171', 'Si vous êtes du type qui change ses besoins en matériel aussi souvent que vous changez vos chaussettes, alors vous avez besoin de la liberté de monter ou de démonter vos boîtes de transport en quelques secondes. Le support de matériel à fixation rapide fonctionne avec les boîtes de toit les plus courantes et comprend 4 loquets verrouillables pour une plus grande tranquillité d\'esprit.', 150, 715, NULL, 268.06723, 321.680676, 'Composé de :\\n4 x supports à fixation rapide\\n2 x traverses en aluminium\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu en epoxy noir\\nAluminium\\nDimensions du produit :\\n704mm (27.7\'\') L x 604mm (23.8\'\') l x 97mm (3.8\'\') H\\nPoids :\\n6.2Kg (13.7lbs)', 'Si vous êtes du type qui change ses besoins en matériel aussi souvent que vous changez vos chaussettes, alors vous avez besoin de la liberté de monter ou de démonter vos boîtes de transport en quelques secondes. Le support de matériel à fixation rapide fonctionne avec les boîtes de toit les plus courantes et comprend 4 loquets verrouillables pour une plus grande tranquillité d\'esprit.', 'Support de boîte de matériel à fixation rapide - de Front Runner', 'Accessoires|RACK SECURING |RANGEMENT|Rangement|Rangement|CAMPER', 0, 1, '2022-01-07 12:29:25', NULL, NULL, 6.1, 7.8, 6009542264691, 'ZA', 'EUR', 268.067, '7326.90.98', 10, 0),
(787, 1, 2, NULL, NULL, NULL, 'Support latéral pour porte-vélos sur galerie de benne - par Front Runner', 'RRAC172', 'Allez, prenez votre paire de roues supplémentaire avec. Les supports latéraux de la galerie de chargement pour les supports de vélo Front Runner offrent cet espace supplémentaire lorsqu\'il en a le plus besoin, lorsqu\'il n\'y a plus de place sur votre galerie.Fonctionne avec le porte-vélo à fourche / Édition Power ou le porte-vélo à axe traversant / Édition Power*.', 240, 320, NULL, 108.40336, 130.084032, 'Composé de :\\n2 x Plaques de montage supérieur\\n2 x Plaques de montage en bas\\n2 x pinces à jambes\\n1 x plaque d\'extension\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier peint par poudrage noir\\nDimensions du produit :\\n276mm (10,9\'\') L x 186mm (7,3\'\') Llx 170mm (7\'\') H\\nPoids :\\n3,7kg (8,2lbs)', 'Allez, prenez votre paire de roues supplémentaire avec. Les supports latéraux de la galerie de chargement pour les supports de vélo Front Runner offrent cet espace supplémentaire lorsqu\'il en a le plus besoin, lorsqu\'il n\'y a plus de place sur votre galerie.Fonctionne avec le porte-vélo à fourche / Édition Power ou le porte-vélo à axe traversant / Édition Power*.', 'Support latéral pour porte-vélos sur galerie de benne - par Front Runner', 'Accessoires|RACK ADVENTURE GEAR|ACTIVITIES|CYCLING|URBAN LIVING|SPORT|SPORT|Vélo', 0, 1, '2022-01-07 12:29:30', NULL, NULL, 6.3, 3.7, 6009542265353, 'ZA', 'EUR', 108.403, '7326.90.98', 10, 0),
