(805, 1, 2, NULL, NULL, NULL, 'Support à lattes de réservoir d’eau Pro - de Front Runner', 'RRAC219', 'Notre réservoir d\'eau de 20 litres a sa place n\'importe où sur votre galerie Front Runner Slimline II ou Slimsport lorsqu\'il est monté avec le support à lattes de réservoir d’eau Pro. Fixez votre réservoir dans le support sur n\'importe quel côté de la galerie qui convient à votre aventure.', 150, 175, NULL, 6.7143, 8.05716, 'Composé de :\\n1 x Support de montage du réservoir d\'eau Pro / 20L\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n97.5 mm (3.8\'\') L x 40 mm (1.6\'\') l x 64 mm (2.5\'\') H\\nPoids :\\n0.16kg (0.4 lbs)', 'Notre réservoir d\'eau de 20 litres a sa place n\'importe où sur votre galerie Front Runner Slimline II ou Slimsport lorsqu\'il est monté avec le support à lattes de réservoir d’eau Pro. Fixez votre réservoir dans le support sur n\'importe quel côté de la galerie qui convient à votre aventure.', 'Support à lattes de réservoir d’eau Pro - de Front Runner', 'Eau|Réservoirs & supports|Accessoires|Attacher et sécuriser', 0, 1, '2022-01-07 12:31:16', NULL, NULL, 1.8, 0.2, 6009542224947, 'ZA', 'EUR', 6.714, '7326.90.98', 10, 0),
