(822, 1, 2, NULL, NULL, NULL, 'Wolf Pack Hi-Lid - par Front Runner', 'SBOX005', 'Rendez vos Wolf Packs plus spacieux grâce à ces Hi-Lids. La hauteur supplémentaire de 57-63,5 mm rend la gestion des conteneurs plus grands et autres équipements encombrants plus facile. Avec les mêmes fermetures à clip, le même design de couvercle en relief et la même fonctionnalité d\'empilage que le couvercle original du Wolf Pack.', 420, 520, NULL, 14.27731, 17.132772, 'Matériaux utilisés :\\nPlastique noir en polyéthylène haute densité (PEHD)\\nDimensions du produit (couvercle seulement) :\\n400 (15.7\'\') L x 510mm (20.1\'\') L x 90mm (3.5\'\') H\\nPoids du couvercle (couvercle seulement) :\\n1,1kg (2,4lbs)\\nWolf Pack Hi-Lid Dimensions :\\n400mm (15.7\'\') L x 510mm (20.1\'\') L x 295mm (11.6\'\') H\\nDimensions internes :\\n335mm (13,2\'\') L x 445mm (17,5\'\') L x 275mm (10,8\'\') H\\nPoids :\\n3,3kg (7,3lbs)', 'Rendez vos Wolf Packs plus spacieux grâce à ces Hi-Lids. La hauteur supplémentaire de 57-63,5 mm rend la gestion des conteneurs plus grands et autres équipements encombrants plus facile. Avec les mêmes fermetures à clip, le même design de couvercle en relief et la même fonctionnalité d\'empilage que le couvercle original du Wolf Pack.', 'Wolf Pack Hi-Lid - par Front Runner', 'CAMPING|Rangement & Sacs|Rangement|Boites & Sacs|ALL STORAGE SYSTEMS|URBAN LIVING', 0, 1, '2022-01-07 12:32:22', NULL, NULL, 3.9, 1.5, 6009542203386, '', 'EUR', 14.277, '3923.10.90', 10, 0),
(823, 1, 2, NULL, NULL, NULL, 'Wolf Pack - de Front Runner', 'SBOX008', 'N’utilisez plus de solutions temporaires de rangement, mais partez en voyage avec ces boîtes durables, superposables et verrouillables. Les boîtes Wolf Pack de Front Runner peuvent être utilisées seules ou en tant que composants pour les tiroirs pour boîtes Wolf Pack de Front Runner, sac de transport Front Runner et boîte de rangement Flatpack de Front Runner. ', 410, 510, NULL, 30.2437, 36.29244, 'Matériau utilisé :\\nPlastique polyéthylène (HDPE) noir à haute densité\\n\\nDimensions du produit :\\n510mm (20.1\'\') L x 400mm (15.8\'\') W x 230mm (9.1\'\') H\\nDimensions internes :\\n450mm (17.7\'\') L x 340mm (13.4\'\') W x 205mm (8.1\'\') H\\n\\nPoids :\\n3.00kg (6.6lbs)', 'N’utilisez plus de solutions temporaires de rangement, mais partez en voyage avec ces boîtes durables, superposables et verrouillables. Les boîtes Wolf Pack de Front Runner peuvent être utilisées seules ou en tant que composants pour les tiroirs pour boîtes Wolf Pack de Front Runner, sac de transport Front Runner et boîte de rangement Flatpack de Front Runner. ', 'Wolf Pack - de Front Runner', 'CAMPING|Rangement & Sacs|Rangement|Boites & Sacs|ALL STORAGE SYSTEMS|ALL CAMPING GEAR|FISHING|CYCLING|OUTDOOR KITCHEN|URBAN LIVING|Vélo|Paddle|Surf|Neige|Pèche|Rangement|Rangement|Cuisine de camping|RANGEMENT|Accessoires', 0, 1, '2022-01-07 12:32:26', NULL, NULL, 9.8, 3.5, 6009542203393, 'ZA', 'EUR', 30.244, '3923.10.90', 10, 0),
(824, 1, 2, NULL, NULL, NULL, 'Étiquettes d’organisation de camping Wolf/Cub Pack - de Front Runner', 'SBOX026', 'Laissez tomber les marqueurs et l’étiqueteusevous pouvez maintenant étiqueter vos Wolf et Cub Packs avec ces étiquettes d’organisationsur mesure. Les étiquettes de revêtement UV ont un support très adhésif, doncquand vous faites du tout terrain la seule chose que vous perdez est votretrain-train quotidien.', 297, 420, NULL, 10.07563, 12.090756, 'Contient:\\n1 x feuille adhésive A3\\n\\nMatériaux utilisés:\\nVinyle de revêtement UV\\n\\nDimensionsde produit:297mmlongueur x 420mm largeur', 'Laissez tomber les marqueurs et l’étiqueteusevous pouvez maintenant étiqueter vos Wolf et Cub Packs avec ces étiquettes d’organisationsur mesure. Les étiquettes de revêtement UV ont un support très adhésif, doncquand vous faites du tout terrain la seule chose que vous perdez est votretrain-train quotidien.', 'Étiquettes d’organisation de camping Wolf/Cub Pack - de Front Runner', 'Cuisine de camping|Rangement & Sacs|Rangement|Boites & Sacs|STORAGE ACCESSORIES|CAMPING', 0, 1, '2022-01-07 12:32:31', NULL, NULL, 0.01378, 0, 6009542250267, 'CN', 'EUR', 10.076, '4821.10.10', 0, 0),
(825, 1, 2, NULL, NULL, NULL, 'Boîte Flat Pack - de Front Runner', 'SBOX027', 'Cette boite en toile très résistante peutêtre utilisée selon deux manières: comme complément de la boîte Wolf Pack ouelle peut être utilisée seule. Les compartiments avec un revêtement en vinyle, deuxpoches de rangement en filet et une pochette de rangement imperméable àglissière facilitent le rangement. Cette boîte est parfaite pour de lanourriture, des habits, une caméra, des produits de toilette, des outils, desustensiles de cuisine, etc. La boîte se plie complètement à plat quand elle estvide.', 305, 725, NULL, 41.17647, 49.411764, 'Contient:\\n1 x Boîte Flatpack\\n2 x Pochettes de rangement en filet\\n1 x Pochette de rangement à fermetureéclair, imperméable à l\'eau\\n1 x Séparateur mobile avec un revêtement envinyle\\n1 x Pochette extérieure en vinyletransparent pour étiquettes\\n4 x Cartes d\'identification de contenurecto verso\\n\\nMatériaux utilisés:\\nExtérieure : 600D Polyester\\nIntérieur : Vinyle\\n\\nDimensions de produit:\\nPlat:\\n725 mm longueur x 380 mm largeur x 38 mmhauteur\\n\\nExtérieur:\\n435 mm (17,1 \'\') longueur x 310 mm (12,2\'\') largeur x 200 mm (7,9 \'\') hauteur\\n\\nIntérieur:\\n415 mm longueur x 295 mm largeur x 190 mmhauteur\\n\\nVolume de stockage : \\n23,3 L\\n\\nPoids:1.68 kg', 'Cette boite en toile très résistante peutêtre utilisée selon deux manières: comme complément de la boîte Wolf Pack ouelle peut être utilisée seule. Les compartiments avec un revêtement en vinyle, deuxpoches de rangement en filet et une pochette de rangement imperméable àglissière facilitent le rangement. Cette boîte est parfaite pour de lanourriture, des habits, une caméra, des produits de toilette, des outils, desustensiles de cuisine, etc. La boîte se plie complètement à plat quand elle estvide.', 'Boîte Flat Pack - de Front Runner', 'CAMPING|Rangement & Sacs|Rangement|Boites & Sacs|ALL STORAGE SYSTEMS|ALL CAMPING GEAR|FISHING|CYCLING|OUTDOOR KITCHEN|URBAN LIVING|Rangement|Rangement|Cuisine de camping', 0, 1, '2022-01-07 12:32:36', NULL, NULL, 2, 1.8, 6009542260044, 'CN', 'EUR', 41.176, '4202.32.90', 10, 0),
(826, 1, 2, NULL, NULL, NULL, 'Wolf Pack Pro - de Front Runner', 'SBOX031', 'Nos nouvelles boîtes de rangement empilables sont fabriquées dans le même plastique résistant aux chocs et sont désormais dotées d\'un nouveau système de verrouillage extra-sécurisé, qui offre une durabilité accrue tout en assurant l\'étanchéité à l\'eau et à la poussière, de sorte que votre équipement reste sûr, sec et propre, même lorsque votre véhicule se fait sale.\\nVEUILLEZ NOTER :\\nEn raison des variations de la pression atmosphérique, le couvercle du Wolf Pack Pro peut parfois s\'avérer difficile à ouvrir en raison de sa capacité d\'étanchéité. Pour l\'ouvrir, exercez une pression modérée sur le couvercle avec une main directement à côté du loquet, en vérifiant que le loquet est correctement fermé avant de le déverrouiller.\\nPour voir une démonstration, veuillez regarder la vidéo dans l\'onglet ci-dessous.', 405, 515, NULL, 41.16807, 49.401684, 'Composé de :\\n1x Wolf PackPro\\nMatériaux utilisés :\\nPlastique noir en polyéthylène haute densité\\nDimensions du produit :\\nDimensions extérieures :\\n510mm (20.1\'\') L x 400mm (15.7\'\') l x 230mm (9.1\'\') H\\nDimensions internes :\\n445mm (17,5\'\') L x 335mm (13,2\'\') l x 203mm (8\'\') H\\nPoids :\\n3.65kg (8.1lbs)', 'Nos nouvelles boîtes de rangement empilables sont fabriquées dans le même plastique résistant aux chocs et sont désormais dotées d\'un nouveau système de verrouillage extra-sécurisé, qui offre une durabilité accrue tout en assurant l\'étanchéité à l\'eau et à la poussière, de sorte que votre équipement reste sûr, sec et propre, même lorsque votre véhicule se fait sale.\\nVEUILLEZ NOTER :\\nEn raison des variations de la pression atmosphérique, le couvercle du Wolf Pack Pro peut parfois s\'avérer difficile à ouvrir en raison de sa capacité d\'étanchéité. Pour l\'ouvrir, exercez une pression modérée sur le couvercle avec une main directement à côté du loquet, en vérifiant que le loquet est correctement fermé avant de le déverrouiller.\\nPour voir une démonstration, veuillez regarder la vidéo dans l\'onglet ci-dessous.', 'Wolf Pack Pro - de Front Runner', 'CAMPING|Rangement & Sacs|Rangement|Boites & Sacs|ALL STORAGE SYSTEMS|ALL CAMPING GEAR|FISHING|CYCLING|OUTDOOR KITCHEN|URBAN LIVING|Rangement|Rangement|Cuisine de camping|Pèche|Neige|Surf|Paddle|Vélo|RANGEMENT|Accessoires', 0, 1, '2022-01-07 12:32:41', NULL, NULL, 9.4, 4.2, 6009542262802, 'ZA', 'EUR', 41.168, '3923.10.90', 10, 0),
(827, 1, 2, NULL, NULL, NULL, 'Séparateurs en mousse pour boîtes de rangement - de Front Runner', 'SBOX052', 'Les solutions de rangement Front Runner peuvent être utilisées pour à peu près tout lors de vos aventures. L\'ajout de ces séparateurs en mousse pour boîtes de rangement offre une protection et une organisation supplémentaires pour l\'équipement photographique, les ustensiles de cuisine et autres articles fragiles.', 205, 990, NULL, 42.0084, 50.41008, 'Composé de :\\n3 x Séparateurs en mousse\\n1 x Couteau utilitaire de bricolage\\n1 x Lot de 10 clips en plastique\\nInstructions de montage\\nMatériaux utilisés :\\nMousse grise\\nPlastique\\nDimensions du produit :\\n950mm (37.4\'\') L x 178mm (7\'\') l x 12mm (0.5\'\') H (Séparateur en mousse simple)\\nPoids :\\n0,57kg (1,3lbs)', 'Les solutions de rangement Front Runner peuvent être utilisées pour à peu près tout lors de vos aventures. L\'ajout de ces séparateurs en mousse pour boîtes de rangement offre une protection et une organisation supplémentaires pour l\'équipement photographique, les ustensiles de cuisine et autres articles fragiles.', 'Séparateurs en mousse pour boîtes de rangement - de Front Runner', 'Rangement & Sacs|Cuisine de camping|Boites & Sacs|CAMPING', 0, 1, '2022-01-07 12:32:46', NULL, NULL, 1.9, 1, 6009542213743, 'ZA', 'EUR', 42.008, '3923.10', 0, 0),
(828, 1, 2, NULL, NULL, NULL, 'Protection de carter pour un Land Rover Discovery LR4 (2013-jusqu’à présent) - de Front Runner', 'SGLD009', ' Une protection de carter qui s’installe en dessous de votre Land Rover Discovery et protège le carter du moteur contre éventuels dommages. ', 600, 1130, NULL, 553.78151, 664.537812, ' \\nContient : \\n1 x Protection de carter \\n2 x Entretoise en aluminium \\nPièces d’installation \\n  \\nMatériaux utilisés : \\nAcier inoxydable 4,5mm 3CR12 en époxy noir \\nAluminium \\n  \\nDimensions du produit : \\n950mm Largeur x 548mm Longueur x 140mm Hauteur \\n  \\nPoids : \\n16,2kg', ' Une protection de carter qui s’installe en dessous de votre Land Rover Discovery et protège le carter du moteur contre éventuels dommages. ', 'Protection de carter pour un Land Rover Discovery LR4 (2013-jusqu’à présent) - de Front Runner', 'Protection|Protection de soubassement du véhicule|ALL PROTECTION EQUIPMENT|VEHICLE SPECIFIC GEAR|Produits vedettes', 0, 1, '2022-01-07 12:32:51', NULL, NULL, 5.1, 17, 6009542233352, 'ZA', 'EUR', 553.782, '8708.29.90', 2, 0),
(829, 1, 2, NULL, NULL, NULL, 'Protection de carter pour un Land Rover Defender (1983-2016) - de Front Runner', 'SGLD010', ' Une plaque en aluminium qui s’installe en dessous de votre Land Rover Defender et protège le carter du moteur contre éventuels dommages.', 485, 930, NULL, 452.94118, 543.529416, ' \\nContient : \\n1 x Protection de carter \\n1 x Paire de support \\nPièces d’installation \\nGuide d’installation \\n  \\nMatériaux utilisés : \\nPlaque en aluminium 6mm \\nAcier doux 8mm en époxy noir \\n  \\nDimensions du produit : \\n373,5mm Longueur x 750mm Largeur x 252mm Hauteur (les supports inclus)  \\nPoids : \\n18,5kg \\n  \\nRemarque spéciale : Correspond au Land Rover Defender séries 90 110.', ' Une plaque en aluminium qui s’installe en dessous de votre Land Rover Defender et protège le carter du moteur contre éventuels dommages.', 'Protection de carter pour un Land Rover Defender (1983-2016) - de Front Runner', 'Protection|Protection de soubassement du véhicule|ALL PROTECTION EQUIPMENT|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:32:53', NULL, NULL, 5.314964, 12.6, 6009542235295, 'ZA', 'EUR', 452.941, '8708.29.90', 6, 0),
(830, 1, 2, NULL, NULL, NULL, 'Rideau de cabine de douche / Caddy - par Front Runner', 'SHOW013', 'Gardez vos produits de douche à l\'abri de la saleté lorsque vous ajoutez de l\'intimité avec ce porte-douche facile à accrocher.', 250, 420, NULL, 30.2437, 36.29244, 'Composé de :\\n1 x Support de douche\\nMatériel de montage\\nInstructions de montage\\nMatériaux utilisés :\\nTissu Ripstop 240 g/m2, résistant aux UV et aux moisissures.\\nDimensions du produit :\\n1000mm (39.4\'\') L x 1200 (47.2\'\') L x 10mm (0.4\'\') P (lorsque suspendu au véhicule)\\nPoids :\\n0,61kg (1,4lbs)', 'Gardez vos produits de douche à l\'abri de la saleté lorsque vous ajoutez de l\'intimité avec ce porte-douche facile à accrocher.', 'Rideau de cabine de douche / Caddy - par Front Runner', 'Tentes & auvents|ALL CAMPING GEAR|ACTIVITIES|OVERLANDING & EXPEDITION|Douche|CAMPING', 0, 1, '2022-01-07 12:32:57', NULL, NULL, 3, 0.6, 6009542214030, 'ZA', 'EUR', 30.244, '3924.90.00', 10, 0),
(831, 1, 2, NULL, NULL, NULL, 'Combinaison de tiroir pour 4 boîtes Cub AND glissière pour frigo - de Front Runner', 'SSAM005', 'Ce système de combinaison de tiroir pour 4 boîtes Cub glissière pour frigo est une solution pratique pour ranger vos affaires. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 944mm Longueur x 935mm Largeur x 618mm Hauteur', 1030, 1030, NULL, 1637.81513, 1965.378156, 'Contient : \\n1 x Base de tiroir\\nGuide d’installation \\n\\nMatériaux utilisés : \\nAcier doux époxy noir - tiroir\\nMoquette en nylon contreplaqué laminé\\nDimension du produit:\\n944mm Longueur x 935mm Largeur x 618mm Hauteur\\n\\nDimensions du plateau intérieur:\\nTiroir supérieur gauche: \\n877mm Longueur x 317mm Largeur x 46mm Hauteur\\n\\nTiroir inférieur gauche (avec plateau):\\n828mm Longueur x 258mm Largeur x 149mm Hauteur\\n\\nGlissière pour frigo:\\n882mm Longueur x 519mm Largeur x 37mm Hauteur\\n\\nPoids: \\n96,16kg \\n\\nCapacité de charge :\\n113kg par tiroir et glissière\\n150kg distribué sur la plaque supérieure ', 'Ce système de combinaison de tiroir pour 4 boîtes Cub glissière pour frigo est une solution pratique pour ranger vos affaires. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 944mm Longueur x 935mm Largeur x 618mm Hauteur', 'Combinaison de tiroir pour 4 boîtes Cub AND glissière pour frigo - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:33:00', NULL, NULL, 25.590565, 88.2, 6009542208817, 'ZA', 'EUR', 1637.815, '7326.90', 6, 0),
(832, 1, 2, NULL, NULL, NULL, 'Tiroir pour 4 boîtes Cub Pack / étroit - de Front Runner', 'SSAM008', 'Ce kit de tiroirs pour 4 boîtes Cub / Small est une solution pratique pour le rangement d’objets dans des 4x4 et VUS.Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Ce système est conçu pour des conditions on-road mais aussi off-road.\\nDimensions du produit: 906mm (35.7\'\') L x 696mm (27.4\'\') l x 262mm (10.3\'\') H', 745, 1030, NULL, 654.62185, 785.54622, 'Composé de :\\n1 x Base de tiroir\\nGuide d’installation\\n\\nMatériau utilisé:\\nAcier doux époxy noir - tiroir\\n\\nDimensions du produit:\\n906mm (35.7\'\') L x 696mm (27.4\'\') l x 262mm (10.3\'\') H\\nDimensions du tiroir intérieur:\\n882mm (34.7\'\') L x 646mm (25.4\'\') l x 45mm (1.8\'\') H\\nPoids :\\n38.44kg (84.7lbs)\\n\\nNotes spéciales :\\nLe tiroir est doté d\'un loquet rotatif qui le maintient en place.', 'Ce kit de tiroirs pour 4 boîtes Cub / Small est une solution pratique pour le rangement d’objets dans des 4x4 et VUS.Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Ce système est conçu pour des conditions on-road mais aussi off-road.\\nDimensions du produit: 906mm (35.7\'\') L x 696mm (27.4\'\') l x 262mm (10.3\'\') H', 'Tiroir pour 4 boîtes Cub Pack / étroit - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:33:01', NULL, NULL, 11.417329, 37.7, 6009542208824, 'ZA', 'EUR', 654.622, '7326.90.98', 10, 0),
