(834, 1, 2, NULL, NULL, NULL, 'Tiroir pour 6 boîtes Cub avec plateau coulissant au-dessus du tiroir - de Front Runner', 'SSAM012', 'Ce kit de tiroirs pour 6 boîtes Cub avec plateau coulissant est une solution pratique pour le rangement d’objets. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Le plateau coulissant facilite l’accès aux endroits difficiles à atteindre dans la benne de Pick-Up. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 969mm Longueur x 940mm Largeur x 350mm Hauteur', 1020, 1065, NULL, 1032.77311, 1239.327732, 'Contient : \\n1 x Base de tiroir\\nGuide d’installation \\n\\nMatériaux utilisés : \\nAcier doux époxy noir - cadre\\nMoquette en nylon contreplaqué laminé - base de tiroir\\n\\nDimension du produit:\\n969mm Longueur x 940mm Largeur x 350mm Hauteur\\n \\nDimensions du tiroir intérieur:\\nPleine grandeur:\\n944mm Longueur x 890mm Largeur x 45mm Hauteur\\n2 sections de taille identique (côté gauche et côté droit)\\n944mm Longueur x 440mm Largeur x 45mm Hauteur\\n\\nTiroir supérieur:\\n948mm Longueur x 893mm Largeur x 71mm Hauteur\\nPoids:\\n68,04kg \\n\\nCapacité de charge :\\n113kg Tiroir intérieur\\n113kg Tiroir supérieur', 'Ce kit de tiroirs pour 6 boîtes Cub avec plateau coulissant est une solution pratique pour le rangement d’objets. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. L’accès au congélateur, frigo, boîtes, etc. est très facile. Le plateau coulissant facilite l’accès aux endroits difficiles à atteindre dans la benne de Pick-Up. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 969mm Longueur x 940mm Largeur x 350mm Hauteur', 'Tiroir pour 6 boîtes Cub avec plateau coulissant au-dessus du tiroir - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SP