(835, 1, 2, NULL, NULL, NULL, 'Tiroir pour 6 boîtes Cub Pack / Large, boîtes incl. - de Front Runner', 'SSAM014', ' \\nCe kit de tiroirs pour boîtes Cub Pack est une solution pratique pour le rangement d’objets. Les boîtes Cub Pack amovibles facilitent le transport des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Ce tiroir peut être placé dans plusieurs véhicules parce qu’il est ‘universel’. Ce système est conçu pour des conditions on-road mais aussi off-road. Dimensions du produit : 1000mm Longueur x 950mm Largeur x 285mm Hauteur', 1030, 1065, NULL, 1486.55462, 1783.865544, ' \\nContient : \\n1 x Base de tiroir \\n1 x Loquet ‘Pousser pour fermer’ avec 2 clés \\n3 x Rails d’arrimage \\n6 x œillets d’arrimage \\n6 x Boîtes Cub Pack \\nPièces d’installation \\nGuide d’installation \\n  \\nMatériaux utilisés : \\nAcier en époxy noir - Cadre \\nMoquette en nylon contreplaqué laminé - base de tiroir \\n  \\nDimensions du produit : \\nDimensions générales : \\n1000mm Longueur x 950mm Largeur x 285mm Hauteur Dimensions quand le tiroir est ouvert : \\n1915mm Longueur x 950mm Largeur x 285mm Hauteur  \\nDimensions du tiroir intérieur : 946mm Longueur x 890mm Largeur x 222mm Hauteur Poids : \\n64,3kg \\n  \\nCapacité de charge : \\n113kg ', ' \\nCe kit de tiroirs pour boîtes Cub Pack est une solution pratique pour le rangement d’objets. Les boîtes Cub Pack amovibles facilitent le transport des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Ce tiroir peut être placé dans plusieurs véhicules parce qu’il est ‘universel’. Ce système est conçu pour des conditions on-road mais aussi off-road. Dimensions du produit : 1000mm Longueur x 950mm Largeur x 285mm Hauteur', 'Tiroir pour 6 boîtes Cub Pack / Large, boîtes incl. - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:33:06', NULL, NULL, 14.173236, 70.6, 6009542234274, 'ZA', 'EUR', 1486.555, '7326.90.98', 7, 0),
(836, 1, 2, NULL, NULL, NULL, 'Plateau coulissant pour benne de Pick-Up / Small - de Front Runner', 'SSBS007', 'Créez un espace facile à accéder dans votre véhicule pour ranger vos outils, congélateurs, frigos, bagages, équipement, boîtes, etc. Ce plateau coulissant de 1,35m correspond à plusieurs bennes de Pick-Up et à d’autres véhicules puisqu’il est universel. Le plateau est conçu pour les conditions on-road et off-road.', 1200, 1600, NULL, 1310.08403, 1572.100836, 'Composé de :\\n1 x Base de tiroir\\n2 x Rails d’arrimage\\nPièces d’installation\\nGuide d’installation\\nMatériel utilisé :\\nAcier inoxydable 3CR12 époxy noir\\nMoquette en nylon\\nContreplaqué laminé\\nDimensions du produit :\\nFermé :\\n1350mm Longueur x 1125mm Largeur x 112mm Hauteur\\nOuvert :\\n2305mm Longueur x 1125mm Largeur x 112mm Hauteur\\nDimensions du plateau intérieur :\\n1336mm Longueur x 940mm Largeur x 50mm Hauteur\\nLargeur nécessaire entre la benne et le passage de roues : 1022mm\\nPoids :\\n50,52kg\\nCapacité de charge :\\n250kg', 'Créez un espace facile à accéder dans votre véhicule pour ranger vos outils, congélateurs, frigos, bagages, équipement, boîtes, etc. Ce plateau coulissant de 1,35m correspond à plusieurs bennes de Pick-Up et à d’autres véhicules puisqu’il est universel. Le plateau est conçu pour les conditions on-road et off-road.', 'Plateau coulissant pour benne de Pick-Up / Small - de Front Runner', 'Rangement|Glissières|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:33:08', NULL, NULL, 5.511814, 77, 6009542238241, 'ZA', 'EUR', 1310.084, '7326.90.98', 10, 0),
