(842, 1, 2, NULL, NULL, NULL, 'Set de platines latérales pour rangements de tiroirs de Pick-Up / Large - de Front Runner', 'SSCA049', ' Utilisez ce set de platines latérales Front Runner pour compléter les côtés des tiroirs avec 6 boîtes Wolf Pack (Large Incl. boîtes) - de Front Runner ou tiroirs pour Pick-Up (Large) - de Front Runner. Ce set contient des trous intégrés pour des interrupteurs et des prises qui peuvent être utilisés en combinaison avec ces tiroirs.  ', 160, 340, NULL, 20.15966, 24.191592, ' \\nContient : \\n1 x Set de platines latérales (1 au côté gauche 1 au côté droit) \\nPièces d’installation \\nGuide d’installation \\n  \\nMatériau utilisé : \\nAcier en époxy noir \\n  \\nDimensions du produit : \\n78mm Longueur x 135mm Largeur x 280mm Hauteur \\n  \\nPoids : 1,1kg (par paire)', ' Utilisez ce set de platines latérales Front Runner pour compléter les côtés des tiroirs avec 6 boîtes Wolf Pack (Large Incl. boîtes) - de Front Runner ou tiroirs pour Pick-Up (Large) - de Front Runner. Ce set contient des trous intégrés pour des interrupteurs et des prises qui peuvent être utilisés en combinaison avec ces tiroirs.  ', 'Set de platines latérales pour rangements de tiroirs de Pick-Up / Large - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS', 0, 1, '2022-01-07 12:33:23', NULL, NULL, 3.543309, 1.3, 6009542236698, 'ZA', 'EUR', 20.16, '7326.90.98', 4, 0),
(843, 1, 2, NULL, NULL, NULL, 'Séparateurs de tiroirs - de Front Runner', 'SSCA050', ' Créez des compartiments dans vos tiroirs Front Runner. Organisez vos objets et arrêtez le mouvement excessif de vos objets lors du trajet grâce aux séparateurs. ', 330, 370, NULL, 31.08403, 37.300836, ' \\nContient : \\n2 x Séparateurs de tiroirs \\nPièces d’installation \\nGuide d’installation \\n  \\nMatériau utilisé : \\nAcier en époxy noir \\n  \\nDimensions du produit : \\nDimensions fermées : \\n30mm Longueur x 340mm Largeur x 196mm Hauteur \\n  \\nDimensions ouvertes : \\n30mm Longueur x 450m Largeur x 196mm Hauteur \\n  Poids : 1,9kg ', ' Créez des compartiments dans vos tiroirs Front Runner. Organisez vos objets et arrêtez le mouvement excessif de vos objets lors du trajet grâce aux séparateurs. ', 'Séparateurs de tiroirs - de Front Runner', 'Rangement|Tiroirs', 0, 1, '2022-01-07 12:33:27', NULL, NULL, 3.1, 2.7, 6009542240176, 'ZA', 'EUR', 31.084, '7326.90.98', 10, 0),
