(877, 1, 2, NULL, NULL, NULL, 'Kit de tiroir pour une Toyota Prado 120/Lexus GX470 - de Front Runner', 'SSTP004', 'Le rangement de votre équipement et de vos objets de valeur devient une évidence. Ces deux tiroirs verrouillables ont une plaque de couverture et des plaques frontales. Le tiroir a spécialement été conçu pour une Toyota Prado 120/Lexus GX470. Il cache le contenu des regards indiscrets, crée un rangement plus efficace et facile à accéder. Les tiroirs sont conçus pour les aventures on road et off road.', 965, 1055, NULL, 1693.27731, 2031.932772, 'Contient :\\n1 x Base de tiroir (SSDR005)\\n1 x Set de plaques de couverture latérales (SSDS106) incl. set de support\\n2 x Loquets ‘pousser pour fermer’ avec 2 clés par loquets\\n3 x Rails d’arrimage\\n6 x œillets d’arrimage pour rails d’arrimage\\nLes pièces d’installation contiennent 4 tendeurs pour attacher l’unité au véhicule\\nGuide d’installation\\n\\nMatériaux utilisés:\\nAluminium - rails d’arrimage et encadrement\\nAcier en époxy noir - tiroirs encadrement\\nMoquette en nylon contreplaqué laminé - plaque de couverture\\n\\nDimensions du produit:\\nLongueur 885mm x Largeur 1430mm x Hauteur 340mm\\nDimensions du tiroir intérieur:\\nCôté gauche:\\nLongueur 817mm x Largeur 386mm x Hauteur 213mm\\n\\nCôté droit:\\nLongueur 817mm x Largeur 386mm x Hauteur 213mm\\n\\nPoids:\\n64,63kg\\n\\nCapacité de charge :\\n113kg par tiroir\\n250kg (réparti sur la plaque supérieure)\\n\\nRemarque spéciale:\\n4 séparateurs de tiroirs (SSCA050) peuvent être placés dans chaque tiroir.', 'Le rangement de votre équipement et de vos objets de valeur devient une évidence. Ces deux tiroirs verrouillables ont une plaque de couverture et des plaques frontales. Le tiroir a spécialement été conçu pour une Toyota Prado 120/Lexus GX470. Il cache le contenu des regards indiscrets, crée un rangement plus efficace et facile à accéder. Les tiroirs sont conçus pour les aventures on road et off road.', 'Kit de tiroir pour une Toyota Prado 120/Lexus GX470 - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:35:53', NULL, NULL, 18.503947, 79.1, 6009542241883, 'ZA', 'EUR', 1693.277, '8708.99.97', 10, 0),
