(879, 1, 2, NULL, NULL, NULL, 'Kit de tiroir pour Volkswagen California (2015-actuel) - de Front Runner', 'SSVC001', 'Ayez l\'esprit tranquille lors de toute aventure en rangeant et en organisant votre équipement et vos objets de valeur grâce à ces deux tiroirs verrouillables. Conçus spécialement pour le Volkswagen California, ces tiroirs sont conçus pour les voyages sur route et hors route.', 850, 1220, NULL, 1441.17647, 1729.411764, '1 x bloc tiroir (SSDR003)\\n1 x Volkswagen California (2015-actuel) Jeu complet de plates-formes\\n2 x Poussez pour fermer le loquet avec 2 clés par serrure\\n3 x rails pour accessoires\\n6 x écrous à œil pour les rails auxiliaires\\nMatériel d\'installation\\nInstruction de montage\\nMatériaux utilisés :\\nAluminium - Moyens auxiliaires et sous-cadres\\nAcier peint en poudre noire - Bacs et cadres à tiroirs\\nTapis en nylon résistant aux UV et contreplaqué laminé - Plate-forme supérieure et panneau latéral\\nDimensions du produit :\\n784mm (30.8\'\') L x 1050mm (41.3\'\') L x 311mm (12.2\'\') H\\nDimensions des tiroirs intérieurs :\\nTiroir de gauche :\\n717 mm (28,2\'\') L x 348 mm (13,7\'\') l x 210 mm (8,3\'\') H\\nTiroir de droite :\\n717 mm (28,2\'\') L x 448 mm (17,6\'\') l x 210 mm (8,3\'\') H\\nPoids :\\n57,1kg (126lbs)\\nCote de charge :\\n113Kg (250lbs) par tiroir', 'Ayez l\'esprit tranquille lors de toute aventure en rangeant et en organisant votre équipement et vos objets de valeur grâce à ces deux tiroirs verrouillables. Conçus spécialement pour le Volkswagen California, ces tiroirs sont conçus pour les voyages sur route et hors route.', 'Kit de tiroir pour Volkswagen California (2015-actuel) - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:35:58', NULL, NULL, 20.1, 69, 6009542266138, 'ZA', 'EUR', 1441.176, '8708.99.97', 8, 0),
(880, 1, 2, NULL, NULL, NULL, 'Tiroir pour 6 boîtes Wolf Pack / Large, boîtes incl. - de Front Runner', 'SSWO008', 'Ce kit de tiroir pour boîtes Wolf Pack est une solution pratique pour le rangement d’objets. Les boîtes Wolf Pack amovibles facilitent le transport des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Ce tiroir peut être placé dans plusieurs véhicules parce qu’il est ‘universel’. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 1252mm Longueur x 1083mm Largeur x 310mm Hauteur', 1110, 1325, NULL, 1688.23529, 2025.882348, 'Contient : \\n1 x Base de tiroir avec 1 tiroir\\n1 x Loquet ‘Pousser pour fermer’ avec 2 clés\\n3 x Rails d’arrimage\\n6 x œillets d’arrimage\\n6 x Boîtes Wolf Pack (couvercle bas)\\nPièces d’installation\\nGuide d’installation\\n\\nMatériaux utilisés : \\nAluminium - Accessoires d’arrimage encadrement\\nAcier en époxy noir - Cadre\\nMoquette en nylon contreplaqué laminé - base de tiroir\\n\\nDimensions du produit:\\nDimensions générales: \\n1252mm Longueur x 1083mm Largeur x 310mm Hauteur\\nDimensions du tiroir intérieur:\\n1197mm Longueur x 1031mm Largeur x 230mm Hauteur\\nDimensions quand le tiroir est ouvert:\\n2163mm Longueur x 1083mm Largeur x 310mm Hauteur\\nPoids: \\n67kg\\n\\nCapacité de charge :\\n113kg ', 'Ce kit de tiroir pour boîtes Wolf Pack est une solution pratique pour le rangement d’objets. Les boîtes Wolf Pack amovibles facilitent le transport des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Ce tiroir peut être placé dans plusieurs véhicules parce qu’il est ‘universel’. Ce système est conçu pour des conditions on-road mais aussi off-road. \\nDimensions du produit: 1252mm Longueur x 1083mm Largeur x 310mm Hauteur', 'Tiroir pour 6 boîtes Wolf Pack / Large, boîtes incl. - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS', 0, 1, '2022-01-07 12:36:02', NULL, NULL, 18.307097, 101.8, 6009542231310, 'ZA', 'EUR