(895, 1, 2, NULL, NULL, NULL, 'Sangles d’arrimage Stratchits - de Front Runner', 'STRA034', ' Utilisez un moyen révolutionnaire pour attacher vos charges à votre véhicule. La Stratchit est une sangle légère et durable. Abandonnez vos sangles à cliquet lourdes et compliquées. Ne luttez plus contre la longueur fixe des tendeurs élastiques. La Stratchit a tous les bénéfices d’une sangle à cliquet et d’un tendeur élastique. La Stratchit est vendue en paire. ', 120, 410, NULL, 31.92437, 38.309244, ' \\nVendu en PAIRE \\n  \\nAjustable de 560mm à 1524mm. Chaque sangle est évaluée à 136kg', ' Utilisez un moyen révolutionnaire pour attacher vos charges à votre véhicule. La Stratchit est une sangle légère et durable. Abandonnez vos sangles à cliquet lourdes et compliquées. Ne luttez plus contre la longueur fixe des tendeurs élastiques. La Stratchit a tous les bénéfices d’une sangle à cliquet et d’un tendeur élastique. La Stratchit est vendue en paire. ', 'Sangles d’arrimage Stratchits - de Front Runner', 'Accessoires|Rangement|Arrimage & Sécurisation|ALL STORAGE SYSTEMS|RANGEMENT|SPORT|CAMPER|Vélo|Paddle|Surf|Neige|Pèche|Rangement|Rangement|Rangement & Sacs', 0, 1, '2022-01-07 12:36:57', NULL, NULL, 1.181103, 0.5, 6009542227108, 'CN', 'EUR', 31.924, '6307.90.98', 10, 0),
(896, 1, 2, NULL, NULL, NULL, 'Stratchit Court - de Front Runner', 'STRA037', 'Attachez votre charge et votre équipement avec ce Stratchit court et compact. Les Stratchits courts sont les plus efficaces du marché parce qu’ils ont une sangle élastique, légère et durable qui est 507mm plus courte qu’un Stratchit habituel. Gardez votre galerie propre et organisée grâce à cette bande élastique facile à ranger. De plus, elle range soigneusement l’excès de corde. Débarrassez-vous de toutes vos sangles lourdes à cliquet et ne vous énervez plus à cause de la longueur d’un sandow. Le Stratchit a tous les bénéfices d’une sangle compacte à cliquets et d’un sandow. ', 120, 340, NULL, 28.56303, 34.275636, 'Contient: \\n2 x Stratchit Court\\n\\nMatériaux utilisés: \\nSangle de polyester\\nÉlastique en latex\\nMousqueton en acier inoxydable 7mm\\nDimensions du produit: \\nAjustable de 470mm de longueur jusqu’à 1017mm de longueur x 25mm Largeur\\n\\nPoids:\\n185g (chaque)\\n370g (par paire)\\n\\nCapacité de la sangle:\\n136kg', 'Attachez votre charge et votre équipement avec ce Stratchit court et compact. Les Stratchits courts sont les plus efficaces du marché parce qu’ils ont une sangle élastique, légère et durable qui est 507mm plus courte qu’un Stratchit habituel. Gardez votre galerie propre et organisée grâce à cette bande élastique facile à ranger. De plus, elle range soigneusement l’excès de corde. Débarrassez-vous de toutes vos sangles lourdes à cliquet et ne vous énervez plus à cause de la longueur d’un sandow. Le Stratchit a tous les bénéfices d’une sangle compacte à cliquets et d’un sandow. ', 'Stratchit Court - de Front Runner', 'Accessoires|Rangement|Arrimage & Sécurisation|ALL STORAGE SYSTEMS|RANGEMENT|SPORT|CAMPER|Vélo|Paddle|Surf|Neige|Pèche|Rangement|Rangement|Rangement & Sacs', 0, 1, '2022-01-07 12:37:01', NULL, NULL, 1.181103, 0.4, 6009542239613, 'CN', 'EUR', 28.563, '6307.90.98', 10, 0),
