(900, 1, 2, NULL, NULL, NULL, 'Kit de tiroir Wolf Pack pour un Ford Ranger T6 DC - de Front Runner', 'SWFR001', 'Le rangement de votre équipement dans un Ford Ranger T6 est devenu plus facile. Le tiroir verrouillable avec boîtes Wolf Pack est une solution pratique pour le rangement de vos objets. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Le tiroir a spécialement été conçu pour un Ford Ranger T6. Les tiroirs sont conçus pour les aventures on road et off road.', 1150, 1310, NULL, 2079.83193, 2495.798316, 'Contient : \\n1 x Base de tiroir (SSWO008)\\n1 x Loquet ‘pousser pour fermer’ avec 2 clés par loquets\\n3 x Rails d’arrimage\\n6 x œillets d’arrimage \\n6 x Boîtes Wolf Pack (couvercle bas)\\n1 x Set de plaques de couverture latérales\\nPièces d’installation \\nInstructions de montage\\n\\nMatériaux utilisés : \\nAluminium - rails d’arrimage et encadrement\\nAcier en époxy noir - encadrement\\nMoquette en nylon contreplaqué laminé - plaque de couverture\\n\\nDimensions du produit :\\nDimensions générales : \\n1430mm Longueur x 1590mm Largeur x 310mm Hauteur\\n \\nDimensions du tiroir extérieur: \\n1083mm Largeur x 1252mm Profondeur x 310mm Hauteur\\n\\nDimensions du tiroir intérieur:\\n1197mm Longueur x 1031mm Largeur x 230mm Hauteur\\n\\nDimensions quand le tiroir est ouvert:\\n2163mm Longueur x 1083mm Largeur x 310mm Hauteur\\n \\nPoids: \\n80,7kg\\n\\nCapacité de charge :\\n113kg ', 'Le rangement de votre équipement dans un Ford Ranger T6 est devenu plus facile. Le tiroir verrouillable avec boîtes Wolf Pack est une solution pratique pour le rangement de vos objets. Transportez facilement des objets à partir de votre véhicule vers le terrain de camping, le garage, etc. Le tiroir a spécialement été conçu pour un Ford Ranger T6. Les tiroirs sont conçus pour les aventures on road et off road.', 'Kit de tiroir Wolf Pack pour un Ford Ranger T6 DC - de Front Runner', 'Rangement|Tiroirs|ALL STORAGE SYSTEMS|VEH