(901, 1, 2, NULL, NULL, NULL, 'Kit de tiroir Wolf Pack pour un Ford Ranger Raptor (2019-jusqu\'à présent) avec doublure de benne - de Front Runner', 'SWFR002', 'Le stockage, l\'organisation et le déplacement de l\'équipment dans un Ford Ranger Raptor équipé d\'une doublure de benne vient de devenir plus facile. Ce système de tiroirs verrouillables constitue une solution de rangement complète et pratique pour le véhicule. Le système de tiroirs utilise nos populaires boîtes de rangement Wolf Pack pour simplifier l\'organisation et le transport des articles stockés. Le kit est conçu pour résister aux conditions de conduite sur route et hors route.', 1110, 1325, NULL, 2046.21849, 2455.462188, 'Composé de :\\n1 x Unité de tiroir de base (SSWO008)\\n1 x Ensemble de plateau Ford Raptor avec doublure de benne\\n1 x Système de tiroir Ensemble d\'ailes\\n1 x Loquet à fermeture rapide avec 2 clés\\n3 x Canaux pour accessoires\\n6 x Écrous à œil pour les canaux d\'accessoires\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAluminium - Canaux d\'accessoires et sous-cadre\\nAcier revêtu de poudre noire - Cadre\\nMoquette et contreplaqué stratifié - Pont supérieur et jeu de ponts\\nDimensions du produit :\\n1456mm (57.7\'\') L x 1548mm (60.9\'\') l x 312mm (12.3\'\') H\\nDimensions du tiroir intérieur :\\n1197 mm (47,1\'\') L x 1031 mm (40,6\'\') l x 230 mm (9,1\'\') H\\nDimensions du tiroir ouvert :\\n2163 mm (85,2\'\') L x 1083 mm (42,6\'\') l x 310 mm (12,2\'\') H\\nPoids :\\n80.7kg (177.9lbs)\\nCharge nominale :\\n113Kg (250lbs) par tiroir', 'Le stockage, l\'organisation et le déplacement de l\'équipment dans un Ford Ranger Raptor équipé d\'une doublure de benne vient de devenir plus facile. Ce système de tiroirs verrouillables constitue une solution de rangement complète et pratique pour le véhicule. Le système de tiroirs utilise nos populaires boîtes de rangement Wolf Pack pour simplifier l\'organisation et le transport des articles stockés. Le 