(907, 1, 2, NULL, NULL, NULL, 'Support oblongue pour tente de toit à coque rigide - de Front Runner', 'TBMK009', 'Installez votre tente de toit à coque rigide grâce à ces supports. Bénéficiez cependant du kit de Raccord Rapide pour tente de toit qui vous donne la liberté d’enlever votre tente en quelques secondes et sans outils.', 110, 1230, NULL, 155.46218, 186.554616, 'Contient :\\n1 x Paire de supports de rails oblongs pour coque rigide\\nPièces d’installation\\nGuide d’installation\\nMatériau utilisé :\\nAcier inoxydable 3CR12 époxy noir 3mm\\nDimensions du produit :\\n1094mm Longueur x 90mm Largeur x 23mm Hauteur (Par rail oblong)\\nPoids :\\n6,2kg (Par rail oblong)', 'Installez votre tente de toit à coque rigide grâce à ces supports. Bénéficiez cependant du kit de Raccord Rapide pour tente de toit qui vous donne la liberté d’enlever votre tente en quelques secondes et sans outils.', 'Support oblongue pour tente de toit à coque rigide - de Front Runner', 'Tentes & auvents|CAMPING', 0, 1, '2022-01-07 12:38:19', NULL, NULL, 4.330711, 7.1, 6009542243856, 'ZA', 'EUR', 155.462, '7326.90.98', 10, 0),
(908, 1, 2, NULL, NULL, NULL, 'Support de tente de toit James Baroud / Autohome - de Front Runner', 'TBMK010', 'Il est désormais possible d’installer une tente de toit James Baroud ou Autohome sur votre galerie Front Runner ou barres de toit, grâce à ces supports de tente de toit.', 130, 175, NULL, 108.40336, 130.084032, 'Contient :\\n4 x Supports de tente de toit\\n4 x Plaque de circulation James Baroud\\n4 x Plaque de circulation Autohome\\nPièces d’installation\\nGuide d’installation\\nMatériau utilisé :\\nAcier inoxydable en époxy noir\\nDimensions du produit :\\n140mm Longueur x 23,5mm Largeur x 81mm Hauteur (Par support)\\nPoids :\\n2kg (Set de support)', 'Il est désormais possible d’installer une tente de toit James Baroud ou Autohome sur votre galerie Front Runner ou barres de toit, grâce à ces supports de tente de toit.', 'Support de tente de toit James Baroud / Autohome - de Front Runner', 'Accessoires|Tentes & auvents|CAMPER|Tentes et Auvents|Tentes et Auvents|CAMPING', 0, 1, '2022-01-07 12:38:22', NULL, NULL, 2.559057, 2.4, 6009542243740, 'ZA', 'EUR', 108.403, '7326.90.98', 10, 0),
(909, 1, 2, NULL, NULL, NULL, 'James Baroud Quick Release Tent Channel Set - par Front Runner', 'TBMK013', 'Le montage de vos tentes Tuffstuff Alpha, Tuffstuff Alpha2 et James Baroud sur n\'importe quelle galerie Front Runner vient de se faire plus facilement et plus rapidement. Avec l\'aide de ce set de canaux, vous pouvez utiliser le support de tente à dégagement rapide Front Runner pour monter ou démonter votre tente de toit en quelques minutes.', 90, 115, NULL, 11.7563, 14.10756, 'Comprend\\n1 x Set de plaques d\'écrou\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n85mm (3.3\'\') L x 23.5mm (0.9\'\') W x 5mm (0.2\'\') H (Plaque d\'écrou simple)\\nPoids :\\n0,35kg (0,77lbs)', 'Le montage de vos tentes Tuffstuff Alpha, Tuffstuff Alpha2 et James Baroud sur n\'importe quelle galerie Front Runner vient de se faire plus facilement et plus rapidement. Avec l\'aide de ce set de canaux, vous pouvez utiliser le support de tente à dégagement rapide Front Runner pour monter ou démonter votre tente de toit en quelques minutes.', 'James Baroud Quick Release Tent Channel Set - par Front Runner', '', 0, 1, '2022-01-07 12:38:24', NULL, NULL, 2.4, 0.4, 6009542281070, 'ZA', 'EUR', 11.756, '7326.90.98', 10, 0),
(910, 1, 2, NULL, NULL, NULL, 'Autohome Quick Release Tent Channel Set - par Front Runner', 'TBMK014', 'Le montage de vos tentes Autohome sur n\'importe quelle galerie Front Runner vient de se faire plus facilement et plus rapidement. Avec l\'aide de ce set de rails, vous pouvez utiliser le support de tente à dégagement rapide Front Runner pour monter ou démonter votre tente de toit en quelques minutes.', 90, 115, NULL, 13.43697, 16.124364, 'Comprend\\n1 x Set de plaques d\'écrou\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n90mm (3.5\'\') H x 28.5mm (01.1\'\') L x 5mm (0.2\'\') H (plaque d\'écrou simple)\\nPoids :\\n0,38kg (0,84lbs)', 'Le montage de vos tentes Autohome sur n\'importe quelle galerie Front Runner vient de se faire plus facilement et plus rapidement. Avec l\'aide de ce set de rails, vous pouvez utiliser le support de tente à dégagement rapide Front Runner pour monter ou démonter votre tente de toit en quelques minutes.', 'Autohome Quick Release Tent Channel Set - par Front Runner', '', 0, 1, '2022-01-07 12:38:26', NULL, NULL, 2.4, 0.5, 6009542281117, 'ZA', 'EUR', 13.437, '7326.90.98', 10, 0),
(911, 1, 2, NULL, NULL, NULL, 'Kit de montage mural pour système de fixation rapide - par Front Runner', 'TBMK016', 'Libérez de l\'espace de rangement dans votre garage et gardez votre tente de toit ou vos boîtes de matériel bien rangées et prêtes pour l\'aventure grâce à cette paire de supports de montage mural en acier robuste.', 92, 181, NULL, 17.63866, 21.166392, 'Consiste en :\\n2 x supports de montage mural\\nMatériel de montage\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n60mm (2,4\'\') L x 31mm (1,2\'\') l x 128mm (5\'\') H (support unique)\\nPoids :\\n0,44 kg (1 livre)', 'Libérez de l\'espace de rangement dans votre garage et gardez votre tente de toit ou vos boîtes de matériel bien rangées et prêtes pour l\'aventure grâce à cette paire de supports de montage mural en acier robuste.', 'Kit de montage mural pour système de fixation rapide - par Front Runner', 'Tentes & auvents|CAMPING|ALL CAMPING GEAR', 0, 1, '2022-01-07 12:38:29', NULL, NULL, 3.1, 0.4, 6009542214283, 'ZA', 'EUR', 17.639, '7326.90.98', 10, 0),
(912, 1, 2, NULL, NULL, NULL, 'Table de camping Pro en acier inoxydable - de Front Runner', 'TBRA015', 'Cette table de camping légère et solide est idéale pour la préparation de la nourriture, pour servir la nourriture et pour diner autour de la table. La table est fabriquée en acier inoxydable et en aluminium époxy noir. La table est spécialement conçue pour être rangée EN DESSOUS de la plupart des galeries Slimline II.*\\nVeuillez noter qu’un kit complet de table de camping Front Runner est disponible (TBRA017). ', 800, 1200, NULL, 466.38655, 559.66386, 'Contient :\\n1 x Table\\nMatériaux utilisés :\\nAluminium en époxy noir\\nAcier inoxydable 0,9mm 3CR12\\nDimensions du produit :\\n750mm Largeur x 1130mm Longueur x 32mm Hauteur\\nHauteur quand la table est ouverte: 730mm\\nPoids :\\n11,82kg\\nDimensions de livraison :\\n55mm Hauteur x 1175mm Longueur x 770mm Largeur\\nPoids de livraison:\\n14,7kg\\nSOINS DE LA TABLE :\\nGardez votre table propre et brillante grâce à ces instructions d\'entretien faciles.\\nAjoutez une petite quantité de savon à vaisselle à un chiffon doux humide.\\nEssuyez la table en suivant le grain de votre plateau.\\nEssuyez l\'excès d\'humidité avec une serviette sèche.\\nAjoutez rapidement du produit à polir en tamponnant avec une petite quantité de minéraux ou de\\nl\'huile pour bébé, en s\'essuyant avec le grain de l\'acier inoxydable.\\nC\'est fait !', 'Cette table de camping légère et solide est idéale pour la préparation de la nourriture, pour servir la nourriture et pour diner autour de la table. La table est fabriquée en acier inoxydable et en aluminium époxy noir. La table est spécialement conçue pour être rangée EN DESSOUS de la plupart des galeries Slimline II.*\\nVeuillez noter qu’un kit complet de table de camping Front Runner est disponible (TBRA017). ', 'Table de camping Pro en acier inoxydable - de Front Runner', 'CAMPING|Tables & Chaises|ALL CAMPING GEAR|FISHING|OUTDOOR KITCHEN|CAMPER|Manger|Manger', 0, 1, '2022-01-07 12:38:30', NULL, NULL, 2, 14, 6009542228310, 'ZA', 'EUR', 466.387, '9403.20.80', 10, 0),
(913, 1, 2, NULL, NULL, NULL, 'Support de rangement sous galerie pour table de camping Pro - de Front Runner', 'TBRA016', 'Un accessoire pour votre galerie Slimline II qui vous permet de ranger une table de camping en acier inoxydable Pro, une table de préparation en acier inoxydable Pro ou une table de préparation en acier inoxydable avec une bassine.', 210, 920, NULL, 91.59664, 109.915968, 'Composé de :\\n1 x Paire de supports\\n1 x Loquet\\nPièces d’installation\\nMatériaux utilisés :\\nAcier époxy noir\\nPVC\\nDimensions du produit :\\n881mm (34.7\'\')L x 187mm (7.4\'\')l x 46mm (1.8\'\')H\\nPoids :\\n2.4kg (5.3lbs)\\nSOINS DE LA TABLE :\\nGardez votre table propre et brillante grâce à ces instructions d\'entretien faciles.\\nAjoutez une petite quantité de savon à vaisselle à un chiffon doux humide.\\nEssuyez la table en suivant le grain de votre plateau.\\nEssuyez l\'excès d\'humidité avec une serviette sèche.\\nAjoutez rapidement du produit à polir en tamponnant avec une petite quantité de minéraux ou de\\nL\'huile pour bébé, en s\'essuyant avec le grain de l\'acier inoxydable.\\nC\'est fait !', 'Un accessoire pour votre galerie Slimline II qui vous permet de ranger une table de camping en acier inoxydable Pro, une table de préparation en acier inoxydable Pro ou une table de préparation en acier inoxydable avec une bassine.', 'Support de rangement sous galerie pour table de camping Pro - de Front Runner', 'Accessoires|CAMPING|Tables & Chaises|ALL CAMPING GEAR|RANGEMENT|CAMPER|Manger|Manger|Rangement|Rangement', 0, 1, '2022-01-07 12:38:34', NULL, NULL, 2.6, 3.6, 6009542232645, 'ZA', 'EUR', 91.597, '7326.90.98', 10, 0),
