aration de la nourriture, pour servir la nourriture et pour diner autour de la table. La table est fabriquée en acier inoxydable et en aluminium époxy noir. La table est spécialement conçue pour être rangée EN DESSOUS de la plupart des galeries Slimline II.*\\nLe kit de table de camping Pro en acier inoxydable contient une table de camping Pro en acier inoxydable, des glissières pour ranger la table en dessous de la galerie et un loquet pour verrouiller la table.', 'Kit de table de camping Pro en acier inoxydable - de Front Runner', 'Accessoires|CAMPING|Tables & Chaises|ALL CAMPING GEAR|FISHING|OVERLANDING & EXPEDITION|CAMPER|Vélo|Paddle|Surf|Neige|Pèche|Manger|ÉXPEDITION|Manger|Cuisine de camping', 0, 1, '2022-01-07 12:38:37', NULL, NULL, 4.724412, 19.2, 6009542231938, 'ZA', 'EUR', 550.42, '9403.20.80', 10, 0),
