(918, 1, 2, NULL, NULL, NULL, 'Rallonge d’échelle pour tente de toit - de Front Runner', 'TENT022', 'Une rallonge d’échelle pour des véhicules plus haut, au cas où vous devez rallonger une échelle pour joindre votre tente de toit Front Runner. ', 370, 570, NULL, 63.02521, 75.630252, 'Dimensions du produit: \\nLongueur 570mm x Largeur 370mm x Hauteur 70mm\\n\\nPoids: \\n1,68kg', 'Une rallonge d’échelle pour des véhicules plus haut, au cas où vous devez rallonger une échelle pour joindre votre tente de toit Front Runner. ', 'Rallonge d’échelle pour tente de toit - de Front Runner', 'Tentes & auvents|Échelles', 0, 1, '2022-01-07 12:38:52', NULL, NULL, 2.952757, 1.8, 6009542210704, 'CN', 'EUR', 63.025, '7616.99.90', 10, 0),
(919, 1, 2, NULL, NULL, NULL, 'Tent Ladder - by Front Runner', 'TENT025', 'A replacement ladder for your Front Runner Roof Top Tent. ', 380, 1210, NULL, 100, 120, 'Materials used:Extruded aluminiumStainless steelNylon-6Product Dimensions:1150mm (45.3) L x 350mm (13.8) W x 90mm (3.5) H \\nOpen Dimensions:2055mm (80.9) L x 350mm (13.8) W x 90mm (3.5) H', 'A replacement ladder for your Front Runner Roof Top Tent. ', 'Tent Ladder - by Front Runner', 'Tentes & auvents|Échelles', 0, 1, '2022-01-07 12:38:53', NULL, NULL, 5.118113, 5.8, 6009542210711, 'CN', 'EUR', 100, '7616.99.90', 10, 0),
(920, 1, 2, NULL, NULL, NULL, 'Tente de toit - de Front Runner', 'TENT031', 'Cette tente a une largeur de 1,3m et une longueur de 2,5m quand elle est dépliée. Son profil bas de 200mm réduit la résistance au vent. Cette tente a le plus bas profil de toutes les tentes sur le marché ! De plus, elle ne pèse que 43kg.', 1280, 1385, NULL, 978.9916, 1174.78992, 'Consiste en :\\n1 x Tente\\n1 x Feuille de route\\n1 x Matelas\\n1 x Couverture de la tente\\n1 x Échelle coulissante\\n1 x Kit de baguettes\\n1 x Kit de plots de montage\\n1 x Housse de tente sur le toit\\nLes matériaux utilisés :\\nCorps de la tente : Hydrofuge 260g 600d poly/coton ripstop\\nRainfly : Polyester oxford 400d imperméable et résistant aux UV\\nHousse de matelas : Tissu oxford en polyester lavable\\nRembourrage de matelas : Mousse PU haute densité de 60 mm d\'épaisseur\\nHousse de tente : 650 g de PVC résistant\\nBase de tentes : Tôle d\'aluminium et parois latérales avec âme en mousse\\nÉchelle : Aluminium\\nDimensions des tentes :\\nFermée (avec couverture et échelle) :\\n1330mm (52.4\'\') L x 1245mm (49\'\') l x 330mm (13\'\') H\\nFermé (sans couvercle ni échelle) :\\n1295mm (51\'\') L x 1220mm (48\'\') l x 216mm (8,5\'\') H\\nDimensions ouverte :\\nExtérieur avec Rainfly :\\n3330mm (131\'\') L x 2290mm (90\'\') l x 1330mm (52,4\'\')\\nIntérieur :\\n2438mm (96\'\') L x 1295mm (51\'\') l x 1168mm (46\'\') H (A Peak)\\nDimensions du matelas :\\n199mm (7.8\'\') L x 121mm (4.8\'\') l x 60mm (2.4\'\') H\\nPoids :\\n43kg (93lbs)\\nCharge Max. :\\n270kg (600lbs)', 'Cette tente a une largeur de 1,3m et une longueur de 2,5m quand elle est dépliée. Son profil bas de 200mm réduit la résistance au vent. Cette tente a le plus bas profil de toutes les tentes sur le marché ! De plus, elle ne pèse que 43kg.', 'Tente de toit - de Front Runner', 'Tentes & auvents|CAMPING|SURFING|CYCLING|OVERLANDING & EXPEDITION|Vélo|Paddle|Surf|Neige|Pèche|Tentes et Auvents|Tentes et Auvents|Produits vedettes', 0, 1, '2022-01-07 12:38:53', NULL, NULL, 15.2, 62.2, 6009542215792, 'CN', 'EUR', 978.992, '6306.22.00', 10, 0),
(921, 1, 2, NULL, NULL, NULL, 'Annexe pour tente de toit - par Front Runner', 'TENT032', 'Une intimité et protection supplémentaire contre les éléments. Cette annexe large est un accessoire optionnel pour la tente de toit de Front Runner. Cette tente a 2 fenêtres à moustiquaire, une porte à moustiquaire et un accès zippé vers votre véhicule. ', 300, 600, NULL, 222.68908, 267.226896, 'Composé de :\\n1 x Annexe de tente de toit\\n1 x Sol à fermeture éclair\\nDimensions générales du produit :\\n600mm Longueur x 175mm Largeur x 185mm Hauteur\\nDimensions de la tente ouverte :\\nBase de la tente de toit :\\n1219mm Longueur x 1295mm Largeur\\nDimensions par terre :\\nEnviron 1524mm Longueur x 1600mm Largeur\\nLargeur maximum quand la tente est ouverte : 2286mm\\nPoids :\\n3,77kg', 'Une intimité et protection supplémentaire contre les éléments. Cette annexe large est un accessoire optionnel pour la tente de toit de Front Runner. Cette tente a 2 fenêtres à moustiquaire, une porte à moustiquaire et un accès zippé vers votre véhicule. ', 'Annexe pour tente de toit - par Front Runner', 'Tentes & auvents|CAMPING|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:38:59', NULL, NULL, 7.87402, 8, 6009542215808, 'CN', 'EUR', 222.689, '6306.22.00', 10, 0),
(922, 1, 2, NULL, NULL, NULL, 'Auvent Easy-Out / 2,5m - de Front Runner', 'TENT036', ' Un auvent pour galerie qui mesure 2,5m de large et a une distance de 2,1m à partir du véhicule, ce qui est une taille idéale pour les véhicules plus larges. ', 155, 2670, NULL, 335.29412, 402.352944, ' \\nMatériau utilisé : \\nNylon indéchirable \\n  \\nDimensions du produit : \\nÉtendu : Largeur 2500mm x Longueur 2100mm \\nRétracté : Largeur 2500mm x Longueur 160mm \\n  \\nPoids : 13,5kg', ' Un auvent pour galerie qui mesure 2,5m de large et a une distance de 2,1m à partir du véhicule, ce qui est une taille idéale pour les véhicules plus larges. ', 'Auvent Easy-Out / 2,5m - de Front Runner', 'Tentes & auvents|CAMPING|OVERLANDING & EXPEDITION|Vélo|Paddle|Surf|Neige|Pèche|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 12:39:25', NULL, NULL, 5.511814, 16.2, 6009542215846, 'CN', 'EUR', 335.294, '6306.12.00', 10, 0),
(923, 1, 2, NULL, NULL, NULL, 'Chambre d\'auvent Easy-Out / 2.5M - de Front Runner', 'TENT037', 'Ces quatre parois pour l’auvent Easy-Out de 2,5m sont conçues pour avoir de l’intimité pendant la journée ou vous pouvez même les utiliser comme tente. ', 380, 600, NULL, 289.91597, 347.899164, 'Composé de :\\n1 x Chambre d\'auvent - 4 parois et plafond\\nPorte avant à fermeture éclair avec moustiquaire et porte d\'accès côté véhicule\\n2 fenêtres en moustiquaire avec couvertures intérieures et extérieures de protection contre les intempéries et l\'intimité\\n4 x piquets de terre\\n1 x Sac de transport\\nMatériau utilisé :\\nNylon indéchirable\\nDimensions du produit :\\nOuvert :\\n2400mm(94.5\'\') largeur x 2000mm(78.7\'\') profondeur x 1900mm(74.8\'\') hauteur\\nPoids :\\n4,43kg (9.8lbs)', 'Ces quatre parois pour l’auvent Easy-Out de 2,5m sont conçues pour avoir de l’intimité pendant la journée ou vous pouvez même les utiliser comme tente. ', 'Chambre d\'auvent Easy-Out / 2.5M - de Front Runner', 'Tentes & auvents|CAMPING', 0, 1, '2022-01-07 12:39:29', NULL, NULL, 9.055123, 11.8, 6009542215860, 'CN', 'EUR', 289.916, '6306.12.00', 0, 0),
(924, 1, 2, NULL, NULL, NULL, 'Mousquetaire pour auvent Easy-Out / 2.5M - de Front Runner', 'TENT039', 'Créez un environnement sans moustiques en dessous de votre auvent Easy-Out 2,5m en attachant ces rideaux en filet aux barres de soutien.', 180, 600, NULL, 116.80672, 140.168064, 'Composé de :\\n1 x pièce maillée avec 4 parois et un plafond\\n4 x Portes à fermeture éclair\\n4 x Piquets de terre\\n1 x Sac de transport\\nMatériaux utilisés :\\nÉcran en maille\\nDimensions du produit :\\n600mm Longueur x 175mm Largeur x 185mm Hauteur\\nPoids :\\n3,5kg', 'Créez un environnement sans moustiques en dessous de votre auvent Easy-Out 2,5m en attachant ces rideaux en filet aux barres de soutien.', 'Mousquetaire pour auvent Easy-Out / 2.5M - de Front Runner', 'Tentes & auvents|CAMPING', 0, 1, '2022-01-07 12:39:33', NULL, NULL, 7.086618, 3.6, 6009542215853, 'CN', 'EUR', 116.807, '6306.90.00', 10, 0),
(925, 1, 2, NULL, NULL, NULL, 'Auvent Easy-Out / 2m - par Front Runner', 'TENT043', 'Ayez toujours un abri contre les éléments avec cet auvent Easy-Out / 2m, qui se monte sur votre galerie de toit. Lorsqu\'il est déployé, cet auvent mesure 2m de large et 2,1m à l\'extérieur du véhicule, ce qui en fait une taille idéale pour tous les véhicules de taille moyenne. ', 165, 2180, NULL, 298.31933, 357.983196, 'Composé de :\\n1 x Auvent avec barres de support réglables horizontalement et verticalement.\\n1 x Plaque de montage avec sac de rangement robuste à fermeture éclair\\n2 x piquets de tente\\nCordes de fixation\\nMatériau utilisé :\\nNylon indéchirable\\nDimensions du produit :\\nÉtendu: Largeur 2000mm x Longueur 2100mm\\nRétracté: Largeur 2000mm x Longueur 160mm\\nPoids :\\n12,5kg', 'Ayez toujours un abri contre les éléments avec cet auvent Easy-Out / 2m, qui se monte sur votre galerie de toit. Lorsqu\'il est déployé, cet auvent mesure 2m de large et 2,1m à l\'extérieur du véhicule, ce qui en fait une taille idéale pour tous les véhicules de taille moyenne. ', 'Auvent Easy-Out / 2m - par Front Runner', 'Tentes & auvents|CAMPING|OVERLANDING & EXPEDITION|Vélo|Paddle|Surf|Neige|Pèche|Tentes et Auvents|Manger|Tentes et Auvents|Manger', 0, 1, '2022-01-07 12:39:38', NULL, NULL, 5.511814, 13.8, 6009542222738, 'CN', 'EUR', 298.319, '6306.12.00', 10, 0),
(926, 1, 2, NULL, NULL, NULL, 'Tente Flip Pop - par Front Runner', 'TENT045', 'Une tente de sol pour deux personnes. Installation immédiate: jetez la tente par terre et la tente se déplie, placez ensuite les piquets dans la tente. La tente se plie rapidement plate comme une crêpe. ', 855, 855, NULL, 100, 120, 'Taille intérieure :\\nLongueur 235cm x Largeur 143cmx Hauteur 98cm\\nTaille du double toit :\\nLongueur 260cm x Largeur 160cm x Hauteur 102cm\\nTaille quand la tente est pliée :\\n86,4cmx 7,6cm\\nMatériaux :\\nDouble toit : 190T polyester PU imperméable 1500mm Tente intérieure : 190T respirant\\nSol : 210D Oxford 3000mm Armature en fibre de verre : 6.00mm\\nSac de transport : 600*300D Oxford\\nCette tente est fabriquée en tissu ignifuge et répond aux exigences d\'inflammabilité de la norme CPAI-84.\\nPoids :\\n3,4kg (7.5 lbs)(poids incluant la tente, les piquets, le sac de transport)', 'Une tente de sol pour deux personnes. Installation immédiate: jetez la tente par terre et la tente se déplie, placez ensuite les piquets dans la tente. La tente se plie rapidement plate comme une crêpe. ', 'Tente Flip Pop - par Front Runner', 'Tentes & auvents|CAMPING|FISHING|SURFING|CYCLING|Tentes et Auvents|Tentes et Auvents', 0, 1, '2022-01-07 12:39:43', NULL, NULL, 2.2, 3.2, 6009542222851, 'CN', 'EUR', 100, '6306.22.00', 10, 0),
