(932, 1, 2, NULL, NULL, NULL, 'James Baroud Evasion XXL Rooftop Tent / Black', 'TENT169', 'Adventures are better with family so get room for everyone with the horizontally opening Evasion XXL roof top tent from James Baroud. With its larger interior space you’ll be able to sit upright comfortably within the entire tent while enjoying the comfort and quality James Baroud is known for.', 1690, 2320, NULL, 3091.5966, 3709.91592, 'Consists of:1 x James Baroud Evasion XXL Tent / Black1 x Mattress 1 x Dust Cover1 x 2 Part Aluminium Ladder1 x Battery light with charging cableMounting Kit \\nProduct Dimensions:Closed Dimensions:2210mm (87\'\') L x 1620mm (63.8\'\') W x 335mm (13.2\'\') H \\nInternal Dimension:2200mm (86.6\'\') L x 1600mm (63\'\') W x 900mm (35.4\'\') H \\nWeight:65kg (143.3 lbs) \\n ', 'Adventures are better with family so get room for everyone with the horizontally opening Evasion XXL roof top tent from James Baroud. With its larger interior space you’ll be able to sit upright comfortably within the entire tent while enjoying the comfort and quality James Baroud is known for.', 'James Baroud Evasion XXL Rooftop Tent / Black', 'Tentes & auvents|CAMPING|OVERLANDING & EXPEDITION', 0, 1, '2022-01-07 12:40:03', NULL, NULL, 15.4, 73, 6009542213392, 'PT', 'EUR', 3091.597, '6306.22.00', 0, 0),
