(935, 1, 2, NULL, NULL, NULL, 'James Baroud Space XXL Rooftop Tent / White', 'TENT172', 'Get big comfort for your big adventures with this roomy XXL Space roof top tent from James Baroud. Perfect for families that enjoy adventuring together or for those who just want extra space to stretch out and enjoy the innovative design, improved ventilation, and all the comfort and quality that James Baroud is known for.', 1690, 2320, NULL, 2932.7731, 3519.32772, 'Consists of:1 x James Baroud Space XXL Tent / White1 x Mattress1 x Dust Cover1 x 2 Part Aluminium Ladder1 x Battery light with charging cableMounting Kit \\nProduct Dimensions:Closed Dimensions:2210mm (87\'\') L x 1620mm (63.8\'\') W x 335mm (13.2\'\') H \\nInternal Dimension:2200mm (86.6\'\') L x 1600mm (63\'\') W x 1450mm (57.1\'\') H \\nWeight:65kg (143.3 lbs)', 'Get big comfort for your big adventures with this roomy XXL Space roof top tent from James Baroud. Perfect for families that enjoy adventuring together or for those who just want extra space to stretch out and enjoy the innovative design, improved ventilation, and all the comfort and quality that James Baroud is known for.', 'James Baroud Space XXL Rooftop Tent / White', 'Tentes & auvents|CAMPING|OVERLANDING & EXPEDITION', 0, 1, '2022-01-07 12:40:36', NULL, NULL, 15.4, 73, 6009542213446, 'PT', 'EUR', 2932.773, '6306.22.00', 0, 0),
