(945, 1, 2, NULL, NULL, NULL, 'Boîte à BBQ/BBQ Grill - De Front Runner', 'VACC087', 'La cuisine de camp vient de se faire de manière encore plus portable grâce à cette boîte à BBQ qui maintient la flamme hors du sol pour des grillades en toute sécurité n\'importe où. Se range à plat pour économiser un précieux espace de chargement et se transporter facilement et se range facilement dans les boîtes Wolf Pack ou Wolf Pack Pro*.', 325, 440, NULL, 172.26891, 206.722692, 'Composé de :\\n1 x Ensemble Braai/BBQ\\n1 x plateau de braise/grille\\n2 x Grille\\n2 x outils de levage de la grille\\nInstructions de montage et d\'assemblage\\nMatériaux utilisés :\\nAcier 3CR12\\nDimensions du produit :\\nDimensions ouvertes :\\n436mm (17.2\'\') L x 436mm (17.2\'\') W x 310mm (12.2\'\') H\\nDimensions de fermeture :\\n415mm (16,3\'\') L x 310mm (12,2\'\') l x 50mm (1,9\'\') H\\nPoids :\\n7.9kg (17.4lbs)', 'La cuisine de camp vient de se faire de manière encore plus portable grâce à cette boîte à BBQ qui maintient la flamme hors du sol pour des grillades en toute sécurité n\'importe où. Se range à plat pour économiser un précieux espace de chargement et se transporter facilement et se range facilement dans les boîtes Wolf Pack ou Wolf Pack Pro*.', 'Boîte à BBQ/BBQ Grill - De Front Runner', 'CAMPING|Cuisine de camping|OUTDOOR KITCHEN', 0, 1, '2022-01-07 12:41:23', NULL, NULL, 2, 7.9, 6009542282602, 'ZA', 'EUR', 172.269, '7321.19.00', 10, 0),
