(947, 1, 2, NULL, NULL, NULL, 'Support latéral de remorque pour réservoir d’eau Pro / 20L - de Front Runner', 'VACC099', 'Équipez votre remorque d\'un système d\'hydratation pour l\'aventure en utilisant le support latéral Front Runner pour le réservoir d\'eau Pro 20L. Le support s\'installe pour faciliter l\'accès à l\'eau partout où votre voyage vous mène.', 322, 440, NULL, 91.5966, 109.91592, 'Composé de :\\n1 x Support latéral de remorque pour réservoir d\'eau Pro / 20L\\nMatériel d\'installation\\nInstructions de montage\\nMatériaux utilisés :\\nAcier revêtu de poudre noire\\nDimensions du produit :\\n211mm (8.3\'\') L x 341mm (13.4\'\') l x 237mm (9.3\'\') H\\nPoids :\\n5,1 kg (11,2lbs)', 'Équipez votre remorque d\'un système d\'hydratation pour l\'aventure en utilisant le support latéral Front Runner pour le réservoir d\'eau Pro 20L. Le support s\'installe pour faciliter l\'accès à l\'eau partout où votre voyage vous mène.', 'Support latéral de remorque pour réservoir d’eau Pro / 20L - de Front Runner', 'RANGEMENT|Carburant et Eau', 0, 1, '2022-01-07 12:41:46', NULL, NULL, 2.1, 2.8, 6009542233307, 'ZA', 'EUR', 91.597, '7616.99', 0, 0),
