(960, 1, 2, NULL, NULL, NULL, 'Kit de tuyau d’eau Premium - de Front Runner', 'WTAN029', ' Un kit de tuyau pour votre réservoir d’eau Front Runner avec laiton.', 250, 455, NULL, 36.96639, 44.359668, ' \\nContient : \\n1x 10mm diamètre x 1500mm longueur du tuyau \\n5 x Support 1 x Robinet en métal ', ' Un kit de tuyau pour votre réservoir d’eau Front Runner avec laiton.', 'Kit de tuyau d’eau Premium - de Front Runner', 'Cuisine de camping|Eau|Tuyaux & pompes', 0, 1, '2022-01-07 12:42:45', NULL, NULL, 1.181103, 0.5, 6009542223957, 'ZA', 'EUR', 36.966, '3917.33.00', 10, 0),
(961, 1, 2, NULL, NULL, NULL, 'Brass Tap Upgrade For Plastic Jerry W/ Tap - by Front Runner', 'WTAN036', '​Upgrade the tap on your Front Runner Plastic Jerry Can w/ Tap (WTAN002) to this heavy duty 1/4 turn brass model. Easily operates with one hand for water when you need it.', 70, 130, NULL, 18.47899, 22.174788, 'Coming Soon!', '​Upgrade the tap on your Front Runner Plastic Jerry Can w/ Tap (WTAN002) to this heavy duty 1/4 turn brass model. Easily operates with one hand for water when you need it.', 'Brass Tap Upgrade For Plastic Jerry W/ Tap - by Front Runner', 'CAMPING|Cuisine de camping|Eau|Réservoirs & supports', 0, 1, '2022-01-07 12:42:47', NULL, NULL, 1.968505, 0.5, 6009542227931, '', 'EUR', 18.479, '8481.80.69', 10, 0),
(962, 1, 2, NULL, NULL, NULL, 'Réservoir d\'eau en acier inox pour tiroir de Pick-Up / 52 litres - de Front Runner', 'WTAN037', ' Ce réservoir d’eau en acier inoxydable de 52L est placé derrière le tiroir de Front Runner. Le réservoir d’eau est positionné en dessous des plaques de couverture du tiroir afin d’utiliser l’espace cachée entre l’arrière du tiroir et le véhicule. Contient une pompe de 12V.', 340, 1220, NULL, 789.07563, 946.890756, ' \\nContient : \\n1 x Réservoir d’eau en acier inoxydable \\n1 x Soupape de fermeture \\n1 x Pompe à eau 12V \\n1 x Kit de tuyau \\nPièces d’installation \\n  \\nRéservoir d’eau : \\n  \\nMatériau utilisé : \\nAcier inoxydable 304 \\n  \\nDimensions du produit : \\n1065mm Largeur x 230mm Longueur x 285mm Hauteur \\n  \\nPoids : \\n14,2kg \\n  \\nPompe à eau : \\n  \\nSpécifications de la pompe : \\n12V \\n12,5 litres par minute \\n35psi \\n  \\nDimensions du produit : \\n360mm Longueur x 135mm Largeur x 110mm Hauteur \\n  \\nPoids : 2,13kg \\n  \\nPoids total approximatif du produit : 16,33kg', ' Ce réservoir d’eau en acier inoxydable de 52L est placé derrière le tiroir de Front Runner. Le réservoir d’eau est positionné en dessous des plaques de couverture du tiroir afin d’utiliser l’espace cachée entre l’arrière du tiroir et le véhicule. Contient une pompe de 12V.', 'Réservoir d\'eau en acier inox pour tiroir de Pick-Up / 52 litres - de Front Runner', 'Eau|Rangement|STORAGE ACCESSORIES|Réservoirs & supports', 0, 1, '2022-01-07 12:42:50', NULL, NULL, 11.81103, 22.7, 6009542233437, 'ZA', 'EUR', 789.076, '7310.10.00', 7, 0);
INSERT INTO `product` (`id`, `type_id`, `provider_id`, `version_motorisation_id`, `version_frame_id`, `original_reference`, `name`, `reference`, `description`, `lenght`, `width`, `height`, `price`, `price_ttc`, `specificity`, `meta_description`, `meta_title`, `meta_keyword`, `position`, `is_enabled`, `add_at`, `updated_at`, `depth`, `depth_in`, `weight`, `upc`, `country_of_origin`, `currency`, `retail_price`, `tariffcode`, `is_in_stock`, `is_on_sale`) VALUES
(963, 1, 2, NULL, NULL, NULL, 'Hose Kit For Tap Extension Bracket - by Front Runner', 'WTAN054', 'A Hose Kit for extending your Water tank tap away from your vehicle with the Tap Extension Bracket.', 250, 470, NULL, 71.4286, 85.71432, 'Consists of:1 x 12mm Diameter x 1500mm (59\'\') length of clear hose1 x Locking Tap1 x ½” Threaded Female to Female Adapter2 x Hose clamp2 x ½” Bonded Washer1 x Right angled tank to pipe fitting1 x Straight tank to pipe fittingFitting instructions \\nMaterials used:SteelClear Hose \\nProduct Dimensions:1500mm (59\'\') L x 40mm (1.6\'\') W x 50mm (2\'\') H \\nWeight:540g (19oz)', 'A Hose Kit for extending your Water tank tap away from your vehicle with the Tap Extension Bracket.', 'Hose Kit For Tap Extension Bracket - by Front Runner', 'Eau|Douche|Tuyaux & pompes', 0, 1, '2022-01-07 12:42:55', NULL, NULL, 2, 0.5, 6009542265827, 'ZA', 'EUR', 71.429, '3917.33.00', 0, 0),
(964, 1, 2, NULL, NULL, NULL, 'Réservoir d\'eau Pro / 20L - par Front Runner', 'WTAN058', 'Lorsque vous avez besoin d\'ajouter de l\'eau à votre aventure mais que l\'espace de chargement est restreint, ce réservoir d\'eau Pro 20L avec robinet est la solution parfaite pour que l\'aventure continue.', 185, 535, NULL, 42.0084, 50.41008, 'Composé de :\\n1 x réservoir d\'eau de 20L\\nMatériaux utilisés :\\nPolyéthylène de qualité alimentaire sans BPA\\nDimensions du produit :\\n470mm (18.5\'\') Longueur x 165mm (6.5\'\') Largeur x 350mm (13.8\'\') Hauteur\\nPoids :\\n1,63kg (3,6lbs)', 'Lorsque vous avez besoin d\'ajouter de l\'eau à votre aventure mais que l\'espace de chargement est restreint, ce réservoir d\'eau Pro 20L avec robinet est la solution parfaite pour que l\'aventure continue.', 'Réservoir d\'eau Pro / 20L - par Front Runner', 'Eau|Réservoirs & supports', 0, 1, '2022-01-07 12:43:18', NULL, NULL, 15.2, 2.1, 6009542223124, 'ZA', 'EUR', 42.008, '3926.90', 0, 0),
(965, 1, 2, NULL, NULL, NULL, 'Pro Water Tank With Tap / 20L - by Front Runner', 'WTAN060', 'When you’re out adventuring water isn’t just nice to have, it\'s a necessity. Always ensure you have water when and where you need it with this Pro Water Tank with Tap / 20L. The convenient tap gives you easy access to your water while the durable tank and holder are strong enough for any terrain.', 185, 565, NULL, 54.62185, 65.54622, 'Consists of:1 x 20L Water Tank1 x 1/2\'\' Lockable Tap \\nMaterials used:Food grade BPA free polyethylene Water TankBlack powder coated steel Tap \\nProduct Dimensions:560mm (22\'\') L x 350mm (13.8\'\') W x 165mm (6.5\'\') H \\nWeight:2.23kg (4.9lbs)', 'When you’re out adventuring water isn’t just nice to have, it\'s a necessity. Always ensure you have water when and where you need it with this Pro Water Tank with Tap / 20L. The convenient tap gives you easy access to your water while the durable tank and holder are strong enough for any terrain.', 'Pro Water Tank With Tap / 20L - by Front Runner', 'Eau|Réservoirs & supports', 0, 1, '2022-01-07 12:43:20', NULL, NULL, 15.2, 2.2, 6009542218311, 'ZA', 'EUR', 54.622, ' ', 0, 0),
(966, 1, 2, NULL, NULL, NULL, 'Réservoir d’eau Pro avec sangle et robinet / 42L - de Front Runner', 'WTAN063', 'Le réservoir d\'eau Pro 42L avec sangle et robinet est tout ce dont vous avez besoin pour vous hydrater lors de vos aventures, le tout inclus dans un seul kit. Ce réservoir offre une source d\'eau facilement accessible, solidement montée à votre galerie de toit ou libre pour une utilisation en camping.', 330, 520, NULL, 175.6303, 210.75636, 'Composé de :\\n1 x Réservoir d\'eau Pro / 42L\\n1 x Système de montage\\n1 x Robinet 1/2\'\'\\nMatériel de montage\\nInstructions de montage\\nDimensions du produit :\\nDimensions du réservoir :\\n470mm (18.5\'\') L x 320mm (12.6\'\') l x 366mm (14.4\'\') H\\nDimensions de la sangle :\\n520 mm (20.5\'\') L x 51 mm (2\'\') l x 350 mm (13.8\'\') H\\nDimensions du robinet :\\n113 mm (4.4\'\') L x 30 mm (1.2\'\') l x 98 mm (3.9\'\') H\\nPoids total :\\n3.68kg (8.11bs)', 'Le réservoir d\'eau Pro 42L avec sangle et robinet est tout ce dont vous avez besoin pour vous hydrater lors de vos aventures, le tout inclus dans un seul kit. Ce réservoir offre une source d\'eau facilement accessible, solidement montée à votre galerie de toit ou libre pour une utilisation en camping.', 'Réservoir d’eau Pro avec sangle et robinet / 42L - de Front Runner', 'Réservoirs & supports|Eau|Douche|Carburant et Eau|CAMPING|Cuisine de camping|CAMPER', 0, 1, '2022-01-07 12:43:39', NULL, NULL, 17.3, 4.5, 6009542222493, 'ZA', 'EUR', 175.63, '3923.10.90', 10, 0),
(967, 1, 2, NULL, NULL, NULL, 'Réservoir d\'eau pour un Land Rover Defender 110 TDI/TD5 (1983-2006) / 36L - de Front Runner', 'WTLD001', ' Ce réservoir d’eau spécifique est très facile à monter. ', 465, 615, NULL, 360.5042, 432.60504, ' \\nMatériau utilisé : \\nLa matière est adaptée pour pouvoir mettre de l’eau potable dans le bidon. \\n  \\nDimensions : Incliné de 560mm de Largeur à 370mm de Largeur x 320mm Hauteur x 315mm Longueur', ' Ce réservoir d’eau spécifique est très facile à monter. ', 'Réservoir d\'eau pour un Land Rover Defender 110 TDI/TD5 (1983-2006) / 36L - de Front Runner', 'Eau|Réservoirs & supports|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:43:42', NULL, NULL, 15.354339, 10.6, 6009542211770, 'ZA', 'EUR', 360.504, '3923.10.90', 10, 0),
(968, 1, 2, NULL, NULL, NULL, 'Réservoir d\'eau pour un Land Rover Defender 110 Puma (2007-2016) / 36L - de Front Runner', 'WTLD002', ' Ce réservoir d’eau spécifique est très facile à monter. ', 465, 615, NULL, 360.5042, 432.60504, ' \\nMatériau utilisé : \\nLa matière est adaptée pour pouvoir mettre de l’eau potable dans le bidon. \\n  \\nDimensions : Incliné de 560mm de Largeur à 380mm de Largeur x 270mm Hauteur x 310mm Longueur', ' Ce réservoir d’eau spécifique est très facile à monter. ', 'Réservoir d\'eau pour un Land Rover Defender 110 Puma (2007-2016) / 36L - de Front Runner', 'Eau|VEHICLE SPECIFIC GEAR', 0, 1, '2022-01-07 12:43:47', NULL, NULL, 15.354339, 12.4, 6009542211787, 'ZA', 'EUR', 360.504, '3923.10.90', 10, 0);
